        <script src="https://cdn.plot.ly/plotly-2.18.2.min.js"></script>                <div id="160612f4-f151-42a4-b5df-1fb44efa5b02" class="plotly-graph-div" style="height:100%; width:100%;"></div>            <script type="text/javascript">                                    window.PLOTLYENV=window.PLOTLYENV || {};                                    if (document.getElementById("160612f4-f151-42a4-b5df-1fb44efa5b02")) {                    Plotly.newPlot(                        "160612f4-f151-42a4-b5df-1fb44efa5b02",                        [{"customdata":[["மர்மம்","தூக்கில் தொங்கு சேவல்கள் திருடர்களை காவு வாங்கு முனி"],["மர்மம்","பவுர்ணமி ஜாமத்தில் மாயமான கர்ப்பிணி"],["மர்மம்","மச்சுபிச்சு மலை ரகசிய"],["மர்மம்","ரத்த பலி வாங்கு விபரீத ஆவி"],["மர்மம்","உலகப் பேரழகியின் மர்ம மரண"],["மர்மம்","அமாவாசை இருட்டில் பேய் விரட்டு முனி"],["மர்மம்","நடுக்கடலில் மிரட்டிய பேய் கப்பல்"],["மர்மம்","புதையலை காவல் காக்கு பூத"],["மர்மம்","காவிரி கரையில் கரை ஒதுங்கு உடல்கள் சூறாவளியாய் சுழன்று வரு ஆவிகள்"],["மர்மம்","இருட்டில் துரத்திய வேட்டி உருவ"],["மர்மம்","கல்லறையை காவல் காக்கு குட்டிச்சாத்தான்"],["விளையாட்டு","ஆஷஸ் டெஸ்ட் இங்கிலாந்து ரன் குவிப்பு"],["ஆன்மீகம்","காக்க காக்க கனகவேல் காக்க சூரசஹார"],["ஆன்மீகம்","வைகுண்ட ஏகாதசி"],["ஆன்மீகம்","கிரகங்கள் அருளு உயர்கல்வி யோக"],["ஆன்மீகம்","நவராத்திரி சுபராத்திரி"],["ஆன்மீகம்","ஆறு பலங்கள் தரு ஆஞ்சநேயா"],["விளையாட்டு","டெஸ்ட் போட்டிக்கு காலிங்வுட் குட்பை"],["விளையாட்டு","ஐசிசி கனவு அணியில் சச்சின் சேவாக் கபில்தேவ்"],["விளையாட்டு","இந்தியா வெற்றிக்கு ரன்கள் தேவை"],["உலகம்","பேஸ் புக் மொத்த மதிப்பு லட்ச கோடி"],["உலகம்","குளிரில் நண்டுகள் சாவு"],["கல்வி","பகுதிநேர பிஇ படிப்பில் சேர வேண்டுமா"],["உலகம்","லூக்சி ஹேண்ட்ஸ் ப்ரீ கேமரா"],["கல்வி","விவசாய பார்த்துக்கொண்டே படிக்கலா"],["உலகம்","ஒபாமா மனைவி கர்ப்ப வல்லரசை வறுத்த வதந்தி"],["கல்வி","திறன் வளர்ப்பு பயிற்சி பெற்றால் இன்ஜி ஆசிரியர்கள் ஜொலிக்கலா"],["கல்வி","மகாத்மா காந்தி பற்றி படிக்க ஆசையா"],["கல்வி","கடற்சார்ந்த டிப்ளமோ படிப்புக்கு வகுப்பு போது"],["கல்வி","ஊதியத்தை கொட்டிக்கொடுக்கு அனிமேஷன் மல்டிமீடியா"],["கல்வி","சில்லரை வணிக நிர்வாக படித்தால் வேலை உறுதி"],["கல்வி","ப்ராக்டிஸ் இருந்தா இங்கிலீஷ் ஈஸி"],["குற்றம்","பிசியோதெரபிஸ்டிட சில்மிஷ வகுப்பு மாணவர் கைது"],["குற்றம்","போதையு சந்தேகமு குடுபத்தையே அழித்தது தலையில் கல்லை போட்டு மனைவி மகள் படுகொலை"],["கல்வி","நிரந்தர வேலைவாய்ப்பு அளிக்கு ஜவுளி மேலாண்மையியல் படிப்பு"],["குற்றம்","சுயஉதவி குழுக்களுக்கு நிதி ஒதுக்க லஞ்ச கைவினைப்பொருள் உதவி இயக்குனர் கைது"],["கல்வி","விண்வெளி படிப்பில் ஆர்வமுண்டா ஐஎஸ்ஆர்ஓ கல்லூரி அழைக்கிறது"],["குற்றம்","தப்பிய கைதி கோர்ட்டில் சரண் ஏட்டுகள் சஸ்பெண்ட்"],["கல்வி","எபிபிஎஸ் பிடிஎஸ் படிப்பில்சேர சதவீத மதிப்பெண் போது"],["கல்வி","அலகாபாத் ஐஐஐடியில் தகவல் தொழில்நுட்பத்தில் உயர் படிப்புகள்"],["கல்வி","உயிரி தொழில்நுட்பத்தில் வேலை உறுதி"],["குற்றம்","தாறுமாறாக ஓடிய பள்ளி வேன் மோதி ஒருவர் பலி"],["கல்வி","வேலைவாய்ப்பை அள்ளித் தரு கடல்சார் முதுகலை படிப்புகள்"],["குற்றம்","கஞ்சா விற்றவர் கைது"],["கல்வி","பாரதியார் பல்கலை வழங்குகிறது எபிஏ படிப்பில் பிரிவுகள்"],["குற்றம்","பெண் போலீசிட தகராறு வெள்ளானூர் ஊராட்சி மாஜி துணை தலைவர் கைது"],["கல்வி","ஆட்டோமேஷன் படிக்க பத்தா வகுப்பே போது"],["குற்றம்","சிவப்பு விளக்கு காரில் சென்று கோடி கோடியாய் கொள்ளை"],["கல்வி","சாப்ட்வேர் துறைக்கு இணையான இமீடியா"],["குற்றம்","திரவமாக ஏற்றுமதி பவுடராக இறக்குமதி சூடு பறக்க நடக்கு ஓபிய கடத்தல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆசிரியர் சொத்து விவர வெளியிட முதல்வர் உத்தரவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","டாக்டருக்கு ஆபாச எஸ்எஎஸ் போலீஸ் கமிஷனர் மீது விசாரணை"],["ஸ்டேட் எக்ஸ்பிரஸ்","பெண் சாமியார் பிரக்யாசிங் சகோதரர் தற்கொலை முயற்சி"],["தலையங்கம்","கோவை ஏர்போர்ட்டில் பயணியிட கோல்டன் பிஷ் பறிமுதல்"],["இந்தியா","உத்தரகண்டில் பஸ் கவிழ்ந்து பேர் பலி"],["மாவட்ட மசாலா","நக்சலை தேடு வன காவலர்களுக்கு சிறப்பு மருத்துவ பரிசோதனை"],["மாவட்ட மசாலா","பழநி தைப்பூச திருவிழா போலி கைடுகளுக்கு எச்சரிக்கை"],["இந்தியா","சபரிமலையில் நெரிசல் ஐகோர்ட் கண்டிப்பு"],["தமிழகம்","சட்டசபை தேர்தல் பணிக்காக லட்ச அரசு ஊழியர் பட்டியல் தயாரிப்பு தீவிர"],["தமிழகம்","கர்நாடகாவுக்கு மின்சார வழங்க என்எல்சி ஒப்பந்த"],["தமிழகம்","நடுக்கடலில் கப்பல் மோதி விசைப்படகு உடைந்தது"],["இந்தியா","காமன்வெல்த் முறைகேடு புகார் இடங்களில் சிபிஐ சோதனை"],["தமிழகம்","ஆண்டுகள் லீவு போட்ட போலீசுக்கு மீண்டுவேலை ஐகோர்ட் உத்தரவு"],["தமிழகம்","கடு பனி காரணமாக டெல்லி ரயில்கள் தாமத"],["உலகம்","இங்கிலாந்து சிறுமிகளை சீரழிக்கு பாக் இளைஞர்கள்"],["தமிழகம்","ஊராட்சிகளில் பொங்கல் பை"],["உலகம்","காபி கொட்டியதால் தரையிறங்கியது விமான"],["தமிழகம்","கல்லூரிக்கு செல்ல மகன் மறுத்ததால் விரக்தியில் பெற்றோர் தீக்குளிப்பு"],["தமிழகம்","இந்திய கயூனிஸ்ட் கிளை மாநாடு ஆலோசனை கூட்ட"],["தமிழகம்","பனையூரில் திடீர் தீ விபத்து"],["தமிழகம்","மதுரை ஏர்போர்ட்டுக்கு சுங்க அந்தஸ்து"],["குற்றம்","அரசு பள்ளியில் நுழைந்து சமூக விரோதிகள் அட்டகாச"],["இந்தியா","தனிதெலங்கானா வலியுறுத்தி ஆந்திராவில் மாணவர்கள் பந்த்"],["உலகம்","பீட்டா பிரசார பீரங்கி பமீலா நபர் ஒன்"],["உலகம்","மாத்திரையை உடைச்சு சாப்பிடுறது ரிஸ்க்"],["உலகம்","வழுக்கைக்கு இனி வாழ்க்கை"],["உலகம்","ஹைதி முகாமில் அதிகரிக்கிறது பலாத்கார"],["உலகம்","பென்ஷன் பணத்துக்காக பாட்டியை ஆண்டு சிறைவைத்தார் பெண்"],["உலகம்","பாக் கவர்னர் கொலை திட்டமிட்ட சதியா"],["வேலைவாய்ப்பு","யுபிஎஸ்சி நடத்து ஒருங்கிணைந்த பாதுகாப்பு படை தேர்வு"],["வேலைவாய்ப்பு","இஎஸ்ஐ நிறுவனத்தில் கிளார்க் ஸ்டெனோகிராபர் வேலை"],["வேலைவாய்ப்பு","மத்திய ரிசர்வ் படையில் ஏஎஸ்ஐ ஹெட் கான்ஸ்டபிள் பிளஸ் மற்று சுருக்கெழுத்து படித்தவர்களுக்கு வாய்ப்பு"],["வேலைவாய்ப்பு","கொங்கன் ரயில்வே கழகத்தில் டிப்ளமோ/பிகா/பிஇபடித்தவர்கள்தேவை"],["வேலைவாய்ப்பு","தேசிய நீர்மின்கழகத்தில் இன்ஜினியர் பணி டிப்ளமோ படித்தவர்களுக்கு வாய்ப்பு"],["வேலைவாய்ப்பு","புரொபஷனரி ஆபீசர் காலியிடங்கள்"],["வேலைவாய்ப்பு","இந்தோதிபெத் எல்லைக்காவல் படையில் போலீஸ் இடங்கள்"],["வேலைவாய்ப்பு","மத்திய அரசுப் பணியில் பணியிடங்கள் வகுப்பு படித்தவர்களுக்கு வாய்ப்பு"],["விளையாட்டு","ரன் இலக்காக இருந்தால் ஜெயித்திருப்போ டோனி"],["விளையாட்டு","ஒருநாள் போட்டி தொடர் தெஆ அணியில் காலிஸ் நீக்க பாக் வசாவளி வீரருக்கு வாய்ப்பு"],["வேலைவாய்ப்பு","நெல்லை இஎஸ்ஐ ஆஸ்பத்திரியில் டெக்னீஷியன் பணி"],["விளையாட்டு","கேப்டன் பதவி கிளார்க் கல்தா"],["வேலைவாய்ப்பு","ரயில்வேயில் காலியிட"],["விளையாட்டு","சானியா ஜோடி தோல்வி"],["விளையாட்டு","முதல் டெஸ்ட் துவக்க நியூசிக்கு விக்கெட் காலி"],["விளையாட்டு","ஆஸி இன்னிங்ஸ் தோல்வி தொடரையு இழந்தது"],["சினிமா(ரீல்மா)","டைரக்ஷன் எனக்கு டைபாஸ் பிரபு தேவா"],["இந்தியா","சஜூதா ரயில் குண்டுவெடிப்புக்கு இந்து தீவிரவாதிகள்தான் காரண"],["குற்றம்","நகைக்கடையில் துணிகர கொள்ளை போலீசை கண்டது குபல் ஓட்ட"],["ஸ்டேட் எக்ஸ்பிரஸ்","கட்சி மாறிய காங்கிரஸ் பெண் எஎல்ஏ பதவி பறிப்பு"],["தமிழகம்","ஆளுநர் உரைக்கு எதிர்ப்பு தெரிவித்து சட்டசபையில் அதிமுக மதிமுக கடு அமளி"],["தமிழகம்","மணல் லாரிகள் ஸ்டிரைக் நள்ளிரவில் தொடங்கியது"],["தமிழகம்","இறுதி வாக்காளர் பட்டியல் தாலுகா ஆர்டிஓ ஆபீஸ்களில் ஜனவரி ல் பார்க்கலா"],["தமிழகம்","பொங்கல் விடுமுறை மறுப்பு முதல்வர் தலையிட கோரிக்கை"],["தமிழகம்","நகர்ப்புற குடிசை ஏழைகள் அனைவருக்கு பாதுகாப்பான வீடுகள் வழங்க சிறப்பு திட்ட"],["தமிழகம்","சட்டசபைக்கு காய்கறி மாலையுடன் வந்த அதிமுக எஎல்ஏக்கள்"],["தமிழகம்","தமிழகத்துக்கு கூடுதலாக மெகாவாட் மின்சார"],["தலையங்கம்","கல்லூரிகளில் ராகிங் கொடுமை"],["குற்றம்","புழல் சிறையில் கைதியிட செல்போன் போலீசார் விசாரணை"],["குற்றம்","விபசார செய்வதற்காக லாட்ஜில் அடைத்த பெண்கள் மீட்பு பேர் கைது"],["மாவட்ட மசாலா","சுற்றுலா பஸ் கவிழ்ந்து பக்தர்கள் படுகாய"],["மாவட்ட மசாலா","பொங்கல் விடுமுறை மறுப்பு முதல்வர் தலையிட கோரிக்கை"],["இந்தியா","அமைச்சர்களின் சிபாரிசுகளை கேஸ் டைரியில் குறிப்பிட வேண்டா"],["இந்தியா","ஸ்ரீகிருஷ்ணா கமிட்டி அறிக்கை எதிரொலி எபி எஎல்ஏ வீடுகள் முற்றுகை"],["தமிழகம்","தேர்வு தேதியில் திடீர் மாற்ற விஏஓ தேர்வு பிப்ரவரி ல் நடக்கிறது"],["குற்றம்","கணவருடன் தகராறு தீக்குளித்த பெண் பலி குழந்தையு சாவு திருவள்ளூர் அருகே சோக"],["குற்றம்","போலி ஆவண மூல கடன் வழங்கிய வங்கி மேலாளர்கள் சிறையில் அடைப்பு"],["தமிழகம்","மணல் லாரி ஸ்டிரைக் வது நாளாகதொடர்கிறது"],["மாவட்ட மசாலா","கல்லூரியில் ராகிங் மாணவர்கள் கைது"],["மாவட்ட மசாலா","தோட்டத்துக்குள் புகுந்து யானைகள் அட்டகாச"],["மாவட்ட மசாலா","தமிழக முழுவது ஜெயிலர்கள் பேர் மாற்ற"],["மாவட்ட மசாலா","மலைவாழ் மக்களுக்கு வீடு தேடி சாதி சான்று"],["தமிழகம்","வெள்ள போல் மாணவர்கள் குவிந்தனர் தினகரன் விஐடி சார்பில் நாகர்கோவிலில் வெற்றி நமதே"],["தமிழகம்","நாகை கடலோர பகுதியில் இலங்கை மீனவர்கள் கைது"],["தமிழகம்","ஒரு வாரத்துக்கு பிறகு கூட்டணி குறித்து பேச்சு முதல்வர் கருணாநிதி பேட்டி"],["தமிழகம்","சாமிதோப்பு பதியில் வழிபாடு ஜெயலலிதா நாளை குமரி பயண"],["தமிழகம்","பெட்டிகளுடன் சரக்கு ரயில் வெள்ளோட்ட"],["விளையாட்டு","இந்தியாதென் ஆப்ரிக்கா ல் நாளை மோதல்"],["விளையாட்டு","உலககோப்பை கிரிக்கெட் போட்டி வாஸ் ஜெயசூர்யாவுக்கு ஆப்பு"],["விளையாட்டு","நடால் தோல்வி"],["விளையாட்டு","காய்கறி விற்கிறது இலங்கை ராணுவ"],["உலகம்","இந்தியரின் திருமணத்தால் நியூசிலாந்தில் டிராபிக் ஜா"],["உலகம்","ஆப்கனில் மனிதகுண்டு தாக்குதல் பேர் பலி"],["ஸ்டேட் எக்ஸ்பிரஸ்","பீகார் துணை முதல்வர் விலக காங்கிரஸ் வலியுறுத்தல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆடைகளை அவிழ்த்து சோதனை பள்ளி மாணவி தற்கொலை"],["ஸ்டேட் எக்ஸ்பிரஸ்","உபியில் கடுங்குளிருக்கு பேர் பரிதாப சாவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","அரசு விழாவில் தீக்குளிப்பேன் பாஜஅமைச்சர் மிரட்டல்"],["இந்தியா","மேற்கு வங்க படுகொலை பலி எண்ணிக்கை ஆக உயர்வு கவர்னர் கண்டன"],["தமிழகம்","கடந்த ஆண்டில் ஆயிர பேரை காப்பாற்றிய ஆபுலன்ஸ் சேவை"],["உலகம்","பாதுகாப்பான உள்ளாடை கண்டுபிடிப்பு பாடி ஸ்கேனிங் வெட்க வேண்டா"],["மர்மம்","தொடரு மரண மிரளு கிராம"],["மாவட்ட மசாலா","காட்டுத்தீயை தடுக்க வன ஊழியருக்கு பயிற்சி"],["மாவட்ட மசாலா","ஊதிய உயர்வு வேண்டு தலைமை ஆசிரியர்கள் கோரிக்கை"],["மாவட்ட மசாலா","சிறுமியை பலாத்கார மேஸ்திரிக்கு வலை"],["மாவட்ட மசாலா","பஞ் தலைவருக்கு கத்திகுத்து பேர் மீது வழக்கு"],["குற்றம்","மணிலா வியாபாரியை விடுவிக்க கோடி கேட்டு கடத்தல்காரர்கள் மிரட்டல்"],["சினிமா(ரீல்மா)","அனுஷ்கா சர்மா ஆஹா ஓஹோ புகழ்ந்து தள்ளுகிறார் ஓவியர் உசேன்"],["தமிழகம்","டெட்டனேட்டர் வெடித்து மாணவன் கை துண்டிப்பு"],["சினிமா(ரீல்மா)","துபாய் கபெனி கோடி பங்களா பரிசு ஷாருக்கானுக்கு வருமான வரி துறை நோட்டீஸ்"],["தமிழகம்","ஒடுக்கப்பட்ட மக்களின் விடுதலைக்கு தன்னை அர்ப்பணித்தவர் அய்யா வைகுண்டசாமி ஜெயலலிதா பேச்சு"],["தமிழகம்","உள்ளாட்சி அமைப்புகளில் காலியாக உள்ள இடங்களுக்கான தேர்தல் வாக்குப்பதிவு தொடங்கியது"],["உலகம்","விலங்கு பறவை மீன்கள் கூட்ட கூட்டமாக சாகிறதே சுற்றுச்சூழல் தரு எச்சரிக்கை"],["தமிழகம்","ரயில்வே பூங்காவில் சமூக விரோத செயல்கள்"],["தமிழகம்","வேட்டி சேலை வழங்காததால் ஊழியர்களுடன் மக்கள் தகராறு"],["தமிழகம்","லாரி மீது வேன் மோதி பக்தர்கள் பரிதாப சாவு"],["தமிழகம்","சட்டசபை தேர்தலுக்கான இறுதி வாக்காளர் பட்டியல் தொகுதிகளிலு வெளியீடு"],["தமிழகம்","எண்ணூரில் வயர் அறுந்ததால் ரயில் போக்குவரத்து பாதிப்பு"],["இந்தியா","தேர்தலில் லட்சத்துக்கு மேல் செலவிட்டதில்லை மதா பானர்ஜி"],["இந்தியா","கடு பனி காரணமாக சண்டிகர் ஏர்போர்ட் மூடல்"],["இந்தியா","டெல்லியில் ஜெகன் உண்ணாவிரத காங் எஎல்ஏக்கள் பேர் ஆதரவு"],["தமிழகம்","கோடி செலவில் வேலூரில் கூட்டுக் குடிநீர் திட்ட"],["விளையாட்டு","ஐபிஎல் அனுபவ கை கொடுத்தது டோனி உற்சாக"],["விளையாட்டு","டோனிக்கு பிப் ல் பாராட்டுவிழா"],["விளையாட்டு","பாக் கேப்டன் ஜன ல் நியமன"],["விளையாட்டு","கங்குலி இல்லாமல் கொல்கத்தா இல்லை ஷாருக் திடீர் பல்டி"],["சினிமா(ரீல்மா)","மோனிகா பேடி நடித்த தமிழ் பட"],["இந்தியா","பட்ட பிடிக்க சென்ற சிறுவர்கள் ரயில் மோதி பலி"],["சினிமா(ரீல்மா)","படக் குழுவுக்கு மலைவாழ் மக்கள் கண்டிஷன்"],["சினிமா(ரீல்மா)","தற்கொலையில் மர்ம நீடிக்கிறது டைரக்டருடன் ஷோபனா காதலா வெண்ணிற ஆடை மூர்த்தி பேட்டி"],["உலகம்","துபாயில் வருஷத்தில் பிளாஸ்டிக் பை குட்பை"],["உலகம்","வாரிசு வளருமா வளராதா கப்யூட்டர் கிளிக் சொல்லு"],["உலகம்","யூ டர்ன் ஜுஜூபி ஓ டர்ன் போடலா"],["உலகம்","குழந்தை மண்டை ஓட்டில் வைரக்கற்கள் பதிப்பு"],["உலகம்","அமெரிக்க பள்ளியில் கபடி கபடி"],["விளையாட்டு","பயிற்சி ஆட்டத்திலு இங்கிவெற்றி"],["விளையாட்டு","பஞ்சாப் அணிக்கு கில்கிறிஸ்ட் கேப்டன்"],["விளையாட்டு","இர்பானை இழந்தது வருத்த கில்கிறிஸ்ட் கிடைத்தது மகிழ்ச்சி"],["விளையாட்டு","மெஸிக்கு பிபா விருது"],["விளையாட்டு","இந்தியா தென் ஆப்ரிக்கா ஒன்டே நாளை ஸ்டார்ட்"],["தமிழகம்","டைரக்டருடன் ஷோபனா காதலா தற்கொலையில் மர்ம நீடிக்கிறது"],["உலகம்","வேலைக்காரிக்கு சூடு சவுதி பெண்ணுக்கு சிறை"],["உலகம்","இங்கிலாந்து போர் கப்பலை பள்ளியாக மாற்ற முயற்சி"],["ஸ்டேட் எக்ஸ்பிரஸ்","கோடி ஏடிஎ பணத்துடன் வேன் டிரைவர் ஓட்ட"],["ஸ்டேட் எக்ஸ்பிரஸ்","கொல்லப்பட்டவரின் மரண வாக்குமூல மொபைலில் பதிவு செய்தவருக்கு பாராட்டு"],["ஸ்டேட் எக்ஸ்பிரஸ்","எச்ஐவி சோதனை கட்டாயமாக்க பெண்கள் ஆணைய வலியுறுத்தல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","உபி எஎல்ஏ மீது பலாத்கார வழக்கு சிபிசிஐடி பரிந்துரை"],["குற்றம்","கள்ளக்காதலன் திட்டியதால் மனமுடைந்த பெண் தற்கொலை"],["குற்றம்","கபெனிக்குள் நுழைந்து ஊழியருக்கு அரிவாள் வெட்டு"],["இந்தியா","பொங்கலுக்கு பிறகு மத்திய அமைச்சரவையில் மாற்ற வருகிறது"],["இந்தியா","திருப்பதி லட்டு டோக்கனில் பார் கோடிங் பதிப்பு போலிகளை தடுக்க அதிரடி"],["இந்தியா","பள்ளிக்கு லேட்டாக வந்ததால் பனிஷ்மென்ட் மைதானத்தை சுற்றிய மாணவன் பரிதாப சாவு"],["இந்தியா","டெல்லியில் ஜெகன் உண்ணாவிரத எஎல்ஏக்கள் பங்கேற்பு"],["தமிழகம்","அதிமுக எஎல்ஏக்கள் மீதான நடவடிக்கை ரத்து சட்டசபையில் தீர்மான"],["மாவட்ட மசாலா","சிறுத்தை தாக்கி ஆடுகள் சாவு சுற்றுலா பயணிகள் பீதி"],["மாவட்ட மசாலா","வாக்குச்சாவடியில் வாலிபர் தீக்குளித்து தற்கொலை முயற்சி"],["மாவட்ட மசாலா","பாஸ்போர்ட் விசா இல்லாத நைஜீரியர்கள் பிளாக் லிஸ்ட்"],["மாவட்ட மசாலா","திண்டிவன நகராட்சியில் கவுன்சிலர்கள் போராட்ட"],["தலையங்கம்","விமானத்தை நிறுத்திய எலி"],["தமிழகம்","நீரிழிவு நோய்க்கு மருந்து கருத்தரங்கில் வலியுறுத்தல்"],["குற்றம்","கழுத்தை அறுத்து பெண் கொலை"],["குற்றம்","நக்சல் வேட்டையில் பகீர் முன்னாள் எஎல்ஏ மகன் கைத்துப்பாக்கியுடன் கைது"],["குற்றம்","லஞ்ச வழக்கில் தொடர்பு அரசு ஊழியர் சஸ்பெண்ட் ரத்து செய்ய கோர்ட் மறுப்பு"],["தமிழகம்","பொங்கல் விடுமுறை நாட்களில் தியேட்டர்களில் காட்சிகள்"],["தமிழகம்","நந்தபாக்கத்தில் வி சிறுத்தைகள் பொதுக்கூட்ட"],["தமிழகம்","திருப்பதி லட்டு டோக்கனில் பார் கோடிங் பதிப்பு"],["தமிழகம்","எலியால் அலறிய வங்கி அலார"],["தமிழகம்","சாக்கடை சுத்த செய்ய ஆட்களை பயன்படுத்த கூடாது"],["தமிழகம்","பஸ் வசதி திடீர் குறைப்பு மக்கள் அவதி"],["தமிழகம்","புறநகர் மின்சார ரயில்களில் சிறு வியாபாரிகள் தொல்லை"],["சினிமா(ரீல்மா)","கவர்ச்சி ஹோலி கவலை இல்லை தன்ஷிகா பேட்டி"],["சினிமா(ரீல்மா)","கேமராவை மறைத்து வைத்து நடந்த ஷூட்டிங்"],["தமிழகம்","இறந்த மாணவருக்கு நஷ்டஈடு கேட்டு செங்கல்பட்டு கலைக்கல்லூரி மாணவர்கள் சாலை மறியல்"],["தமிழகம்","உள்ளாட்சி இடைத்தேர்தல் அதிக இடங்களை திமுக கைப்பற்றியது"],["தமிழகம்","வெடிகுண்டு பீதி மர்ம சூட்கேசால் ஏர்போர்ட்டில் பரபரப்பு"],["தமிழகம்","பரங்கிமலையில் சுகாதாரமற்ற கழிவறையால் நோய் பரவு அபாய"],["தமிழகம்","செங்கல்பட்டு அரசு மருத்துவமனை ஊழியர்கள் மீது எஎல்ஏ புகார்"],["தமிழகம்","ஆவடி மின்வாரிய கோட்டத்தில் உடைந்த மின்கபங்களால் மக்கள் பீதி"],["இந்தியா","சரக்கு சமாசாரங்கோ டாஸ்மாக்குக்கு தாத்தாதி தாத்தா"],["உலகம்","பிரா தான வாங்குது சிங்கப்பூர் வெப்சைட்"],["உலகம்","பணவீக்கத்தால் உடபு வீங்கு ஆண்டு சர்வே புது தகவல்"],["இந்தியா","நாடாளுமன்ற கமிட்டி முன்பு முப்படை தளபதிகள் ஆஜர்"],["இந்தியா","ஆண்டுக்கு பிறகு அதிசய தவளை பாதி நண்டு பாதி கலந்த கலவை கண்டுபிடிப்பு"],["தமிழகம்","பாதுகாப்பு படை போலீசுக்கு எதிராக சென்னை விமானநிலைய ஊழியர்கள் ஆர்ப்பாட்ட"],["இந்தியா","ராஜினாமா செய்யத் தயார் ஜெகன் ஆதரவு எஎல்ஏக்கள் அறிவிப்பு"],["தமிழகம்","பஸ் வராததால் ஆத்திர திருவள்ளூர் பஸ்நிலையத்தில் பயணிகள் திடீர் மறியல்"],["தமிழகம்","காஞ்சி திருவள்ளூர் மாவட்ட உள்ளாட்சி இடைத்தேர்தலில் திமுக அபார"],["குற்றம்","பழ வியாபாரி கொலையில் பேருக்கு ஆயுள்சிறை"],["குற்றம்","வேன் பைக் மோதல் ஒருவர் பலி பேர் காய"],["குற்றம்","குழந்தை ஏக்கத்தில் இளபெண் தற்கொலை"],["குற்றம்","மணல் திருட்டை தடுத்த எஸ்ஐக்கு சவுல் அடி"],["குற்றம்","வேலூரில் நள்ளிரவு பரபரப்பு லஞ்சபணத்துடன் பைக்கில் பறந்த மின்வாரிய அதிகாரிகள் கைது"],["கல்வி",null],["குற்றம்","மாவட்டங்களில் கைவரிசை பவுன் நகைகள் திருடிய தஞ்சை சகோதரிகள் கைது"],["தலையங்கம்","பெற்றோரை இணைத்த குழந்தைகள்"],["கல்வி","இன்ஜினியரிங் படித்தால் மட்டு போது"],["விளையாட்டு","கிளார்க் தலைமையில் ஆஸ்திரேலிய அணி"],["விளையாட்டு","தெஆ பறந்தார் இஷாந்த்சர்மா"],["விளையாட்டு","இளைஞர்களுக்கு வாய்ப்பு டோனி"],["விளையாட்டு","நபர் க்கு சான்ஸ்"],["விளையாட்டு","டாக்டர் சச்சின்"],["விளையாட்டு","முதல் ஒருநாள் போட்டி சரித்திர படைக்குமா இந்திய அணி"],["மர்மம்","கந்து வட்டிக்காரர்களை பழிவாங்கு ஆவி"],["வேலைவாய்ப்பு","மத்திய அரசு இன்ஜினியர் பணியிடங்களுக்கு ஸ்டாப் செலக்ஷன் தேர்வு"],["வேலைவாய்ப்பு","தென்கிழக்கு ரயில்வேயில் காலியிடங்கள்"],["இந்தியா","ஜெகன்மோகன் ரெட்டிக்கு சொந்தமான நிறுவனங்களில் இன்கடாக்ஸ் ரெய்டு"],["தமிழகம்","கடலூர் நெல்லையில் வெள்ள சேத ஆய்வு மத்திய குழுவினரிட விவசாயிகள் கண்ணீர்"],["குற்றம்","புழல் சிறை கைதி தப்பி ஓட்ட வார்டன் சஸ்பெண்ட்"],["குற்றம்","பகலில் வசூல் இரவில் சூது போலி ஐயப்ப பக்தர்கள் பேர் பிடிபட்டனர்"],["தலையங்கம்","ரயில் பெட்டியில் புகை மண்டல"],["தமிழகம்","ரத்து செய்த டிக்கெட் பண தர தாமத ஆயிர நஷ்டஈடு வழங்க ரயில்வேக்கு உத்தரவு"],["தமிழகம்","இலங்கையில் சிறைபிடிக்கப்பட்ட காசிமேடு மீனவர்களை மீட்க போர்க்கால நடவடிக்கை"],["குற்றம்","எஸ்ஐயை தாக்கிவிட்டு தப்பிய கொள்ளையன் பிடிபட்டான்"],["தமிழகம்","பாலாற்றில் மணல் அள்ளுவதால் திருக்கழுக்குன்றத்தில் குடிநீர் தட்டுப்பாடு அபாய"],["இந்தியா","எல்லைக்குள் அத்துமீறிய இலங்கை மீனவர்கள் பேர் பிடிபட்டனர்"],["தமிழகம்","திருச்சி அருகே பஸ்கள்கார்கள் மோதல் பேர் உடல் நசுங்கி பலி"],["இந்தியா","பேரை பலிகொண்ட சபரிமலை கோர விபத்து அமைச்சர் டிஜிபி நேரில் விசாரணை"],["தமிழகம்","களை கட்டியது காணு பொங்கல் மெரினாவில் லட்ச பேர் குவிந்தனர்"],["தலையங்கம்","தள்ளுமுள்ளு உயிருக்கு ஆபத்து"],["குற்றம்","ரசாயன தேய்த்தால் டாலர் கிடைக்கு கருப்பு தாள்களை கொடுத்து மோசடி செய்த பேர் கைது"],["தமிழகம்","ஷ்னைடர் எலக்ட்ரிக் நிறுவன விஐடி பல்கலையுடன் ஒப்பந்த"],["மாவட்ட மசாலா","எருது விடு விழாவில் மோதல் எஸ்ஐ ஏட்டு காய பேர் கைது"],["மாவட்ட மசாலா","விநாயகர் சிலைகள் மாதத்துக்கு பிறகு கரைப்பு"],["குற்றம்","காட்டுக்குள் தூக்கி சென்று பலாத்கார வகுப்பு மாணவி கழுத்து நெரித்து கொலை"],["மாவட்ட மசாலா","யானை தந்த விற்பனை ஊட்டியில் பேர் கைது"],["உலகம்","நரி சுட்டதில் குண்டு பாய்ந்து வேட்டைக்காரர் படுகாய"],["உலகம்","சர்ச் மீது தாக்குதல் குற்றவாளிக்கு மரண தண்டனை"],["உலகம்","நீர்மூழ்கி கப்பல் வாங்கியதில் சர்தாரிக்கு கோடி லஞ்ச"],["ஸ்டேட் எக்ஸ்பிரஸ்","பைக்கில் வந்த குபல் லட்ச வழிப்பறி"],["ஸ்டேட் எக்ஸ்பிரஸ்","பாய்பிரெண்ட் மீது வெளிநாட்டு மாணவி புகார்"],["ஸ்டேட் எக்ஸ்பிரஸ்","காற்றாடி விளையாட்டு குஜராத்தில் மோதல்"],["குற்றம்","புனித தலமான சபரிமலையில் அடிப்படை வசதிகள் மிகவு மோச நடிகர் விவேக் ஓபராய் ஆவேச"],["இந்தியா","புனித தலமான சபரிமலையில் அடிப்படை வசதிகள் மிகவு மோச நடிகர் விவேக் ஓபராய் ஆவேச"],["தமிழகம்","உதவி பேராசிரியர்கள் நியமன தேதி முதல் இன்டர்வியூ"],["தமிழகம்","கலை பண்பாட்டு துறை சார்பில் தமிழக அரசு விருதுகள் அறிவிப்பு"],["தமிழகம்","எஜிஆர் பிறந்தநாள் கொண்டாட்ட"],["தமிழகம்","தமிழக பாஜ வேட்பாளர் பட்டியல் தயாராகிறது"],["தமிழகம்","வழக்குகளை பதிவு செய்யாத இன்ஸ்பெக்டர்களுக்கு மெமோ"],["தமிழகம்","எஜிஆர் சிலைக்கு ஜெயலலிதா மரியாதை"],["தமிழகம்","குடியரசு தினத்தையொட்டி தமிழகத்தில் பலத்த போலீஸ் பாதுகாப்பு"],["தமிழகம்","கொரட்டூர் அருகே சரக்கு லாரி கால்வாயில் கவிழ்ந்தது"],["உலகம்","விக்கிலீக்ஸ்க்கு ரகசியங்களை தெரிவித்த அமெரிக்க வீரருக்கு சிறையில் சித்ரவதையா"],["விளையாட்டு","ஆஸ்திரேலிய ஓபன் ஷரபோவா முதல் சுற்றில் வெற்றி"],["விளையாட்டு","இலங்கை வெஇ ஒருநாள் போட்டி ஜனவரி ல் தொடக்க"],["விளையாட்டு","ஐபிஎல் போட்டிகள் மூல அரசுக்கு கோடி வருமான"],["விளையாட்டு","நாளை இந்தியா தெஆ வது ஒன்டே முன்னிலை பெறுவது யார்"],["விளையாட்டு","உலககோப்பை இந்திய அணி அறிவிப்பு ரோகித் சர்மா நீக்க தமிழக வீரர் அஷ்வினுக்கு வாய்ப்பு"],["தமிழகம்","குடியரசு தின ஒத்திகை நிகழ்ச்சி காமராஜர் சாலையில் போக்குவரத்து மாற்ற"],["இந்தியா","சபரிமலை கோர விபத்துக்கு கூட்ட நெரிசலே காரண முதல்கட்ட விசாரணையில் தகவல்"],["மாவட்ட மசாலா","நாகர்கோவில் அருகே கடல் உள்வாங்கியது"],["மாவட்ட மசாலா","உளுந்தூர்பேட்டையில் லட்ச கறி விற்பனை"],["மாவட்ட மசாலா","கிணற்றில் குளித்தபோது நீரில் மூழ்கி சிறுமி பலி"],["தலையங்கம்","பாதியில் நின்ற ஜல்லிக்கட்டு"],["தமிழகம்","கில் கோடியில் காகித ஆலை யூனிட் வீடியோ கான்பரன்சில் முதல்வர் நாளை திறக்கிறார்"],["உலகம்","சுவிஸ் வங்கி ரகசியங்களை வெளியிட போகுது விக்கிலீக்ஸ்"],["சினிமா(ரீல்மா)","நடிகர் பாவிஜய் வீட்டில் கொள்ளை முயற்சி"],["குற்றம்","பெசன்ட்நகரில் நள்ளிரவில் பயங்கர கத்தியால் குத்தி பேர் கொலை"],["குற்றம்","குழந்தைகளை கொன்று பெண் தற்கொலை கணவன் மாமியார் சிறையில் அடைப்பு"],["விளையாட்டு","ஆஸ்திரேலிய ஓபன் டென்னிஸ் நடால் வெற்றி"],["குற்றம்","நுங்கபாக்க ஓட்டலில் துணிகர தொழிலதிபரிட லட்ச கொள்ளை"],["விளையாட்டு","ரணதுங்காவுக்கு கோர்ட் வாரன்ட்"],["குற்றம்","காரைக்குடி அருகே கொடூர மனைவி குழந்தைகளை வெட்டிக்கொன்ற ஆசாமி"],["விளையாட்டு","வது டெஸ்ட் நியூசிலாந்து நிதான"],["குற்றம்","தொழிலதிபர் வீட்டில் பவுன் கொள்ளை"],["குற்றம்","வீட்டுக்கு வீடு ஜேப்படி மபியில் ஒரு திருட்டு கிராம கோச்சிங் கிளாஸ் நடத்தி திருட்டு ஜாமீனில் எடுக்க ஸ்பெஷல் வக்கீல்கள்"],["விளையாட்டு","உலககோப்பை ஆஸி அணி அறிவிப்பு பான்டிங் கேப்டனாக நீடிப்பு"],["விளையாட்டு","உலககோப்பையை வென்று சச்சினுக்கு சமர்ப்பிப்போ கவுத காபீர் உறுதி"],["உலகம்","பாக் தீவிரவாத முகாமில் கனடா நாட்டினர் பயிற்சி"],["கல்வி","விவசாய மேலாண்மை படிப்பு மார்ச் ல் நுழைவுத்தேர்வு"],["கல்வி","உடனடி வேலைவாய்ப்பு தரு ஓட்டல் மேனேஜ்மென்ட் படிப்புகள்"],["குற்றம்","காஞ்சிபுர பஸ் ஸ்டாண்டில் நள்ளிரவில் பயங்கர கழுத்து அறுத்து வாலிபர் கொலை"],["குற்றம்","இளபெண் மர்ம சாவு சடலத்தை தோண்டி எடுக்க முடிவு"],["குற்றம்","கல்பாக்க அருகே நல்லாத்தூரில் தண்டுமாரியமன் கோயில் கோபுர கலச திருட்டு"],["தமிழகம்","புழல் விநாயகபுரத்தில் மாதமாக தேங்கி நிற்கு கழிவுநீர் தொடர் மறியல் நடத்த மக்கள் முடிவு"],["தமிழகம்","கட்சியில் கூடுதல் பொறுப்பு கொடுத்தால் மறுக்க மாட்டேன்"],["உலகம்","செவாலியர் ஜாக்சன் நினைவாக அமெரிக்காவில் லபக்"],["உலகம்","சுடச்சுட காபியுடன் ஆஸ்பிரின் டாஸ்மாக் ஹேங் ஓவர் போயிந்தே"],["உலகம்","பையன் கணக்குல புலி ஆகணுமா தாய்மார்களுக்கு அட்வைஸ்"],["இந்தியா","சபரிமலை விபத்துக்கு கேரள அரசே பொறுப்பு"],["தமிழகம்","ராணுவத்தில் சேர சான்றிதழ் கேட்டு ஐகோர்ட்டில் டாக்டர் மனுதாக்கல்"],["இந்தியா","பேர் பலியான புல்மேட்டில் லட்ச பக்தர்களுக்கு போலீசாரே பாதுகாப்பு"],["தமிழகம்","மேலவை வாக்காளர் பட்டியல் நாளை வெளியீடு எண்ணிக்கை அதிகரிக்க வாய்ப்பு"],["தமிழகம்","அனைவருக்கு கல்வி திட்ட கல்விக்குழு உறுப்பினர்களுக்கு பயிற்சி"],["தமிழகம்","மகப்பேறு உதவி திட்டத்தில் பெண்களுக்கு தலா"],["குற்றம்","தொழிலாளிக்கு அடி கோர்ட் ஊழியர் கைது"],["சினிமா(ரீல்மா)","ஆடுகள விமர்சன"],["தமிழகம்","காரை கிராமத்தில் சங்கரா கல்லூரி சார்பில் என்எஸ்எஸ் முகா"],["தமிழகம்","திருவள்ளூர் மாவட்டத்தில் எய்ட்ஸால் பாதிக்கப்பட்ட பேருக்கு பஸ் பாஸ்"],["தமிழகம்","மத்திய அரசின் சாதனைகளை பட்டி தொட்டி எங்கு காங்கிரசார் பரப்ப வேண்டு"],["தமிழகம்","இருளில் மூழ்கிய அரசு மருத்துவமனை திருவள்ளூரில் நோயாளிகள் அவதி"],["மாவட்ட மசாலா","கோடி மோசடி வழக்கில் பெண்ணுக்கு ஜாமீன் மறுப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","மாஜி தலைமை நீதிபதிக்கு எதிராக வக்கீல் சங்க தீர்மான"],["ஸ்டேட் எக்ஸ்பிரஸ்","டாக்டர்கள் ஓய்வு வயதை ஆக உயர்த்த நிதிஷ்குமார் உத்தரவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","சுரங்க பாதையில் சிக்கியவர் நாளுக்கு பிறகு உயிருடன் மீட்பு"],["மாவட்ட மசாலா","லாரி மீது பைக் மோதி வாலிபர்கள் பலி"],["மாவட்ட மசாலா","கருபு தோட்ட எரிந்து நாசமானது"],["மாவட்ட மசாலா","நித்யானந்தா ஆசிரமத்தை பட பிடித்தவருக்கு உதை"],["விளையாட்டு","வது சுற்றில் வோஸ்னியாக்கி"],["மாவட்ட மசாலா","அறிவியல் கண்காட்சி புதுவையில் நாளை துவக்க"],["விளையாட்டு","உலககோப்பைக்கான தெஆ அணி அறிவிப்பு"],["விளையாட்டு","யூசுப் ஹர்பஜன் அதிரடி இந்தியா த்ரில் வெற்றி"],["சினிமா(ரீல்மா)","தங்கைக்கு காஜல் சிபாரிசு"],["தமிழகம்","தறிகெட்டு ஓடிய மினி லாரி பஸ் ஸ்டாப்பில் புகுந்தது மாமியார் மருமகள் உடல் நசுங்கி பலி"],["தமிழகம்","டியூப்லைட்டை கடித்து தின்று புழல் சிறையில் கைதி தற்கொலை முயற்சி"],["தமிழகம்","சட்டமேலவை தேர்தலுக்கான இறுதி வாக்காளர் பட்டியல் வெளியீடு கலெக்டர் அலுவலகங்களில் பார்க்கலா"],["குற்றம்","கயூ பிரமுகர் வெட்டிக் கொலை கடைகள் எரிப்பு பஸ்கள் உடைப்பு"],["உலகம்","அழுக்கு துணி சண்டைதான் டைவர்ஸ் வரை போகிறதா"],["உலகம்","ஆன்ட்டிபயாடிக் ஆபத்து"],["குற்றம்","குளச்சலில் வெறிநாய் தொல்லை பேரை விரட்டி கடித்தது"],["உலகம்","பொடியனின் வீடியோகே பபுள்பால் உலக சாதனை"],["உலகம்","உலகக்கோப்பை கால்பந்து ஆருட சொன்ன ஆக்டோபசுக்கு நினைவுச் சின்ன உருவச்சிலை"],["மாவட்ட மசாலா","ஜன தேதி விவசாயிகள் ஆர்ப்பாட்ட"],["மாவட்ட மசாலா","மோட்டார் வாகன ஆய்வாளர் பேர் விரைவில் நியமன"],["மாவட்ட மசாலா","தேசிய பேரிடர் மீட்பு படைக்கு அதிநவீன கருவிகள்"],["உலகம்","கிளப் டான்சருக்கு கோடி தருகிறார் இத்தாலி பிரதமர்"],["உலகம்","ஆப்கன் குண்டு வெடிப்பில் அப்பாவி மக்கள் பலி"],["தமிழகம்","வாக்குறுதிகளை நிறைவேற்றியதால் மக்களை துணிவாக சந்திக்கிறோ துணை முதல்வர் ஸ்டாலின் பேச்சு"],["உலகம்","சீனாவின் வளர்ச்சி உலகுக்கு நல்லது ஒபாமா"],["குற்றம்","செக்ஸ் டார்ச்சர் கொடுத்த மாமனார் கணவர் கைது"],["தமிழகம்","சத்தியஞான சபையில் தைப்பூச ஜோதி தரிசன"],["தமிழகம்","வேதாரண்ய மீனவர்கள் மீது இலங்கை ராணுவ தாக்குதல்"],["தமிழகம்","பட்டாபிரா வங்கியில் நூதன மோசடி க்கு ஆசைப்பட்டு ஆயிர இழந்த பெண்"],["தமிழகம்","பஸ் வசதி இல்லாமல் கிராம மக்கள் அவதி"],["குற்றம்","பஸ்சில் வந்த லக்கேஜில் பெண் தலை குழந்தை சடல கொலை செய்யப்பட்டவர்கள் சென்னையை சேர்ந்தவர்களா"],["தமிழகம்","அடிப்படை வசதிகள் எதுவு இல்லை"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஊழல் புகாரில் சிக்கிய உபி அமைச்சர் டிஸ்மிஸ்"],["ஸ்டேட் எக்ஸ்பிரஸ்","விலைவாசி பிரச்னை சோனியாவுக்கு சமன்"],["ஸ்டேட் எக்ஸ்பிரஸ்","சாலையில் குடியிருப்போரை இரவில் கணக்கெடுக்க முடிவு"],["விளையாட்டு","பயஸ் ஜோடி கலக்கல் வெற்றி ஜெலினா ஜன்கோவிக் அதிர்ச்சி தோல்வி"],["விளையாட்டு","நாளை வது ஒருநாள் போட்டி தொடரை வென்று சாதிக்குமா டோனி அன்கோ"],["இந்தியா","மூத்த அமைச்சர்களுக்கு மறைமுக எச்சரிக்கை டெல்லி வட்டாரத்தில் பரபரப்பு"],["தமிழகம்","பிறந்த நாள் பரிசு வழக்கில் விடுவிக்க கோரி ஜெ மனு விசாரணை மீண்டு தள்ளிவைப்பு"],["சினிமா(ரீல்மா)","மாஜி கவர்னர் ரீஎன்ட்ரி நாஜி கமாண்டராக நடிக்கிறார் அர்னால்டு"],["சினிமா(ரீல்மா)","ஆனிஸ்டனின் ஹேர்ஸ்டைல் சுவாரசிய"],["இந்தியா","ஊழல் புகாரில் சிக்கு அரசு அதிகாரிகள் உடனே டிஸ்மிஸ்"],["குற்றம்","கயூ பிரமுகர் கொலையில் பேர் கைது"],["குற்றம்","ஆரணி அருகே பயங்கர பலாத்கார முயற்சியில் சிறுமி படுகொலை"],["தலையங்கம்","நீதி கிடைக்க ஆண்டுகள்"],["மாவட்ட மசாலா","பாளை கைதி தப்பியோட்ட"],["மாவட்ட மசாலா","பூரண மதுவிலக்கு வரை கள் இறக்க அனுமதி"],["மாவட்ட மசாலா","மதுரையில் கார் திருட்டு ஏட்டுகள் சஸ்பெண்ட்"],["மாவட்ட மசாலா","சட்டசபை குழு மூல மனுக்களுக்கு தீர்வு"],["மாவட்ட மசாலா","வனக்கல்லூரியில் யானைகள் அட்டகாச"],["மாவட்ட மசாலா","அதிக கட்டண வசூல் செயல் அலுவலர் சஸ்பெண்ட்"],["குற்றம்","லக்கேஜ் பையில் தலை சடல மீட்பு திருப்பூர் வாலிபருக்கு போலீஸ் வலை"],["மாவட்ட மசாலா","மாதவரத்தில் லட்ச செலவில் புதிய பஸ் நிலைய திறப்பு"],["மாவட்ட மசாலா","வடபழனியில் மூதாட்டியிட செயின் அபேஸ்"],["தமிழகம்","மாதா மடியில் குழந்தை நிலவை வணங்கிய மக்கள் அச்சிறுப்பாக்க செங்கல்பட்டில் பரபரப்பு"],["மாவட்ட மசாலா","பாதிக்கப்பட்டவருக்கு நஷ்டஈடு தர கட்டுமான நிறுவனத்துக்கு உத்தரவு"],["மாவட்ட மசாலா","மத்திய சென்னையில் இளைஞர் காங்கிரசார் நாள் பிரசார"],["மாவட்ட மசாலா","நில தகராறை விசாரிக்க சென்ற பெண் எஸ்ஐ மூக்கு உடைப்பு"],["மாவட்ட மசாலா","தாபரத்தை அடுத்த சேலையூரில் புதிய சார்பதிவாளர் அலுவலக அமைச்சர் அன்பரசன் திறந்தார்"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆள்கடத்தல் பலாத்காரத்தில் நகரங்களில் டெல்லிக்கு முதலிட"],["ஸ்டேட் எக்ஸ்பிரஸ்","நாலந்தா பல்கலைக்கு கோடி நிதிஷ்குமாரிட சீன தூதர் உறுதி"],["ஸ்டேட் எக்ஸ்பிரஸ்","தெலங்கானா மாணவர்கள் செமஸ்டர் தேர்வு புறக்கணிப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","பலாத்கார புகாரில் சிக்கிய உபி எஎல்ஏ மீது குற்றப்பத்திரிகை"],["உலகம்","சக மாணவிகளை பேஸ்புக்கில் அநாகரிக வர்ணனை பள்ளி மாணவன் சஸ்பெண்ட்"],["உலகம்","உணவில் பங்கு காய்கறி பழங்கள் இதய நோயில் இருந்து தப்பிக்கலா"],["இந்தியா","கவர்னரை கண்டித்து பாஜ பந்த் பஸ்கள் எரிப்பு கர்நாடகாவில் பதற்ற"],["மாவட்ட மசாலா","மணல் அள்ளுவதை தடுத்த அதிகாரிகளை கொல்ல முயற்சி"],["மாவட்ட மசாலா","எலக்ட்ரானிக்ஸ் கடையில் தீ லட்ச பொருள் நாச"],["மாவட்ட மசாலா","பாத்திர தொழிலாளர் ஸ்டிரைக் வது நாளாக நீடிக்கிறது"],["மாவட்ட மசாலா","சாராய குடித்தால் மீன்பிடிக்க செல்ல தடை"],["மாவட்ட மசாலா","இஸ்ரோ சார்பில் குன்னூரில் சிறப்பு அறிவியல் கருத்தரங்கு"],["தலையங்கம்","திரியில் கருகு மனித உயிர்கள்"],["தமிழகம்","எஸ்எஸ்எல்சி பிளஸ் தேர்வு மாவட்ட கல்வி அதிகாரிகளுடன் ல் சென்னையில் ஆலோசனை"],["தமிழகம்","விஐடி பல்கலையில் சர்வதேச கல்வி கண்காட்சி"],["மாவட்ட மசாலா","கொசஸ்தலை ஆற்றில் மணல் திருட்டு மேபால தூண்களுக்கு ஆபத்து"],["தமிழகம்","சிவகாசி விபத்தில் அனுமதியின்றி வெடி தயாரித்தது அபல போர்மேன் கைது ஓனர்கள் தலைமறைவு"],["விளையாட்டு","ஹோக்லி ஆட்ட வீண் வது ஆட்டத்தில் இந்தியா தோல்வி"],["மாவட்ட மசாலா","திருநங்கைகள் தினவிழா"],["தமிழகம்","ஆயிர ாய்க்காக மகளை வீட்டுவேலைக்கு அனுப்பிய தாய்"],["மாவட்ட மசாலா","திருத்தணியில் டிஎஸ்பி அலுவலக போலீஸ் குடியிருப்பு திறப்பு விழா"],["மாவட்ட மசாலா","பொன்விழாவை முன்னிட்டு கேளபாக்க அரசு பள்ளிக்கு புதிய கட்டிட அரங்க மேடை"],["விளையாட்டு","ஒன்டே போட்டியில் பாக் தள்ளாட்ட"],["விளையாட்டு","வது சுற்றில் பயஸ் ஜோடி"],["தமிழகம்","திருவள்ளூர் கலெக்டர் அலுவலகத்தில் பராமரிப்பின்றி பாழாகு பூங்கா செயற்கை நீ்று"],["குற்றம்","தொழிலதிபர் வீட்டில் பவுன் கொள்ளை"],["மாவட்ட மசாலா","குடுப தகராறில் இன்ஜினியர் தற்கொலை"],["உலகம்","மற்ற நாடுகளின் மீது ஆதிக்க செலுத்த மாட்டோ சீன அதிபர்"],["உலகம்","ரகசிய கணக்கு பட்டியலை தந்த சுவிஸ் வங்கி அதிகாரி சிறையில் அடைப்பு"],["உலகம்","கேட்டால் வரு டபுளாக வழங்கிய ஏடிஎ"],["உலகம்","பிரேசில் நிலச்சரிவு பலி ஆக உயர்வு பேர் மாய"],["ஸ்டேட் எக்ஸ்பிரஸ்","பாக்கெட் மணிக்காக கார் திருடிய மாணவன் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","அவதூறு வழக்கில் இருந்து நடிகர் சஞ்சய் தத் விடுதலை"],["ஸ்டேட் எக்ஸ்பிரஸ்","கோர்ட்டில் ஆடையை அவிழ்த்த பெண் அதிகாரி"],["ஸ்டேட் எக்ஸ்பிரஸ்","லாக்அப்பில் விஷ குடித்த கைதி சாவு நண்பர் எஸ்கேப்"],["சினிமா(ரீல்மா)","இசை அமைக்க ராஜா போட்ட கண்டிஷன்"],["சினிமா(ரீல்மா)","பத்மஸ்ரீ விருது போட்டியில் பிரியங்கா ஜெயப்பிரதா"],["உலகம்","சவுதி மன்னர் தாராள ஒபாமாவுக்கு கோடி நகைகள் பரிசு"],["தமிழகம்","திருவொற்றியூர் ரயில்வே ஸ்டேஷன் ரிசர்வேஷன் கவுன்ட்டரில் விஜிலென்ஸ் திடீர் சோதனை"],["குற்றம்","ஓடு ரயிலில் துணிகர பயணிகளை தாக்கி கொள்ளை"],["சினிமா(ரீல்மா)","காதல் கைகூடியது மாஜி முதல்வரின் மகனை மணக்கிறார் ஜெனிலியா"],["உலகம்","ஒட்டக ஸ்பீடா ஓடு துபாயில் டுபாக்கூர் சேல்ஸ்"],["மர்மம்","சாலை வளைவில் காத்திருக்கு பேய் நடுங்கு கிராம"],["உலகம்","ஆயில் டேங்கர் மீது பஸ் மோதி பேர் பலி"],["உலகம்","முதலை வயிற்றில் கேட்குது வித்தியாசமான ரிங்டோன்"],["உலகம்","இங்கிலாந்து இளவரசர் கல்யாண சூதாட்ட ஆகிப் போச்சு"],["சினிமா(ரீல்மா)","கேத்ரினா கைப் பிரியங்கா சோப்ரா வீடுகளில் இன்கடாக்ஸ் ரெய்டு"],["தமிழகம்","நாளை மறுநாள் குடியரசு தின விழா சென்னையில் பலத்த பாதுகாப்பு"],["குற்றம்","ஒரே ஆண்டில் கவுரவ கொலைகள் பாகிஸ்தான்"],["மாவட்ட மசாலா","இலவச வேட்டி சேலை கேட்டு திருவொற்றியூர் நகராட்சி தலைவர் ரேஷன் கடையில் உண்ணாவிரத"],["மாவட்ட மசாலா","தடுப்பணையில் மூழ்கி பாட்டி பேத்தி பலி"],["மாவட்ட மசாலா","சர்வதேச கணக்கு தணிக்கை முறை ஏப்ரல் முதல் அமலாகிறது"],["மாவட்ட மசாலா","மார்ச் தேதி வேலூரில் புதிய நீதிக்கட்சி மாநாடு"],["மாவட்ட மசாலா","பாசன நீர் பற்றாக்குறை ஆக உயரு அபாய"],["தமிழகம்","கல்விக்குழு திருவிழா"],["மாவட்ட மசாலா","நாகையில் மீனவர் ஸ்டிரைக்"],["குற்றம்","காதல் போட்டியில் கல்லூரி மாணவி கொலையா"],["மாவட்ட மசாலா","பாளை மத்திய சிறையில் கழுத்தை இறுக்கி கைதி கொலை"],["தமிழகம்","ஆலந்தூரில் மையங்களில் ஆயிர குழந்தைகளுக்கு போலியோ சொட்டு மருந்து"],["மாவட்ட மசாலா","சபரிமலை புல்மேடு பகுதியில் அனாதையாக கிடந்த பைக்"],["தமிழகம்","கல்விக் கட்டணத்தை அரசு நிர்ணயிக்ககூடாது ஜிவிசுவநாதன் வலியுறுத்தல்"],["குற்றம்","பெண்ணை கட்டிப்பிடித்து முத்த தனியார் நிறுவன மேலாளர் கைது"],["மாவட்ட மசாலா","நக்சலைட்களை ஒடுக்க நடவடிக்கை மலைக்கிராம மக்களுக்கு நலத்திட்ட உதவிகள்"],["தமிழகம்","பக்தர்கள் நெரிசலில் சிக்கி தவிப்பதை தவிர்க்க சபரிமலையில் கோடியில் திட்ட ஓராண்டில் பணிகளை முடிக்க முடிவு"],["குற்றம்","பஸ்சில் சிறுமி மானபங்க அரசு ஊழியர் கைது"],["மாவட்ட மசாலா","வெள்ளானூர் ஊராட்சியில் பேருக்கு கலைஞர் வீடு"],["மாவட்ட மசாலா","தீயில் கருகி பெண் சாவு கணவர் சீரியஸ்"],["தமிழகம்","திருவள்ளூர் மாவட்டத்தில் ஸ்டேஷன்களில் போலீசார் பற்றாக்குறை"],["குற்றம்","உறவினர்கள் பிரிக்க முயன்றதால் தீக்குளித்த கள்ளக் காதல் ஜோடி பலி"],["மாவட்ட மசாலா","ரோடு ரோலர் மோதி கூலி தொழிலாளி பலி"],["குற்றம்","ஆட்டோ டிரைவருக்கு உருட்டுக்கட்டை அடி"],["விளையாட்டு","இந்திய அணியின் பயிற்சியாளர் கிறிஸ்டன் பதவி விலகுகிறார்"],["ஸ்டேட் எக்ஸ்பிரஸ்","குழந்தைகள் எரித்துக்கொலை போதையில் தந்தை வெறிச்செயல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","தொலைபேசி ஒட்டுக் கேட்பு மோடி மீது காங் குற்றச்சாட்டு"],["ஸ்டேட் எக்ஸ்பிரஸ்","கவர்னர் உத்தரவை எதிர்த்து வழக்கு இல்லை எடியூரப்பா"],["ஸ்டேட் எக்ஸ்பிரஸ்","சிறையிலிருக்கு மாஜி முதல்வருக்கு எய்ஸ்சில் சிகிச்சை அளிக்க அனுமதி"],["ஸ்டேட் எக்ஸ்பிரஸ்","டெல்லியில் நாளில் குழந்தைகள் மாய"],["சினிமா(ரீல்மா)","தீவிரவாதிகள் கதையில் மேக்னா"],["உலகம்","இங்கிலாந்து இளவரசர் கல்யாண சூதாட்ட ஆகிப் போச்சு"],["உலகம்","முதலை வயிற்றில் கேட்குது வித்தியாசமான ரிங்டோன்"],["விளையாட்டு","உலககோப்பை கிரிக்கெட் பிப் ல் தொடக்க"],["விளையாட்டு","சச்சினை ரோல் மாடலாக எடுத்துக்கொள்ளுங்கள் பாக் வீரர்களுக்கு மியான்தத் அட்வைஸ்"],["ஸ்டேட் எக்ஸ்பிரஸ்","காஷ்மீரில் கொடியேற்ற நிதிஷ்குமார் கடு எதிர்ப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","மகாராஷ்டிர சந்தைகளில் வெங்காய விலை திடீர் சரிவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","சொத்து குவிப்பு புகார் ஜெகனுக்கு ஐகோர்ட் நோட்டீஸ்"],["ஸ்டேட் எக்ஸ்பிரஸ்","உபியில் தலித் வாலிபர்களை நிர்வாணமாக்கி ஊர்வல"],["தமிழகம்","கட்டுமான பொருள் விலையேற்றத்தால் தாபர போலீஸ் ஸ்டேஷன் புதிய கட்டிட பணி மந்த"],["இந்தியா","நைட்ல டைட்டா குடிச்சா குறட்டை சத்த அதிகரிக்கு"],["உலகம்","மகளின் சிகிச்சைக்கு உதவியதால் பிரதமருடன் உல்லாசமாக இருந்தேன்"],["இந்தியா","மஞ்சளின் மகத்துவ முகத்துக்கு அவசிய உடலை பளபளபாக்கு உன்னத மருந்து"],["குற்றம்","காதல் திருமணத்தால் ஆத்திர போலீஸ் கண்ணெதிரில் கழுத்து அறுபட்ட இளபெண்ணுக்கு தீவிர சிகிச்சை"],["மாவட்ட மசாலா","நில இழப்பீடு னீ லட்ச வரை கலெக்டர் வழங்க அதிகார"],["மாவட்ட மசாலா","யானைகள் விரட்டியதால் வனத்துறையினர் ஓட்ட"],["மாவட்ட மசாலா","கோயிலில் கொள்ளை போன ஐபொன் சிலை மீட்பு"],["மாவட்ட மசாலா","மனைவியை வெட்டிய கணவன் தற்கொலை"],["மாவட்ட மசாலா","மாடு முட்டி மாணவன் பலி பேர் மீது வழக்கு"],["சினிமா(ரீல்மா)","சென்சார் மீது எஸ்பி சரண் தாக்கு"],["ஸ்டேட் எக்ஸ்பிரஸ்","வாடகை தாய்களை கட்டுப்படுத்த புதிய சட்ட"],["ஸ்டேட் எக்ஸ்பிரஸ்","காஷ்மீர் அரசு மீது வழக்கு அத்வானி முடிவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","ழி ஆயிர கடனுக்காக வயது சிறுமி அடமான"],["ஸ்டேட் எக்ஸ்பிரஸ்","மாவோயிஸ்ட்கள் அட்டூழிய பள்ளிகள் தகர்ப்பு"],["உலகம்","வந்தாச்சு பிரெஸ்ட் சிப் மார்பக புற்றுநோய் சிகிச்சை ஈஸி"],["உலகம்","காங்கோவில் நியூஇயர் அட்டகாச ராணுவ வீரர்களால் பேர் பலாத்கார"],["உலகம்","கால்பந்து ஹெல்த் ரகசிய ஷுகருக்கு ரெட் கார்டு போடலா"],["உலகம்","ஸ்பெஷல் ஓட்டலில் தங்க ஸ்பெயினில் ஏக கிராக்கி"],["மாவட்ட மசாலா","வாலிபர்கள் பலி"],["உலகம்","மாடல் அழகிகளின் சூப்பர் தண்ணி பார்ட்டி லட்ச டிப்ஸ்"],["மாவட்ட மசாலா","பேர் மீது வழக்கு பதிவு"],["உலகம்","மாஸ்கோ குண்டுவெடிப்புக்கு வீடியோ கே காரண"],["மாவட்ட மசாலா","காங் தலைவர் கடத்தலா"],["மாவட்ட மசாலா","ஓட்டல் அதிபருக்கு அபராத"],["தமிழகம்","தொழிற்சங்கங்கள் ஸ்டிரைக்கால் பாதிப்பில்லை தமிழக முழுக்க பஸ்கள் ஓடின"],["தலையங்கம்","ஏழைகளின் சாப சுமா விடாது"],["குற்றம்","மாணவியை கிண்டல் செய்ததால் ஆத்திர கோஷ்டி மோதலில் அரிவாள் வெட்டு போலீஸ் ஸ்டேஷன் மீது கல்வீச்சு"],["மாவட்ட மசாலா","தண்ணீர் தொட்டியில் மூழ்கி குழந்தைகள் பரிதாப சாவு"],["குற்றம்","பட்டுக்கோட்டை அருகே பயங்கர வது மனைவி உயிருடன் எரிப்பு கட்டிப்பிடித்ததால் கணவனு கருகினார்"],["தமிழகம்","செங்க தொகுதி காங்கிரஸ் எஎல்ஏ போளூர் வரதன் காலமானார்"],["மாவட்ட மசாலா","போதை லாரி டிரைவர்களால் பாதிப்பு காஞ்சியில் பெண்கள் மறியல்"],["மாவட்ட மசாலா","மீனவர்கள் படுகொலை கண்டித்து திருவொற்றியூர் எண்ணூரில் மீனவர்கள் திடீர் சாலை மறியல்"],["மாவட்ட மசாலா","ஆவடி ரவுடி கொலை பேர் கைது"],["இந்தியா","கலெக்டர் எரிப்பு வழக்கில் மேலு பேர் சிக்கினர்"],["குற்றம்","ஆட்டோ நிறுத்திய தகராறில் மோதல் ரகளையில் ஈடுபட்ட வாலிபர்கள் கைது"],["மர்மம்","சோழவர அருகே பஞ்செட்டியில் மேபால"],["தமிழகம்","திமுக கூட்டணியில் புதிய நீதிக்கட்சி ஏசிசண்முக பேச்சு"],["தமிழகம்","வாக்குறுதிகளை நிறைவேற்றிய ஒரே தலைவர் கருணாநிதி"],["மாவட்ட மசாலா","பெருபாக்க ஊராட்சியில் லட்சத்தில் சிமென்ட் சாலை"],["குற்றம்","கிராமசபை கூட்டத்தில் ஊராட்சி தலைவர் மீது தாக்குதல் பேர் கைது பேருக்கு வலை"],["தமிழகம்","லட்சுமிபுரத்தில் பாஜ ஆர்ப்பாட்ட"],["தமிழகம்","வாகன மோதி போலீஸ்காரர் பலி"],["தமிழகம்","நெசவாளரின் கலங்கரை விளக்க மத்திய அமைச்சர் தயாநிதி மாறன் ஏசிசண்முக பாராட்டு"],["விளையாட்டு","இறுதிபோட்டியில் பூபதி பயஸ்"],["விளையாட்டு","ஜிபாப்வே வீரர் திடீர் விலகல்"],["விளையாட்டு","இந்தியாவில் இது வது முறை"],["விளையாட்டு","வது தொடர் காணு சச்சின்"],["விளையாட்டு","சீனியர் பான்டிங்"],["விளையாட்டு","இந்தியா சாபியன்"],["சினிமா(ரீல்மா)","சமூக சேவையில் ஸ்ரேயா"],["தமிழகம்","மார்ச் இறுதியில் உற்பத்தி ஆரப கூடங்குளத்தில் ஆண்டுகள் மின்உற்பத்தி செய்ய முடியு அதிகாரி தகவல்"],["தமிழகம்","காத்திருப்பதை தவிர்க்க ஏற்பாடு கைதிகளை சந்திக்க போனில் முன்பதிவு வேலூரில் அறிமுக"],["தமிழகம்","சேல அருகே இன்று காலை வீடுகள் அதிர்ந்ததால் பொதுமக்கள் பீதி"],["மாவட்ட மசாலா","நெல்லை அருகே யானைகள்அட்டகாச"],["மாவட்ட மசாலா","திருப்பூர் பாத்திர தொழிலாளர்கள் வேலை நிறுத்த வாபஸ்"],["மாவட்ட மசாலா","பைக் மீது பஸ் மோதி வாலிபர் பரிதாப சாவு"],["மாவட்ட மசாலா","பல லட்ச சுருட்டல் மோசடி ஆசாமி கைது"],["குற்றம்","மயிலாப்பூரை சேர்ந்த ஆட்டோ டிரைவர் கடத்தி கொலை ஈசிஆரில் சடல மீட்பு"],["குற்றம்","பேய் என நினைத்து குழந்தை கொலை அப்பாவை கைது செய்ய அமா கோர்ட்டில் மனு"],["உலகம்","பாகிஸ்தானில் கொள்ளையர்களை சுட்டு கொன்றார் அமெரிக்க அதிகாரி"],["உலகம்","நெல்சன் மண்டேலா ஆஸ்பத்திரியில் அனுமதி"],["உலகம்","தாய்ப்பால் கொடுக்க தயங்காதீங்க"],["உலகம்","ஒரு விரல் டைனோசர் சீன ஆய்வில் கண்டுபிடிப்பு"],["உலகம்","பெண் புலிக்கு செயற்கை இடுப்பு உலகிலேயே முதல் முறை"],["உலகம்","மாடி கட்டிடத்தில் விதிகளை மீறி ஏறிய ஸ்பைடர்மேனுக்கு விலங்கு"],["உலகம்","பள்ளிக்கூட பசங்களுக்கு ஹோமோ செக்ஸ் பாடமா இங்கிலாந்தில் கடு எதிர்ப்பு"],["தமிழகம்","நெல்லை அருகே யானைகள்அட்டகாச"],["தமிழகம்","தாளவேட்டில் புதிய சமத்துவபுர பிப் ல் துணை முதல்வர் திறக்கிறார்"],["மாவட்ட மசாலா","கொள்ளையன் கைது பவுன் பறிமுதல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","கோடிக்கணக்கில் அரசு விளபர கவர்னரிட மதா கட்சி புகார்"],["மாவட்ட மசாலா","சோத்துப்பாக்கத்தில் குழந்தைகள் பார்லிமென்ட்"],["ஸ்டேட் எக்ஸ்பிரஸ்","தலைகீழாக தேசிய கொடி பாஜ நிபந்தனையற்ற மன்னிப்பு"],["மாவட்ட மசாலா","பஞ்செட்டி ஊராட்சியில் துப்புரவு பணி சிறப்பு முகா"],["குற்றம்","கள்ளத்தொடர்பை கண்டித்த மனைவி கொலை கள்ளக்காதலி கைது கணவனுக்கு வலை"],["இந்தியா","தேசிய ஊரக வேலை உறுதி திட்டத்தில் கூலி உயர்வு மத்திய அரசு அறிவிப்பு"],["தமிழகம்","மகளிருக்கு உதவிகள் வழங்கு விழா திமுக ஆட்சி மீண்டு மலரு"],["தமிழகம்","நியூ பிரின்ஸ் பள்ளியில் அறிவியல் கண்காட்சி"],["தமிழகம்","கள்ளச்சாராய விற்பனை கண்டித்து திருப்போில் மக்கள் மறியல்"],["தமிழகம்","செங்குன்றத்தில் பரபரப்பு சிமென்ட் மூட்டை சரிந்ததில் சிறுவர்கள் சிக்கினர்"],["மாவட்ட மசாலா","கல்பாக்க அருகே திடீர் கலவர கடைகளுக்கு தீ வைப்பு கல்வீச்சில் பஸ் சேத"],["விளையாட்டு","பிப் போட்டி ரத்து எதிரொலி ஈடன்கார்டன் பிப் ல் ரெடியாகு"],["விளையாட்டு","ஈடன்கார்டனில் போட்டி ரத்து செய்யப்பட்டதற்கு பிசிசிஐ பொறுப்பல்ல"],["உலகம்","மாதங்களுக்கு பிறகு தாய்லாந்து கப்பல் விடுவிப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","இஷ்ரத் என்கவுன்ட்டர் போலியானது சிறப்பு புலனாய்வு அதிகாரி தகவல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","பிஎப் மோசடி வழக்கில் மாஜி நீதிபதிகளின் மனு தள்ளுபடி"],["ஸ்டேட் எக்ஸ்பிரஸ்","விஜிலென்ஸ் கமிஷனர் பதவி பிஜேதாமஸ் விலக மறுப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","மகன்களுக்கு நில ஒதுக்கியது தவறுதான் எடியூரப்பா ஒப்புதல்"],["விளையாட்டு","ஈடன் கார்டனுக்கு நோ ஐசிசி மீண்டு பிடிவாத"],["விளையாட்டு","நெருக்கடியா அப்படின்னா"],["விளையாட்டு","சான்ஸ் கிடைக்கு ஸ்ரீசாந்த்"],["விளையாட்டு","இன்னு சாதிக்கணு சச்சின் சந்தோஷ"],["தமிழகம்","கிராமப்புற பள்ளிகளின் தரத்தில் அக்கறை செலுத்த வேண்டு"],["குற்றம்","அண்ணனை தாக்கிய தபி கைது"],["தமிழகம்","கழிவுநீர் கால்வாய்களை சீரமைக்க நடவடிக்கை போட்சியில் தீர்மான"],["குற்றம்","போலிஆவண மூல நில மோசடி ரியல் எஸ்டேட் அதிபர் கைது"],["தமிழகம்","தினகரன் விஐடி பல்கலை சார்பில் சென்னையில் வெற்றி நமதே அலைகடலென திரண்ட மாணவ மாணவியர்"],["தமிழகம்","களக்காடு அருகே இன்று காலை யானைகள் மீண்டு ஊருக்குள் புகுந்தன"],["குற்றம்","மோசடி ஜோதிடர் ஈஸ்வரன் சிறையில் அடைப்பு"],["தமிழகம்","மூலிகைச் செடி வளர்க்க கோடியில் புதிய திட்ட"],["மாவட்ட மசாலா","தேர்தல் முன்விரோத கொலையில் பேருக்கு ஆயுள்தண்டனை"],["மாவட்ட மசாலா","பெண் குழந்தையை கொன்று கோணியில் கட்டி சடல வீச்சு"],["மாவட்ட மசாலா","பாதை தகராறில் வாலிபர் படுகொலை"],["இந்தியா","கடப்பா தொகுதியில் ஜெகன்மோகனுக்கு எதிராக கள இறங்கு உறவினர்"],["தமிழகம்","உத்தபுரத்தில் பதற்ற பிப் வரை தடையுத்தரவு"],["குற்றம்","அண்ணனூர் ரயில்வே ஸ்டேஷன் அருகே கழுத்தில் கத்தியை வைத்து மிரட்டி கர்ப்பிணியிட பவுன் வழிப்பறி"],["மாவட்ட மசாலா","கொள்ளை சபவங்களை தடுக்க யோசனை"],["தமிழகம்","குறுக்கே பாயு வாகனங்களால் விபத்து பட்டாபிரா ரவுண்டானாவில் சிக்னல் அமைக்கப்படுமா"],["சினிமா(ரீல்மா)","ஆர்யா அனுஷ்கா தமன்னா உள்பட பேருக்கு கலைமாமணி விருது"],["மர்மம்","புதரில் தெரியு திக் திக் உருவ செல்போனில் தெரிவது பேயா சித்தரா"],["மருத்துவம்","சர்க்கரை நோயாளிகளுக்கான ஸ்வீட்"],["மருத்துவம்","ஸ்வீட் சாப்பிடு சூடா தண்ணி குடி"],["மருத்துவம்","வெயிட் ஏறுதா டைட் பண்ணுங்க"],["மருத்துவம்","முதுகு வலிக்கு முற்றுப்புள்ளி"],["மருத்துவம்","நீரிழிவு நோயால் ஏற்படு விழித்திரை பாதிப்புகள்"],["மருத்துவம்","ஹேர் சிகிச்சையில் புதிய யுக்தி"],["மருத்துவம்","அல்சரை அழிக்க"],["மருத்துவம்","பற்கள் பாதுகாப்பு"],["இந்தியா","பில்லியனரிட நன்கொடை பெற பப்பெட் பில் கேட்ஸ் இந்தியா வருகின்றனர்"],["வேலைவாய்ப்பு","ராணுவத்தில் வக்கீல் பணி"],["வேலைவாய்ப்பு","இந்திய உணவு கழகத்தில் பணிகள்"],["இந்தியா","காந்தி நினைவு நாளையொட்டி டெல்லியில் ஊழல் ஒழிப்பு பேரணி"],["இந்தியா","ஆதர்ஷ் ஹவுசிங் ஊழல் அதிகாரிகளின் வீடுகளில் சிபிஐ அதிரடி சோதனை"],["வேலைவாய்ப்பு","ரயில்வேயில் காலியிடங்கள் வகுப்பு தகுதி"],["வேலைவாய்ப்பு","இந்தோதிபெத் எல்லை காவல்படையில் காவலர் வேலை"],["வேலைவாய்ப்பு","இன்ஜினியரிங் சர்வீசஸ் தேர்வு"],["இந்தியா","மீனவர் பிரச்னைக்கு தீர்வுகாண நிருபமாராவ் இலங்கை பயண"],["இந்தியா","காவிரி நீரை தேக்கி வைக்க தொட்டி கட்டுகிறது கர்நாடகா"],["தமிழகம்","மீனவர்கள் மீதான தாக்குதலை தடுக்க பிரதமர் மன்மோகனுடன் கருணாநிதி ஆலோசனை"],["தமிழகம்","சேல மாவட்டத்தில் கோடி திட்டங்களுக்கு ஸ்டாலின் அடிக்கல்"],["தலையங்கம்","போலி எப்ஐஆர் போலீசாருக்கு சிறை"],["குற்றம்","வேலை வாங்கி தருவதாக லட்சக்கணக்கில் மோசடி"],["தமிழகம்","தூத்துக்குடியில் குறுபு குரங்குகள் ஆண்களிட கொஞ்சல் பெண்களிட கோப"],["தமிழகம்","பிளஸ் பிராக்டிகல் தேர்வு பிப் தேதி தொடக்க"],["மாவட்ட மசாலா","ஊதிய விகித மாற்ற ஊராட்சி உதவியாளர்கள் கோரிக்கை"],["மாவட்ட மசாலா","பைனான்சியர் வீட்டில் பவுன் நகை கொள்ளை"],["மாவட்ட மசாலா","பிப்ரவரி ல் மறியல் பிப்ரவரி ல் மறியல்"],["மாவட்ட மசாலா","ஆண்டில் பாசன நீர் சதவீததான் கிடைக்கு"],["மாவட்ட மசாலா","மாமனாரை தாக்கிய போலீஸ்காரருக்கு வலை"],["கல்வி","எபிபிஎஸ் முடித்தவர்களுக்கான முதுகலை படிப்புகள் அட்மிஷன் ஆரப"],["கல்வி","கோவை அண்ணா பல்கலையில் பல்வேறு உயர் படிப்புகள்"],["குற்றம்","சென்னை அருகே திருமழிசையில் இளபெண் கொடூர கொலை"],["தமிழகம்","தண்ணீர் என நினைத்து மண்ணெண்ணெய் குடித்த குழந்தை பரிதாப சாவு"],["மாவட்ட மசாலா","பனைமரத் தொழிலாளர்களை அரசு பணியாளராக அறிவிக்க வேண்டு"],["தமிழகம்","பெண் தொழிலாளர் பலி நிவாரண கேட்டு திடீர் சாலை மறியல்"],["தமிழகம்","கலெக்டர் பேச்சுவார்த்தை தோல்வி உத்தபுரத்தில் உச்சகட்ட பதற்ற"],["குற்றம்","இருபு கபியால் அடித்து வாலிபர் படுகொலை"],["மாவட்ட மசாலா","ஏரியில் மூழ்கி வாலிபர் சாவு"],["மாவட்ட மசாலா","பொன்னேரியில் காங்கிரசார் நடைபயண"],["மாவட்ட மசாலா","பூண்டியில் இலவச கண் சிகிச்சை முகா"],["மாவட்ட மசாலா","வெண்பாக்க கேகேநகரில் தமிழக அரசின் சாதனை விளக்க பொதுக்கூட்ட"],["தமிழகம்","புழல் ஒன்றிய அதிமுகவினர் காங்கிரசில் இணைந்தனர்"],["மாவட்ட மசாலா","படாளத்தில் பைக் மோதி கவிழ்ந்ததில் கவுன்சிலர் கணவர் உள்பட இருவர் சாவு"],["தமிழகம்","முறுக்கு கபெனி வேலைக்காக தமிழக சிறுவர்கள் பீகாருக்கு கடத்தல்"],["மருத்துவம்","தோல் வெடிப்பை துரத்த"],["குற்றம்","மோதலுக்கு வந்தவர்களை தட்டிக்கேட்ட முதியவருக்கு சரமாரி அரிவாள் வெட்டு"],["தமிழகம்","மீனவர் மீதான தாக்குதலை கண்டித்து காரைக்காலில் பந்த் மறியல்"],["மாவட்ட மசாலா","கேபிள் வயர் துண்டிப்பு பாலிமர் சேனல் எடி மீது வழக்குப்பதிவு"],["தமிழகம்","இலங்கை அகதிகள் முகாமில் மேலு கைதிகள் மயக்க"],["ஸ்டேட் எக்ஸ்பிரஸ்","ரோட்டில் கிடந்த பாஸ்போர்ட்கள் திருவனந்தபுரத்தில் பரபரப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","சரக்கு கப்பலுடன்போர்க் கப்பல் மோதல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","சொத்து குவிப்பு குற்றச்சாட்டு ஆந்திர டிஜிபி மறுப்பு"],["விளையாட்டு","உலககோப்பையை சச்சினுக்கு பரிசளிப்போ ஹர்பஜன்சிங்"],["விளையாட்டு","பிப் இந்தியா இங்கிலாந்து மோதல் ஈடன்கார்டனா பெங்களூரா இன்று ஐசிசி அறிவிக்கிறது"],["விளையாட்டு","உலககோப்பை போட்டியை வாரமாக நடத்துவதா பீட்டர்சன் சாடல்"],["விளையாட்டு","எனக்கு கோப வரு சச்சின்"],["விளையாட்டு","உலககோப்பையின் போது ஒதுங்கியிருக்க பிச்சைக்காரர்களுக்கு தின"],["விளையாட்டு","துப்பாக்கியால் சுட்ட அமெரிக்க அதிகாரியை விடுவிக்க பாக் மறுப்பு"],["விளையாட்டு","மிகப் பெரிய பிரா இங்கிலாந்தில் அறிமுக"],["உலகம்","துப்பாக்கியால் சுட்ட அமெரிக்க அதிகாரியை விடுவிக்க பாக் மறுப்பு"],["உலகம்","எகிப்தில் ஜனநாயக தேர்தல் அமெரிக்கா வலியுறுத்தல்"],["சினிமா(ரீல்மா)","சவாலான வேட அனுஷ்கா விருப்ப"],["சினிமா(ரீல்மா)","ஸ்டுடியோ கட்டி ஷூட்டிங் போன படக்குழு"],["உலகம்","நரி நம பெஸ்ட் பிரெண்டா"],["உலகம்","ஆண்டு ஓவிய கோடிக்கு ஏல"],["உலகம்","ஜில்லுனு ஒரு கேஸ்"],["உலகம்","போதை மது ஒழிக்க மாடல் அழகிகள் குத்துச்சண்டை"],["உலகம்","பிஷ் ஃபிரை சிப்ஸ் சப்பு கொட்டு"],["சினிமா(ரீல்மா)","மல்லிகா ஷெராவத்தை விட சூப்பர் பாலிவுட் இள ஜோடி லிப் டு லிப் சாதனை"],["இந்தியா","காமன்வெல்த் முறைகேடு சுங்லு குழு இடைக்கால அறிக்கை சமர்ப்பிப்பு"],["இந்தியா","கடு பனி மூட்ட விமான சேவை ஸ்தபிப்பு"],["இந்தியா","ஊழலுக்கு எதிராக காந்தியவாதிகள் காலவரையற்ற உண்ணாவிரத"],["இந்தியா","ஜனவரியில் மட்டு செல்போன்கள் திருட்டு"],["இந்தியா","ஆருஷி கொலை வழக்கில் குற்றவாளியை கண்டுபிடிக்கக் கோரி பல்கலை மாணவர்கள் ஆர்ப்பாட்ட"],["இந்தியா","வாகனங்கள் வரிசையாக பஞ்சராகி நின்ற மர்ம"],["இந்தியா","காலக்கெடு முடிந்தது புளூலைன் பஸ்கள் இன்று முதல் ஓடாது"],["இந்தியா","எகிப்தில் கலவர இந்தியர்களுடன் ஏர் இந்தியா விமான முபை வந்து சேர்ந்தது"],["இந்தியா","திக்விஜய் சிங்கின் கருத்துக்கு பால்தாக்கரே கடு எதிர்ப்பு"],["இந்தியா","சத்ரபதி சிவாஜி கோட்டை கோடியில் புதுப்பிக்கப்படுகிறது"],["இந்தியா","ராஜ் தாக்கரே ரயில் பயண பயணிகளுடன் பேச மறுப்பு"],["இந்தியா","பில்லி சூனிய வைத்து என்னை கொல்ல சதி எதிர்க்கட்சி தலைவர்கள் மீது எடியூரப்பா குற்றச்சாட்டு"],["தமிழகம்","மேட்டூர் நீர்தேக்கத்தில் கர்நாடகா அத்துமீறல் தண்ணீர் உறிஞ்சுவதை தடுக்க ஒரு வாரத்தில் நடவடிக்கை"],["தலையங்கம்","ஆள் கடத்து அரக்க குபல்"],["குற்றம்","சேல கில் கைவரிசை போலி டிஎஸ்பி கைது"],["மாவட்ட மசாலா","பாளை மத்திய சிறையில் சிகார்டு சார்ஜர் சிக்கின"],["மாவட்ட மசாலா","தீ வைத்து பெண் கொலை அக்கா கணவர் கைது"],["மாவட்ட மசாலா","திபெத்துக்கு சுதந்திர கோரி ரத்தத்தால் பிரதமருக்கு கடித"],["மாவட்ட மசாலா","சிறுமி கொலை வழக்கு மீனவருக்கு இரட்டை ஆயுள்"],["இந்தியா","டெல்லியில் முதல்வர்கள் மாநாடு பிரதமர் தொடங்கி வைத்தார்"],["தமிழகம்","ஆத்தூர் அருகே புதிய சமத்துவபுர ஸ்டாலின் திறந்தார்"],["தமிழகம்","ஆவின் பால் சப்ளையில் கடு பாதிப்பு சென்னை மக்கள் தவிப்பு"],["இந்தியா","தகவல் தொடர்பில் குளறுபடியே சரக்கு கப்பல் விபத்துக்கு காரண"],["குற்றம்","ஆந்திராவில் இருந்து பள்ளிப்பட்டுக்கு பைக்கில் சாராய கடத்தியவர் கைது"],["தமிழகம்","திருவள்ளூரில் கல்குவாரி நடத்த அரசு புறபோக்கு நில குத்தகை"],["மாவட்ட மசாலா","ஆவடி நகராட்சி கட்டிடத்துக்கு காமராஜர் பெயர் வைக்க தீர்மான"],["மாவட்ட மசாலா","மேல்மருவத்தூரில் தூய்மையை வலியுறுத்தி பேரணி"],["மாவட்ட மசாலா","தனியார் நிலத்தில் மணல் அள்ள தடை"],["மாவட்ட மசாலா","இன்ஜினியரிங் மாணவர் மாய"],["தமிழகம்","பிணத்தை தோண்டி எடுக்கு நாய்கள்"],["தமிழகம்","செங்கல்பட்டு முகாமில் இலங்கை அகதிகள் போராட்ட வாபஸ்"],["தமிழகம்","கோடியில் லட்ச பேருக்கு இலவச கலர் டிவி"],["தமிழகம்","மண் அள்ளு இயந்திர உரிமையாளர்கள் விழாவில் பேர் கண் தான"],["மாவட்ட மசாலா","இருபு லோடு லாரி கவிழ்ந்தது ஈசிஆரில் டிராபிக் ஜா"],["மாவட்ட மசாலா","மாமியாரை உதைத்த ஆசிரியைக்கு சிறை"],["குற்றம்","கன்னியாகுமரி அருகே பயங்கர கர்ப்பிணி அடித்துக் கொலை"],["தமிழகம்","பிப் தேதி சட்டபேரவை கூட்ட"],["ஸ்டேட் எக்ஸ்பிரஸ்","பள்ளி வகுப்பறையில் வெடிகுண்டுகள்"],["ஸ்டேட் எக்ஸ்பிரஸ்","தீவிரவாத தாக்குதலில் இறந்தவரின் குடுபத்துக்கு லட்ச நிவாரண"],["ஸ்டேட் எக்ஸ்பிரஸ்","மாட்டு தீவன ஊழல் வழக்கில் பேருக்கு சிறை தண்டனை"],["ஸ்டேட் எக்ஸ்பிரஸ்","திருப்பதியை அழகுபடுத்த திட்ட ஆந்திர முதல்வர் பேட்டி"],["ஸ்டேட் எக்ஸ்பிரஸ்","வளர்ச்சி திட்டங்களை கண்காணிக்க மாயாவதி அதிரடி சுற்றுபயண"],["சினிமா(ரீல்மா)","ரீல்மா கிளிப்பிங்ஸ்"],["விளையாட்டு","அக்தருக்கு அப்ரிடி எச்சரிக்கை"],["விளையாட்டு","பான்டிங் ரெடி"],["உலகம்","அடி பள்ளத்தில் தொபுக்கடீர் அதிசயமாக பிழைத்த அபூர்வ சிகாமணி"],["விளையாட்டு","வீரர்கள் அடுத்தடுத்து காய ஆஸி இங்கிலாந்து கவலை"],["உலகம்","வில்லிய கேத் ஜோடி பட்ஜெட் ஹனிமூன் தபி காதல் கனியுமா"],["தமிழகம்","எஜிஆர் சிவாஜிக்கு பட காட்டிய ராதா டாக்கீஸ் தரைமட்டமாகிறது"],["விளையாட்டு","பிப் ல் முடிவு ஐபிஎல்லில் மீண்டு கங்குலி"],["உலகம்","தென்கிழக்கு ஆசியாவின் நீண்ட நினைவு சின்ன"],["உலகம்","ஓட்ட முடியாது ஊட்டலா சாக்லேட் மெர்சிடஸ் கார் ரெடி"],["விளையாட்டு","உலக கோப்பை சேப்பாக்கத்தில் டிக்கெட் விற்பனை தொடக்க"],["மருத்துவம்","தோல் வெடிப்பை துரத்த"],["விளையாட்டு","இந்தியா ஆட்ட பறிபோச்சு உலககோப்பை போட்டிகள் கொல்கத்தாவில் நடக்குமா"],["உலகம்","எகிப்தின் புதிய அரசில் மாஜி அதிகாரிகளுக்கு இட"],["தமிழகம்","முதல்வர் கருணாநிதி தலைமையில் திமுக பொதுக்குழு இன்று கூடுகிறது"],["கல்வி","தொலைதூர கல்வி முறையில் ரயில்வே மேலாண்மை படிப்பு"],["தமிழகம்","முதல்வர் கருணாநிதி மீது அசைக்க முடியாத நபிக்கை ஸ்டாலின்"],["உலகம்","ஊர் முழுக்க தாத்தா பாட்டீஸ் கடைசி பாப்பாவுக்கு வயசு"],["உலகம்","குழந்தை பாசத்தில் மனிதனை மிஞ்சு சிபன்ஸி குரங்குகள்"],["கல்வி","சதவீத மதிப்பெண் போது டேராடூனில் எபிபிஎஸ் படிக்கலா"],["தமிழகம்","பட்டாசு ஆலை விபத்து பலி எண்ணிக்கை ஆனது"],["உலகம்","ஷுகர் நோ பிராப்ள செயற்கை கணைய கண்டுபிடிப்பு"],["உலகம்","சிறுமியிட பலாத்கார ஆசாமிக்கு ஆண்டு சிறை"],["உலகம்","கொலபியா சுரங்கத்தில் கேஸ் வெடித்து விபத்து ஊழியர்கள் சாவு"],["உலகம்","விஸ்வ எடுக்கிறது போராட்ட எகிப்து அதிபர் பதவி விலக முடிவு"],["கல்வி","கணிதத்தில் ஆராய்ச்சி படிப்பு"],["தமிழகம்","தை அமாவாசை ராமேஸ்வரத்தில் பக்தர்கள் புனித நீராடினர்"],["குற்றம்","திருட்டுப் புகாரில் கல்லூரியில் சித்ரவதை மாணவி தற்கொலை"],["குற்றம்","ராமநாதபுர அருகே ஜுவல்லரியில் புகுந்து கிலோ நகை கொள்ளை"],["இந்தியா","மாதங்களில் ராணுவ ஆராய்ச்சி மையத்தில் விஞ்ஞானிகள் ராஜினாமா"],["மாவட்ட மசாலா","துணை முதல்வர் ஸ்டாலினுக்கு சிறப்பான வரவேற்பு அளிக்க முடிவு"],["இந்தியா","தீவிரவாதத்தை ஒடுக்க ஒருங்கிணைந்து செயல்படுவோ பிரதமர்"],["இந்தியா","சிஏஜி அறிக்கை அடிப்படையில் ஸ்பெக்ட்ர லைசென்சை ரத்து செய்ய முடியாது"],["தமிழகம்","திருத்தணி துயர்துடைப்பு ஆபீசில் அலைக்கழிக்கப்படு முதியோர்கள்"],["இந்தியா","இன்றைய சமுதாயத்தில் பண பதவி மீது ஆசை அதிகரிப்பு சோனியா கவலை"],["குற்றம்","பந்தியில் இட பிடிப்பதில் தகராறு கணவன் மனைவி உள்பட பேர் கைது"],["தமிழகம்","திருமுல்லைவாயல் செங்குன்ற ரோடு உடைந்து கிடப்பதால் பஸ் போக்குவரத்து நிறுத்த"],["குற்றம்","வாலிபருக்கு கத்திக் குத்து பேர் கைது"],["மாவட்ட மசாலா","நேர்முக தேர்வு நடத்தி வேலை இடைநிலை ஆசிரியர்கள் முதல்வருக்கு கோரிக்கை மனு"],["தமிழகம்","கேஸ் சப்ளை தாமத கண்டித்து காலி சிலிண்டருடன் மறியல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","தெலங்கானா பகுதியில் வக்கீல்கள் போராட்ட"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆதர்ஷ் குடியிருப்பு ஊழல் சவான் மீது சிபிஐ குற்றச்சாட்டு"],["ஸ்டேட் எக்ஸ்பிரஸ்","விதவையை பலாத்கார செய்து கொன்றவருக்கு மரண தண்டனை"],["மாவட்ட மசாலா","தீக்குளித்து பெண் பலி கணவர் கைது"],["மாவட்ட மசாலா","பைக் மோதி முதியவர் பலி"],["மாவட்ட மசாலா","அனுமதி பெறாமல் கட்டப்படு மாடி கட்டிடத்துக்கு சீல்"],["மாவட்ட மசாலா","அனுப்பபட்டில் முப்பெரு விழா"],["மாவட்ட மசாலா","ஆலந்தூரில் பேருக்குகலர் டிவி"],["மாவட்ட மசாலா","தனலட்சுமி சீனிவாசன் கல்லூரியில் மெக்கானிக்கல் இன்ஜினியரிங் துறை கூட்டமைப்பு தொடக்க"],["மாவட்ட மசாலா","பல் பாதுகாப்பு திட்ட அய்யபேட்டையில் செவிலியர்களுக்கு பயிற்சி"],["இந்தியா","தலைநகர் டெல்லியில் கொடிகட்டி பறக்குது குழந்தை விற்பனை"],["மாவட்ட மசாலா","குடிபோதையில் தகராறு ஆய்வாளர் சஸ்பெண்ட்"],["இந்தியா","கிராமத்துப் பொண்ணு வெள்ளந்தியா சர்வே எடுத்தவங்க ஷாக் ஆயிட்டாங்க"],["மாவட்ட மசாலா","காதலியுடன் கிரிக்கெட் வீரர் போலீஸ் ஸ்டேஷனில் தஞ்ச"],["மாவட்ட மசாலா","இருபு கபியால் அடித்து மனைவியை கொன்றவருக்கு வலை"],["மாவட்ட மசாலா","குழந்தையை கொன்று தாயு தற்கொலை"],["சினிமா(ரீல்மா)","அனுஷ்காவுடன் நடிக்க பயமா"],["விளையாட்டு","பெங்களூரில் பிப் ல் பயிற்சி முகா தொடக்க இந்திய வீரர்கள் ரெடி பிரவீன்குமார் சந்தேக"],["இந்தியா","ஸ்பெக்ட்ர விவகார ஆ ராசா கைது"],["தமிழகம்","அபராத விதித்த செக்கரை ஆள் வைத்து அடித்த பயணி"],["விளையாட்டு","இது சச்சின் உலககோப்பை"],["விளையாட்டு","நான் ரெடி நீங்க ரெடியா"],["இந்தியா","கோர்ட் வளாகத்தில் ஆருஷியின் தந்தையை தாக்கிய உத்சவ் சர்மாவுக்கு ஜாமீன் மறுப்பு"],["உலகம்","எகிப்து அதிபர் முபாரக் பதவி விலக கோரி போராட்ட வலுக்கிறது ஒடுக்க ராணுவ முயற்சி"],["இந்தியா","போலீஸ் இணையதளத்தில் பைக் திருட்டுடன் எப்ஐஆர் அப்லோடு ஆரப"],["குற்றம்","படேல் நகரில் கொடூர வகுப்பு படிக்கு சிறுமி ஒரு மாதமாக பலாத்கார"],["இந்தியா","ஆண்டில் கட்ட அரசு முடிவு குறைந்த விலையில் பிளாட்"],["குற்றம்","ஆட்டோ டிரைவருக்கு வலை பெண்ணுடன் கள்ளத்தொடர்பு வாலிபருக்கு கத்திக்குத்து"],["ஸ்டேட் எக்ஸ்பிரஸ்","சிறுவனுடன் தகாத உறவு எய்ஸ் டாக்டர் டிஸ்மிஸ்"],["ஸ்டேட் எக்ஸ்பிரஸ்","எடியூரப்பா குடுபத்துக்கு கோடி பினாமி நில"],["ஸ்டேட் எக்ஸ்பிரஸ்","நீதிமன்ற ஜாமீன் உத்தரவுகளை இமெயிலில் அனுப்ப உத்தரவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","பலாத்கார புகாரில் சிக்கிய எஎல்ஏவுக்கு மரபணு சோதனை"],["உலகம்","சிகரெட்டுக்கு மங்கள பாட சிலர் தயங்குறாங்களே ஏன்"],["உலகம்","பனிச்சறுக்கு நாய்கள் கனடாவில் சுட்டு கொலை"],["உலகம்","கிரீஸ் அமைச்சருக்கு பார்சலில் வெடிகுண்டு"],["உலகம்","பெண்கள் பலாத்கார சீன ஆசாமிக்கு தூக்கு"],["மாவட்ட மசாலா","இந்திய கயூ நிற்கு தொகுதி மார்ச் முதல் வாரத்தில் இறுதி"],["தமிழகம்","தேதி முதல் உற்பத்தி நிறுத்த பால் உற்பத்தியாளர்கள் முடிவு"],["மாவட்ட மசாலா","மாட்டு வண்டிகள் பறிமுதல் மணல் திருடிய பேர் கைது"],["தமிழகம்","மனித உரிமை ஆணையத்தின் தீர்ப்பை எதிர்த்த எஸ்ஐக்கு ஐகோர்ட்டில் அபராத"],["மாவட்ட மசாலா","நள்ளிரவில் திடீர் தீ ஷோ் எரிந்து நாச"],["தமிழகம்","ஆண்டாக பயன்படுத்தாத பிஎப் கணக்குகளுக்கு வட்டி கிடையாது"],["மாவட்ட மசாலா","மின்சார பாய்ந்து எலக்ட்ரிஷியன் பலி"],["தமிழகம்","மருதமலை கிராமங்களில் யானைகள் முற்றுகை"],["தமிழகம்","அண்ணா நினைவு தின முதல்வர் தலைமையில் அமைதி பேரணி"],["விளையாட்டு","ஆஸிதான் ஜெயிக்கு ஸ்டீவ்வாஹ் சொல்கிறார்"],["விளையாட்டு","இதுதான் சிறந்த இந்திய அணி ஹைடன்"],["தமிழகம்","திமுக ஆட்சி தொடரு கருணாநிதி உறுதி"],["தமிழகம்","ஏட்டு வியாபாரி கட்டிப்புரண்டு சண்டை ஓட்டேரியில் கோஷ்டி மோதல் பரபரப்பு"],["விளையாட்டு","பாகிஸ்தானுக்கு ஒரு போட்டிக்கு கோடி"],["தமிழகம்","ஸ்பெக்ட்ர பிரச்னை நாடாளுமன்ற கூட்டுக் குழு விசாரணை ஜெ"],["தமிழகம்","லாரி டிரைவர்களுடன் மோதல் காய்கறிகளை ரோட்டில் கொட்டி வியாபாரிகள் திடீர் மறியல்"],["தமிழகம்","அமைச்சர் வீரபாண்டி ஆறுமுகத்துக்கு சென்னையில் சிகிச்சை"],["மாவட்ட மசாலா","பெரபலூரில் கடையடைப்பு"],["மாவட்ட மசாலா","அரசு பஸ் மீது பைக் மோதி வாலிபர்கள் பரிதாப சாவு"],["மாவட்ட மசாலா","அண்ணா நினைவிடத்தில் அதிமுக அஞ்சலி"],["மாவட்ட மசாலா","ஆரப சுகாதார நிலையத்தில் மருந்து தட்டுப்பாடு"],["மாவட்ட மசாலா","இன்ஜின்ஆயில் கபெனியில் நள்ளிரவில் தீ விபத்து"],["குற்றம்","சுய உதவி குழுவினரிட லட்ச மோசடி"],["குற்றம்","மண்ணெண்ணெய் ஊற்றி மனைவி எரித்து கொலை"],["சினிமா(ரீல்மா)","நிருபராகு நகுலன்"],["குற்றம்","திருமண நிச்சயித்த பெண்ணை வீடு புகுந்து கடத்திய குபல்"],["குற்றம்","வாலிபருக்கு உருட்டுக்கட்டை அடி போதை ஆசாமிகள் கைது"],["சினிமா(ரீல்மா)","ஆங்கில படத்தில் பூஜா"],["குற்றம்","பசிக்கு சோறு கேட்டு நூதன பட்டபகலில் பவுன் கொள்ளை"],["இந்தியா","திருப்பதி மருத்துவமனையில் கரடி புகுந்ததால் நோயாளிகள் ஓட்ட"],["சினிமா(ரீல்மா)","விஜய்க்கு மாமனாராக நடிக்கிறார் சத்யராஜ்"],["தொழில்","இன்ஸ்டன்ட் உணவு எகிறுது லாப"],["சினிமா(ரீல்மா)","அதிரடி ரெய்டு பிரியங்கா சோப்ரா கோடிக்கு வருமான வரி சமத"],["இந்தியா","ஸ்பெக்ட்ர விவகார ராசாவை நாட்கள் காவலில் விசாரிக்க அனுமதி"],["தமிழகம்","குழந்தை தொழிலாளர் முறை சமுதாயத்துக்கு அவமான கலெக்டர் ராஜேந்திரன்"],["தமிழகம்","இன்ஜின்ஆயில் கபெனியில் நள்ளிரவில் தீ விபத்து லட்ச பொருட்கள் நாச"],["தமிழகம்","சேலத்தில் ப்ரீபெய்டு ஆட்டோ சிஸ்ட கலெக்டர் சந்திரகுமார் தகவல்"],["இந்தியா","பிப் ல் சோனியாவை சந்திக்கிறார் சிரஞ்சீவி"],["இந்தியா","பசுமை சேதத்தை தடுக்க ஒழுங்கு முறை சட்ட பிரதமர் மன்மோகன் ஆதரவு"],["இந்தியா","ஸ்பெக்ட்ர பிரச்னை பிஏசி முன் ரிசர்வ் வங்கி கவர்னர் ஆஜர்"],["இந்தியா","மத்திய அரசு தப்பிக்க கல்மாடி ராசாவை பலிகடா ஆக்காதீர் கட்கரி பேட்டி"],["இந்தியா","ஸ்பெக்ட்ர பிரச்னைக்கு ஜேபிசி வேண்டு முலாய வலியுறுத்தல்"],["இந்தியா","விஜிலென்ஸ் கமிஷனர் வழக்கு உச்ச நீதிமன்ற கருத்து"],["இந்தியா","சொத்து குவிப்பை நிித்தால் ராஜினாமா எடியூரப்பா"],["இந்தியா","பாஜ எஎல்ஏக்கள் பதவி பறிப்பு வழக்கு தேதிக்கு ஒத்திவைப்பு"],["இந்தியா","ஆதர்ஷ் ஹவுசிங் ஊழல் முக்கிய குற்றவாளிகளிட சிபிஐ விசாரணை"],["இந்தியா","போர்க்கப்பல் மீது மோதிய வெளிநாட்டு கப்பல் கேப்டனிட விசாரணை"],["தமிழகம்","சட்டசபையில் நாளை இடைக்கால பட்ஜெட் கூட்டத் தொடர்"],["தமிழகம்","திமுக ஆட்சியில்தான் எண்ணற்ற சாதனைகள் முதல்வர் கருணாநிதி பெருமித"],["தமிழகம்","இரண்டாவது கட்டமாக மக்கள்தொகை கணக்கெடுப்பு"],["குற்றம்","தூத்துக்குடியில் தொடர் பைக் திருட்டு தூத்துக்குடியில் தொடர் பைக் திருட்டு"],["தமிழகம்","மின்வாரிய அலுவலகத்தில் புகுந்து பட எடுத்து ஆடிய பாபுகள்"],["தமிழகம்","அயப்பாக்க வீட்டு வசதி வாரிய குடியிருப்பில் ஆண்டாக தொடரு அவல"],["குற்றம்","புகார் கொடுக்க வந்தவருக்கு அடி உதை எஸ்ஐ ஏட்டுக்கு அபராத"],["மாவட்ட மசாலா","சட்டசபை தேர்தலில் யாருக்கு ஆதரவு சத்திரிய நாடார் இயக்க தலைவர் பேட்டி"],["குற்றம்","மாணவியிட சில்மிஷ பள்ளி ஆசிரியர் கைது"],["மாவட்ட மசாலா","கிருஷ்ணகிரி ஏட்டுவின் வாக்கி டாக்கி திருட்டு"],["குற்றம்","வாங்குவது போல் நடித்து நகைக்கடையில் மோதிர திருட்டு"],["உலகம்","இத்தாலி பிரதமருக்கு எதிராக உள்ளாடை போராட்ட"],["குற்றம்","கொசஸ்தலை ஆற்றில் மணல் திருடிய பேர் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","நரேந்திர மோடி அப்பாவி இல்லை புலனாய்வு குழு அறிக்கை"],["உலகம்","காபி குடிப்பதால் புத்துணர்ச்சி பெண்களுக்கு விர் ஆண்களுக்கு சர்"],["ஸ்டேட் எக்ஸ்பிரஸ்","பள்ளி மாணவி பலாத்கார வாலிபர்கள் கைது"],["உலகம்","பெண்ணை மாறி மாறி விற்று பலாத்கார செய்த கொடுமை"],["ஸ்டேட் எக்ஸ்பிரஸ்","கமாண்டோவின் உறவினர் நாடாளுமன்ற முன் தீக்குளிப்பு"],["உலகம்","செல்போன் நிறுவனங்களுக்கு எகிப்து அதிகாரிகள் நிர்பந்த"],["ஸ்டேட் எக்ஸ்பிரஸ்","பத்தா வகுப்பு ஆசிரியர்கள் சென்சஸ் எடுக்க ஐகோர்ட் தடை"],["உலகம்","நேபாள பிரதமராக ஜலாநாத் கேனல் தேர்வு"],["மாவட்ட மசாலா","வஉசி இழுத்த செக்கு முதல்வருக்கு எபி மனு"],["விளையாட்டு","ஐபிஎல் கங்குலி கதை ஓவர்"],["விளையாட்டு","உலககோப்பையில் விளாசித்தள்ளுவோ சேவாக்"],["விளையாட்டு","காலிறுதியில்தான் விறு விறுப்பு டிராவிட்"],["மாவட்ட மசாலா","ஏட்டு குடுபத்துக்கு லட்ச நஷ்டஈடு"],["விளையாட்டு","ஈடனுக்கு கல்தா கோர்ட்டில் வழக்கு"],["மாவட்ட மசாலா","யானையை பிச்சை எடுக்க வைத்த உரிமையாளருக்கு அபராத"],["விளையாட்டு","படக் குழுவை மீட்ட தீயணைப்பு வீரர்கள்"],["சினிமா(ரீல்மா)","திருடர்களிட சிக்கிய காதலியின் கதை"],["மாவட்ட மசாலா","குழந்தையை கடத்த முயன்ற தந்தை போலீசில் சிக்கினார்"],["சினிமா(ரீல்மா)","படக் குழுவை மீட்ட தீயணைப்பு வீரர்கள்"],["மாவட்ட மசாலா","மோசடி ஜோதிடர் ஈஸ்வரனிட போலீசார் தீவிர விசாரணை"],["மாவட்ட மசாலா","பள்ளி ஆண்டுவிழா"],["மாவட்ட மசாலா","கடைகளை அகற்ற சொன்னதால் எஸ்ஐயுடன் தகராறு செய்த வியாபாரி சங்க தலைவர் கைது"],["தமிழகம்","தயாநிதிமாறன் தொகுதி நிதியில் கட்டப்பட்ட பெரபூர் மேபாலத்தை முதல்வர் நாளை திறக்கிறார்"],["தமிழகம்","அஞ்சல்வழி பிஎட் படித்த ஆசிரியர்களுக்கு சலுகை ஐகோர்ட் உத்தரவு"],["தமிழகம்","தொழிற்சங்க அங்கீகார தேர்தல் பிஎஸ்என்எல் ஊழியர் சங்க முமுனை போட்டியில் வெற்றி"],["தமிழகம்","விலைவாசி உயர்வு அதிமுக பிப் ல் போராட்ட அறிவிப்பு"],["தமிழகம்","கேட் பாஸ் விவகார டேங்கர் லாரிகள் திடீர் ஸ்டிரைக்"],["குற்றம்","பெண்களை ஏமாற்றியது எப்படி மோசடி ஜோதிடர் அபல"],["தமிழகம்","அருந்ததியர் உள்ஒதுக்கீடு விவகார உச்ச நீதிமன்ற தீர்ப்புக்கு பிறகு முடிவெடுக்க ஐகோர்ட் உத்தரவு"],["தமிழகம்","பெருந்துறை பெட்ரோல் பங்க் பயங்கர தீவிபத்துக்கு காரண என்ன"],["தமிழகம்","இலங்கை ராணுவத்தால் கொல்லப்பட்ட மீனவர் குடுபத்துக்கு பாஜ நிதி உதவி"],["தமிழகம்","சாய ஆலை பிரச்னை திருப்பூரில் இன்று பந்த்"],["இந்தியா","தொழிற்சாலைகளுக்கு நான் விரோதி அல்ல மதா பானர்ஜி"],["இந்தியா","நிலமோசடி விவகார எடியூரப்பா வழக்கு விசாரணை ஒத்திவைப்பு"],["இந்தியா","போலீசார் அதிரடி முபையில் பேரிட துப்பாக்கி பறிமுதல்"],["இந்தியா","நக்சல் அச்சுறுத்தல் மேவங்கத்தில் தேர்தல் பற்றி குரேஷி பேட்டி"],["இந்தியா","அங்கீகார பள்ளிகளில் ஏழை மாணவர்களுக்கு விண்ணப்ப"],["உலகம்","பதவி விலக காலக்கெடு நிராகரித்தார் முபாரக் எகிப்தில் கலவர நீடிக்கிறது"],["இந்தியா","வெளிநாட்டு வங்கிகளில் கறுப்பு பண பதுக்கலை தடுக்க சார்க் ஒப்பந்த"],["இந்தியா","குழந்தை இறப்பு விகித மத்தியப் பிரதேச முதலிட"],["இந்தியா","மத்திய அரசை கண்டித்து பாஜ இன்று பேரணி"],["இந்தியா","முபை டப்பாவாலாக்களை சந்திக்கு அமெரிக்க அமைச்சர்"],["இந்தியா","இந்தியாவின் பெயர் கெடுகிறது மன்மோகன் சிங் கவலை"],["இந்தியா","உபி பேரவையில் பேசவிடாமல் கவர்னர் மீது காகித பந்து வீச்சு"],["தமிழகம்","தமிழக சட்டப்பேரவை ஆண்டிற்கான இடைக்கால பட்ஜெட் தாக்கல்"],["உலகம்","ஆன்லைனில் சுள்ளான் வாங்கிய லட்ச விமான"],["உலகம்","தூக்கத்தை கலைத்த மகளை கழுத்தை நெரித்து கொன்றார் தந்தை"],["உலகம்","பாகிஸ்தானில் தீவிரவாதிகள் மீது தாக்குதல் ஆயிர பேர் வெளியேற்ற"],["உலகம்","அமெரிக்காவில் ரஷ்ய சிறுவர்கள் சித்ரவதை"],["தமிழகம்","தமிழக கர்நாடகாவை இணைக்கு மலைப்பாதையில் நிலச்சரிவு அபாய"],["தமிழகம்","லிப்ட் கேட்டு சென்றபோது ஜீப்பில் இருந்து குதித்த மாணவி பலி"],["தமிழகம்","தியாகி பெட்டையன் கிராமத்தில் நாளை பவள விழா கோலாகல"],["தமிழகம்","பிளஸ் தேர்வில் சதவீத மார்க் பெற்றவர் பிடிஎஸ் படிக்க முடியாது"],["தலையங்கம்","காதல் வலையில் ஏமாறு பெண்கள்"],["தமிழகம்","சட்டசபையில் இருந்து அதிமுக மதிமுக வெளிநடப்பு"],["மாவட்ட மசாலா","முதல்வருக்கு பாராட்டு"],["தமிழகம்","சென்னையில் விரைவில் மினி பஸ்கள் அமைச்சர் நேரு"],["தமிழகம்","அரசு மருத்துவமனைகளில் டாக்டர்கள் நியமிக்கப்படுவர் எஆர்கே"],["தமிழகம்","ஆண்டுகளில் கல்லூரிகள் அமைச்சர் பொன்முடி தகவல்"],["குற்றம்","ஒரே நிலத்தை பலருக்கு விற்றவர் கைது"],["குற்றம்","அண்ணனை கொன¢ற தபிக்கு ஆண்டு சிறை"],["தமிழகம்","நாளை மறுநாள் குபாபிஷேக திருத்தணி நகரே விழாக் கோல"],["குற்றம்","பவுன் நகையுடன் மாயமான கன்னியாகுமரி பெண் பெங்களூரில் படுகொலை"],["குற்றம்","கணவனை தாக்கி மனைவியிட பவுன் தாலி பறிப்பு"],["குற்றம்","கடைகளில் பூட்டை உடைத்து கொள்ளையடித்த குபல் கைது"],["விளையாட்டு","விளபர கோடிகளுக்கு வேட்டு சச்சின் டோனி யுவிக்கு சிக்கல்"],["விளையாட்டு","புதுசு புதுசா யோசிப்பாங்களோ ஹர்பஜன்சிங்"],["விளையாட்டு","கொச்சி அணிக்கு மீண்டு சிக்கல்"],["விளையாட்டு","முதல் ஓவர் முக்கிய"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆயிர போலீசார் இடமாற்ற ஐகோர்ட் அனுமதி"],["ஸ்டேட் எக்ஸ்பிரஸ்","அட்டை பெட்டியில் பெண் பிண பலாத்கார செய்து கொலை"],["ஸ்டேட் எக்ஸ்பிரஸ்","மாஜிஸ்திரேட்டை மிரட்டிய இன்ஸ்பெக்டருக்கு மாத சிறை"],["சினிமா(ரீல்மா)","ஆற்றுக்குள் பஸ்சை கவிழ்த்து ஷூட்டிங்"],["சினிமா(ரீல்மா)","மயங்கி விழுந்தார் பூர்ணா"],["இந்தியா","ரயிலில் இருந்து கீழே தள்ளி இளபெண் பலாத்கார"],["இந்தியா","ரஜினி கமல் பெயரை பயன்படுத்த சென்சார் போர்டு திடீர் தடை"],["தமிழகம்","சிறுவன் விழுங்கிய ாய் எண்டோஸ்கோபி மூல அகற்ற"],["உலகம்","எகிப்தில் துணை அதிபரை கொல்ல முயற்சி"],["சினிமா(ரீல்மா)","டயட் என்ற பெயரில் பட்டினி கிடப்பதா"],["தலையங்கம்","கடத்தல் பயத்தில் இறந்த மாணவி"],["மாவட்ட மசாலா","கல்லூரி மாணவரை கொன்ற நண்பர் பிடிபட்டார்"],["மாவட்ட மசாலா","பரோலில் வந்தார் சாமியார் பிரேமானந்தா"],["மாவட்ட மசாலா","குழந்தைகளை கடித்த நாய் அடித்துக் கொலை"],["குற்றம்","பிறந்த வீட்டுக்கு செல்ல எதிர்ப்பு குழந்தைகளை கொன்று தாய் தூக்கிட்டு தற்கொலை"],["குற்றம்","பாளையங்கோட்டை அருகே ஏட்டை கொல்ல முயன்ற பேர் கைது"],["தமிழகம்","நிமிடத்தில் தாள கட வித்வான் சாதனை"],["குற்றம்","நெல்லையை கலக்கிய கொள்ளையர் கைது"],["குற்றம்","மகளிர் சுயஉதவி குழுவுக்கு கடன் வாங்கி தருவதாக கூறி லட்ச மோசடி செய்தவர் கைது"],["குற்றம்","போலி நகை மோசடி பேர் பிடிபட்டனர்"],["குற்றம்","கோவை அருகே அதிகாலை விசைத்தறி தபதி கொடூர கொலை"],["தமிழகம்","பால் உற்பத்தியாளர்கள் நாளை முதல் ஸ்டிரைக்"],["தமிழகம்","ஆசிரியர் சங்க தலைவர் திருமண துணை முதல்வர் ஸ்டாலின் வாழ்த்து"],["குற்றம்","அனல்மின் கோபுரத்தில் இருந்து விழுந்து எலக்ட்ரிஷியன் பரிதாப சாவு"],["குற்றம்","பள்ளிக்கரணை ஏரியில் வாலிபர் சடல"],["இந்தியா","தாழ்ப்பாள் ஃப்ரிட்ஜ் கிச்சன் துணி தொற்றுநோய் கிருமி உஷார்"],["இந்தியா","விதித்தது ஆண்டு அடைத்தது ஆண்டா"],["உலகம்","ஆஸ்கர் விருது விழாவில் ஏஆர்ரகுமான் இசை நிகழ்ச்சி"],["உலகம்","காலண்டர் கவர்ச்சி போஸ்"],["மர்மம்","உடல்களை விழுங்கிய பேய்மர"],["இந்தியா","பக்தர்கள் கூட்டத்தை கட்டுப்படுத்த ஆண்டுக்கு ஒருமுறை சாமி தரிசன"],["இந்தியா","ஒய்எஸ்ஆர் காங்கிரஸ் துவக்க இடைத்தேர்தலில் பலத்தை நிிக்க ஜெகன் திட்ட"],["ஸ்டேட் எக்ஸ்பிரஸ்","பீகார் முதல்வர் நிதீஷுக்கு பில்கேட்ஸ் பாராட்டுக் கடித"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆயுதங்களுடன் சோட்டா ராஜன் குபலை சேர்ந்தவர் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","பாத்ில் செல்போன் கேமரா கல்லூரி மாணவி சஸ்பெண்ட்"],["ஸ்டேட் எக்ஸ்பிரஸ்","கேரள முன்னாள் அமைச்சர் மீது வழக்குப்பதிவு செய்ய கோர்ட் உத்தரவு"],["விளையாட்டு","மெக்ராத்தை சீண்டினேன் சச்சின்"],["விளையாட்டு","ஸ்லோமோஷனாக காண்பிக்கு கேமரா உலககோப்பையில் இல்லை"],["விளையாட்டு","ஐடியா சொல்லு ஸ்டாரஸ்"],["விளையாட்டு","இந்திய அணிக்கு மவுசு கூடுது ஆயிர கோடிக்கு சூதாட்ட"],["உலகம்","பாக் அதிபருடன் திருமணமா அமெரிக்க டாக்டர் மறுப்பு"],["உலகம்","முபாரக் மகன் ராஜினாமா அமெரிக்கா வரவேற்பு"],["உலகம்","வெள்ளத்தில் சிக்கிய பெண்ணுக்கு ஹெலிகாப்டரில் பிரசவ"],["தமிழகம்","விரைவில் சிங்கார சென்னை"],["தமிழகம்","தாழவேட்டில் சமத்துவபுர திறக்க துணை முதல்வர் வருகை செயல்வீரர்கள் கூட்டத்தில் ஆலோசனை"],["குற்றம்","திருமுல்லைவாயலில் பரபரப்பு கிணற்றில் கார்பென்டர் சடல"],["தமிழகம்","பிரின்ஸ் இன்ஜினியரிங் கல்லூரி விழாவில் மாணவர்களுக்கு பரிசு சான்றிதழ்"],["தமிழகம்","ஓமனில் வேலைவாய்ப்புக்கு விண்ணப்பிக்கலா"],["வேலைவாய்ப்பு","கடலோர காவல்படையில் மாலுமி"],["வேலைவாய்ப்பு","இஎஸ்ஐ நிறுவனத்தில் ஸ்டெனோகிராபர் பணி"],["தமிழகம்","காங்கிரசில் இணைந்தார் எஸ்விசேகர் எஎல்ஏ"],["இந்தியா","சொத்து விவர எடியூரப்பாவுக்கு ஏக்கர் நில கிலோ தங்க"],["இந்தியா","கோடி ஊழல் ஒரிசா பெண் அமைச்சர் ராஜினாமா ஏற்பு"],["இந்தியா","மகாராஷ்டிராவில் கந்துவட்டி கொடுமை"],["இந்தியா","காமன்வெல்த் சட்ட மாநாடு பிரதமர் தொடங்கி வைத்தார்"],["இந்தியா","தகவல் அறியு உரிமை அரசு ஊழியரின் சர்வீஸ் புக் விவர"],["இந்தியா","ஆசியாவின் வது காஸ்ட்லி நகர முபை"],["இந்தியா","கறுப்பு பண பட்டியல் தர இந்தியாவிட நாடு சமத"],["ஸ்டேட் எக்ஸ்பிரஸ்","மாயாவதி கட்சி அமைச்சர் மீது கொலை குற்றச்சாட்டு"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஜார்கண்ட்டில் தொடங்கியது புதிய மாவோயிஸ்ட் இயக்க"],["ஸ்டேட் எக்ஸ்பிரஸ்","பெண் இன்ஜினியர் கொலை கைதானார் கணவர்"],["ஸ்டேட் எக்ஸ்பிரஸ்","கூட்டணி குறித்து இடதுசாரிகளின் அறிவுரை தேவையில்லை பிரணாப்"],["ஸ்டேட் எக்ஸ்பிரஸ்","தொடங்கியது பயிற்சி ஆட்டங்கள் ஜிபாப்வே வெற்றி"],["உலகம்","சீன கப்பலை கடத்தினர் கொள்ளையர்கள்"],["உலகம்","லண்டன் கூட்டத்தில் முஷாரப் மீது ஷூ வீச்சு"],["ஸ்டேட் எக்ஸ்பிரஸ்","கனடா அசத்தல் தொடக்க"],["உலகம்","ஜெயில் அதிகாரிகளுக்கு ஈரானில் மரண தண்டனை"],["உலகம்","அமெரிக்க பல்கலையில் துப்பாக்கி சூடு ஒருவர் பலி"],["விளையாட்டு","ஆப்கனை அடித்து நொறுக்கியது கென்யா"],["உலகம்","புதன் கோளில் அடுத்த மாத இறங்குது அமெரிக்க விண்கல"],["உலகம்","இங்கிலாந்தில் பிரதமர் வீட்டில் பேன் தொல்லை"],["இந்தியா","கற்பனையா கல்யாண செய்யலா"],["குற்றம்","கேஸ் வெல்டிங் வைத்து மெஷின் உடைப்பு பமல் ஏடிஎ ல் கொள்ளை முயற்சி போலீஸ் ரோந்து வந்ததால் பண தப்பியது"],["மாவட்ட மசாலா","குமரியில் ஒலி ஒளி கூட மாதத்தில் முடிக்க உத்தரவு"],["தமிழகம்","நடை திறக்க தாமத கோயில் வாசலில் ஜோடிகள் திருமண"],["மாவட்ட மசாலா","வீட்டில் சந்தன கட்டை பதுக்கல் வாலிபரை மடக்கியது வனத்துறை"],["மாவட்ட மசாலா","பஸ்சில் பிளாஸ்டிக் கொண்டுவந்தால் பயணிக்கு அபராத"],["மாவட்ட மசாலா","சேவல் சண்டை சூதாட்ட திருப்பூரில் பேர் கைது"],["குற்றம்","உளவு விமான தயாரித்த இன்ஜி மாணவர் மர்ம சாவு தர்மபுரியில் பரபரப்பு"],["தமிழகம்","ஈரோடு மாவட்டத்தில் சாய ஆலை கழிவுநீர் வெளியேற்ற சுப்ரீ கோர்ட்டில் விரைவில் அறிக்கை"],["தமிழகம்","கோயில்களில் உள்ள பழமையான ஓவியங்களை பாதுகாக்க நடவடிக்கை அமைச்சர் தங்க தென்னரசு தகவல்"],["தமிழகம்","ஸ்பிரிங் ஆக்சில் விபத்து ஆறாக ஓடியது விமான எரிபொருள்"],["தமிழகம்","காதல் பிரச்னையில் வாலிபர் கொலை டிரைவர் கைது பரபரப்பு வாக்குமூல"],["தமிழகம்","வெங்கபாக்கத்தில் பேருக்கு வீட்டுமனை பட்டா"],["குற்றம்","லட்ச மதிப்பு நகை ஐ பாட் கடத்தல் சென்னை ஏர்போர்ட்டில் ஒருவர் கைது"],["தமிழகம்","பால் உற்பத்தியாளர்கள் ஸ்டிரைக் ஆவின் பால் சப்ளை பாதிப்பில்லை"],["மாவட்ட மசாலா","கலைஞர் வீடு வழங்க குடிசைகள் கணக்கெடுப்பு"],["சினிமா(ரீல்மா)","கோவை குண்டுவெடிப்பு கதையில் பிரகாஷ்ராஜ்"],["தலையங்கம்","உளவு பார்க்க உரிமை இல்லை"],["தமிழகம்","சென்னையில் மொபைல் ரேஷன் கடை பேரவையில் அமைச்சர் விளக்க"],["இந்தியா","நக்சல் தாக்குதல் ஜார்கண்டில் தண்டவாள குண்டு வைத்து தகர்ப்பு"],["குற்றம்","குடிசைக்குள் அடைத்து வைத்து இளபெண் பலாத்கார எரிக்க முயன்றதால் பரபரப்பு"],["தமிழகம்","இடைக்கால பட்ஜெட் பேரவையில் விவாத"],["தமிழகம்","ஜெ உடல்நலக் குறைவு கூட்டத்தொடரில் பங்கேற்க மாட்டார்"],["தமிழகம்","எபிபிஎஸ் நன்கொடை விவகார சிபிஐ விசாரணை ஐகோர்ட் ரத்து"],["தமிழகம்","வெடிமருந்து கிடைக்கவில்லை குவாரிகளில் பணிகள் பாதிப்பு"],["தமிழகம்","சோமனூரில் பரபரப்பு தபதி கொலை கண்டித்து விசைத்தறி கூடங்கள் மூடல் கடைகளு அடைப்பு"],["உலகம்","பெனாசிர் வழக்கு குற்றப்பத்திரிகையில் முஷாரப் பெயர் இணைப்பு"],["தமிழகம்","திமுக ஆட்சி தொடரத்தான் போகிறது துணை முதல்வர் ஸ்டாலின் பேச்சு"],["இந்தியா","எடியூரப்பா இந்துக்களின் மனதை புண்படுத்தி விட்டார் ஆளுநர்"],["இந்தியா","இஸ்ரோவில் நடந்தது என்ன பாஜ உட்பட எதிர்க்கட்சிகள் புது புகார்"],["தமிழகம்","பறக்கு ரயில் நிலையத்தில் தொடர்கிறது பயங்கர"],["இந்தியா","பட்ஜெட்தொடர் சுயேச்சை எபிக்களுடன் மீராகுமார் ஆலோசனை"],["இந்தியா","எஎல்ஏவால் பலாத்கார செய்த சிறுமியை சந்தித்தார் ராகுல்"],["இந்தியா","போபர்ஸ் விவகார மத்திய அரசு பரிசீலனை"],["இந்தியா","விஜிலன்ஸ் கமிஷனர் நியமன உச்ச நீதிமன்றத்தில் தாமஸ் வாத"],["இந்தியா","பட்ஜெட்டுக்கு பிறகு அமைச்சரவை விரிவாக்க ஈஸ்வரப்பா பேட்டி"],["இந்தியா","ஆருஷி கொலை விவகார மீண்டு விசாரணை"],["சினிமா(ரீல்மா)","பிற மொழியில் நடிப்பது தப்பா"],["உலகம்","பார்பி கென் பொமைகளின் ஆண்டு நட்பு தொடருமா"],["உலகம்","நேட்டோ டேங்கர்கள் பாகிஸ்தானில் எரிப்பு"],["தமிழகம்","காட்பாடியில் இன்று காலை சோக சிலிண்டர் வெடித்து பேர் பரிதாப சாவு தமிழகஅரசு நிதி உதவி அறிவிப்பு"],["மாவட்ட மசாலா","பசுமைப்படை திட்டத்தின்கீழ் பள்ளிகளுக்கு தலா"],["மாவட்ட மசாலா","வீட்டு மனை இல்லாதவர்களுக்கு இலவச நில வழங்க கோரிக்கை"],["மாவட்ட மசாலா","மாணவிணீயிட சில்மிஷ விடுதி வார்டன் சஸ்பெண்ட்"],["குற்றம்","போலீசை தள்ளிவிட்டு ரயிலில் இருந்து குதித்து கைதி தப்பி ஓட்ட"],["குற்றம்","வங்கி மேலாளர் எரித்துக் கொலை சாலையில் சடல கிடந்தது தாபரத்தில் அதிகாலை பரபரப்பு"],["தமிழகம்","பிப் தேதி விஏஓ தேர்வு செல்போன் கால்குலேட்டருக்கு தடை டிஎன்பிஎஸ்சி நிர்வாக அறிவிப்பு"],["குற்றம்","கிணற்றில் குதித்து டிரைவர் தற்கொலை செய்ததாக வதந்தி ஊத்துக்கோட்டை அருகே பரபரப்பு"],["தமிழகம்","மணலி ஏரியில் கழிவுநீர் கலப்பு நிலத்தடிநீர் பாதிக்கு அபாய"],["குற்றம்","மேட்டூரில் இன்று காலை அதிமுக கவுன்சிலர் படுகொலை"],["ஸ்டேட் எக்ஸ்பிரஸ்","வெடிகுண்டு வழக்கில் கைதான மாணவர் தேர்வு எழுத அனுமதி"],["ஸ்டேட் எக்ஸ்பிரஸ்","நள்ளிரவில் பெண் மானபங்க பிபீஓ நிறுவன மீது நடவடிக்கை"],["ஸ்டேட் எக்ஸ்பிரஸ்","கோதாவரியில் அணை கட்ட ஜெகன்மோகன் பாதயாத்திரை"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஏர் இந்தியா பைலட்கள் வேலை நிறுத்த மிரட்டல்"],["விளையாட்டு","ஆஸி அடங்குமா அடித்து நொறுக்குமா"],["விளையாட்டு","பயிற்சி முகா இந்திய கிரிக்கெட் வீரர்கள் நாளை பெங்களூர் வருகை"],["விளையாட்டு","உள்ளூரில் பயிற்சியில்லை சங்ககரா"],["விளையாட்டு","கணித்து கூறமுடியாது ஜாகீர்"],["விளையாட்டு","தகுதியில்லாதவர்களை அனுப்பாதீர்கள் நீல்சன்"],["இந்தியா","போர் விமானத்தில் பறக்கு முதல் நடிகர் ஷாகித் கபூர்"],["இந்தியா","பல்கலைக்கழக ஆஸ்டலில் ப்ளூபிலி ஷூட்டிங்"],["மாவட்ட மசாலா","அில் கூவி கூவி விற்பனை ஒரு கிலோ தக்காளி"],["மாவட்ட மசாலா","கொள்ளையர்கள் கைது பவுன் நகைகள் மீட்பு"],["தமிழகம்","மனைகள் ஒதுக்கீட்டில் முறைகேடு இல்லை முதல்வர்"],["தமிழகம்","இன்று காலை பரபரப்பு ராயபுர பள்ளிக்கு குண்டு மிரட்டல் பிளஸ் செய்முறை தேர்வு ரத்து"],["தமிழகம்","பிற்படுத்தப்பட்டோர் நல ஆபீசில் லஞ்ச ஒழிப்பு சோதனை ஆயிர பறிமுதல்"],["மாவட்ட மசாலா","நர்சிங் கல்லூரி மாணவி மாய"],["தமிழகம்","அரசு லைப்ரரியில் உல்லாச வெளியே பூட்டியதால் அபல கள்ளக்காதல் ஜோடியை தாக்க துடைப்பத்துடன் திரண்ட மக்கள்"],["இந்தியா","கேரளாவில் தொடரு சபவ ஓடு ரயிலில் டீச்சரை பலாத்கார செய்ய முயற்சி"],["தமிழகம்","கலைஞர் காப்பீடு திட்ட இதய ஆபரேஷனுக்கு செலவு கூடினால் லட்ச வழங்கப்படு எஆர்கேபன்னீர் செல்வ தகவல்"],["தமிழகம்","முல்லைப் பெரியாறில் புதிய அணை கேரள அரசு மீது அவமதிப்பு வழக்கு சட்டசபையில் அமைச்சர் அறிவிப்பு"],["தமிழகம்","கொள்ளை வழக்கில் ஒரு மாதத்தில் பேர் கைது பவுன் பறிமுதல் சென்னை போலீஸ் கமிஷனர் பேட்டி"],["தமிழகம்","சேல ஆர்டிஓ அலுவலகத்தில் லஞ்ச ஒழிப்பு போலீஸ் ரெய்டு விடிய விடிய நடந்தது"],["தமிழகம்","பேரவையில் அமைச்சர் தகவல் பட்டதாரி ஆசிரியர்கள் பிப் க்குள் நியமன"],["இந்தியா","உபி முதல்வர் மாயாவதியின் ஷூவை துடைத்தார் பாதுகாப்பு டிஎஸ்பி"],["இந்தியா","உபியில் ஆட்சியை பிடிக்க பிரியங்காவையு அழைத்து வாருங்கள்"],["இந்தியா","ஸ்பெக்ட்ர வழக்கில் ராசாவுக்கு மேலு நாள் சிபிஐ காவல்"],["இந்தியா","ஆர்ஜித சேவைகள் ரத்து திருப்பதியில் நாளை ரத சப்தமி விழா"],["இந்தியா","தேர்தல் தொகுதி பங்கீடு தமிழக காங்கிரஸ் குழு ஆலோசனை"],["இந்தியா","இந்திய மக்கள் தொகை கணக்கெடுப்பில் தீவிரவாதி கசாப்பின் பெயர்"],["இந்தியா","விலாஸ்ராவ் தேஷ்முக் வழக்கு அபராத செலுத்தியது மகாராஷ்டிர அரசு"],["இந்தியா","சொத்துகுவிப்பு வழக்கு ஜெ நேரில் ஆஜராக முடியாது வக்கீல் வாத"],["தமிழகம்","தேர்தலுக்கு கட்சிகள் தயார் கட்சி கொடிகள் தயாரிப்பு தீவிர"],["இந்தியா","எஎல்ஏக்களுக்கு கொலை மிரட்டல் திடுக்கிடு தகவல்"],["தமிழகம்","திருச்செந்தூர் முருகன் கோயில் கருவூல சாவி கேட்டு அப்பீல் ஐகோர்ட்டில் தள்ளுபடி"],["குற்றம்","காதலித்து கைவிட்டதால் அத்தைமகன் வீடு முன்பு இள பெண் தற்கொலை"],["தமிழகம்","ஆவடி அபத்தூர் பகுதியில் சிலிண்டருக்கு கடு தட்டுப்பாடு ஓட்டலுக்கு பிளாக்கில் விற்பனை"],["தமிழகம்","செங்கல்பட்டு அருகே சுடுகாட்டில் மணல் அள்ளு அவல"],["ஸ்டேட் எக்ஸ்பிரஸ்","வெடிகுண்டு வழக்கில் தேடப்பட்ட சமாஜ்வாடி எஎல்ஏ கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","மாயாவதி ஷூவை துடைத்ததில் தவறில்லை கேபினட் செயலர்"],["ஸ்டேட் எக்ஸ்பிரஸ்","மதுக்கடைகள் திறக்க பஞ்சாயத்துகள் எதிர்ப்பு"],["விளையாட்டு","இலங்கைக்கு சாதக"],["விளையாட்டு","பாக் களங்கத்தை துடையுங்கள் வாக்கர்"],["விளையாட்டு","இந்தியாவுக்கு நெருக்கடி அதிக ஸ்ரீநாத்"],["விளையாட்டு","இந்தியா தரமான அணி கங்குலி"],["விளையாட்டு","உலககோப்பை களை கட்டியது பெங்களூரில் இந்திய வீரர்கள் பயிற்சி"],["விளையாட்டு","உலககோப்பை பயிற்சி ஆட்டங்கள் கனடாவை வீழ்த்தி ஆப்கன் அசத்தல்"],["விளையாட்டு","அயர்லாந்தை அடித்து நொறுக்கியது கென்யாவுக்கு வது வெற்றி"],["உலகம்","தூதரக அதிகாரியை விடுவிக்க பாகிஸ்தானுடன் பேச்சு தொடரு அமெரிக்க அதிகாரி தகவல்"],["உலகம்","அமா வேலைக்கு போனா குழந்தைகள் குண்டாகு"],["இந்தியா","ஏரோ இந்தியா விமான கண்காட்சி பெங்களூரில் தொடங்கியது"],["தமிழகம்","மக்கள் தொகை கணக்கெடுப்பு ஒத்துழைப்பு தர மறுத்தால் ஓராண்டு சிறை"],["தமிழகம்","சமத்துவபுர திறப்புவிழா துணை முதல்வருக்கு உற்சாக வரவேற்பு"],["உலகம்","செம ஸ்டிராங் பீர் ஆயிர"],["உலகம்","ஹிட்லர் தலைமையக நினைவு சின்னமாகிறது"],["சினிமா(ரீல்மா)","பிரகாஷ்ராஜ் படத்துக்கு திடீர் தடை"],["சினிமா(ரீல்மா)","டூயட் வேண்டா"],["கல்வி","சிறந்த கல்வி நிறுவனங்களில் எபிஏ படிக்க எளிய வழி"],["கல்வி","சுற்றுச்சூழல் முதுகலை படிப்பு"],["கல்வி","வேதியியல் உயிரியல் துறையில் உதவித்தொகையுடன் ஆராய்ச்சி படிப்பு பிஎஸ்சி முதலாண்டு மாணவர்களுக்கு வாய்ப்பு"],["மாவட்ட மசாலா","வெளி மாநில தொழிலாளர் நிலை ஆய்வு செய்ய குழு அமைப்பு"],["மாவட்ட மசாலா","லட்ச கொள்ளை லாட்ஜ் உரிமையாளர் கைது"],["மாவட்ட மசாலா","முஸ்கான் ரித்திக் கொலை வழக்கு மகிளா கோர்ட்டுக்கு மாற்ற"],["மாவட்ட மசாலா","நகைகள் திருடிய பெண் செல்போனால் சிக்கினார்"],["மாவட்ட மசாலா","புதுக்கோட்டை அருகே விவசாயி வெட்டி கொலை"],["மாவட்ட மசாலா","மருமகனுக்கு கத்திக்குத்து மாமியார் பிடிபட்டார்"],["குற்றம்","குட்டையில் மூழ்கி குழந்தை சாவு திருவள்ளூர் அருகே சோக"],["தமிழகம்","பராமரிப்பு பணி காரணமாக மேல்மருவத்தூர் விழுப்புர பயணிகள் ரயில் ரத்து"],["விளையாட்டு","உலக கோப்பை கிரிக்கெட் தென் ஆப்பிரிக்கா டீ சென்னை வந்தது"],["குற்றம்","மாணவி சாவு குறித்து விசாரிக்க கேட்டு கல்லூரிமுன்பு திடீர்மறியல் மாணவிகள் கைது"],["தமிழகம்","இஸ்ரோ தேவாஸ் ஒப்பந்த ரத்து செய்யப்பட வேண்டு ஜெயலலிதா வலியுறுத்தல்"],["இந்தியா","கூர்கா போராட்டத்தை ஒடுக்க ராணுவ உதவி கேட்கிறது மேற்கு வங்க"],["தமிழகம்","மருத்துவ படிப்புக்கு நுழைவுத் தேர்வு இல்லை அமைச்சர் அறிவிப்பு"],["தமிழகம்","சாயப்பட்டறைகள் விவகார தலைமைச் செயலகத்தில் பேச்சுவார்த்தை பேரவையில் அமைச்சர் தகவல்"],["தமிழகம்","சுனாமி வருவதை முன்கூட்டியே அறிய குமரியில் வசதி"],["இந்தியா","இந்தியர் கறுப்பு பண பட்டியல் பெற நாடுகளுடன் ஒப்பந்த உச்ச நீதிமன்றத்தில் மத்திய அரசு பதில்"],["தமிழகம்","விளபர மோகத்தில் திளைக்கு ரயில்வே வருவாய்தான் காரண"],["தமிழகம்","கடனை திருப்பி செலுத்து வல்லமை அரசுக்கு உள்ளது நிதியமைச்சர்"],["தமிழகம்","எஸ்பாண்ட் விவகார ஜெயலலிதா அறிக்கை"],["இந்தியா","ஏகேஅந்தோணி தகவல் ராணுவத்துக்கு தனி பட்ஜெட்"],["இந்தியா","ஸ்பெக்ட்ர வழக்கு ஸ்வான் அதிகாரிக்கு நாள் சிபிஐ காவல்"],["இந்தியா","விபத்தில் சிக்குபவர்களை மருத்துவமனையில் சேர்த்தால் பரிசு கேரள அரசு"],["இந்தியா","மாதத்தில் காங்கிரசுடன் பிரஜா ராஜ்ய இணைப்பு சிரஞ்சீவி"],["இந்தியா","ஆருஷி கொலை வழக்கில் குற்றவாளியாக பெற்றோர் சேர்ப்பு"],["இந்தியா","கர்நாடகா முழுவது சென்சஸ் பணி துவக்க"],["இந்தியா","ஜனாதிபதியை விமர்சித்த காங்கிரஸ் அமைச்சர் ராஜினாமா"],["இந்தியா","மொபைல் நபர் தராததால் ஆத்திர கபடி வீராங்கனை சுட்டுக் கொலை"],["தமிழகம்","சத்தியமூர்த்தி பவனில் இளைஞர் காங்கிரஸ் நிர்வாகி தீக்குளிக்க முயன்றதால் பரபரப்பு"],["குற்றம்","ஆபரேஷன் செய்த மாணவன் சாவு ஆஸ்பத்திரி சூறை ஊழியர்கள் காய பெரபூரில் பரபரப்பு"],["தமிழகம்","அரசின் கூடுதல் செலவினங்களுக்காக கோடிக்கு துணை மதிப்பீடு சட்டசபையில் தாக்கல்"],["தமிழகம்","பயிற்சியாளர் பற்றாக்குறையால் பரிதவிக்கு விளையாட்டு வீரர்கள்"],["தமிழகம்","இமாத இறுதிக்குள் சமத்துவபுரங்கள் திறக்கப்படு துணை முதல்வர் ஸ்டாலின் பேச்சு"],["தமிழகம்","திருப்போில் தங்கத்தேர் வெள்ளோட்ட அமைச்சர் பெரியகருப்பன் தொடங்கி வைத்தார்"],["ஸ்டேட் எக்ஸ்பிரஸ்","மேற்கு வங்க துப்பாக்கி சூடு சிபிஐ விசாரிக்க வலியுறுத்தல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","பலாத்கார செய்யப்பட்ட பெண் அபார்ஷன் செய்ய கோர்ட் அனுமதி"],["விளையாட்டு","பயிற்சியாளர் கிறிஸ்டன் முன்னிலையில் இந்திய வீரர்கள் பெங்களூரில் பயிற்சி"],["விளையாட்டு","ஆக்ரோஷ காட்டுமா பாகிஸ்தான்"],["விளையாட்டு","கிரிக்கெட் விமர்சன சல்மான்பட்டுக்கு தடை"],["விளையாட்டு","இளமை அணி சாதிக்கு சங்ககரா"],["விளையாட்டு","அட்டாக் தான் இலக்கு பிரெட்லீ"],["விளையாட்டு","சாதிக்க விருபுறோ பீட்டர்சன்"],["உலகம்","பேஸ்புக்கில் தகவல் சொல்லிவிட்டு மாடியில் இருந்து குதித்து பள்ளி மாணவி தற்கொலை"],["உலகம்","இன்டர்வியூக்கு வந்தா ஐபேட் இலவச"],["இந்தியா","ஒன் ஜீரோ ஜீரோவுக்கு திருடர்களே டயல் செய்த துயர டெல்லியில் களவாணி காமெடி"],["உலகம்","போரை விட்டு காதலை வளர்க்க புதிய டீல் துப்பாக்கிக்கு பதிலாக செக்ஸ் பொமை"],["உலகம்","ரேடியோ நிறுவனத்தின் அசத்தல் பரிசு போட்டியில வெல்லு மணமகளை அள்ளு"],["இந்தியா","தவறான சிகிச்சையால் கோமா பெண் நோயாளிக்கு கோடி பில் ஆஸ்பத்திரியா ரவுடியா கணவர் குமுறல்"],["உலகம்","சிகரெட் பிடிப்பதை நிறுத்தினார் ஒபாமா மனைவி மிஷெல் பெருமித"],["தமிழகம்","எரித்து கொல்லப்பட்ட பெண் உயிருடன் திருபினார்"],["மாவட்ட மசாலா","கோத்தகிரி நேரு பூங்கா நாளை மறுநாள் திறப்பு"],["மாவட்ட மசாலா","துணை தாசில்தார் வீட்டில் பவுன் பண கொள்ளை"],["மாவட்ட மசாலா","மதுரை கிள்ளிகுளத்தில் பூச்சிக்கொல்லி ஆய்வக"],["மாவட்ட மசாலா","பாலிஷ் போடுவதாக கூறி பவுன் நகை அபேஸ்"],["விளையாட்டு","விமானத்தில் பெண் பயணியிட நியூசி வீரர் சவுதி சில்மிஷ"],["ஸ்டேட் எக்ஸ்பிரஸ்","கோடி கொள்ளை வழக்கில் எஎல்ஏ மீது குற்றப்பத்திரிகை"],["ஸ்டேட் எக்ஸ்பிரஸ்","கலப்படத்தை கண்டுபிடித்த அதிகாரிக்கு இருபு கபி அடி"],["குற்றம்","திருக்கோவிலூர் அருகே பரிதாப சர்க்கரை என நினைத்து விஷ பவுடரை தின்ற சிறுமி பலி"],["தமிழகம்","பிப் தேதிக்கு பிறகு தேர்தல் தொகுதி பங்கீடு தங்கபாலு பேட்டி"],["தமிழகம்","பிராந்தியால் கிளபியது பூத மக்கள் விடிய விடிய மறியல் டாஸ்மாக்குக்கு சீல்"],["தமிழகம்","எத்திராஜ் மகளிர் கல்லூரியில் கருத்தரங்கு நரேஷ் குப்தா வலியுறுத்தல்"],["தமிழகம்","லஞ்ச ஒழிப்பு போலீஸ் ரெய்டு சீட்டுக்கு அடியில் பணத்தை மறைத்த துணை தாசில்தார்"],["தமிழகம்","படப்பையில் ஆதிதிராவிடர்களுக்கு இலவச வீடு காங் எஎல்ஏ கோரிக்கை"],["தமிழகம்","வெளிநாடுவாழ் தமிழர்களுக்காக நலவாரிய அமைச்சர் தகவல்"],["தமிழகம்","பூரண ஓய்வில் இருப்பவர் முதல்வராக முடியுமா அன்பழகன் கேள்வி அதிமுக வெளிநடப்பு"],["இந்தியா","கோடி ஊழல் புகார் மாஜி அமைச்சருக்கு சிறை சுப்ரீ கோர்ட் அதிரடி"],["இந்தியா","இந்தியர் கறுப்புப்பண பட்டியல் பகிரங்கமாக அறிவிக்க தயார் மத்திய அரசு அறிவிப்பு"],["இந்தியா","அரசியல்வாதிகள் அதிகாரிகள் நேர்மை தவற கூடாது பிரதமர் வலியுறுத்தல்"],["இந்தியா","கேரளாவில் சாலை ஓரங்களில் கூட்ட நடத்த புதிய சட்ட"],["தமிழகம்","சாயக்கழிவு பிரச்னைக்கு தீர்வு அதிமுக உண்ணாவிரத ஜெ அறிவிப்பு"],["இந்தியா","விஜிலென்ஸ் கமிஷனர் தாமஸ் நியமன வழக்கில் தீர்ப்பு தள்ளி வைப்பு"],["இந்தியா","கேரள மின் திட்டத்தில் ஊழல் மாஜி மந்திரிக்கு ஆண்டு கடுங்காவல்"],["இந்தியா","ஸ்பெக்ட்ர வழக்கில் சிக்கிய ஷாகித் பல்வா எப்படி கோடீஸ்வரர் ஆனார்"],["இந்தியா","இஸ்ரோ தேவாஸ் ஒப்பந்த மறு ஆய்வு செய்ய உயர் குழு"],["இந்தியா","பாராளுமன்ற பட்ஜெட் கூட்டத்தொடர் சுமூகமாக நடக்கு மீராகுமார்"],["இந்தியா","ஐநா பாதுகாப்பு குழு விரிவாக்க பிற நாட்டு தலைவர்களுடன் கிருஷ்ணா பேச்சு"],["உலகம்","மரத்தால் கட்டப்பட்டது சீன பெருஞ்சுவர் ஆராய்ச்சியாளர்கள் புது தகவல்"],["தமிழகம்","கில் விபத்தில் ஒருவர் பலி சடலத்துடன் மறியல் போலீஸ் தடியடி"],["குற்றம்","விவசாயியை கடத்தி மிரட்டல் போலி எஸ்ஐகள் கைது"],["தமிழகம்","புலித்தோல் கடத்தல் பேர் பிடிபட்டனர்"],["தமிழகம்","எண்ணூர் பஸ் நிலைய லட்சத்தில் சீரமைப்பு பூமி பூஜையில் அமைச்சர் பங்கேற்பு"],["உலகம்","அமெரிக்காவின் ஆளில்லா போர் விமான பெட்ரோலு போடு குண்டு போடு"],["உலகம்","செல் சர்வீஸ் செய்வதில் சாக்லேட் கில்லாடி கேன்சர் ஹார்ட் அட்டாக் வராது"],["குற்றம்","பெண்களை ஏமாற்றுவதில் சத பிளாட்பார கிப்ட் ஜோசியர் கைது"],["சினிமா(ரீல்மா)","நாய்களுக்கு நடுவில் சிக்கி நடுங்கிய சமீரா"],["உலகம்","பாகிஸ்தான் ஆடுகளத்தில் ஒட்டக சண்டை"],["குற்றம்","மயிலாப்பூரில் நள்ளிரவில் பயங்கர வீடு புகுந்து பேர் வெட்டிக் கொலை"],["இந்தியா","கூட்டுறவு வங்கியில் கோடி முறைகேடு ராஜ்யசபா துணை தலைவர் மீது போலீசில் புகார்"],["விளையாட்டு","ஆதிக்க செலுத்துமா வெஸ்ட் இண்டீஸ்"],["விளையாட்டு","சென்னையில் தெஆஜிபாப்வே மோதல் நாளை போட்டிகள்"],["விளையாட்டு","அதிரடி தான் வெற்றி கெய்ல்"],["விளையாட்டு","சீரான ஆட்ட பல தில்ஷான்"],["விளையாட்டு","அதிர்ச்சி அளிப்போ ரிச்சர்ட்சன்"],["ஸ்டேட் எக்ஸ்பிரஸ்","கபடி வீராங்கனை பலி எதிரொலி மத்திய போலீஸ் விரட்டியடிப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","வங்கியில் கொள்ளையடிக்க முயன்ற பேர் சுட்டுக் கொலை"],["ஸ்டேட் எக்ஸ்பிரஸ்","மத்திய அரசை கண்டித்து மபி முதல்வர் உண்ணாவிரத"],["மாவட்ட மசாலா","விஐடி பல்கலையில் சர்வதேச ஆய்வரங்க"],["மாவட்ட மசாலா","குமரி நெல்லை தூத்துக்குடியில் ரவுடிகள் பட்டியல் தயாரிப்பு"],["மாவட்ட மசாலா","போலீஸ்காரர் மனைவியிட பவுன் செயின் பறிப்பு"],["தமிழகம்","மாடபாக்க போட்சியில் கோடியே லட்சத்தில் சாலை குடிநீர் பணிகள்"],["குற்றம்","மனைவியுடன் தங்குவதில் கணவர்கள் தகராறு"],["தமிழகம்","தத்கல் டிக்கெட்டில் பயண ஒரிஜினல் ஐடி கட்டாய இன்று முதல் அதிரடி அமல்"],["தமிழகம்","குமிடிப்பூண்டி போக்குவரத்து துறை செக்போஸ்ட்டில் திடீர் ரெய்டு கட்டுக்கட்டாக பண சிக்கியது"],["இந்தியா","கொச்சி பெட்டக முனையத்தை பிரதமர் மன்மோகன் சிங் நாட்டுக்கு அர்ப்பணித்தார்"],["தமிழகம்","ஆந்திர முதல்வர் சென்னை வருகை"],["தமிழகம்","திருச்சி அருகே எல்கேஜி சிறுமிக்கு சூடு வைத்து பலாத்கார"],["உலகம்","எகிப்தில் மக்கள் புரட்சி வெற்றி ஓட்ட பிடித்தார் முபாரக்"],["தமிழகம்","சட்ட பேரவை தேர்தல் எப்போது குரேஷி சென்னை வருகை"],["தமிழகம்","மாற்று திறனாளிகளுக்கு பயிற்சி ஆசிரியருக்கு சிறப்பு பயிற்சி"],["தமிழகம்","ஜெயலலிதாவின் தந்திர இப்போதுதான் புரிகிறது"],["தமிழகம்","வீரப்பன் காட்டில் கடத்தல்காரர்கள் கைவரிசை"],["இந்தியா","கன்டெய்னர் முனைய நாட்டுக்கு அர்ப்பணிப்பு பிரதமர்"],["இந்தியா","ஷாகித் உஸ்மானுடன் தொடர்பு இல்லை சரத்பவார் மறுப்பு"],["இந்தியா","காஷ்மீருக்கு மாற்ற கோரி தீவிரவாதி அப்சல் குரு மனு"],["உலகம்","கூகுள் ஆப்பிளுக்கு போட்டி மைக்ரோசாப்ட் நோக்கியா கூட்டு"],["தமிழகம்","ஆலந்தூரில் தனியார் நிறுவனங்கள் கொட்டு குப்பைகள் தீ வைத்து எரிப்பு சுற்றுச்சூழல் பாதிப்பு"],["குற்றம்","குன்றத்தூர் அருகே ஏரியில் செங்கல்சூளை தொழிலாளி சடல"],["குற்றம்","காஞ்சிபுர அருகே பயங்கர கழுத்து அறுத்து வாலிபர் கொலை"],["குற்றம்","கிணற்றில் மிதந்த மெக்கானிக் சடல செங்குன்ற அருகே பரபரப்பு"],["தமிழகம்","கழிவறை சுவரில் துளைபோட்டு பொள்ளாச்சி சிறையில் கைதிகள் தப்பினர்"],["தமிழகம்","சட்டசபை தேர்தல் ஏற்பாடுகள் சென்னையில் குரேஷி ஆலோசனை"],["இந்தியா","பள்ளி ஆசிரியர் வேலைக்கு நுழைவுத் தேர்வு கட்டாய"],["விளையாட்டு","இங்கிலாந்து அணிக்கு துரதிருஷ்ட போகுமா"],["விளையாட்டு","பெங்களூரில் வெற்றிக்கொடி நாட்டுவது யார் இந்தியா ஆஸிநாளை பலப்பரிட்சை"],["விளையாட்டு","இந்திய கிரிக்கெட் வீரர்களுக்கு கோடி இன்சூரன்ஸ்"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆபாச சிடியில் சிக்கிய பாஜ தலைவர் சஸ்பெண்ட்"],["ஸ்டேட் எக்ஸ்பிரஸ்","மாவோயிஸ்ட்கள் கடத்திய போலீசார் விடுதலை"],["ஸ்டேட் எக்ஸ்பிரஸ்","பலாத்கார செய்து மாணவி கொலை"],["உலகம்","மாஜி காதலனுக்கு சீன பெண் நறுக்"],["உலகம்","இளபெண் மரணத்துக்கு காரண முத்த"],["இந்தியா","மில்லியன் டாலர் ஸ்மைல் டெல்லியை கலக்குது பேஷன்"],["சினிமா(ரீல்மா)","கருந்தேள் காட்டில் திக் திக் திக்"],["தலையங்கம்","ஒரு மனைவி இரண்டு கணவர்"],["உலகம்","காந்திய வழியில் போராடிய எகிப்து மக்களுக்கு வெற்றி அமெரிக்க அதிபர் ஒபாமா பெருமித"],["உலகம்","சுவிஸ் பாங்க் கணக்கு முடக்க"],["உலகம்","ஹாங்காங் டிவியில் பார்த்து ரசிக்கலா ஆண்களை அடுப்படிக்கு அனுப்ப அழகியின் கிளுகிளு நிகழ்ச்சி"],["மாவட்ட மசாலா","காட்பாடி கேஸ் விபத்தில் பலி ஆக உயர்ந்தது"],["மாவட்ட மசாலா","கயூனிஸ்ட் பிரமுகருக்கு ஆண்டு சிறைதண்டனை"],["மாவட்ட மசாலா","திருவிழாவில
