மிழகம்","கத்தை கத்தையாய் பண பறக்கு படை பறிமுதல்"],["தமிழகம்","அனைவரு மறக்காமல் ஓட்டு போட வேண்டு நரேஷ்குப்தா"],["தமிழகம்","ஆண்டாக யாருக்கு வாக்களிக்காத கட்சியின் மாநில தலைவர்"],["தமிழகம்","திமுக குழுவினருடன் பாமக பேச்சுவார்த்தை"],["தமிழகம்","திமுக கூட்டணிக்கு நாடார் சங்கங்கள் ஆதரவு"],["வேலைவாய்ப்பு","இந்தியன் ஆயில் நிறுவனத்தில் பல்வேறு பணிகள்"],["விளையாட்டு","ஆட்டத்திலு தோல்வி ஆஸியிடமு உதை வாங்கியது கென்யா"],["விளையாட்டு","பரிசோதனைகள் இல்லை"],["விளையாட்டு","ஜிபாப்வேயுடன் இன்று சந்திப்பு அடித்து நொறுக்க பாகிஸ்தான் தயார்"],["விளையாட்டு","கோப்பையை வெல்லு டோனி கனவு பலிக்காது"],["விளையாட்டு","கே பிளான்"],["விளையாட்டு","நெக்ரா யூசுப்பதானுக்கு ஆப்பு வருகிறார்கள் ரெய்னா அஸ்வின்"],["வேலைவாய்ப்பு","இந்திய விளையாட்டு ஆணையத்தில் கிளார்க் அக்கவுன்டன்ட் பணியிடங்கள்"],["ஸ்டேட் எக்ஸ்பிரஸ்","முபையில் கடந்த ஆண்டாக தினந்தோறு பேர் மாய"],["ஸ்டேட் எக்ஸ்பிரஸ்","பீகாருக்கு சிறப்பு அந்தஸ்து வழங்க தேசியவாத காங்கிரஸ் எதிர்ப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஜிஎமை எரித்துக் கொன்ற யூனியன் தலைவர் கைது"],["ஆன்மீகம்","தீர்க்க சுமங்கலி பாக்ய தரு சாவித்ரி விரத"],["வேலைவாய்ப்பு","ஆயுத தொழிற்சாலையில் வேலை ஐடிஐ டிப்ளமோ தகுதி"],["குற்றம்","பீகாரில் துப்பாக்கி சண்டை போலீஸ் தாக்குதலில் நக்சல்கள் சுட்டுக் கொலை"],["தமிழகம்","அதிமுக மதிமுக இன்று மாலை பேச்சு"],["குற்றம்","ஏரியில் மூழ்கி சிறுமிகள் பலி சோகத்தில் கிராம மக்கள்"],["தமிழகம்","அனுமதியின்றி சுவர் விளபர பேனர் பேர் மீது வழக்கு"],["தமிழகம்","தேர்தல் கமிஷன் அடுத்த அதிரடி தொண்டு நிறுவனங்களுக்கு செக்"],["தமிழகம்","பேர் மீது வழக்கு துப்பாக்கி போலீஸ் குவிப்பு"],["தமிழகம்","மணி நேரத்துக்குள் வேட்பாளருக்கு நோட்டீஸ் தேர்தல் ஆணைய அதிரடி"],["தமிழகம்","யாதவர் ஒருங்கிணைப்பு கூட்ட திருச்சியில் நாளை நடக்கிறது"],["மாவட்ட மசாலா","காரில் கொண்டு சென்ற லட்ச சிக்கியது"],["மாவட்ட மசாலா","வாக்குச் சாவடிகளில் முதியோர்களுக்காக சாய்தள"],["மாவட்ட மசாலா","ஈரோடு அருகே தீ விபத்து காவலாளி உடல் கருகி பலி"],["மாவட்ட மசாலா","பெண்ணிட நகை பறிப்பு ஆசாமிக்கு தர்ம அடி"],["தலையங்கம்","கைவிட்ட கணவனு ஏமாற்றிய காதலனு"],["தமிழகம்","பல்லாவர துரைபாக்க ரேடியல் சாலை செக்போஸ்டில் ரெய்டு லட்ச சிக்கியது"],["தமிழகம்","திமுக வேட்பாளர் பட்டியல் முதல்வர் கருணாநிதி ல் வெளியிடுகிறார்"],["தமிழகம்","ஆதரவாளர்களுக்கு சீட் வாங்க காங்கிரஸ் தலைவர்கள் டெல்லிக்கு படையெடுப்பு"],["தமிழகம்","சிறு வியாபாரிகளுக்கு இடையூறு கூடாது குரேஷியிட திமுக வலியுறுத்தல்"],["தமிழகம்","நேர்காணலுக்கு அழைக்காததால் பெண் வக்கீல் தீக்குளிக்க முயற்சி"],["தமிழகம்","தேர்தல் பாதுகாப்புக்கு கபெனி துணை ராணுவ டிஜிபி"],["தமிழகம்","தனியார் பள்ளி கல்லூரி ஊழியர்களை இஎஸ்ஐ திட்டத்தில் சேர்த்தது செல்லு ஐகோர்ட்"],["தமிழகம்","கடந்த தேர்தல்களில் பதிவான வழக்குகளின் நிலை என்ன தேர்தல் கமிஷன் கிடுக்கிப்பிடி"],["உலகம்","ஆஸ்திரேலிய சுள்ளான் எஸ்எஎஸ் கில்லாடி"],["உலகம்","ஜிவ் கங்காருவின் வால் ரகசிய"],["உலகம்","தலையை சுற்ற வைக்கு அமெரிக்க பீர் விற்பனை"],["தமிழகம்","மாசு கட்டுப்பாடு வாரியத்துக்கு ஐகோர்ட் புது உத்தரவு"],["தமிழகம்","அரசு ஊழியர்களுக்கு தபால் ஓட்டு வாக்குச்சீட்டுகள் அச்சடிக்க உத்தரவு"],["இந்தியா","டெல்லிக்கு குடிநீர் வராது ஜாட் இனத்தவர் மிரட்டல்"],["இந்தியா","லட்ச கோடி ாய் கறுப்பு பண கண்டுபிடிப்பு பிரணாப் முகர்ஜி"],["தமிழகம்","ஆதரவாளர்களுக்கு சீட் வாங்க காங்கிரஸ் தலைவர்கள் டெல்லிக்கு படையெடுப்பு"],["தமிழகம்","மக்கள் நல்வாழ்வுத் துறையில் திமுக அரசு சாதனைகள் முதல்வர்"],["தமிழகம்","வாக்குசாவடிகள் பதற்றமானவை குரேஷி"],["தமிழகம்","வாக்காளர் அடையாள அட்டை விண்ணப்பிக்க நாளை கடைசி நாள்"],["தமிழகம்","அதிமுக கூட்டணியில் கயூனிஸ்டுகளுக்கு தொகுதிகள்"],["உலகம்","பூகப சுனாமியால் இதுவரை லட்ச கோடி இழப்பு"],["விளையாட்டு","நெதர்லாந்தை வீழ்த்தி கால் இறுதி வாய்ப்பை தக்கவைத்தது வங்கதேச"],["இந்தியா","பிஎப் கணக்கில் இருந்து இடையே பண பெறலா"],["இந்தியா","கடல் கொள்ளையர்களை கப்பல்படை மடக்கியது"],["இந்தியா","மரபணு சோதனைக்கு திவாரி உட்பட வேண்டு உயர் நீதிமன்ற"],["இந்தியா","நாடாளுமன்றத்தில் பாஜ கடு அமளி"],["இந்தியா","உள்துறை தகவல் மனித உரிமை மீறல் முதலிடத்தில் உபி"],["இந்தியா","கணவர் மாமியார் மீது சிரஞ்சீவி மகள் புகார்"],["இந்தியா","ஆதர்ஷ் ஊழல் மாஜி கமிஷனர் வீட்டில் சிபிஐ அதிகாரிகள் ரெய்டு"],["உலகம்","சல்மானுடன் ஆடியதால் சர்ச்சைக்குள்ளான நடிகை மலாய்க்கா கின்னஸ் சாதனை"],["உலகம்","பஹ்ரைனில் புரட்சி ராணுவ விரைந்தது"],["சினிமா(ரீல்மா)","ஏஞ்சலினாவை பார்த்து தைரிய வந்தது சினேகா"],["சினிமா(ரீல்மா)","முத்தக்காட்சிக்கு நோ சொன்ன பிசின்"],["விளையாட்டு","ஷபீக் அதிரடியில் தொலைந்தது ஜிபாப்வே"],["விளையாட்டு","காலிறுதியில் கால்பதிப்போ வங்கதேச கேப்டன் நபிக்கை"],["விளையாட்டு","நெக்ராவை கிண்டல் செய்து பறக்கு ஜோக்குகள்"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஜெகன் புதிய கட்சி மீது சந்திரபாபு நாயுடு தாக்கு"],["ஸ்டேட் எக்ஸ்பிரஸ்","தீவிரவாதிகள் தாக்குதல் ராணுவ வீரர்கள் பலி"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஜாட் இனத்தவர் போராட்ட ரயில்கள் ரத்து"],["ஸ்டேட் எக்ஸ்பிரஸ்","குளிர்பானத்தில் விஷ தந்தை மகள்கள் சாவு"],["தலையங்கம்","பிரச்னையை கேட்டாலே பாதி துன்ப குறையு"],["குற்றம்","நிதி நிறுவன ஊழியரை தாக்கி லட்ச ாய் கொள்ளை"],["குற்றம்","விவசாயியிட லஞ்ச மின் அதிகாரி கைது"],["தமிழகம்","க்கு தவறான தகவல் போதை ஆசாமிக்கு வலை"],["குற்றம்","பள்ளியில் அத்துமீறி நுழைய முயற்சி தடுத்த வாட்ச்மேன் குத்திக் கொலை"],["தமிழகம்","திருச்சியில் நள்ளிரவில் வீசப்பட்டதா வீட்டு வாசலில் வேட்டி சேலை"],["மாவட்ட மசாலா","ஊட்டி மலைப்பாதையில் லட்ச சிக்கியது"],["மாவட்ட மசாலா","நாட்டு வெடிகுண்டு வெடித்து வாலிபர்கள் படுகாய"],["மாவட்ட மசாலா","சுனாமி நிதி கையாடல் எஸ்ஐக்கு ஆண்டு சிறை"],["தமிழகம்","அபத்தூர் ரயில்வே மேபாலத்தில் பல கிமீ தூரத்துக்கு டிராபிக் ஜா"],["குற்றம்","திருப்பூர் அரசு மருத்துவமனையில் குழந்தையை கடத்திய தபதி கைது"],["தமிழகம்","தேர்தல் பாதுகாப்பு ஏற்பாடு போலீஸ் அதிகாரிகளுடன் டிஜிபி ஆலோசனை"],["குற்றம்","காரில் எடுத்து சென்ற லட்ச சிக்கியது"],["தமிழகம்","அதிமுக கூட்டணியில் தொகுதி பங்கீட்டில் இழுபறி நிர்வாகிகளுக்கு வைகோ அவசர அழைப்பு"],["குற்றம்","திருவொற்றியூரில் பிரபல ரவுடிக்கு சரமாரி அரிவாள் வெட்டு"],["குற்றம்","சென்னை விமான நிலையத்தில் லட்ச போதை பொருள் சிக்கியது"],["தமிழகம்","காங்கிரஸ் போட்டியிடு தொகுதி பட்டியல் கருணாநிதி வெளியிட்டார்"],["தமிழகம்","போயஸ் கார்டனில் மீண்டு பரபரப்பு அதிமுக பிரமுகர் தீக்குளிக்க முயற்சி"],["குற்றம்","கள்ளக் காதலருடன் தகராறு துணை நடிகை தீக்குளித்து தற்கொலை"],["தமிழகம்","திமுக கூட்டணி வெற்றிக்கு காங்கிரஸ் பாடுபடு தங்கபாலு"],["குற்றம்","முபை ரயில் நிலையத்தில் சூட்கேசில் பெண் பிண"],["குற்றம்","பின்னணி பாடகிகள் வீட்டில் பவுன் பண கொள்ளை"],["இந்தியா","காமன்வெல்த் முறைகேடு கல்மாடியிட வது முறையாக சிபிஐ அதிகாரிகள் விசாரணை"],["உலகம்","விதையில்லாத சீத்தாபழ விஞ்ஞானிகள் கண்டுபிடிப்பு"],["உலகம்","போராட்டத்தை ஒடுக்க பக்ரைனில் புகுந்தது சவுதி ராணுவ"],["இந்தியா","மேற்கு வங்க தேர்தலில் காங்கிரஸ் திரிணாமுல் பேச்சில் இழுபறி"],["இந்தியா","ஆண்டுகளில் அனைவருக்கு வீடு அச்சுதானந்தன்"],["இந்தியா","நாடாளுமன்றத்தில் பிஏசி தலைவராக மீண்டு ஜோஷி"],["இந்தியா","மக்களவையில் அரசு தகவல் அணு மின் நிலையங்களுக்கு தீவிரவாதிகளால் அச்சுறுத்தல்"],["தமிழகம்","மதுரையில் தேதி ஜெயலலிதா பிரசார"],["தமிழகம்","காங்கிரசில் இன்று முதல் விருப்பமனு பெறப்படு தங்கபாலு"],["தமிழகம்","டமி சுயேச்சைகளை கண்காணிக்க உத்தரவு தேர்தல் ஆணைய"],["தமிழகம்","சுயேச்சைகள் போட்டி பேர் வாங்கிய ஓட்டு"],["தமிழகம்","திமுக கூட்டணி வெற்றிக்கு உழைப்போ ஸ்ரீதர் வாண்டையார்"],["தமிழகம்","மக்களுக்கு சுகாதார சேவை உலக வங்கி பாராட்டு முதல்வர்"],["தமிழகம்","வது முறையாக கருணாநிதி முதல்வராவார் கூட்டணி கட்சி தலைவர்கள்"],["சினிமா(ரீல்மா)","பிருத்விராஜ் காதல் திருமண"],["விளையாட்டு","அயர்லாந்து ஆதிக்கத்துக்கு அடிகொடுத்தது தெஆப்ரிக்கா"],["விளையாட்டு","ஆஸியை சமாளிக்குமா கனடா"],["விளையாட்டு","இந்தியாவுக்கு தலைவலி பேட்டிங் பவர்பிளே"],["விளையாட்டு","இந்தியாவில் விளையாட பயப்படவில்லை அப்ரிடி"],["விளையாட்டு","பாக் அணியில் வெட்டுக்குத்து"],["விளையாட்டு","இன்று முதல் பயிற்சி தொடக்க யூசுப்பதான் இட எது"],["ஸ்டேட் எக்ஸ்பிரஸ்","தாயை கத்தியால் குத்தி கொன்ற மகன் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","வருமானத்துக்கு அதிகமாக சொத்து ஜெகனுக்கு ஐகோர்ட் நோட்டீஸ்"],["ஸ்டேட் எக்ஸ்பிரஸ்","டெல்லியில் கட்டிட சுவர் இடிந்து குழந்தைகள் பரிதாப பலி"],["ஸ்டேட் எக்ஸ்பிரஸ்","கோவா மீனவர்களுக்கு லைப் ஜாக்கெட் கட்டாய"],["உலகம்","ஆஸ்திரேலிய சுள்ளான் எஸ்எஎஸ் கில்லாடி"],["உலகம்","ஜிவ் கங்காருவின் வால் ரகசிய"],["தலையங்கம்","குழந்தை கடத்தல் கொடூர பாவ"],["தமிழகம்","பிரபல ஆடிட்டர் வீட்டில் அதிகாரிகள் திடீர் ரெய்டு"],["தமிழகம்","வாக்குச் சாவடிகளில் முறை தணிக்கை தேர்தல் ஆணைய"],["தமிழகம்","பாரத முன்னேற்ற கழக புதிய கட்சி துவக்க"],["தமிழகம்","பெற்றோர் கடன் பாக்கிக்காக கல்வி கடன் மறுக்ககூடாது ஐகோர்ட் கிளை"],["தமிழகம்","பிளஸ் விடைத்தாள் திருத்து பணி தேதி தொடங்குகிறது"],["தமிழகம்","வேட்பாளர் பட்டியல் கருணாநிதி ஆலோசனை நாளை மாலை வெளியிடுகிறார்"],["தமிழகம்","சிறப்பு முகா மூல பேருக்கு வாக்காளர் அடையாள அட்டை"],["தமிழகம்","வெள்ளித்தேர் சக்கரத்தின் அச்சு முறிந்தது பக்தர்கள் ஏமாற்ற"],["மாவட்ட மசாலா","கை கால்களில் விரலுடன் நாகையில் அதிசய குழந்தை"],["மாவட்ட மசாலா","கள் விற்பனை செய்த தோட்ட உரிமையாளர் கைது"],["மாவட்ட மசாலா","மிலிட்டரி சரக்கு கடத்தல் பேர் பிடிபட்டனர்"],["மாவட்ட மசாலா","நடராஜர் கோயில் உண்டியலில் காந்த மூல திருட முயற்சி"],["மாவட்ட மசாலா","தேர்தல் ஆணைய கெடுபிடி ஊட்டியில் சுற்றுலா டல்"],["தமிழகம்","தேர்தல் தொடர்பான சந்தேகங்களுக்கு மண்டல அலுவலர்களுக்கு விளக்க"],["தமிழகம்","தனியார் பாலிடெக்னிக் கல்லூரிக்கு செல்போனில் குண்டு மிரட்டல்"],["குற்றம்","தீக்குளித்த இளபெண் குழந்தைகளுடன் கருகி சாவு"],["குற்றம்","முதல்வரின் பாதுகாப்பு பணியில் ஈடுபட்ட போலீஸ்காரர் விபத்தில் பலி"],["உலகம்","கட்டுக்கடங்காத கதிர்வீச்சு ஊழியர் வெளியேற உத்தரவு"],["உலகம்","செர்னோபில் பாதிப்பைவிட புகுஷிமா பாதிப்பு கமிதான்"],["உலகம்","கேன்சரின் படிப்படி வேட்டை அட்டாக் ஆரபிச்சு கோடி வருஷ"],["தமிழகம்","பாஜ கூட்டணியில் மதிமுக பொன்ராதாகிருஷ்ணன் பதில்"],["தமிழகம்","தேர்தல் கமிஷன் கெடுபிடி சிவகாசி அச்சு தொழிலில் கோடி வர்த்தக பாதிப்பு"],["கல்வி","பாராமெடிக்கல் கோர்ஸ்களுக்கு மாணவர் சேர்க்கை ஆரப"],["தமிழகம்","அதிமுக தன்னிச்சையாக பட்டியல் வெளியிட்டது தேமுதிக கயூனிஸ்ட் அதிர்ச்சி"],["தமிழகம்","மயிலாப்பூரில் இன்று அறுபத்து மூவர் விழா"],["தமிழகம்","சாமியார்களுக்கு வாக்குரிமை தேர்தல் ஆணைய அனுமதி"],["தமிழகம்","தொகுதிகளில் போட்டி அதிமுக வேட்பாளர் பட்டியல் வெளியீடு"],["தமிழகம்","திமுக ஆட்சியில் நகர்ப்புற பகுதிகளில் முன்னேற்ற முதல்வர்"],["விளையாட்டு","விக்கெட் வித்தியாசத்தில் ஆஸ்திரேலியா அபார வெற்றி"],["இந்தியா","கர்நாடகாவில் எடியூரப்பாவுக்கு எதிராக கையெழுத்து வேட்டை"],["தமிழகம்","தொகுதிகளில் திமுக அதிமுக நேரடி போட்டி"],["தமிழகம்","தொழில் அதிபர் சாதிக் பாட்சா தூக்கு போட்டு தற்கொலை"],["இந்தியா","கோடி சபாதிப்பவருக்கு ரேஷனில் மானிய தேவையா உச்ச நீதிமன்ற"],["இந்தியா","முரசு சின்ன ஒதுக்குபடி தேர்தல் ஆணையத்தை தேமுதிக அணுகலா"],["இந்தியா","சட்டப்பேரவை தேர்தலில் அச்சுதானந்தனுக்கு சீட் கிடையாது"],["தமிழகம்","தேமுதிக தொகுதி பட்டியல் ஓரிரு நாளில் வெளியாகு"],["தமிழகம்","சோனியா காந்தி இறுதி செய்வார் தங்கபாலு"],["தமிழகம்","தேதிக்குள் வாக்காளர் பட்டியல் வெளியிட ஏற்பாடு"],["சினிமா(ரீல்மா)","மூணுஷா பறித்த சான்ஸ்"],["சினிமா(ரீல்மா)","கிளாமருக்கு முதலிட தரு பாமா"],["ஆன்மீகம்","திருமண தடை நீக்கு பங்குனி உத்திர திருநாள்"],["உலகம்","வறண்டால் கதிர்வீச்சு அதிகரிக்கு உலைகளில் தண்ணீர் நிரப்பு பணி தீவிர"],["உலகம்","உயிரை பணய வைத்து அணு உலை பணி"],["ஸ்டேட் எக்ஸ்பிரஸ்","சதவீத பெண்களுக்கு வயதுக்குள் திருமண"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஐஏஎஸ் அதிகாரிக்கு அரசு செலவில் சிலை"],["ஸ்டேட் எக்ஸ்பிரஸ்","சோமாலிய கொள்ளையரில் பேர் சிறுவர்கள்"],["ஸ்டேட் எக்ஸ்பிரஸ்","தகவல் அறியு சட்டத்தில் இருந்து சிபிஐக்கு விலக்கு அளிக்க பரிந்துரை"],["விளையாட்டு","நடுவர் அசோகா டிசில்வாவுக்கு ஆப்பு"],["விளையாட்டு","இந்தியா வெஸ்ட் இண்டீஸ் இங்கிலாந்து வங்கதேச தலைவிதி நிர்ணய"],["விளையாட்டு","கனடாவை வீட்டுக்கு அனுப்பியது ஆஸி"],["மாவட்ட மசாலா","தொழிலதிபர் வீட்டில் துப்பாக்கிகள் மாய"],["மாவட்ட மசாலா","மே வது வாரத்தில் ஊட்டி மலர் கண்காட்சி"],["மாவட்ட மசாலா","சிறுமியை பலாத்கார செய்த வாலிபருக்கு ஆண்டு சிறை"],["இந்தியா","மகாராஷ்டிராவில் பயங்கர பாலத்தில் பஸ் கவிழ்ந்து பக்தர் பரிதாப சாவு"],["இந்தியா","தொகுதி பங்கீட்டில் சிக்கல் நீடிப்பு காங்கிரசுக்கு மதா இறுதி கெடு"],["தமிழகம்","சென்னை மைதானத்தில் இன்று இங்கிலாந்து வெஸ்ட் இண்டீஸ் மோதல்"],["தமிழகம்","தமிழக சட்டசபை தேர்தல் சூடுபிடிக்கிறது நாளை மறுநாள் வேட்பு மனு தாக்கல்"],["தலையங்கம்","கெடுபிடியால் நன்மையு தீமையு"],["குற்றம்","முஸ்கான் ரித்திக் கொலை வழக்கு வக்கீலுக்கு திடீர் மிரட்டல்"],["குற்றம்","போட்சி துணைத் தலைவர் சரமாரி வெட்டிக் கொலை"],["தமிழகம்","காலை மணிக்கு தொடங்கு வாக்குப்பதிவு நேர குறைப்பு"],["தொழில்","எரிகட்டி தயாரித்தால் ஏற்ற"],["தமிழகம்","திமுக வேட்பாளர் பட்டியல் வெளியீடு திருவாில் கருணாநிதி போட்டி"],["விளையாட்டு","கால் இறுதி வாய்ப்பை தக்கவைத்தது இங்கிலாந்து"],["விளையாட்டு","உலக கோப்பைக்கு பின் ஓய்வு அக்தர் திடீர் முடிவு"],["தமிழகம்","தற்கொலை செய்து கொண்ட சாதிக் பாட்சா உடல் ஒப்படைப்பு"],["இந்தியா","ல் கபெனிகள் பெற்ற ஸ்பெக்ட்ர லைசென்ஸ் ரத்து செய்யப்படுமா"],["தமிழகம்","திமுக மீது வைத்துள்ள சிறுபான்மை மக்கள் நபிக்கை வீண் போகாது"],["தமிழகம்","திருவாில் கருணாநிதி ல் பிரசார தேதி வேட்புமனு தாக்கல்"],["தமிழகம்","வேட்பாளர் தேர்வு குறித்து தங்கபாலு தலைமையில் குழு ஆய்வு"],["தமிழகம்","பாமக வேட்பாளர்கள்"],["தமிழகம்","ஜெயலலிதாவை தோற்கடிக்க திமுகவின் சாதனைகள் போது ஆனந்த்"],["உலகம்","ஆண்டு பயணத்துக்கு பிறகு புதன் கிரகத்தை அடைந்தது விண்கல"],["தமிழகம்","வது அணியில் சேர மாட்டோ ஐஜேகே அறிவிப்பு"],["மாவட்ட மசாலா","பவுன் கொள்ளை பலே ஆசாமி பிடிபட்டார்"],["மாவட்ட மசாலா","ஜெயங்கொண்ட அருகே புதுமாப்பிள்ளை படுகொலை"],["மாவட்ட மசாலா","பைக்குகள் மோதல் பேர் பரிதாப சாவு"],["மாவட்ட மசாலா","மனைவியை எரித்து கொன்ற கணவனுக்கு போலீஸ் வலை"],["விளையாட்டு","ஸ்ரீகாந்த்துடன் டோனி பகீர் மோதல் பயிற்சியை புறக்கணித்தார் டோனி"],["மாவட்ட மசாலா","லட்ச மோசடி பெண் மந்திரவாதி கைது"],["விளையாட்டு","இங்கி இந்தியா தலைவிதி வங்கதேசத்தின் கையில்"],["இந்தியா","திரிணாமுல் காங்கிரஸ் உடன்பாடு மதாவுடன் பேசுகிறார் பிரணாப்"],["இந்தியா","மேவங்கத்தில் பாஜவுடன் சிபுசோரன் கட்சி கூட்டணி"],["இந்தியா","அசாமில் திரிணாமுல் காங்கிரஸ் வது பட்டியல் வெளியீடு"],["இந்தியா","எபிக்களை விலைக்கு வாங்க யாருக்கு அதிகார அளிக்கவில்லை மன்மோகன்சிங் விளக்க"],["ஸ்டேட் எக்ஸ்பிரஸ்","போலீஸ் இன்ஸ்பெக்டர் உயிருடன் எரித்து கொலை"],["ஸ்டேட் எக்ஸ்பிரஸ்","லாலு கட்சி மாஜி எபிக்கு ஆண்டு சிறை தண்டனை"],["ஸ்டேட் எக்ஸ்பிரஸ்","அமா மகள் வெட்டிக் கொலை சூட்கேசில் துண்டுதுண்டாக உடல்"],["தமிழகம்","காஞ்சிபுர மாவட்ட தேர்தல் செலவு கணக்கு ஆலோசனை கூட்ட"],["குற்றம்","ஆட்டோ டிரைவரை தாக்கிய பேர் கைது"],["தமிழகம்","திருவள்ளூர் மாவட்டத்தில் பதற்றமான வாக்குச்சாவடிகள்"],["தமிழகம்","சட்டசபை தேர்தலுக்கான வேட்புமனு தாக்கல் நாளை தொடக்க"],["தமிழகம்","ஸ்டாலின் ராமதாஸ் சந்திப்பு"],["தமிழகம்","ரயில் பஸ் லாட்ஜ்களில் அதிரடி சோதனை"],["தமிழகம்","தங்கபாலு நாளை டெல்லி பயண ஒரிரு நாளில் வேட்பாளர் பட்டியல்"],["குற்றம்","மாணவிகளிட சில்மிஷ கைதான ஆசிரியர் சிறையில் அடைப்பு"],["தலையங்கம்","குடுபத்தை கொல்லு நோய்"],["தலையங்கம்","பிளஸ் கணக்கு தேர்வில் இடபெற்ற பிழையான கேள்விகளுக்கு உரிய மதிப்பெண் வழங்க முடிவு"],["குற்றம்","பெசன்ட் நகரில் பரபரப்பு வாலிபர் கொடூர கொலை சாலையோர சடல வீச்சு"],["தமிழகம்","அதிமுக கூட்டணி கட்சிகள் இடையே குழப்ப நீடிப்பு"],["தமிழகம்","சட்டசபை தேர்தலுக்கான வேட்புமனு தாக்கல் இன்று தொடக்க"],["தமிழகம்","பிரசார வாகனங்களின் வடிவ மாறக் கூடாது தேர்தல் கமிஷன்"],["விளையாட்டு","ரன் வித்தியாசத்தில் நியூசிலாந்தை வீழ்த்தியது இலங்கை"],["விளையாட்டு","அயர்லாந்து அபார வெற்றி"],["விளையாட்டு","தென் ஆப்ரிக்காவுடன் இன்று மோதல் சாதிக்குமா வங்கதேச"],["இந்தியா","நபிக்கை வாக்கெடுப்பில் வெற்றி பெற சட்டவிரோத செயலில் காங்கிரஸ் ஈடுபடவில்லை"],["தமிழகம்","தேர்தல் பிரசாரத்துக்கு பிரதமர் சோனியா வருவது எப்போது முதல்வர் கருணாநிதி பேட்டி"],["உலகம்","அமெரிக்க வங்கி வாரிய இயக்குனராகிறார் முகேஷ்"],["குற்றம்","ஊத்தங்கரை ஊத்தங்கரையில் நடந்த வாகன சோதனையில் உரிய ஆவணங்கள் இன்றி பைக்கில் எடுத்துச் சென்ற லட்ச கிரா தங்க பறிமுதல் செய்யப்பட்டது"],["தமிழகம்","மனுதாக்கல் தொடங்கியது நிதியமைச்சர் அன்பழகன் வேட்புமனு தாக்கல் செய்தார்"],["தமிழகம்","இன்று பவுர்ணமி கோவளத்தில் கடல் சீற்ற"],["குற்றம்","கைதி தப்பினார் துப்பாக்கியால் சுட்டு போலீஸ் தற்கொலை"],["தலையங்கம்","குடுபத்தில் ஒளியேற்று தீர்ப்பு"],["குற்றம்","சேல தனியார் பள்ளியில் சென்னை மாணவன் கொலை"],["குற்றம்","டன் ரப்பருடன் லாரி கடத்தல்"],["மாவட்ட மசாலா","லட்ச மோசடி கோவை ஆசாமி கைது"],["மாவட்ட மசாலா","தேர் சக்கரத்தில் சிக்கிய வாலிபர் நசுங்கி பலி"],["மாவட்ட மசாலா","நீலகிரி கோடை விழா தேதி ஆலோசனை"],["மாவட்ட மசாலா","பள்ளி மாணவி பலாத்கார வாலிபர் பிடிபட்டார்"],["தமிழகம்","திமுக கவுன்சிலர் மீது ஆசிட் வீச்சு ரவுடிக்கு வலை"],["தமிழகம்","போட்டோவுடன் கூடிய பூத்சிலிப் காட்டி ஓட்டுப்போட ஆணைய பரிசீலனை"],["இந்தியா","உலக கோப்பை கிரிக்கெட் முபையில் இறுதிப் போட்டியை சீர்குலைக்க தீவிரவாதிகள் சதி"],["குற்றம்","சிறையில் இருந்து வந்தது கைவரிசை பைக் திருடர்கள் சிக்கினர்"],["தமிழகம்","யூரியா கொட்டியதால் ராயபுர மக்களுக்கு கண் எரிச்சல்"],["தமிழகம்","அபத்தூர் தொகுதியில் திமுக வேட்பாளர் வாக்கு சேகரிப்பு"],["உலகம்","ராணுவத்தை சந்திக்க வேண்டி வரு கடாபிக்கு ஒபாமா எச்சரிக்கை"],["தமிழகம்","திருப்போ் செங்கல்பட்டு பாமக வேட்பாளர்கள்"],["தமிழகம்","நடிகர் ஜெயரா மலையாள கவிஞருக்கு பாராட்டு விழா"],["இந்தியா","கலவர வழக்கில் தேடப்படு தெலங்கானா தலைவர்கள் திடீர் தலைமறைவு"],["இந்தியா","தொகுதி உடன்பாடு முடிவெடுக்க காங்கிரசுக்கு மதா இறுதி கெடு"],["ஸ்டேட் எக்ஸ்பிரஸ்","கருக்கலைப்பு மாத்திரைகளுக்கு மகாராஷ்டிராவில் கட்டுப்பாடு"],["ஸ்டேட் எக்ஸ்பிரஸ்","பீகாரில் நக்சலைட்களை அதிரடி படை சுற்றி வளைத்தது"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆயுள் கைதிகளுக்கு பெட்ரோல் பங்க் பணி"],["ஸ்டேட் எக்ஸ்பிரஸ்","சூட்கேசில் பெண் பிண பேர் கைது"],["சினிமா(ரீல்மா)","பாடல் தேடி அலைந்த யூனிட்"],["தமிழகம்","அனைத்து தொகுதிக்கு சென்று தேர்தல் பணியை தீவிரப்படுத்துவேன் முகஅழகிரி"],["தமிழகம்","தஞ்சை திருச்சியில் கருணாநிதி பொதுக்கூட்ட"],["தமிழகம்","கொளத்தூரில் செயல்வீரர்கள் கூட்ட கூட்டணி கட்சியினருடன் முகஸ்டாலின் ஆலோசனை"],["தமிழகம்","விடுதலை சிறுத்தைகள் கட்சியின் வேட்பாளர் பட்டியல் அறிவிப்பு"],["தமிழகம்","ஜெயலலிதா உருவபொமை எரிப்பு தேர்தல் அதிகாரி போலீசில் புகார்"],["தமிழகம்","உத்தேச வேட்பாளர் பட்டியலுடன் டெல்லி விரைந்தார் தங்கபாலு"],["தமிழகம்","விடிய விடிய நடந்த பேச்சுவார்த்தையில் தொகுதிகளை விட்டுக் கொடுத்தது அதிமுக"],["தமிழகம்","மதிமுக நீடிக்கிறதா என்பதில் குழப்ப நீடிக்கிறது அதிமுக குழுவினர் வைகோவுடன் சந்திப்பு"],["விளையாட்டு","தென் ஆப்பிரிக்காவிட வங்கதேச படு தோல்வி இந்தியா இங்கிலாந்து மேற்கு இந்தியத் தீவுகள் காலிறுதிக்கு தகுதி"],["தமிழகம்","தொகுதி ஒதுக்கீட்டில் உதாசீனப்படுத்தி விட்டார் ஜெ அதிமுக கூட்டணி மதிமுக விலகல் தேர்தலை புறக்கணிக்கப் போவதாகவு அறிவிப்பு"],["விளையாட்டு","இந்தியா வெஇண்டீஸ் இன்று மோதல் ராணுவ கட்டுப்பாட்டில் சேப்பாக்க மைதான"],["குற்றம்","ஏசி மெஷின் துளை வழியே நுழைந்து தூத்துக்குடி டாக்டர் வீட்டில் பவுன் நகை கொள்ளை"],["குற்றம்","பைக் மீது கார் மோதி"],["மர்மம்","குளத்துக்குள் மூழ்கி கிடக்கு பொக்கிஷ ஐந்து தலை நாக ஆருட சொல்கிறது"],["தமிழகம்","காஞ்சியில் பொதுக்கூட்டத்துக்கு அனுமதிக்கப்பட்ட இடங்கள்"],["தமிழகம்","திருவள்ளூர் மாவட்டத்தில் தேர்தல் பார்வையாளர் தொடர்பு அலுவலர் நியமன"],["தமிழகம்","சீனியர் சிட்டிசனுக்கு பஸ் பாஸ் கல்லூரி மாணவர்களுக்கு லேப்டாப் ஒவ்வொரு குடுபத்துக்கு இலவச கிரைண்டர் மிக்சி"],["இந்தியா","திருப்பதி அருகே யானைகள் அட்டகாச மாமரங்கள் நாச"],["இந்தியா","எடியூரப்பா என்னுடன் சமாதான பேச முயன்றார் குமாரசாமி"],["விளையாட்டு","வெஸ்ட் இண்டீசுடன் இன்று மோதல் சென்னை மைதானத்தில் சாதிப்பாரா சச்சின்"],["விளையாட்டு","ஆஸி ஆதிக்கத்துக்கு ஆப்பு அடித்தது பாகிஸ்தான்"],["விளையாட்டு","பீல்டிங்தான் தலைவலி டோனி"],["விளையாட்டு","காலிறுதியில் இந்தியா மோதுவது ஆஸியுடனா இலங்கையுடனா"],["சினிமா(ரீல்மா)","கைதிகளின் நிஜ கதை படமாகிறது"],["வேலைவாய்ப்பு","உபி மின்வாரியத்தில் இன்ஜினியர் பணி"],["தமிழகம்","திமுக தேர்தல் அறிக்கையை மக்கள் மனதில் பதியவையுங்கள்"],["இந்தியா","திமுக காங் கூட்டணியை ஆதரித்து தமிழகத்தில் சிரஞ¢சீவி பிரசார"],["தமிழகம்","தொகுதி ஒதுக்கீடு முடிந்தது தேமுதிக வேட்பாளர் பட்டியல் எப்போது"],["தமிழகம்","காஞ்சிபுர தொகுதிகள் ஒரு பார்வை"],["தமிழகம்","அபத்தூர் தொகுதிகள் ஒரு பார்வை"],["தமிழகம்","தொகுதி பங்கீட்டில் உதாசீன அதிமுக கூட்டணியில் பிளவு"],["விளையாட்டு","வெஸ்ட் இண்டீசை வீழ்த்தியது இந்தியா"],["இந்தியா","திமுக காங்கிரஸ் அணிக்கு நடிகர் சிரஞ்சீவி பிரசார"],["இந்தியா","கேரளாவில் கூடுதலாக தொகுதியில் காங்கிரஸ் போட்டி"],["இந்தியா","திரிணாமுல் காங்கிரஸ் ஒதுக்கு தொகுதிகளை ஏற்பதா"],["இந்தியா","டிஆர்எஸ் கட்சியில் எஎல்ஏ சஸ்பெண்ட்"],["இந்தியா","கோடி லஞ்ச வாங்கினார் குமாரசாமி எடியூரப்பா"],["தமிழகம்","இந்திய கயூனிஸ்ட் கட்சிக்கு தொகுதிகள் புதுசு"],["தமிழகம்","அதிமுக அணியில் இருந்து மதிமுக விலகியது ஏன்"],["தமிழகம்","மணி நேரத்திற்கு பின்னு தாமத"],["தமிழகம்","ஜெயலலிதா இன்று அதிமுக புதிய பட்டியல் வெளியிடுகிறார்"],["தமிழகம்","எஸ்எஎஸ் பிரசாரத்தில் இறங்கியது மதிமுக"],["தமிழகம்","சமூக நல மற்று சத்துணவு துறைகளில் சாதனைகள் முதல்வர்"],["தமிழகம்","திமுக கூட்டணிக்கு அமோக வெற்றி முகஅழகிரி"],["தமிழகம்","தேர்தலில் இரட்டை இலக்க வெற்றி பெறுவோ பொன்ராதாகிருஷ்ணன்"],["தமிழகம்","தேர்தல் பிரசாரத்துக்கு பள்ளி வாகனங்களை வழங்க கூடாது"],["தமிழகம்","திமுக தேர்தல் அறிக்கையை மக்கள் மனதில் பதிய வையுங்கள்"],["சினிமா(ரீல்மா)","அடுத்த வருட காதலன் கிடைப்பார் சமீரா கணிப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","சூட்கேசில் பெண் சடல டாக்டர் கணவர் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஹோலி கொண்டாட்ட குட்டையில் மூழ்கி மாணவர்கள் பலி"],["ஸ்டேட் எக்ஸ்பிரஸ்","லட்ச பணத்துடன் வனத்துறை அதிகாரி கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","வாக்குப் பதிவு இயந்திரத்துக்கு அசா கனபரிஷத் எதிர்ப்பு"],["குற்றம்","சென்னை மாப்பிள்ளையை தாக்கி தாலி உள்பட பவுன் கொள்ளை"],["தமிழகம்","தொழிலதிபர் வீட்டில் துப்பாக்கி பறிமுதல்"],["குற்றம்","திருமணத்துக்கு வைத்திருந்த பவுன் நகை கொள்ளை"],["மாவட்ட மசாலா","கோவை பிஷப் பணி புதிய பாதிரியார் நியமன"],["மாவட்ட மசாலா","நெல்லை தூத்துக்குடி குமரியில் ரவுடிகள் கைது"],["மாவட்ட மசாலா","கோவையில் குழந்தைகளுக்காக லட்சத்தில் ஆபரேஷன் தியேட்டர்"],["மாவட்ட மசாலா","வேட்பாளரை மாற்றக்கோரி அதிமுக ஆர்ப்பாட்ட"],["மாவட்ட மசாலா","புறக்கணிப்பால் ஏமாற்ற மதிமுக எஎல்ஏ விலகல்"],["தமிழகம்","அதிமுக கூட்டணியில் மீண்டு இழுபறி தொகுதி ஒதுக்கீட்டில் தேமுதிக அதிருப்தி"],["தமிழகம்","வகுப்பு மெட்ரிக்குலேஷன் தேர்வுகள் நாளை தொடக்க"],["தமிழகம்","ஒரே பகுதியில் இரு வேட்பாளர் பிரசாரத்துக்கு அனுமதிக்க கூடாது"],["தமிழகம்","துணை முதல்வர் ஸ்டாலின் தேதி சிவகங்கையில் பிரசார"],["தமிழகம்","ஸ்ரீபெருபுதூர் திருவொற்றியூர் தொகுதிகள் ஒரு பார்வை"],["தமிழகம்","துணை முதல்வர் ஸ்டாலின் வேட்பு மனு தாக்கல்"],["குற்றம்","இளபெண் அடித்து கொன்று பிணத்தை எரித்த கொடூர"],["இந்தியா","நடிகர்களுக்கு வாய்ப்பு மதாவுக்கு எதிராக நிர்வாகிகள் கொதிப்பு"],["தமிழகம்","தண்டவாளத்தில் விரிசல் ரயிலை நிறுத்திய சிறுவனுக்கு பரிசு"],["குற்றம்","லாரி மோதியதில் பயங்கர அரசு பஸ் கவிழ்ந்து பயணிகள் பலி"],["குற்றம்","கல் குவாரியில் நின்ற லாரிகளுக்கு தீ வைப்பு"],["குற்றம்","பெண் ஊழியரை கீழே தள்ளி பவுன் நகை கொள்ளை"],["விளையாட்டு","அனைத்து போட்டிகளிலு வென்றால் சாபியன்தான் யுவராஜ்சிங்"],["விளையாட்டு","அரையிறுதியில் இந்தியா பாக் மோதல்"],["விளையாட்டு","காலிறுதியில் ஆஸியை எதிர்கொள்கிறது இந்தியா"],["தமிழகம்","திமுக தேர்தல் அறிக்கை மக்கள் வரவேற்பு"],["தமிழகம்","தேமுதிகவுக்கு ஒதுக்கப்பட்ட தொகுதிகள் எவை"],["தமிழகம்","ஜெயலலிதா ஆணவ மாறவில்லை வைகோ"],["தமிழகம்","பாமக தேர்தல் அறிக்கை ராமதாஸ் வெளியிட்டார்"],["தமிழகம்","பண பறிமுதல் செய்வதை எதிர்த்து வழக்கு தேர்தல் ஆணைய பதில் அளிக்க உயர்நீதிமன்ற உத்தரவு"],["குற்றம்","நீலாங்கரையில் பரபரப்பு பிரபல ரவுடிக்கு அரிவாள் வெட்டு"],["தமிழகம்","சென்னை புறநகர் கமிஷனராக கரன் சின்ஹா பொறுப்பேற்பு"],["தமிழகம்","தேமுதிக அலுவலகத்தில் நின்ற வாகனங்களில் திடீர் சோதனை"],["தமிழகம்","திருவாில் பிரமாண்ட பொதுக்கூட்ட கருணாநிதி நாளை முதல் பிரசார"],["உலகம்","அசா சட்டப்பேரவை தேர்தல் உல்பா இயக்கத்தில் இருந்த பழைய தீவிரவாதிகள் போட்டி"],["இந்தியா","இழுபறிக்கு முற்றுப்புள்ளி மேற்கு வங்கத்தில் காங்கிரசுக்கு தொகுதி"],["தமிழகம்","அதிமுக புது பட்டியலில் தொகுதிகள் மாற்ற"],["தமிழகம்","பத்தா வகுப்பு மெட்ரிக்குலேஷன் தேர்வு இன்று தொடக்க"],["தமிழகம்","மதுவை தடுப்பது எங்கள் உயிர் மூச்சு கொள்கை பாமக"],["தமிழகம்","வாக்குச்சாவடிகளில் வாக்காளர்களின் களைப்பை போக்க உப்பு சர்க்கரை கரைசல்"],["தமிழகம்","மக்கள் நலப்பணிகள் தொடர திமுகவுக்கு ஆதரவு கொடுங்கள் ஸ்டாலின்"],["தமிழகம்","சில்லரை காசுகளுடன் வந்த சுயேச்சை வேட்பாளர்"],["தமிழகம்","வனிதாவிட நாள் தந்தையிட நாள்"],["தமிழகம்","சென்னை தொகுதிகளில் பறக்கு படைகள்"],["விளையாட்டு","சாபியனை வீழ்த்துவோ யுவராஜ் சிங்"],["தமிழகம்","திமுக அதிமுக நேரடியாக மோது தொகுதிகள்"],["தமிழகம்","தேர்தலை மதிமுக சந்திக்க வேண்டு திருமாவளவன்"],["இந்தியா","பாதுகாப்பு விதிகளை பின்பற்றாத செல்போன் கபெனிகளுக்கு கோடி அபராத"],["இந்தியா","நாடாளுமன்றத்தில் பிரதமர் மீது உரிமை மீறல்"],["தமிழகம்","தொகுதி போச்சே சோகமு யோகமு"],["தமிழகம்","புரோட்டா கடைகளுக்கு வந்தாச்சு கெடுபிடி ஆணைய அதிரடி"],["சினிமா(ரீல்மா)","மேக்அப் பெண்ணுடன் அசின் மோதல்"],["மருத்துவம்","அவஸ்தைக்கு எளிய பயிற்சிகள்"],["தமிழகம்","துணை முதல்வர் ஸ்டாலின் ரஜினிகாந்த்தை சந்தித்தார்"],["தமிழகம்","காளஹஸ்தி சிவன் கோயிலில் தோஷ பூஜை பொருட்கள் தேவஸ்தான தயாரிப்பு"],["மாவட்ட மசாலா","வரதட்சணை கொடுமை பேருக்கு ஜெயில்"],["மாவட்ட மசாலா","வால்பாறை வனத்தில் புலிகள் நடமாட்ட"],["தமிழகம்","கொரட்டூர் பகுதியில் திமுக வேட்பாளர் தீவிர ஓட்டு சேகரிப்பு"],["தமிழகம்","செங்கை வேட்பாளர் மாற்றத்தால் அதிமுகவினர் கடு அதிருப்தி"],["தமிழகம்","திருவள்ளூர் தொகுதியில் பாஜ வேட்பாளர் மனு தாக்கல்"],["தமிழகம்","தாபர பல்லாவர தொகுதியில் தேர்தல் பிரசார தொடக்க"],["தமிழகம்","வென்டிலேட்டரில் ஓடுது அதிமுக கூட்டணி முகஅழகிரி"],["தமிழகம்","வேட்பாளர் பட்டியல் ரெடி தமிழக காங்கிரசில் பரபரப்பு"],["தமிழகம்","கோவை மாவட்டத்தில் திமுக அதிமுக தொகுதியில் மோதல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","மேற்கு வங்க தேர்தல் ஆயிர துணை ராணுவ வருகை"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆந்திர மேலவை தேர்தலில் சதவீத வாக்குப் பதிவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","விருது வாங்குவதற்காக தன்னை தானே சுட்டுக் கொண்ட போலீஸ்"],["ஸ்டேட் எக்ஸ்பிரஸ்","பீகாரில் கோடி குழந்தைகளுக்கு மருத்துவ பரிசோதனை"],["ஸ்டேட் எக்ஸ்பிரஸ்","பழங்குடி மக்கள் சுட்டுக் கொலையா ஒரிசா முதல்வர் மறுப்பு"],["தமிழகம்","சட்டசபை தேர்தல் சூடுபிடிக்கிறது தலைவர்கள் சூறாவளி பிரசார"],["தமிழகம்","டூ மச் நடவடிக்கையால் தேர்தல் கமிஷனுக்கு எதிர்ப்பு"],["தமிழகம்","மதிமுக தொண்டர்கள் பார்வை திமுக பக்க திருபுகிறது"],["தமிழகம்","பண பறிமுதல் செய்ய அதிகார உள்ளது ஐகோர்ட்டில் தேர்தல் ஆணைய வாத"],["உலகம்","புகுஷிமாவில் மீண்டு புகை"],["குற்றம்","தொழில் அதிபர் வீட்டில் சவரன் கொள்ளை"],["இந்தியா","அசா தேர்தல் பாதுகாப்புக்கு கொரில்லா சிறப்பு படை"],["விளையாட்டு","சாதனை களத்தில் சாதனை கிட்டுமா"],["விளையாட்டு","பாக் வெஇ பலப்பரீட்சை"],["விளையாட்டு","பான்டிங் நீக்க"],["விளையாட்டு","இந்திய போட்டி மினி பைனல் ஆஸி பயிற்சியாளர் அதிரடி"],["இந்தியா","மன்மோகன்சிங் மீது உரிமை மீறல் சபாநாயகரிட பாஜ நோட்டீஸ்"],["தமிழகம்","முதல்வர் கருணாநிதி ஜெயலலிதா நாளை வேட்புமனு தாக்கல்"],["இந்தியா","அசா மாநிலத்தில் திரிணாமுல் தனித்து போட்டி காங்கிரசுக்கு பாதிப்பு"],["இந்தியா","பிரதமர் மீது உரிமை மீறல் பிரச்னை மாநிலங்களவை முறை ஒத்திவைப்பு"],["தமிழகம்","திமுக தேர்தல் அறிக்கையை கொண்டு சென்றால் வெற்றி தயாநிதி மாறன்"],["தமிழகம்","கூட்டு பிரசார இல்லை தேமுதிக கயூனிஸ்ட் அதிருப்தி"],["தமிழகம்","தேர்தலில் அதிக கெடுபிடி செய்ய காரண முதல்வர்"],["தமிழகம்","சுயேச்சைகளுக்கு சின்னங்கள் தேர்தல் ஆணைய"],["தமிழகம்","யானைகளை விரட்டு பணியில் மரத்துக்கு மர தாவு ஆதிவாசிகள்"],["தமிழகம்","பெண்களுக்கு மட்டுமே தேமுதிகவில் வாய்ப்பு"],["தமிழகம்","திமுக தேர்தல் அறிக்கை வெற்றித்திருமகள் ராமதாஸ்"],["தமிழகம்","தேர்தல் பார்வையாளர்கள் முதல் அறிக்கை தாக்கல் ஆணைய உத்தரவு"],["இந்தியா","தாமசை நியமித்ததில் பின்னணி என்ன பிருத்விராஜ் சவான்"],["இந்தியா","தேர்தல் கமிஷன் கெடுபிடி அசா கட்சிகள் தவிப்பு"],["இந்தியா","மதா மீது மார்க்சிஸ்ட் தேர்தல் கமிஷனில் புகார்"],["இந்தியா","எனக்கு ஒன்று தங்கைக்கு ஒன்று சீட் முரளீதரன்"],["இந்தியா","சிறையில் அடைக்கப்பட்டுள்ள முன்னாள் அமைச்சர் தேர்தலில் போட்டி"],["விளையாட்டு","ஆஸிக்கு சவுக்கடி கொடுக்குமா இந்தியா"],["விளையாட்டு","நடுவர் முடிவை அறிந்திருந்தால் சச்சின் வெளியேறியிருக்க மாட்டார்"],["விளையாட்டு","பாக்கை சமாளிக்குமா வெஸ்ட் இண்டீஸ்"],["விளையாட்டு","சேவாக்கை வீழ்த்த திட்ட ரெடி"],["ஸ்டேட் எக்ஸ்பிரஸ்","தனிநபர் வருமானத்தில் டெல்லியை முந்தியது முபை"],["ஸ்டேட் எக்ஸ்பிரஸ்","காமன்வெல்த் போட்டியில் அன்னிய செலாவணி மோசடி"],["ஸ்டேட் எக்ஸ்பிரஸ்","காங்கிரசுடன் இணைப்பா தெலங்கானா ராஷ்ட்ரிய சமிதி மறுப்பு"],["தலையங்கம்","வேகத்தால் பலியாகு அப்பாவி மக்கள்"],["தமிழகம்","தாவர மரபியல் பூங்காவில் கருகிய நிலையில் பெண் மீட்பு"],["தமிழகம்","நீர்மூழ்கி கருவியில் பழுது முல்லைப் பெரியாறு ஆய்வுபணியில் தொய்வு"],["தமிழகம்","முஸ்கான் ரித்திக் கொலை வழக்கு மனோகரன் மீது குற்றச்சாட்டு பதிவு"],["மாவட்ட மசாலா","ரவுடி கொலையில் வாலிபர்கள் கைது"],["மாவட்ட மசாலா","திருமண செய்த பலே ஆசாமி சிக்கினார்"],["மாவட்ட மசாலா","காரில் எடுத்து சென்ற கோடி நகை சிக்கியது"],["தமிழகம்","பிளஸ் விடைத்தாள் திருத்து பணி தொடங்கியது"],["குற்றம்","லாரியை மறித்து பண வசூல் போலீஸ் போல் நடித்தவர் கைது"],["குற்றம்","பிஎஸ்என்எல் ஊழியர் வீட்டில் பவுன் நகைகள் கொள்ளை"],["இந்தியா","திரிணாமுல் காங்கிரஸ் கூட்டணியில் சரத்பவார் கட்சிக்கு ஒரு தொகுதி"],["குற்றம்","ஆட்டோ டிரைவர் கொலை ரவுடி நாய் சேகர் உள்பட பேர் கைது"],["சினிமா(ரீல்மா)","கவர்ச்சிகளுக்கு நமீ அட்வைஸ்"],["கல்வி","பஞ்சாப் தொழில்நுட்ப பல்கலையில் மாற்று திறனாளிகளுக்கு இலவச கல்வி"],["கல்வி","புதுவை ஜிப்மரில் எபிபிஎஸ் சேர ஜூன் ல் நுழைவுத்தேர்வு"],["கல்வி","சென்னை பல்கலையில் எபிஏ தொலைநெறி படிப்புகள்"],["தமிழகம்","நாளை வேட்புமனு தாக்கல் முதல்வர் கருணாநிதி திருவா் பயண"],["குற்றம்","சமட்டியால் தாக்கி விஷ கொடுத்து மனைவி கொலை"],["தமிழகம்","தொகுதிகள் ஒரு பார்வை துறைமுக"],["தமிழகம்","தொகுதிகள் ஒரு பார்வை திருவள்ளூர்"],["தமிழகம்","ஸ்ரீரங்கத்தில் ஜெ நாளை வாக்கு சேகரிப்பு"],["தமிழகம்","செலவு கணக்கு தராவிட்டால் பிரசார செய்ய முடியாது தேர்தல் கமிஷன்"],["தமிழகம்","சங்கரராமன் கொலை வழக்கு விசாரணைக்கு தடை இல்லை ஐகோர்ட்"],["இந்தியா","பொறுப்பை தட்டிக் கழிப்பதா பிரதமர் மீது பாஜ கடு தாக்கு"],["இந்தியா","ஆந்திர மேலவை தேர்தல் இடங்களை வென்றது ஜெகன் கட்சி"],["தமிழகம்","காங்கிரஸ் வேட்பாளர் பட்டியல் எஎல்ஏக்களுக்கு மீண்டு சீட்"],["விளையாட்டு","காலிறுதியில் ஆஸியுடன் இன்று மோதல் சாதிக்கு முனைப்பில் இந்தியா"],["விளையாட்டு","சொதப்பியது வெஸ்ட் இண்டீஸ் அரை இறுதியில் பாகிஸ்தான்"],["தமிழகம்","வாக்குச்சாவடியில் உள்ளூர் போலீசாரை நியமிக்ககூடாது தேர்தல் ஆணைய"],["தமிழகம்","லஞ்ச ஊழல் பற்றி க்கு எஸ்எஎஸ் அனுப்பலா"],["தமிழகம்","தொழிலாளர்களுக்கு மனைப்பட்டா இந்திய கயூனிஸ்ட்"],["தமிழகம்","அக்கா கணவர் கடத்தல் திட்ட போலீஸ் பாதுகாப்புடன் தேர்வு எழுதிய மாணவி"],["தமிழகம்","திருவா் தொகுதியில் கருணாநிதி இன்று வேட்புமனு தாக்கல்"],["தமிழகம்","மாணவர்கள் பைகளில் அதிகாரிகள் சோதனை பொது மக்கள் எதிர்ப்பு"],["தமிழகம்","பண பட்டுவாடா செய்வதாக பஞ்சாயத்து தலைவரை மாட்டிவிட்ட மர்ம நபர்"],["இந்தியா","மேற்கு வங்கத்தில் வது முறையாக கயூனிஸ்ட் ஆட்சி"],["இந்தியா","சிறையில் இருப்பவருக்கு சீட்டா காங்கிரஸ் எதிர்ப்பு"],["இந்தியா","தவறுகளுக்கு பிரதமரே பொறுப்பேற்க வேண்டு"],["இந்தியா","ஸ்பெக்ட்ர வழக்கு தாவூத் மிரட்டலா சிபிஐ மறுப்பு"],["இந்தியா","யூனியன் கார்பைடு தலைவரை இந்தியா கொண்டு வர நடவடிக்கை"],["உலகம்","ஜப்பான் பேரழிவால் லட்ச கோடி நஷ்ட"],["உலகம்","தூசு புகை மாசு காரணமாக குழந்தைகள் குண்டாகலா"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஜார்கண்ட்டில் பெரியமைக்கு பேர் பரிதாப பலி"],["ஸ்டேட் எக்ஸ்பிரஸ்","கோத்ரா வழக்கில் விடுதலையான பேருக்கு ஐகோர்ட் சமன்"],["ஸ்டேட் எக்ஸ்பிரஸ்","சிறுவன் கொலை வழக்கில் மற்றொரு சிறுவன் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஸ்ரீகிருஷ்ணா அறிக்கை ஐகோர்ட் புது உத்தரவு"],["தொழில்","வாழைத் தண்டு வடக அலேக்"],["விளையாட்டு","காலிறுதியில் பாகிஸ்தானிட உதை சீனியர் வீரர்களால் தோல்வி"],["தமிழகம்","தேர்தல் தினகரன் ஸ்பெஷல் தேர்தல் இணையதள"],["சினிமா(ரீல்மா)","ஏஆர் ரகுமானின் புத்தக ரெடி"],["சினிமா(ரீல்மா)","காதலனுடன் பேச்சு ஷூட்டிங் பாதிப்பு"],["சினிமா(ரீல்மா)","திவ்யாவுக்கு திடீர் தடை"],["சினிமா(ரீல்மா)","சண்டக்கோழி பார்ட் லிங்குசாமி மறுப்பு"],["தலையங்கம்","பண பறிக்க திருமண மோசடி"],["தமிழகம்","மாணவர்களை பிரபால் அடித்த தலைமை ஆசிரியை சஸ்பெண்ட்"],["குற்றம்","பல லட்ச வசூலித்து மோசடி குடுபத்துடன் வாலிபர் கைது"],["தமிழகம்","என்எல்சியில் வது நாளாக சிபிஐ அதிரடி சோதனை"],["மாவட்ட மசாலா","ஊட்டி தாவரவியல் பூங்காவில் வாக்கிங் செல்ல கட்டண"],["மாவட்ட மசாலா","பஸ் டயர் வெடித்ததில் பயணி கால் முறிந்தது"],["மாவட்ட மசாலா","கள்ளத்தொடர்பு அபல மைத்துனியுடன் வாலிபர் தற்கொலை"],["மாவட்ட மசாலா","கிராம மக்கள் தேர்தல் புறக்கணிப்பு"],["குற்றம்","திருமுல்லைவாயலில் கோஷ்டி மோதல் பேர் கைது"],["தமிழகம்","திருவள்ளூர் தொகுதியில் திமுக தேர்தல் அலுவலக திறப்பு"],["தமிழகம்","கத்திவாக்க தொகுதியில் கேபிபிசாமி வாக்கு சேகரிப்பு"],["தமிழகம்","டிராபிக் போலீசுடன் இணைந்து சட்ட ஒழுங்கு போலீசார் பணி"],["தமிழகம்","மைசூரில் இருந்து வருகிறது மை தேர்தல் அதிகாரி"],["தமிழகம்","மதுராந்தக தொகுதி ஒரு பார்வை"],["தமிழகம்","தமிழகத்தில் தேர்தல் களை கட்டுகிறது திருவாில் கருணாநிதி வேட்புமனு தாக்கல்"],["தமிழகம்","தேர்தல் பாதுகாப்புக்கு துணை ராணுவபடையினர் வருகை"],["தமிழகம்","தங்கபாலு உருவ பொமை எரிப்பு சத்தியமூர்த்தி பவனில் பரபரப்பு"],["தமிழகம்","ஜெயலலிதாவின் அறிவிப்புகள் மக்களிட எடுபடாது கருணாநிதி"],["தமிழகம்","மணலி பெட்ரோ கெமிக்கல் கழிவுநீர் கடலில் விடுவதை எதிர்த்து வழக்கு"],["தமிழகம்","மாத கிலோ அரிசி இலவச அதிமுக"],["தமிழகம்","கந்தர்வகோட்டையில் இன்று பிரசார துவக்குகிறார் ஸ்டாலின்"],["தமிழகம்","சேப்பாக்க திமுக வேட்பாளரை ஆதரித்து மத்திய அமைச்சர் தயாநிதிமாறன் பிரசார"],["தமிழகம்","களத்தை கலக்கப் போகு வேட்பாளர்கள்"],["தமிழகம்","திமுக அதிமுக மோதல் கல்வீச்சில் இன்ஸ்பெக்டர் காய"],["தமிழகம்","பல்லாவரத்தில் நள்ளிரவில் நிலக்கரி ஏற்றி வந்த லாரி சாலையில் கவிழ்ந்தது"],["தமிழகம்","சோனியா காந்தியின் முடிவை கட்சியினர் ஏற்க வேண்டு தங்கபாலு"],["விளையாட்டு","திக் திக் ஆட்டத்தில் சாபியனை வீழ்த்தியது இந்தியா"],["இந்தியா","எடியூரப்பாவுக்கு மீண்டு சிக்கல் அமைச்சரவை கூட்டத்தை அமைச்சர்கள் புறக்கணிப்பு"],["இந்தியா","மேலு உதவ தயார் ஜப்பான் பிரதமருடன் மன்மோகன் சிங் பேச்சு"],["தமிழகம்","கடைசி ஏழை இருக்கு வரை இலவச திட்டங்கள் தொடரு முதல்வர்"],["உலகம்","ஈபிள் டவருக்கு வெடிகுண்டு மிரட்டல்"],["உலகம்","லாஸ் ஏஞ்சல்ஸ் மயானத்தில் எலிசபெத் உடல் அடக்க"],["தமிழகம்","தென்மாவட்ட தலைநகரங்களில் திமுக அதிமுக நேரடி போட்டியில்லை"],["தமிழகம்","மன்னர் வேடத்தில் வந்து சுயேச்சை மனு தாக்கல்"],["தமிழகம்","விமான நிலையத்தில் கிலோ தங்க சிக்கியது தேர்தல் அதிரடி வேட்டை"],["தமிழகம்","தூத்துக்குடி தொகுதி அதிமுக வேட்பாளர் வது முறையாக மாற்ற"],["இந்தியா","ரயிலில் வந்து முபைக்குள் ஊடுருவ தீவிரவாதிகள் முயற்சி"],["இந்தியா","சட்டசபையில் அமளி திரிணாமுல் காங்கிரஸ் எஎல்ஏக்கள் சஸ்பெண்ட்"],["தமிழகம்","அதிமுக தேர்தல் அறிக்கை மக்களிட எடுபடாது முதல்வர்"],["தமிழகம்","திமுக தேர்தல் அறிக்கையை ஜெயலலிதா காப்பி அடித்துள்ளார் தயாநிதி மாறன்"],["தமிழகம்","தேர்தலில் வாக்காளர் அச்சமின்றி வாக்களிக்க நடவடிக்கை டிஜிபி"],["தமிழகம்","நல்லாட்சி தொடர திமுக கூட்டணியை ஆதரியுங்கள் முகஸ்டாலின்"],["தமிழகம்","ஜெயலலிதாவுடன் பிரசாரமா எது நடக்கணுமோ அதுதான் நடக்கு"],["தமிழகம்","மதிமுகவை கழற்றி விட்டது ஏன் வைகோ"],["இந்தியா","நாடாளுமன்ற சட்டசபையில் முஸ்லிகளுக்கு இடஒதுக்கீடு முலாய"],["தமிழகம்","ஏழைகளுக்காக எதையு செய்வேன் தஞ்சை பிரசார கூட்டத்தில் முதல்வர் கருணாநிதி பேச்சு"],["விளையாட்டு","யுவராஜ்சிங் அசத்தல் ஆஸியை விரட்டியது இந்தியா"],["விளையாட்டு","இந்தியா கோப்பை வெல்லு பிரதமர் நபிக்கை"],["விளையாட்டு","யுவிக்கு டோனி புகழார"],["விளையாட்டு","சிதைந்துவிட்டேன் பான்டிங் குமுறல்"],["விளையாட்டு","மிர்பூரில் இன்று மோதல் தென் ஆப்ரிக்க சுழலை சமாளிக்குமா நியூசி"],["விளையாட்டு","காயத்தால் தவிக்கு இங்கிலாந்து"],["விளையாட்டு","காலிங்வுட்டிற்கு ஆபரேஷன்"],["விளையாட்டு","இந்தியா பாக் தேதி அரையிறுதியில் மோதல்"],["விளையாட்டு","தோல் பந்து வேண்டா"],["தமிழகம்","ஜெ ஆட்சிக்கு வரமாட்டார் தங்கமு தரமாட்டார் முகஅழகிரி"],["தலையங்கம்","துப்பாக்கியு போதை போலீசு"],["தமிழகம்","ரயில் மோதி கர்ப்பிணி சாவு வயிற்றில் இருந்த சிசு தப்பியது"],["குற்றம்","பஸ்சில் இருக்கை கொடுத்து பெண்ணிட தாலி அபேஸ்"],["குற்றம்","சிறுமிக்கு திருமண பெற்றோர் மீது வழக்கு"],["மாவட்ட மசாலா","வேட்பாளர்களை மாற்ற குமரி காங்கிரசார் போர்க்கொடி"],["மாவட்ட மசாலா","ரோபோட்டிக்ஸ் ஆராய்ச்சி கோவை மாணவி தேர்வு"],["மாவட்ட மசாலா","பறக்கு படை சோதனையில் லட்ச நகை சிக்கியது"],["மாவட்ட மசாலா","டிராக்டர் மீது லாரி மோதி இரண்டு பேர் பலி"],["உலகம்","மியான்மரில் பூகப பேர் பலி"],["தமிழகம்","திமுக கூட்டணியின் வெற்றிக்கு கடுமையாக உழைக்க வேண்டு அமைச்சர் அன்பரசன்"],["தமிழகம்","வாஷிங் மெஷின் பிரிட்ஜூ வழங்குவோ ஸ்டாலின்"],["தமிழகம்","பார்வையாளராக இருக்கவே விருபுகிறேன் டிராஜேந்தர்"],["தமிழகம்","நல்ல நேர முடிஞ்சிடு வெத்து படிவத்தை வாங்குங்க தேமுதிக வேட்பாளர்"],["தமிழகம்","தமிழக சட்டசபை தேர்தலுக்கான வேட்புமனு தாக்கல் நாளை முடிகிறது"],["ஸ்டேட் எக்ஸ்பிரஸ்","கலப்பு ஜோடிகளை பாதுகாக்க பஞ்சாப் அரசு புது திட்ட"],["ஸ்டேட் எக்ஸ்பிரஸ்","கோவா கடற்கரை பகுதிகளில் வெளிநாட்டினர் மர்ம சாவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","பெண் குழந்தைகளை கங்கையில் வீசி கொன்ற தந்தை"],["ஸ்டேட் எக்ஸ்பிரஸ்","எஎல்ஏ மகன் கொலை வழக்கில் சிறை கண்காணிப்பாளர் கைது"],["தமிழகம்","தங்கபாலு வீட்டை காங்கிரசார் முற்றுகை பெண் தீக்குளிக்க முயன்றார்"],["இந்தியா","காமன்வெல்த் ஊழல் விவகார மக்களவையில் பாஜ வெளிநடப்பு"],["குற்றம்","மாங்காட்டில் கர்ப்பிணி தற்கொலை கணவர் மாமியார் கைது"],["தமிழகம்","துபாயில் இருந்து விமானத்தில் கொண்டு வந்த உடல் மாய சாலையோர சவப்பெட்டி"],["குற்றம்","ஆவடியில் பெயின்டர் அடித்து கொலையா ரோட்டில் உடல் வீச்சு"],["தமிழகம்","தேர்தல் கமிஷன் குளறுபடி துப்புரவு தொழிலாளிக்கு ஆபீசர் டூட்டி"],["தமிழகம்","போட்டோ பூத் சிலிப் தயாரிப்பு பணி தீவிர ஏப் முதல் வாக்காளர்களுக்கு வினியோக"],["தமிழகம்","மதிமுகவினர் ஓட்டு யாருக்கு மாவட்ட வாரியாக சென்று வைகோ ரகசிய ஆலோசனை"],["தமிழகம்","தொகுதிகள் ஒரு பார்வை சோழிங்க நல்லூர்"],["தமிழகம்","தொகுதிகள் ஒரு பார்வை திருத்தணி"],["தமிழகம்","விடுதலை சிறுத்தைக்கு மெழுகுவர்த்தி சின்ன"],["தமிழகம்","திமுக அமைத்தது கூட்டணி அதிமுக வெறு சீட்டணி குஷ்பு"],["இந்தியா","நாடாளுமன்றத்தில் பசிதபரத்தை கண்டித்து சமாஜ்வாடி பாஜ அமளி"],["தமிழகம்","இதுவரை பேர் வேட்புமனு மனு தாக்கல் இன்று முடிகிறது"],["தமிழகம்","தமிழின வளமுடன் வாழ திமுகவை ஆதரியுங்கள் முதல்வர்"],["உலகம்","மியான்மர் பூகபத்தில் பேர் பரிதாப பலி"],["தமிழகம்","சுயமாக சிந்திக்காமல் வந்தது அதிமுக தேர்தல் அறிக்கை பாக்யராஜ்"],["உலகம்","ஆப்பிள் நிறுவன ஐபேட் உலக முழுது அறிமுக"],["தமிழகம்","தலைமை தேர்தல் அதிகாரி பதில் இலவசங்களை தடுக்க முடியாது"],["தமிழகம்","கருணாநிதியின் தேர்தல் அறிக்கையை ஜெராக்ஸ் காப்பி எடுத்த ஜெயலலிதா முகஸ்டாலின்"],["தமிழகம்","ஜெயலலிதா முதல்வர் ஆவார் என்று நான் சொன்னதில்லை வைகோ"],["தமிழகம்","நெய்யாறு பிரச்னை குறித்து பேசியதால் மார்க்சிஸ்ட் எஎல்ஏக்கு சீட் மறுப்பு"],["தமிழகம்","போராட்ட நடத்துபவர்கள் கூலிப்படை சமூக விரோதிகள் தங்கபாலு"],["தமிழகம்","வைகோ பிரிந்து சென்றது வருத்த அளிக்கிறது நல்லகண்ணு"],["தமிழகம்","திமுக தேர்தல் அறிக்கை சூப்பர் டூப்பர் ஹிட்டாகு குஷ்பு"],["தமிழகம்","பொள்ளாச்சியில் மதிமுக நிர்வாகி காலில் விழுந்த பாஜ வேட்பாளர்"],["இந்தியா","கேரளாவில் காங் கூட்டணிக்கு திமுக ஆதரவு"],["இந்தியா","அசாமுக்கு லட்சத்துடன் சென்ற திரிணாமுல் காங்கிரஸ் எபி"],["தமிழகம்","தேர்தல் கமிஷன் அறிவிப்பு தேமுதிகவுக்கு முரசு சின்ன"],["இந்தியா","அதிகாலையில் வாக்கிங் சென்ற பெண் ஐஜியை பலாத்கார செய்ய முயற்சி"],["விளையாட்டு","சைலன்டா வந்தாங்க பாகிஸ்தான் வீரர்கள்"],["விளையாட்டு","நியூசிலாந்துடன் மோதுவது யார் இலங்கை இங்கி பலப்பரீட்சை"],["விளையாட்டு","செகண்டுக்கு லட்ச"],["விளையாட்டு","கோட்டைவிட்ட சச்சின்"],["விளையாட்டு","இந்தியா ஜெயிக்கு புக்கிகள் கணிப்பு"],["விளையாட்டு","ாய் டிக்கெட் ஆயிரத்துக்கு விற்பனை"],["விளையாட்டு","நெருக்கடி இந்தியாவுக்கு தான்"],["விளையாட்டு","பைனலில் மாற்றமில்லை"],["ஸ்டேட் எக்ஸ்பிரஸ்","அரியானா முதல்வர் உறுதி ஜாட் போராட்ட வாபஸ்"],["ஸ்டேட் எக்ஸ்பிரஸ்","தெலங்கானா போராட்ட மாணவர்கள் மீது வழக்குகள்"],["ஸ்டேட் எக்ஸ்பிரஸ்","ராணுவ நிலங்களை ஒப்படைக்க மேகாலயா முதல்வர் கோரிக்கை"],["ஸ்டேட் எக்ஸ்பிரஸ்","பசிதபர கருத்துக்கு நிதிஷ்குமார் கண்டன"],["மாவட்ட மசாலா","மலர் உற்பத்தியில் தமிழக முதலிட"],["மாவட்ட மசாலா","சர்ச்சில் மாதா சிலையை சேதப்படுத்தியவர் கைது"],["மாவட்ட மசாலா","விவசாயி கொலை வழக்கில் தாய் மகனுக்கு ஆயுள்"],["தமிழகம்","சென்னை திருவள்ளுரில் தாபா நாள் பிரசார"],["தமிழகம்","தமிழ் உணர்வு உள்ளவர்கள் ஆட்சிக்கு வருவதை தடுக்க சதி கருணாநிதி"],["குற்றம்","மூதாட்டிக்கு மயக்க மருந்து கொடுத்து சவரன் நகை பண கொள்ளை"],["குற்றம்","பெயின்டர் கொலையில் துப்பு துலங்கியது இருபு பைப்பால் அடித்த பிளபர் கைது"],["தமிழகம்","தொட்டியத்தில் சூறைக்காற்று லட்ச வாழைகள் நாச"],["தமிழகம்","திருச்சியில் திரண்டது மக்கள் வெள்ள தமிழர்கள் ஏமாற மாட்டார்கள் கருணாநிதி"],["தமிழகம்","தொகுதி ஒரு பார்வை குமிடிப்பூண்டி"],["தமிழகம்","சோர்ந்து கிடந்த தேர்தல் கள தலைவர்கள் வருகையால் கலகலப்பு"],["தமிழகம்","கொடுப்பது கருணாநிதி கெடுப்பது ஜெயலலிதா குமரிமுத்து"],["இந்தியா","கேரளாவில் காங்கிரசுக்கு ஆதரவாக காமெடி நடிகர் ஜெகதீஷ் பிரசார"],["தமிழகம்","நிறைவேற்ற முடியாததை அள்ளி வீசுகிறார் ஜெ முகஸ்டாலின்"],["தமிழகம்","நலத் திட்டங்கள் தொடர திமுகவுக்கு வாக்களியுங்கள் கஅன்பழகன்"],["தமிழகம்","பேர் வேட்புமனு தாக்கல் நாளை பரிசீலனை"],["விளையாட்டு","அரை இறுதியில் வெளியேறியது இங்கிலாந்து"],["தமிழகம்","கருணாநிதி சூறாவளி பிரசார வது கட்டமாக நாள் சுற்றுப்பயண"],["இந்தியா","தேவைக்கு மட்டு இந்துத்வா அருண் ஜெட்லி ஒப்புதல் விக்கிலீக்ஸ் பரபரப்பு தகவல்"],["விளையாட்டு","மொகாலியில் டோனி அன்கோ"],["விளையாட்டு","முதல் முறையாக அரையிறுதியில் ஆசிய அணிகள்"],["விளையாட்டு","சச்சின் என்ன யாரையு விளாசவிட மாட்டோ அப்ரிடி"],["வேலைவாய்ப்பு","ரயில்வே பாதுகாப்பு படையில் கான்ஸ்டபிள் வேலை"],["வேலைவாய்ப்பு","யுபிஎஸ்சி நடத்து ஐஎப்எஸ் தேர்வுகள்"],["வேலைவாய்ப்பு","எஸ்எஸ்சி நடத்து பட்டதாரிகளுக்கான தேர்வு"],["வேலைவாய்ப்பு","கடற்படையில் சப்லெப்டினன்ட் பதவி"],["வேலைவாய்ப்பு","இஸ்ரோவில் டெக்னீஷியன் வேலை ஐடிஐ முடித்தவர்கள் விண்ணப்பிக்கலா"],["குற்றம்","ஏடிஎ கார்டை அபேஸ் செய்து லட்ச மோசடி செக்யூரிட்டி கைது"],["மாவட்ட மசாலா","உப்பு கரைசல் ரெடி ஒரு பூத்துக்கு பாக்கெட்"],["மாவட்ட மசாலா","லாரி மீது கார் மோதி பேர் நசுங்கி பலி"],["தமிழகம்","செங்கல்பட்டில் பரிதாப பஸ் கண்ணாடி துண்டு கழுத்தில் குத்தி பெண் பலி"],["இந்தியா","செமி பைனலை பார்க்க இந்தியா வருகிறார் கிலானி"],["ஸ்டேட் எக்ஸ்பிரஸ்","சாக்கடையில் வீசி குழந்தையை கொன்ற தந்தை"],["ஸ்டேட் எக்ஸ்பிரஸ்","திருப்பதியில் மாந்தோப்பை துவச செய்த யானைகள்"],["தமிழகம்","வாக்கு சாவடிகளுக்கு கூடுதல் போலீஸ் பாதுகாப்பு"],["தமிழகம்","தமிழக புதுச்சேரியில் மையங்களில் பத்தா வகுப்பு தேர்வு இன்று தொடங்குகிறது"],["தமிழகம்","தொகுதிகளில் பேர் மனு வேட்பு மனுக்கள் இன்று பரிசீலனை"],["தமிழகம்","சூடுபிடிக்கிறது பிரசார தேர்தலுக்கு இன்னு நாட்கள் தொகுதிகளில் தலைவர்கள் முற்றுகை"],["உலகம்","இந்தியா பாகிஸ்தான் கிரிக்கெட் போட்டியை பார்க்க மொகாலி வருகிறார் கிலானி"],["விளையாட்டு","டாசில் தோற்றவுடன் சற்று பயந்தேன் இலங்கை கேப்டன் சங்கக்கரா"],["தமிழகம்","தொகுதிகளில் தலைவர்கள் முற்றுகை சூடுபிடிக்கிறது பிரசார"],["விளையாட்டு","இந்தியாவை வீழ்த்துவோ அப்ரிடி"],["இந்தியா","ரயில்வே சாதனைகள் பற்றி நேருக்கு நேர் வாதாட தயாரா புத்ததேவுக்கு மதா சவால்"],["விளையாட்டு","சச்சினுக்கு என்ற எண்ணுக்கு உள்ளதொடர்பு"],["தமிழகம்","கடந்த ஐந்தாண்டுகளில் திமுக அரசு செய்த சாதனைகள் முதல்வர்"],["தமிழகம்","கடந்த தேர்தலுடன் ஒப்பிடுபோது பேர் கூடுதலாக வேட்புமனு தாக்கல்"],["தமிழகம்","திருமண நிதி உதவி திட்டத்தை நிறுத்தியவர் ஜெயலலிதா முகஸ்டாலின்"],["தமிழகம்","என்ஆர்காங் அதிமுக கூட்டணியில் இந்திய கயூ தேமுதிகவுக்கு தலா ஒரு தொகுதி ஒதுக்கீடு"],["தமிழகம்","தேர்தல் அறிக்கை என்ற பெயரில் ஜெயலலிதா புருடா விட்டுள்ளார் முகஸ்டாலின்"],["தமிழகம்","கண்ணியத்தையு கட்டுப்பாட்டையு காத்திட வேண்டு முதல்வர்"],["தமிழகம்","வேட்பாளர் டீ குடிப்பது கூட வீடியோவில் பதிவாகு தேர்தல் கமிஷன்"],["தமிழகம்","நெல்லை தூத்துக்குடி குமரியில் நக்சலைட்கள் ஊடுருவலா"],["தமிழகம்","காங் தேர்தல் அறிக்கை நாட்களில் வெளியீடு தங்கபாலு"],["தமிழகம்","அதிமுக கூட்டணிக்கு நடிகர் விஜய் ஆதரவு ஜெயலலிதா"],["தமிழகம்","ஆபுலன்ஸ் சோதனை தேர்தல் கமிஷனின் உச்சகட்ட கெடுபிடி ராமதாஸ்"],["தமிழகம்","எல்லா குடுபத்துக்கு மாத கிலோ அரிசி மார்க்சிஸ்ட்"],["இந்தியா","தீவிரவாதிகள் மிரட்டலுக்கு காங்கிரஸ் பயப்படவில்லை திக்விஜய் சிங்"],["இந்தியா","இந்தியரா வங்கதேசத்தவரா சந்தேக குடிமகன் வாக்களிக்க தடை"],["இந்தியா","அசா தேர்தலில் காங்கிரஸ் சொல்வது எல்லாமே பொய் பாஜ"],["தமிழகம்","குடிநீர் பிரச்னையை தீர்க்க புதிய காவிரி திட்ட ஜெயலலிதா"],["விளையாட்டு","இலங்கையிட ஆதிக்க செலுத்துமா நியூசிலாந்து"],["விளையாட்டு","இறுதியில் நுழைவது யார் நாளை அரையிறுதி போட்டிகள் ஆரப"],["விளையாட்டு","தன்னபிக்கை உள்ளது ஜான்ரைட்"],["விளையாட்டு","முதலில் பேட் செய்தால் வெற்றி வாய்ப்பு அதிக"],["விளையாட்டு","ஆசிய அணிகள் இறுதியில் மோத வேண்டு சங்ககரா"],["தலையங்கம்","சிறப்பான சேவை அளிக்க முடியு"],["குற்றம்","அதிமுகவில் சீட் கேட்ட இளபெண் தீக்குளித்து பலி"],["தமிழகம்","போலீஸ் ரெய்டில் பண பறிமுதல் எஎல்ஏ தலைமையில் ஸ்டேஷன் முற்றுகை"],["மாவட்ட மசாலா","மன வளக்கலை பயிற்சி மைய கிராமங்களில் துவங்க முடிவு"],["மாவட்ட மசாலா","சுற்றுலா கார் மோதி வாலிபர்கள் பலி"],["குற்றம்","திருப்பதியில் லட்டு டோக்கன் விற்பனையில் முறைகேடு கண்காணிப்பாளர் கைது"],["இந்தியா","ஆந்திர எஎல்ஏவுக்கு அமைச்சர் பளார் சட்டசபையில் பரபரப்பு"],["குற்றம்","தடுப்புச்சுவரை உடைத்துக் கொண்டு அடி பள்ளத்தில் வேன் பாய்ந்தது"],["தமிழகம்","தேர்தல் விதி மீறல் திருவள்ளூர் மாவட்டத்தில் வழக்குகள் பதிவு"],["தமிழகம்","மின் இணைப்பு பட்டா வழங்காததால் தேர்தலை புறக்கணிப்பதாக அறிவித்து வது நாளாக மக்கள் போராட்ட"],["தமிழகம்","மாதவர தொகுதி ஒரு பார்வை"],["தமிழகம்","திருவள்ளூர் மாவட்ட புதிய நீதிக்கட்சி கூட்ட திமுகவுக்கு ஆதரவு தீர்மான"],["தமிழகம்","குமரியில் ஸ்டாலின் இன்று பிரசார இடங்களில் பேசுகிறார்"],["தமிழகம்","திமுக கூட்டணியின் வெற்றி தொடரு ஜிகேவாசன்"],["தமிழகம்","அமராவதி ஆற்றில் புதிய பால கில் ஜெயலலிதா வாக்குறுதி"],["இந்தியா","இடதுசாரிகளுடன் பாஜ ரகசிய கூட்டு உமன்சாண்டி"],["தமிழகம்","தேர்தல் பணியில் ஈடுபடு ஆசிரியர்கள் அரசு ஊழியர்கள் ஏப் ல் தபால் ஓட்டு போடலா"],["தமிழகம்","அதிமுக அணியில் நீடித்தால் விஜயகாந்தை யாரு காப்பாற்ற முடியாது நடிகர் பாக்யராஜ்"],["தமிழகம்","தேர்தல் கமிஷன் கெடுபிடி போச்சபள்ளி சந்தையில் ஆடுகள் விற்பனை டல்"],["விளையாட்டு","நாளை அரையிறுதி போட்டிகள் ஆரப இறுதியில் நுழைவது யார்"],["விளையாட்டு","முதல் அரையிறுதியில் மோதல் இலங்கையிட ஆதிக்க செலுத்துமா நியூசிலாந்து"],["விளையாட்டு","தன்னபிக்கை உள்ளது சொல்கிறார் ஜான்ரைட்"],["விளையாட்டு","இந்தியா பாகிஸ்தான் மோதல் மொகாலியில் ரன்குவிக்கலா"],["விளையாட்டு","சவுதி சூப்பர் டொனால்டு"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆயிர கிராமங்களுக்கு மின் வசதி இல்லை"],["ஸ்டேட் எக்ஸ்பிரஸ்","புதிய கட்சி தொடங்கினார் பஞ்சாப் முதல்வர் மருமகன்"],["ஸ்டேட் எக்ஸ்பிரஸ்","பேராசிரியர் கை துண்டித்த வழக்கு என்ஐஏ விசாரணைக்கு மாற்ற"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஒரிசா சட்டசபையில் அரிஜன் வார்த்தைக்கு தடை"],["உலகம்","கடாபி சொந்த ஊரில் நேட்டோ படை குண்டு வீச்சு"],["தமிழகம்","திமுக ஆட்சியில் சினிமா துறைக்கு ஏராளமான சலுகைகள் முதல்வர்"],["இந்தியா","கடற்கொள்ளையர்கள் கைது பாக் ஈரான் மாலுமிகள் மீட்பு"],["தமிழகம்","தங்கபாலு மனைவி ஜெயந்தி மனு டிஸ்மிஸ் மயிலாப்பூர் தொகுதியில் திடீர் பரபரப்பு"],["தமிழகம்","போலீஸ் அதிகாரிகள் இடமாற்ற விவகார தேர்தல் கமிஷனுக்கு ஐகோர்ட் உத்தரவு"],["தமிழகம்","ஸ்டாலின் தொகுதியில் வடிவேலு இன்று பிரசார"],["தமிழகம்","மதுரையில் முதன்முறையாக துணை ராணுவ தகவல் மைய"],["தமிழகம்","மனுக்கள் மீதான பரிசீலனை தொடங்கியது நாளை மறுநாள் இறுதிபட்டியல்"],["வேலைவாய்ப்பு","போட்டித் தேர்வுக்கு தயாராகுங்கள்"],["வேலைவாய்ப்பு","கடற்படையில் சப்லெப்டினன்ட் பதவி"],["வேலைவாய்ப்பு","இஸ்ரோவில் டெக்னீஷியன் வேலை ஐடிஐ முடித்தவர்கள் விண்ணப்பிக்கலா"],["வேலைவாய்ப்பு","ரயில்வே பாதுகாப்பு படையில் கான்ஸ்டபிள் வேலை தமிழில் தேர்வு எழுதலா"],["தமிழகம்","கருணாநிதி ஜெயலலிதா ஸ்டாலின் விஜயகாந்த் உட்பட தலைவர்கள் மனுக்கள் ஏற்பு"],["உலகம்","கடாபி சொந்த ஊர் மீது தாக்குதல் லிபிய ராணுவ மையங்கள் மீது அமெரிக்க படை குண்டு வீச்சு"],["உலகம்","அமெரிக்காவில் ஒபாமா செல்வாக்கு குறைகிறது"],["விளையாட்டு","முதலாவது அரை இறுதி இலங்கை நியூசிலாந்து இன்று பலப்பரீட்சை"],["இந்தியா","இந்திய பாகிஸ்தான் உள்துறை செயலாளர்கள் சந்தித்து பேச்சு"],["இந்தியா","இந்தியாவில் புலிகள் எண்ணிக்கை ஆக அதிகரிப்பு"],["இந்தியா","ஹெலிகாப்டர் பயண செலவு வேட்பாளர் கணக்கில் வராது தேர்தல் ஆணைய"],["இந்தியா","மாஜி சிபிஐ அதிகாரி திரிணாமுல் வேட்பாளர் செலவை தொகுதி மக்களே ஏற்பு"],["தமிழகம்","அதிமுக கூட்டணி வேட்பாளர்களுக்கு புதுக்கோட்டையில் ஜெ பிரசார"],["தமிழகம்","கிருஷ்ணகிரி கயூ செயலாளர் நீக்க தாபாண்டியன்"],["தமிழகம்","மாற்றுதிறனாளிகள் என பெயர் சூட்டிய கருணாநிதியை மீண்டு முதல்வராக்க வேண்டு பசிதபர"],["தமிழகம்","முதல்வரின் கட்ட பிரசார கோவையில் நாளை துவக்க"],["தமிழகம்","தென்மாவட்டங்களில் திமுக கூட்டணி வெற்றி உறுதி முகஅழகிரி"],["தமிழகம்","மக்கள் நலத் திட்டங்கள் தொடர திமுகவை வெற்றி பெற செய்யுங்கள் முகஸ்டாலின்"],["தமிழகம்","தொகுதிகளிலு திமுக கூட்டணிக்கு வெற்றி அலை திருமாவளவன்"],["தமிழகம்","தேர்தலுக்குள் கட்டமாக செலவு கணக்கு தாக்கல் தேர்தல் ஆணைய"],["தமிழகம்","குறிப்பிட்ட எண்ணிக்கையில் போட்டியிடு கட்சிகளுக்கு மட்டுமே தனி சின்ன ஒதுக்கீடு"],["விளையாட்டு","நாளை அரையிறுதி ஆட்ட இந்தியா பாக் பலப்பரீட்சை"],["விளையாட்டு","விஐபிக்கள் வருவதால் களைகட்டியது என்எஸ்ஜி கமாண்டோ கட்டுப்பாட்டில் மொகாலி"],["விளையாட்டு","இலங்கையுடன் அரையிறுதியில் இன்று மோதல் கனவை நனவாக்கு முனைப்பில் நியூசி"],["விளையாட்டு","கேப்டன் பதவிக்கு பான்டிங் குட்பை"],["விளையாட்டு","சோனியா வருகை"],["விளையாட்டு","ஆயிர கோடி சூதாட்ட ஜ்"],["தமிழகம்","பெரியாறு குறித்த ஆதாரங்கள் நாளில் தாக்கல் செய்ய தமிழக கேரளாவுக்கு உத்தரவு"],["தமிழகம்","யானை நடமாடு பகுதியில் தேயிலை சாகுபடி கைவிட முடிவு"],["குற்றம்","சிகிச்சை பெற வேனில் சென்ற மனைவி உறவுப்பெண் சாவு"],["குற்றம்","அதிகாரிக்கு செக்ஸ் டார்ச்சர் சென்னை ஆடிட்டர் கைது"],["மாவட்ட மசாலா","கிணற்றில் தவறி விழுந்த குட்டி யானை சாவு"],["மாவட்ட மசாலா","எஸ்ஐ மீது தாக்குதல் ராணுவ வீரர் கைது"],["மாவட்ட மசாலா","சேவல் சண்டை சூதாட்ட பேர் பிடிபட்டனர்"],["குற்றம்","சினிமா ஸ்டன்ட் பயிற்சியாளர் வீட்டில் பவுன் கொள்ளை"],["தமிழகம்","தமிழகத்தில் கருணாநிதி அலை நிதியமைச்சர் அன்பழகன்"],["தமிழகம்","அதிமுக தேமுதிக கூட்டணி பற்றி ஹனிமூன் கதை சொல்லி பாக்யராஜ் பிரசார"],["தமிழகம்","தற்கொலை மிரட்டல் வேட்பாளர் மனு ஏற்பு"],["தமிழகம்","அதிமுகவுக்கு ஆதரவாக தேர்தல் கமிஷன் செயல்படுகிறது முக அழகிரி"],["தமிழகம்","அறிக்கையை காப்பியடித்த ஜெஆட்சிக்கு வர முடியாது குஷ்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","கிரிக்கெட் போட்டிக்காக மபி சட்டசபைக்கு லீவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","ரயில் விபத்தில் இறந்தவர் உடல் மாதத்துக்கு பிறகு ஒப்படைப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஹசன்அலி கூட்டாளிக்கு ஆயிர கோடி அபராத"],["உலகம்","கடாபியின் சொந்த ஊரை கைப்பற்ற போராட்டக்காரர்கள் முயற்சி"],["உலகம்","ஆப்கனில் மனித குண்டு தாக்குதல் பேர் பலி"],["உலகம்","எகிப்து மாஜி அதிபருக்கு வீட்டுக் காவல்"],["தமிழகம்","வகுப்பு மெட்ரிக் தேர்வில் தவறான கேள்வியால் குழப்ப"],["தமிழகம்","மகிளா காங்கிரஸ் உறுப்பினர் தீக்குளிக்க முயன்றதால் பரபரப்பு"],["தமிழகம்","தூத்துக்குடி வெடி விபத்தில் பலி எண்ணிக்கை ஆனது"],["இந்தியா","வயதில் புத்தக ஆசிரியர் தயாரிப்பாளர் மகள் அசத்தல்"],["தமிழகம்","இறுதி வேட்பாளர் பட்டியல் மாலையில் வெளியாகு"],["தமிழகம்","லண்டன் விமானத்தில் இன்ஜின் பழுது பயணிகள் தப்பினர்"],["குற்றம்","கிரைண்டர் கல்லால் அடித்து மனைவி மகள் படுகொலை"],["தமிழகம்","அதிமுக இலவச திட்ட தாபாண்டியன் அதிருப்தி"],["தமிழகம்","ல் எஸ்பி அனுப்பியதாக வந்த போலீசார் வீட்டுக்குள் அத்துமீறி நுழைந்து மிரட்டினர்"],["தமிழகம்","பிளஸ் கணக்கு பேப்பர் திருத்துவதற்கான கீ புத்தகத்தில் குழப்ப"],["விளையாட்டு","மொகாலியில் இன்று கிரிக்கெட் போர் பைனலுக்கு முன்னேறப் போவது யார்"],["விளையாட்டு","இறுதி போட்டிக்கு இலங்கை தகுதி"],["தமிழகம்","பணத்தால் ஜெயிக்க அதிமுக திட்ட முதல்வர் கருணாநிதி பரபரப்பு குற்றச்சாட்டு"],["இந்தியா","ஜவுளி துறை நவீனமயத்துக்கு கோடி கூடுதல் நிதி மத்திய அரசு"],["இந்தியா","அடுத்த நிதி ஆண்டு அமல் மாததோறு பிஎப் ஸ்டேட்மென்ட்"],["இந்தியா","எடியூரப்பா நில மோசடி விசாரணைக்கு தடை விதித்தது ஐகோர்ட்"],["இந்தியா","காங்கிரசுக்கு ஆதரவான மாநில அசா அதனால் வது முறையாக ஆட்சியை பிடிப்போ பிரணாப் முகர்ஜி"],["இந்தியா","கேரளாவில் காங்கிரசில் பண வாங்கிக் கொண்டு சீட்"],["இந்தியா","பெரிய கட்சிகளை பார்க்காதீர் அசாமில் பிருந்தா கரத் பிரசார"],["விளையாட்டு","மொகாலியில் இன்று கிரிக்கெட் போர் பைனலுக்கு முன்னேறப் போவது யார்"],["இந்தியா","வேட்பாளரை கண்காணிக்க ராகுல் அனுப்பிய ரகசிய படை"],["இந்தியா","அசாமில் இந்த முறை பாஜ அரசு அமையு சுஷ்மா நபிக்கை"],["தமிழகம்","கோடநாட்டில் வழி விடாத ஜெயலலிதா எப்படி நல்வழி காட்டுவார் குஷ்பு"],["தமிழகம்","காங்கிரஸ் தேர்தல் பணிக்குழு நியமன தங்கபாலு"],["தமிழகம்","கருவறை முதல் கல்லறை வரை உதவி செய்பவர் கருணாநிதி ஸ்ரீதர் வாண்டையார்"],["தமிழகம்","அதிமுக கூட்டணியை ஆதரித்து நாகையில் ஜெயலலிதா பிரசார"],["தமிழகம்","தேர்தல் பிரசாரத்துக்கு நெல்லையை முற்றுகையிடு நடிகர் பட்டாள"],["தமிழகம்","அடித்தட்டு மக்களுக்கு பாடுபடு திமுக அரசு முதல்வர்"],["தமிழகம்","கோவை பொதுக்கூட்டத்தில் இன்று கருணாநிதி உரை"],["தமிழகம்","சோதனைக்கு பிறகே அனுமதிக்க ஆபுலன்ஸ்களுக்கு சுற்றறிக்கை"],["தமிழகம்","ஏப்ரல் ல் சோனியா திமுக காங் கூட்டணியை ஆதரித்து பிரசார"],["தமிழகம்","தேர்தல் வாக்குறுதிகளை நிறைவேற்றியவர் கருணாநிதி முகஸ்டாலின்"],["தமிழகம்","பத்தா வகுப்பு விடைத்தாள் திருத்து பணி ஏப்ரல் ல் துவக்க"],["தமிழகம்","வாக்காளர்களிட பீதி ஏற்படுத்து டிஜிபி போலாநாத் மீது நடவடிக்கை"],["உலகம்","இந்திய ராணுவ ஹெலிகாப்டரில் கிலானி வருகை"],["தலையங்கம்","சந்தேகத்தால் பலியான குடுப"],["தமிழகம்","பொள்ளாச்சி அருகே மெகா சேவல் சண்டை பேர் பிடிபட்டனர்"],["மாவட்ட மசாலா","சிறுத்தைக்கு கண்ணி பேருக்கு அபராத"],["மாவட்ட மசாலா","கிலோ தக்காளி பைசா விவசாயிகள் வேதனை"],["மாவட்ட மசாலா","தஞ்சையில் ஒரே தெருவில் வீடுகளில் கொள்ளை"],["விளையாட்டு","மொகாலி மைதானத்தில் போலீஸ் குவிப்பு"],["தமிழகம்","இறுதி வேட்பாளர் லிஸ்ட் இன்று மாலை அறிவிப்பு"],["தமிழகம்","கட்ட பிரசார கோவையில் கருணாநிதிக்கு உற்சாக வரவேற்பு"],["தமிழகம்","தேர்தல் நெருங்குவதால் சோதனை தீவிர கெடுபிடியால் ஊழியர்கள் பொதுமக்கள் அவதி"],["தமிழகம்","மீண்டு கருணாநிதி முதல்வரானால் தமிழக ஒளிமயமான நாடாகு தங்கபாலு"],["தமிழகம்","ரயில்கள் நிற்காததால் தேர்தலை புறக்கணிக்க கிராமங்கள் முடிவு"],["தமிழகம்","மாமல்லபுர அண்ணாநகரில் தேர்தலை புறக்கணிக்க முடிவு"],["உலகம்","புதன் எப்படி இருக்கு பாருங்க போட்டோ அனுப்பியது மெசஞ்சர்"],["உலகம்","கதிர்வீச்சு சோதனை அமெரிக்காவில் தீவிர"],["உலகம்","மேக்கப் லட்சணத்தை காட்டு மாயாஜால டிஜிட்டல் கண்ணாடி"],["இந்தியா","சிரஞ்சீவிக்கு போட்டியாக சந்திரபாபு நாயுடு பிரசார"],["இந்தியா","மேற்குவங்க தேர்தல் பாஜ கூட்டணியில் சிக்கல் நீடிப்பு"],["குற்றம்","ஹவுஸ் ஓனருடன் டீலிங் போட்ட அழகிகள் புரோக்கர்கள் கைது"],["தமிழகம்","ஆத்தூரில் பிரசாரத்துக்கு எதிர்ப்பு விஜயகாந்தை கண்டித்து வீடுகளில் கறுப்புக்கொடி"],["ஸ்டேட் எக்ஸ்பிரஸ்","எஸ்எஎஸ்சில் பூத் விவரங்கள் தேர்தல் ஆணைய ஏற்பாடு"],["ஸ்டேட் எக்ஸ்பிரஸ்","கூர்க்காலாந்துக்கு ஆதரவாக சிக்கி சட்டசபையில் தீர்மான"],["ஸ்டேட் எக்ஸ்பிரஸ்","பலாத்கார வழக்கில் எஎல்ஏ தேடப்படு குற்றவாளி"],["ஸ்டேட் எக்ஸ்பிரஸ்","சுங்லு கமிட்டி அறிக்கைக்கு டெல்லி முதல்வர் கண்டன"],["தமிழகம்","ஜெயலலிதாவின் வாக்குறுதிகளை தண்ணீரில்தான் எழுத வேண்டு கிவீரமணி"],["தமிழகம்","ஜெயலலிதாவுக்கு கோடநாடு கருணாநிதிக்கு தமிழ்நாடு முகஸ்டாலின்"],["தமிழகம்","இந்தா வெச்சுக்கோ லுங்கி பதறியது பறக்கு படை"],["தமிழகம்","கருணாநிதி மீண்டு முதல்வராக வேண்டு நெப்போலியன்"],["தமிழகம்","திமுக அரசின் சாதனை தேர்தல் அறிக்கையை மக்களிட எடுத்து சொன்னாலே வெற்றி உறுதி முகஅழகிரி"],["கல்வி","மத்திய அரசு ஸ்காலர்ஷிப்புடன் மாத தொழில்நுட்ப படிப்பு"],["கல்வி","இந்திராகாந்தி தேசிய பல்கலையில் எபிஏ கார்ப்பரேட் கவர்னன்ஸ்"],["கல்வி","கடல்சார் படிப்புகளுக்கு மவுசு அதிகரிப்பு"],["விளையாட்டு","வயிறு வலிக்குதுகாய்ச்சல் அடிக்குது தனியார் நிறுவன ஊழியர்கள் எஸ்கேப்"],["விளையாட்டு","டோனி வீட்டுக்கு பாதுகாப்பு"],["விளையாட்டு","ஆஸி அணிக்கு கிளார்க் கேப்டன்"],["விளையாட்டு","இந்தியா பாகிஸ்தான் மோதல் மிரட்டு மழையில் இன்று யுத்த"],["இந்தியா","டாஸில் வென்ற இந்தியா பேட்டிங்"],["தமிழகம்","எஸ்பியை மாற்றக்கோரி திமுக நிர்வாகி மனைவி ஜனாதிபதிக்கு தந்தி"],["தமிழகம்","பண பறிமுதல் வழக்கு தேர்தல் கமிஷன் ஏப் ல் விளக்க அளிக்க உத்தரவு"],["தமிழகம்","ஜெயந்தி தங்கபாலு மனு மாற்றமா விசாரணை அதிகாரி மறுப்பு"],["தமிழகம்","ஜெயலலிதா ஆட்சியில்தான் மணல் கொள்ளை தொடங்கியது இலகணேசன்"],["விளையாட்டு","ரன்னில் பாகிஸ்தானை வீழ்த்தியது பைனலில் இந்தியா"],["தமிழகம்","வேட்புமனுக்கள் வாபஸ் முடிந்தது களத்தில் வேட்பாளர்கள்"],["தமிழகம்","கோவையில் பிரமாண்ட பொதுக்கூட்டத்தில் முதல்வர் மேலு பல சலுகைகள் அறிவிப்பு"],["இந்தியா","மொகாலியில் பாகிஸ்தான் பிரதமருக்கு மன்மோகன் சிங் விருந்து"],["இந்தியா","அதிக வரி செலுத்திய பேரில் அமிதாப் ஷாருக்கான் அக்ஷய்"],["தமிழகம்","வீடுகளில் கறுப்புக் கொடி ஏற்றி அதிமுக வேட்பாளருக்கு எதிர்ப்பு"],["இந்தியா","பாலியல் பலாத்கார வழக்கு இந்தி நடிகர் அகுஜாவுக்கு ஆண்டு கடுங்காவல்"],["தமிழகம்","சுயேச்சைகளுக்கு முரசு சின்னமா தாபாண்டியன் எதிர்ப்பு"],["இந்தியா","காங்கிரசுடன் பிரஜா ராஜ்ஜிய ஏப்ரலில் இணைப்பு நடிகர் சிரஞ்சீவி"],["இந்தியா","ஆந்திராவில் அமைச்சர் பதவியில் இருந்து ஒய்எஸ்ஆர் தபி ராஜினாமா"],["தமிழகம்","ஐபிஎல் கிரிக்கெட் மோசடி வழக்கு லலித் மோடி கூட்டாளியின் முன்ஜாமீன் மனு தள்ளுபடி"],["தமிழகம்","ஓய்வூதியதாரர்களுக்கு அகவிலைப்படி உயர்வு தமிழக அரசு"],["தமிழகம்","திட்டங்களு சாதனைகளு தொடர திமுக ஆட்சி தொடர வேண்டு முக ஸ்டாலின்"],["தமிழகம்","விவசாயக் கடன் கோடி தள்ளுபடி அன்பழகன்"],["தமிழகம்","அதிமுக கூட்டணியை ஆதரித்து விழுப்புரத்தில் ஜெ பிரசார"],["தமிழகம்","பெண்கள் சொந்த காலில் நிற்க நடவடிக்கை எடுத்தவர் கருணாநிதி குஷ்பு"],["தமிழகம்","வாக்குச்சாவடியில் வீடியோ பதிவு தடுத்தால் மறு தேர்தல்"],["தமிழகம்","காங்கிரஸ் வேட்பாளரானார் கணவர் சையத் கியாஸ் ஹசீனா மனு வாபஸ்"],["தமிழகம்","வது சென்சஸ் கணக்கெடுப்பு வெளியீடு இந்திய மக்கள் தொகை கோடியை தாண்டியது"],["தமிழகம்","கப்பல் மோதி விசைப்படகு உடைந்தது நடுக்கடலில் தத்தளித்த மீனவர்கள் மீட்பு"],["குற்றம்","காதலியுடன் தனிக்குடித்தன நடத்திய மகன் வெட்டிக் கொலை"],["மாவட்ட மசாலா","கொத்தடிமையாக இருந்த சிறுவன் அதிரடி மீட்பு"],["மாவட்ட மசாலா","கியூ பிரிவு நடவடிக்கை அகதிகள் முகாகளில் சோதனை"],["மாவட்ட மசாலா","உலக சித்தர் நெறி மாநாடு மதுரையில் நடக்கிறது"],["இந்தியா","அசா சட்டசபை தேர்தல் தேர்தல் பணிக்கு ஹெலிகாப்டர்கள்"],["தமிழகம்","துணை வாக்காளர் பட்டியல் நாளை வெளியீடு"],["தமிழகம்","தொகுதி ஒரு பார்வை செங்கல்பட்டு"],["தமிழகம்","தொகுதி ஒரு பார்வை பூந்தமல்லி தனி"],["தமிழகம்","தேமுதிகவினர் வந்த காரில் ஆயிர பறிமுதல் பறக்கு படை அதிரடி"],["தமிழகம்","விடுதலைசிறுத்தை கட்சிக்கு தொகுதிகளில் மெழுகுவர்த்தி சின்ன"],["தமிழகம்","நல்லாட்சி தந்த திமுக மீண்டு வெல்ல வேண்டு அன்பழகன்"],["தமிழகம்","ஓய்வின்றி உழைக்கணு விழிப்புடன் இருக்கணு முகஅழகிரி"],["விளையாட்டு","கடவுள் தான் கைகொடுத்தார் சச்சின்"],["விளையாட்டு","வில்லன் ஆனார் மிஸ்பா"],["விளையாட்டு","த்ரில் ஆட்டத்தில் பாகிஸ்தானுக்கு ஷாக் கொடுத்தது இந்தியா"],["விளையாட்டு","தில்ஷானை நெருங்கு சச்சின்"],["விளையாட்டு","ஆல் தி பெஸ்ட் இந்தியா அப்ரிடி"],["விளையாட்டு","தவறாக கணித்துவிட்டோ டோனி"],["இந்தியா","பைனலில் இந்தியா நாடு முழுவது ரசிகர்கள் கொண்டாட்ட"],["தமிழகம்","எஜிஆரை புறக்கணிப்பதா ஜெபேரவை செயலாளர் கை விரலை வெட்டினார்"],["ஸ்டேட் எக்ஸ்பிரஸ்","உலக கோப்பை இறுதி போட்டி அமைச்சர்களுக்கு டிக்கெட்"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஜனாதிபதி ஆட்சி வலியுறுத்தி சட்டசபையில் காங்கிரஸ் அமளி"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஜிபிஎஸ் கருவிக்கு எதிர்ப்பு டெல்லியில் ஆட்டோ ஸ்டிரைக்"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆந்திராவில் மின் கட்டண ஆண்டுக்கு பிறகு அதிகரிப்பு"],["தமிழகம்","சோனியா மன்மோகனுடன் பேசி திருப்பூர் சாயக்கழிவு பிரச்னைக்கு நிரந்தர தீர்வு முதல்வர் கருணாநிதி"],["இந்தியா","பாஜ வெற்றி பெற ஒரு வாய்ப்பு தாருங்கள் சுஷ்மா சுவராஜ்"],["தமிழகம்","நெசவாளர்களுக்கு யூனிட் இலவச மின்சார வழங்க நடவடிக்கை ஜிகேவாசன்"],["தமிழகம்","மற்றொரு பண பறிமுதல் வழக்கு தேர்தல் கமிஷன் பதிலளிக்க ஐகோர்ட் உத்தரவு"],["தமிழகம்","கட்சி தலைவர்களுடன் கூட்டு பிரசார செய்ய நேர இல்லை ஜெயலலிதா"],["தமிழகம்","உண்ணாவிரத இருப்பது கட்சி விரோத நடவடிக்கை தங்கபாலு"],["தமிழகம்","அதிக வாகனத்தில் பிரசார பிரேமலதா மீது வழக்கு"],["தமிழகம்","சத்தியமூர்த்தி பவனில் காங் தொண்டர்கள் திடீர் உண்ணாவிரத"],["மர்மம்","நடுநிசியில் நடக்கு செய்வினை பூஜை ஆடு கோழி உயிரோடு சமாதி"],["இந்தியா","மேட்ச் பிக்சிங் செய்து கொண்டு காங்கிரஸ் தெலுங்கு தேச எனக்கு எதிராக சதி ஜெகன்மோகன்"],["தமிழகம்","நெசவாளர் பிரச்னையை தீர்க்க குழு அமைப்பேன் ஜெயலலிதா பிரசார"],["தமிழகம்","இன்று பூத் சிலிப் வினியோக தேர்தல் ஊழியர்கள் வீடுவீடாக வருவார்கள்"],["தமிழகம்","பதற்றமான வாக்குச் சாவடி தமிழகத்தில் எதுவுமே இல்லை டிஜிபி போலாநாத்"],["விளையாட்டு","அசத்தலான பீல்டிங்கால் வெற்றி டோனி"],["இந்தியா","ஸ்பெக்ட்ர வழக்கு ராசாவுக்கு நாளை வரை சிறை காவல் நீட்டிப்பு"],["தமிழகம்","அரசு ஊழியர்கள் லட்ச பேரை வீட்டுக்கு அனுப்பியவர் ஜெயலலிதா முகஸ்டாலின்"],["தமிழகம்","நெஞ்சை நிமிர்த்தி வாக்கு கேட்கிறோ ப சிதபர"],["தமிழகம்","மத்திய அமைச்சர் அழகிரிக்கு போலீஸ் பாதுகாப்பு வாபஸ்"],["தமிழகம்","தேர்தல் அறிக்கையின் வில்லி ஜெயலலிதா வீரமணி"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஒரே நாளில் ஆயிர அரசு ஊழியர்கள் ஓய்வு"],["ஸ்டேட் எக்ஸ்பிரஸ்","நக்சல் பகுதிகள் அரசு கட்டுப்பாட்டில் இல்லை முதல்வர் ஒப்புதல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","பெண்களுக்கு சதவீத ஒதுக்கீடு ஒரிசா சட்டசபையில் மசோதா"],["விளையாட்டு","முபையில் நாளை பைனல் இந்தியா இலங்கை பலப்பரீட்சை"],["விளையாட்டு","இறுதி போட்டி ஏற்பாடுகள் முமுர பாதுகாப்பு படைகளின் வளையத்தில் முபை"],["விளையாட்டு","நிர்வாண ஓட்டத்திற்கு ரெடி"],["விளையாட்டு","ரன் குவிக்கலா"],["தமிழகம்","முபையில் உச்சகட்ட பாதுகாப்பு ராணுவ வளையத்தில் ஸ்டேடிய"],["இந்தியா","ஓடு ரயிலில் பெண்ணை பாலியல் பலாத்கார முயற்சி"],["தமிழகம்","தனியாக கழன்ற ரயில் பெட்டி கிலோ மீட்டர் சென்றது"],["மாவட்ட மசாலா","மாணவி திடீர் மாய பொதுமக்கள் மறியல்"],["தமிழகம்","தொகுதி ஒரு பார்வை உத்திரமே்"],["தமிழகம்","சிறந்த திட்டங்கள் தொடர திமுக கூட்டணிக்கு ஓட்டு அன்புமணி"],["தமிழகம்","சட்டசபைக்கு குடித்து விட்டு செல்வதாக கூறிய ஜெயலலிதாவுடன் விஜயகாந்த் கூட்டணி லியோனி"],["தமிழகம்","திமுக அரசின் சாதனைகளை விவாத நடத்த எதிர்க்கட்சிகள் தயாரா பசிதபர"],["தமிழகம்","திமுக கூட்டணிக்கு பிரகாசமான வெற்றி வாய்ப்பு முகஸ்டாலின்"],["தமிழகம்","ஜெயலலிதா விஜயகாந்துக்கு பாட கற்பிக்க வேண்டு நெப்போலியன்"],["தமிழகம்","புதிதாக பல திட்டங்கள் நிறைவேற திமுகவை ஆதரியுங்கள் குஷ்பு"],["தமிழகம்","ாய் அரிசியின் அருமை பசியால் வாடுபவருக்கே தெரியு ஜிகேவாசன்"],["தமிழகம்","திமுக கூட்டணிக்கு தொகுதிக்கு மேல் வெற்றி உறுதி முகஅழகிரி"],["தமிழகம்","மீண்டு திமுகவுக்கு வாக்களிக்க மக்கள் முடிவு செய்துவிட்டார்கள் அன்பழகன்"],["குற்றம்","மகன் மர்மமாக இறந்ததால் தந்தை ஆத்திர மூதாட்டி குத்திக் கொலை"],["தமிழகம்","மாற்ற வேண்டு பேச்சு விவகார மதுரை கலெக்டரிட பிரவீன்குமார் விசாரணை"],["தமிழகம்","ஜோலார்பேட்டையில் ஜெயலலிதா கூட்டத்தில் மயங்கி விழுந்த பெண்கள்"],["தமிழகம்","ஆண்டு கால சாதனைகளை சொல்லி உரிமையோடு ஓட்டு கேட்க வந்திருக்கிறேன் முகஸ்டாலின்"],["தமிழகம்","மக்கள்தொகையில் உபி நபர் ஒன் வது இடத்தில் தமிழக"],["தமிழகம்","பிறந்த நாள் பரிசாக வந்த பணத்தை சொந்த செலவுக்கு பயன்படுத்தினார் ஜெ"],["இந்தியா","பிரதமர் வருகையை எதிர்த்து அசாமில் நாளை பந்த் தீவிரவாதிகள் மிரட்டல்"],["தமிழகம்","புதுவையில் காங் தேர்தல் அறிக்கை வெளியீடு அனைவருக்கு ஃபிரிட்ஜ் ஏழைகளுக்கு செல்போன்"],["தமிழகம்","ஓட்டுப்பதிவு மணி நேர குறைப்பு காலை மணிக்கு தொடங்கு"],["விளையாட்டு","இந்தியா இலங்கை மோதல் கோப்பை யாருக்கு"],["இந்தியா","சுங்லு கமிட்டி அளித்த அறிக்கைப் பற்றி மன்மோகன் சிங் பதில்"],["தமிழகம்","திமுக வெற்றியை தடுக்க வில்லன்கள் சதி முதல்வர் கருணாநிதி"],["தமிழகம்","தேர்தல் பிரசார சோனியா மன்மோகன் ராகுல் தமிழக வருகை"],["விளையாட்டு","இன்று உலககோப்பை பைனல் ஆண்டு கனவு பலிக்குமா"],["தமிழகம்","துணை ராணுவ தமிழக போலீஸ் கூட்டாக பாதுகாப்பு"],["தமிழகம்","கடந்த ஆண்டுகளில் தமிழக மக்கள் தொகை உயர்ந்துள்ளது"],["இந்தியா","பிரமுகர்களுக்கு பத்ம விருதுகள் பிரதிபா வழங்கினார்"],["இந்தியா","கேரள சட்டப்பேரவையில் பாஜனதா கால் பதிக்கு சுஷ்மா சுவராஜ்"],["தமிழகம்","ஜெ ஓட்டு போட்டால் ஏப்ரல் ஃபூல் ஆக்கி விடுவார் குஷ்பு"],["தமிழகம்","தலைவர்களை சிறையில் தள்ளியது ஜெயலலிதா ஆட்சியின் சாதனை தொல்திருமாவளவன்"],["தமிழகம்","கொளத்தூர் தொகுதி முன்மாதிரியாகு ஜிகேவாசன்"],["தமிழகம்","கருணாநிதி ஆதரவு அலை தமிழக முழுவது வீசுகிறது ராமதாஸ்"],["தமிழகம்","மக்கள் நல பணியாளர்களை வீட்டுக்கு அனுப்பியவர் ஜெயலலிதா முகஸ்டாலின்"],["தமிழகம்","தமிழக சிறந்த மாநிலனு ஐநா சபையே சொல்லியிருக்கு"],["விளையாட்டு","தொடர் நாயகன் விருது யாருக்கு"],["விளையாட்டு","நிர்வாண தரிசனத்திற்கு வந்தது வினை"],["விளையாட்டு","முதல் பேட்டிங் ராசி"],["ஸ்டேட் எக்ஸ்பிரஸ்","இடைத்தேர்தலுக்கு பிறகு அமைச்சரவை விரிவாக்க"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆயிர புதிய ஆட்டோ அரசு முடிவுக்கு ஐகோர்ட் தடை"],["ஸ்டேட் எக்ஸ்பிரஸ்","புட்டபர்த்தி சத்ய சாய்பாபா உடல்நிலையில் முன்னேற்ற"],["தலையங்கம்","பழி வாங்கிய பில்லி சூனிய"],["தமிழகம்","பஸ் ஸ்டாண்ட் பிச்சைக்காரரிட கட்டு கட்டாக பண பறிமுதல்"],["மாவட்ட மசாலா","களக்காடு அருகே புலி நடமாட்ட"],["மாவட்ட மசாலா","விடை எழுதிய தாளுடன் மாணவர் திடீர் மாய"],["தமிழகம்","செங்கல்பட்டு சோழிங்கநல்லூர் ஆலந்தூரில் முகஸ்டாலின் பிரசார"],["தமிழகம்","கூவ குசஸ்தலை ஆற்றின் குறுக்கே தடுப்பணை கட்ட நடவடிக்கை பாஜ வேட்பாளர்"],["தமிழகம்","தொகுதி ஒரு பார்வை மதுரவாயல்"],["தமிழகம்","தமிழ் மக்களுக்காக தன்னையே அர்ப்பணித்தவர் கருணாநிதி குஷ்பு"],["தமிழகம்","வெள்ளை எஜிஆரையே பிடிக்காத ஜெ கருப்பு எஜிஆரை எப்படி ஏற்பார் திருமாவளவன்"],["தமிழகம்","ஓட்டுப்பெட்டி பாதுகாக்க ஒரு மாத வீண் செலவு அன்பழகன்"],["தமிழகம்","தேர்தலுக்காக மலையில் இருந்து இறங்கி வந்துள்ளார் ஜெயலலிதா நெப்போலியன்"],["தமிழகம்","தமிழகத்தில் ஒவ்வொரு குடுபமு திமுக ஆட்சியில் பயனடைந்துள்ளது காதர் மொய்தீன்"],["தமிழகம்","சிப்பாயாக மாறிய கேப்டன் இனி சிப்பந்தி ஆகிவிடுவார் கார்த்திக் சிதபர"],["ஸ்டேட் எக்ஸ்பிரஸ்","குழந்தையை கடத்த திட்ட வேலைக்கார பெண் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","மேற்குவங்கத்தில் ஆசிரியர் சித்ரவதை செய்து சுட்டுக்கொலை"],["ஸ்டேட் எக்ஸ்பிரஸ்","சாய்பாபாவை கவனிக்க குழு ஆந்திர முதல்வர் அனுப்பினார்"],["ஸ்டேட் எக்ஸ்பிரஸ்","சரக்கு ரயில் மோதி பருந்துகள் சாவு"],["மாவட்ட மசாலா","ஓடு காரில் தீ இரண்டு பேர் தப்பினர்"],["விளையாட்டு","சாபியன் ஆனது இந்தியா பரிசு மழையில் நனையு டோனி படை"],["இந்தியா","முதல்கட்டமாக அசாமில் நாளை தொகுதிக்குவாக்குபதிவு"],["தமிழகம்","களைகட்டுகிறது தேர்தல் கள சோனியா நாளை வருகை"],["இந்தியா","மாநில தேர்தல் முடிந்தது தெலங்கானா அமைக்க கோரி மிகப்பெரிய போராட்ட"],["தமிழகம்","சட்ட ஒழுங்கு நிலை குறித்து குற்ற சாட்ட ஜெயலலிதாவிற்கு தகுதி இல்லை முதல்வர்"],["விளையாட்டு","சுமா கிடைக்கவில்லை கோப்பை"],["தமிழகம்","ஆப்பு அடிக்க ஆஃப் அடிக்கணு விஐயகாந்த் பேச்சு"],["தமிழகம்","இன்று முதல் மே தேதி வரை கருத்துக் கணிப்பு வெளியிட தடை தேர்தல் அதிகாரி"],["விளையாட்டு","உலக கோப்பையை வென்ற வீரர்களுக்கு கொட்டுகிறது பரிசு மழை"],["இந்தியா","தொகுதிகளில் நடக்கிறது அசாமில் இன்று முதல்கட்ட தேர்தல்"],["இந்தியா","கேரள தேர்தலில் மீண்டு முதல்வராக உமன் சாண்டிக்கு வாய்ப்பு"],["இந்தியா","மதா ஆட்சியமைத்தால் காங்கிரஸ் பங்கேற்குமா பிரணாப்"],["தமிழகம்","திமுக கூட்டணியிட எந்த சூழ்ச்சியு பலிக்காது குஷ்பு"],["தமிழகம்","காங்கிரஸ் கூட்டணி அமோக வெற்றி பெறு நாராயணசாமி"],["தமிழகம்","சர்ச்சையை ஏற்படுத்து தேர்தல் ஆணைய உத்தரவுகள் பசிதபர"],["தமிழகம்","எஸ்மா டெஸ்மா சட்டங்கள் தான் ஜெயலலிதா ஆட்சியின் சாதனை திருமாவளவன்"],["தமிழகம்","அதிமுக வேட்பாளர்களை ஆதரித்து தூத்துக்குடியில் ஜெ பிரசார"],["தமிழகம்","அதிமுக தேர்தல் அறிக்கை பொதுமக்கள் நபவில்லை ஜிகேவாசன்"],["தமிழகம்","ஓட்டுப்பதிவு இயந்திர அனுப்பு பணி தீவிர"],["தமிழகம்","மக்கள் நல திட்டங்களை நிறுத்தி விடுவார் ஜெயலலிதா முகஸ்டாலின்"],["தமிழகம்","எதிர்கட்சியாக செயல்பட பாஜவுக்கு வாய்ப்பு கொடுங்கள் நிர்மலா சீதாராமன்"],["ஸ்டேட் எக்ஸ்பிரஸ்","டோனிக்கு பாரத ரத்னா ஜார்கண்ட் காங் கோரிக்கை"],["ஸ்டேட் எக்ஸ்பிரஸ்","கடப்பா இடைத்தேர்தல் ஏப் ல் ஜெகன் வேட்புமனு"],["ஸ்டேட் எக்ஸ்பிரஸ்","பாரின் கரன்சியுடன் அமைச்சர் டிஸ்மிஸ் செய்ய வலியுறுத்தல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","கோடி ஹெராயினுடன் கல்லூரி மாணவர்கள் கைது"],["இந்தியா","அசா முதல் கட்ட தேர்தலில் விறுவிறுப்பான வாக்குப்பதிவு"],["இந்தியா","தீபிகா படுகோன் வாங்கிய கோடி சூப்பர் பிளாட்"],["தமிழகம்","உலக கோப்பையை வென்ற இந்திய அணிக்கு தமிழக அரசு கோடி பரிசு"],["இந்தியா","கொல்கத்தாவில் நடந்தே சென்று வாக்கு சேகரிக்கு மதா பானர்ஜி"],["விளையாட்டு","சச்சினின் கண்ணீரைவிட உலககோப்பை பெரிதல்ல யுவராஜ்சிங்"],["விளையாட்டு","உலககோப்பை வெற்றிக்கு கங்குலி குப்ளே டிராவிட் காரண டோனி"],["விளையாட்டு","டெண்டுல்கர் ஓய்வு பெறக்கூடாது பயிற்சியாளர் ராகாந்த் அச்ரேக்கர்"],["விளையாட்டு","முபையில் மட்டு லட்ச லிட்டர் பீர் லட்ச ஸ்வீட் விற்பனை"],["தமிழகம்","சோனியா காந்தியின் சென்னை பயணத்தில் சிறிய மாற்ற"],["தமிழகம்","உலக கோப்பை வென்றதன் மூல சிறுவயது கனவு நனவாகிவிட்டது அஸ்வின்"],["தமிழகம்","ரோந்து பணியில் வெளி மாநில போலீஸ்"],["தலையங்கம்","பெற்றோரின் பாசத்தை நபாத உலக"],["குற்றம்","பைக் மீது லாரி மோதி உடல் நசுங்கி பேர் பலி"],["மாவட்ட மசாலா","மாமியாரை தாக்கிய மருமகள் மீது வழக்கு"],["மாவட்ட மசாலா","வீட்டு உண்டியலில் திருட்டு கொள்ளையனுக்கு தர்ம அடி"],["மாவட்ட மசாலா","அலையாத்தி காடுகளில் புலி நடமாட்டமா"],["மாவட்ட மசாலா","மின்கபத்தில் பைக் மோதி வாலிபர்கள் சாவு"],["தமிழகம்","பெண் புகாரால் பரபரப்பு தேடி அலையு அதிகாரிகள்"],["தமிழகம்","எபிபிஎஸ் மாணவரை மருத்துவர் பயிற்சிக்கு அனுப்ப ஐகோர்ட் உத்தரவு"],["தமிழகம்","தீயணைப்பு வாகனத்தை சிறைபிடித்து மக்கள் மறியல்"],["தமிழகம்","கருணாநிதியின் ஆட்சியில் அனைத்து குடுபத்துக்கு பயன் ராமதாஸ்"],["தமிழகம்","கருத்து கணிப்பு முக்கிய அல்ல மக்கள் கணிப்புதான் முக்கிய வாசன்"],["தமிழகம்","எதையு சாதிக்காத ஜெயலலிதா எதை சொல்லி ஓட்டு கேட்பார் முகஸ்டாலின்"],["தமிழகம்","வெப் கேமரா கண்காணிப்பு தேர்தல் பணியில் ஈடுபடு மாணவர்களுக்கு ாய்"],["தமிழகம்","ஈரோடு க் அறந்தாங்கியில் ஆதரவு திரட்டுகிறார் ராகுல்"],["தமிழகம்","அதிமுக ஆட்சிக்கு வந்தால் மதுரையில் பறக்கு பால ஜெ"],["தமிழகம்","மின் தட்டுப்பாட்டுக்கு ஜெயலலிதாவே காரண கிவீரமணி"],["மாவட்ட மசாலா","கருணாநிதி மீண்டு முதல்வராக விவசாயிகள் ஆதரவு தர வேண்டு செல்லமுத்து"],["தமிழகம்","ஜெயலலிதா ஒரு சண்டைக்கோழி மத்திய திட்டங்கள் கிடைக்காமல் செய்வார் கேபாக்யராஜ்"],["தமிழகம்","காசு ஜெராக்சில் முடித்து விட்டார் ஜெ நடிகர் வாகை சந்திரசேகர்"],["தமிழகம்","விஜய் மன்றங்கள் கூண்டோடு கலைப்பு மாநில தலைவர் திடீர் விலகல்"],["தமிழகம்","தேர்தல் ஆணைய பாரபட்ச காட்டுகிறது தங்கபாலு"],["தமிழகம்","திருப்தி அளிக்கு வகையில் பாஜ அணி வெற்றி பெறு வெங்கையா நாயுடு"],["தமிழகம்","வளமான தமிழக காண பாடுபட்டு வெற்றிநடை போடுவோ முதல்வர்"],["தமிழகம்","திமுக காங்கிரஸ் கூட்டணியை பிரிக்க சதி முதல்வர் கருணாநிதி"],["இந்தியா","வாலிபருக்கு தந்தையா திவாரிக்கு மரபணு சோதனை ஐதராபாத் லேபுக்கு நோட்டீஸ்"],["தமிழகம்","மக்களுக்காக உழைக்கு தலைவர் கருணாநிதி முகஸ்டாலின்"],["விளையாட்டு","ஒரிஜினல் கோப்பை குழப்ப தீர்ந்தது"],["இந்தியா","முதல் கட்ட தேர்தலில் அசாமில் சதவீத ஓட்டுப் பதிவு"],["தமிழகம்","பறக்கு படைகள் தயார் தேர்தல் ஆணைய ஏற்பாடு"],["தமிழகம்","மத்திய அரசுடன் இணைந்து சாதனை திட்டங்களை திமுக நிறைவேற்று பசிதபர"],["தமிழகம்","வாக்குறுதிகளை நிறைவேற்றியவர் உரிமையுடன் வாக்கு கேட்கிறார் தயாநிதிமாறன்"],["தமிழகம்","கருணாநிதி ஆட்சியில்தான் தமிழக முன்னேறுகிறது அன்பழகன்"],["தமிழகம்","தேர்தல் ஆணைய பாகுபாடின்றி செயல்பட வேண்டு ஜிகேவாசன்"],["தமிழகம்","வாக்குறுதிகளை நிச்சய நிறைவேற்றுவார் முதல்வர் தங்கபாலு"],["தமிழகம்","வது முறையாக கருணாநிதிதான் முதல்வர் குலாநபி ஆசாத்"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஏழைகளுக்கு இலவச சிகிச்சை தனியார் ஆஸ்பத்திரிக்கு உத்தரவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","தேர்தல் பிரசார சிடிகளில் கங்குலிக்கு பதில் டோனி"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஐபிஎல் போட்டிக்கு பாதுகாப்பு ஜெய்ப்பூர் போலீஸ் புது நிபந்தனை"],["உலகம்","ஏமனில் துப்பாக்கி சூடு பேர் பலி"],["இந்தியா","மதா வரைந்த ஓவியங்கள் லட்சத்துக்கு விற்பனை"],["உலகம்","காங்கோவில் ஐநா விமான விபத்து பேர் பரிதாப பலி"],["விளையாட்டு","கிரிஸ்டனை தந்தை ஸ்தானத்தில் வைத்துள்ளேன் யுவராஜ்சிங்"],["விளையாட்டு","வெற்றி பார்ட்டியில் டோனி மிஸ்சிங்"],["விளையாட்டு","ஜாகீர்கானுக்கு டு டு"],["விளையாட்டு","செப்டபர் வரை டோனி படைக்கு நான் ஸ்டாப் கிரிக்கெட்"],["விளையாட்டு","ஓய்வு இல்லை சச்சின் அறிவிப்பு"],["விளையாட்டு","போர் விமானத்தில் பறக்க டோனிக்கு சிறப்பு அனுமதி"],["தலையங்கம்","நாயை தொலைத்த அதிகாரிகள்"],["குற்றம்","தாராபுர அருகே பயங்கர ஆசிரியை எரித்து கொலை"],["மாவட்ட மசாலா","பண கையாடல் செய்த போஸ்ட் மாஸ்டர் டிஸ்மிஸ்"],["மாவட்ட மசாலா","லாரி மீது கார் மோதி பேர் பரிதாப சாவு"],["மாவட்ட மசாலா","அரிமா சங்க கூட்ட"],["தமிழகம்","சிங்காரச் சென்னையை சிங்கப்பூராக மாற்றுவார் துணை முதல்வர் ஸ்டாலின் துர்கா ஸ்டாலின்"],["தமிழகம்","தமிழகத்தில் மட்டு தேர்தல் ஆணைய கெடுபிடி ராமதாஸ்"],["தமிழகம்","தொகுதி ஒரு பார்வை ஆயிர விளக்கு"],["தமிழகம்","எனக்கு கன்னிப் பேச்சு அந்த ஆளுக்கு தண்ணி பேச்சு வடிவேலு"],["தமிழகம்","சிறுபான்மையினருக்கு கை கொடுப்பது திமுக கூட்டணி வாசன்"],["தமிழகம்","பாஜ தலைவர்கள் கட்கரி சுஷ்மா தமிழக வருகை"],["தமிழகம்","கோமாளிகளின் கூட்டணி அதிமுக முகஸ்டாலின்"],["தமிழகம்","கணினி பயன்படுத்து முறை தேர்தல் ஆணைய விளக்க"],["தமிழகம்","சோனியா கருணாநிதி ஒரே மேடையில் பிரசார"],["தமிழகம்","தங்கபாலு வேட்பு மனுவை நிராகரிக்க கோரிய வழக்கு தள்ளுபடி"],["இந்தியா","ஆந்திரா இடைத்தேர்தல் பிரசார தொடங்கினார் ஜெகன்"],["இந்தியா","சாய்பாபா உடல்நிலை தொடர்ந்து கவலைக்கிட புட்டபர்த்தியில் பதற்ற"],["இந்தியா","ஊழல் தடுப்பு சட்ட வலியுறுத்தி அன்னா ஹசாரே உண்ணாவிரத"],["சினிமா(ரீல்மா)","ரஜினி வெற்றி ரகசிய எஸ்பிமுத்துராமன் தகவல்"],["தமிழகம்","தமிழர்களின் உயிர் பிரச்னையு கூட கச்சத் தீவை திருப பெற வேண்டு சோனியா காந்தி"],["தமிழகம்","ஏழைகளுக்கு நல திட்டங்கள் தொடர மீண்டு திமுக ஆட்சி வேண்டு சோனியா காந்தி"],["விளையாட்டு","தொழில் துறை நிர்வாக கல்விக்கு டோனி நிர்வாக திறமை அனைவருக்கு பாட"],["தமிழகம்","முரசு சின்ன பொறித்த பனியன் மொத்தமாக விற்க ஐகோர்ட் தடை"],["தமிழகம்","திமுக ஆட்சியில் கோடிக்கணக்கான மக்கள் பயனடைந்துள்ளனர் முகஸ்டாலின்"],["தமிழகம்","கூட்டணி தலைவர்கள் பேச்சு வது முறையாக கருணாநிதி தான் முதல்வர்"],["தமிழகம்","உலகக் கோப்பை வெற்றி சச்சினுக்கு பாரத ரத்னா மகாராஷ்டிரா பரிந்துரை"],["தமிழகம்","கள்ளஓட்டு போட்டால் ஆண்டு சிறை தேர்தல் கமிஷன்"],["தமிழகம்","பண பொருள் வாங்காமல் வாக்களிக்க வேண்டு தேர்தல் அதிகாரி"],["தமிழகம்","அதிமுகவில் ஒருவரை புகழ்ந்தால் மற்றவருக்கு பிடிக்காது குஷ்பு"],["தமிழகம்","மக்கள் இதயத்தில் முதல்வருக்கு நிரந்தர இட ஜிகேவாசன்"],["இந்தியா","இஸ்லாமியர்களின் கோரிக்கைகளை திமுக கூட்டணியால் மட்டுமே நிறைவேற்ற முடியு அப்துல் ரகுமான்"],["தமிழகம்","அதிமுக கூட்டணி தலைவர்கள் தேர்தல் பிரசார பொதுக்கூட்ட"],["குற்றம்","குழாயில் தண்ணீர் பிடித்த பெண்கள் பரிதாப சாவு"],["தலையங்கம்","ராணுவ வீரர் ரயிலில் தற்கொலை"],["குற்றம்","சாட்சி சொல்ல வந்தவர் அரிவாளால் வெட்டிக் கொலை"],["மாவட்ட மசாலா","தண்டவாளத்தில் கல்வைத்து ரயிலை கவிழ்க்க சதி"],["மாவட்ட மசாலா","மூன்று பேர் பலாத்கார காமக்கொடூரன் சிக்கினான்"],["தமிழகம்","காவலாளியை கட்டிப் போட்டு கேஸ் குடோனில் சிலிண்டர்கள் திருட்டு"],["தமிழகம்","அதிமுகவுக்கு வாக்களித்தால் தடுமாற்றதான் ஏற்படு சிபிராதாகிருஷ்ணன்"],["தமிழகம்","தொகுதி ஒரு பார்வை மயிலாப்பூர்"],["தமிழகம்","அதிமுக அணி பிணி அல்ல சனி முகஸ்டாலின்"],["தமிழகம்","எதிர்க்கட்சிக்கு பூஜ்ய கருணாநிதிக்கு ராஜ்ய குஷ்பு"],["தமிழகம்","திமுக கூட்டணி வேட்பாளர்களை ஆதரித்து கோவையில் தேதி மன்மோகன் பிரசார"],["தமிழகம்","மதுராந்தக கேளபாக்கத்தில் துணை ராணுவ கொடி அணிவகுப்பு"],["விளையாட்டு","வார்ன் தந்திர பலிக்குமா"],["விளையாட்டு","புது ரத்தத்துடன் கொல்கத்தா"],["விளையாட்டு","அதிரடி மிரட்டலுக்கு தயாராகு முபை"],["விளையாட்டு","ஐபிஎல் கோலாகலதிருவிழா நாளை மறுநாள் துவக்க"],["விளையாட்டு","சாதிக்கு முனைப்பில் சிஎஸ்கே"],["விளையாட்டு","சொல்லி அடிப்பாரா கில்லி"],["விளையாட்டு","சேவாக் தலைமையில் மீண்டு டேர்டெவில்ஸ்"],["விளையாட்டு","வலுவாக களமிறங்குது பெங்களூர்"],["விளையாட்டு","உத்வேகத்துடன் ஐதராபாத்"],["விளையாட்டு","இவர்கள் புதியவர்கள்"],["விளையாட்டு","புனே வாரியர்ஸ்"],["தமிழகம்","ஜெயலலிதாவின் கடந்த ஆட்சி தமிழகத்தின் இருண்டகால பசிதபர"],["குற்றம்","பெண் கஞ்சா வியாபாரி சரமாரி வெட்டிக் கொலை"],["ஸ்டேட் எக்ஸ்பிரஸ்","நித்யானந்தா வாழ்க்கையை திரைப்படமாக்க கோர்ட் தடை"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஹசன் அலி கூட்டாளிகளுக்கு ஆயிர கோடி அபராத"],["ஸ்டேட் எக்ஸ்பிரஸ்","போபர்ஸ் வழக்கு செலவு சிபிஐ முரண்பட்ட தகவல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","அசா தேர்தலில் போட்டியிடு பேருக்கு கிரிமினல் பின்னணி"],["தமிழகம்","மதுரையில் முதல்வர் கருணாநிதி இன்று பிரசார"],["விளையாட்டு","சச்சினுக்கு பாரத ரத்னா கேப்டன் டோனி பேட்டி"],["தமிழகம்","தேர்தலையொட்டி டாஸ்மாக் கடைகள் நாள் மூடல் தேர்தல் கமிஷன்"],["தமிழகம்","சென்னையில் ஐபிஎல் திருவிழா சேப்பாக்கத்தில் போக்குவரத்து மாற்ற"],["தமிழகம்","தேர்தல் கமிஷன் நடவடிக்கைகளால் மக்களின் சுதந்திர பறிபோய்விட்டது"],["இந்தியா","மேற்குவங்க சட்டசபை தேர்தல் மன்மோகன் சிங் மதா ஒரே மேடையில் பிரசார"],["இந்தியா","சமூக சேவகர் அன்னா ஹசாரே வது நாளாக உண்ணாவிரத"],["தமிழகம்","தலைவர்கள் முற்றுகை அனல் பறக்கிறது பிரசார"],["தமிழகம்","ஜெயலலிதாவின் கொடிய ஆட்சி மீண்டு வரக்கூடாது முதல்வர் கருணாநிதி"],["தமிழகம்","வாக்குச்சாவடிகளில் பயன்படுத்த வெப் கேமராக்கள் தேர்தல் ஆணைய"],["தமிழகம்","தமிழகத்தின் மேன்மைக்காக திமுகவை ஆதரியுங்கள் ஜிகேவாசன்"],["தமிழகம்","பூத் சிலிப் கிடைக்காதவர்கள் க்கு புகார் தெரிவிக்கலா தேர்தல் அதிகாரி"],["தமிழகம்","அறிவித்த திட்டங்கள் அனைத்து நிறைவேற்றப்படு முகஸ்டாலின்"],["தமிழகம்","ஜெயலலிதாவுக்கு பாட புகட்ட வேண்டு காதர் முகைதீன்"],["தமிழகம்","திமுக ஆட்சியைதான் மக்கள் விருபுகின்றனர் நடிகர் சந்திரசேகர்"],["தமிழகம்","அதிமுக வென்றால் சசிகலா குடுபத்தின் ஆட்சிதான் நடக்கு சுப்பிரமணிய சாமி"],["தமிழகம்","கோவை பொதுக்கூட்டத்தில் கூட்டணி தலைவர்களுடன் ஜெபிரசார"],["தமிழகம்","பாஜ தனித்து போட்டி ஏன் சுஷ்மா சுவராஜ்"],["தமிழகம்","திமுக அரசு சாதனைகளுக்காக மக்கள் வாக்களிக்க வேண்டு பார்வையற்ற கல்லூரி மாணவி"],["தமிழகம்","திமுக அறிக்கையை காப்பியடித்தவர் ஜெயலலிதா நடிகர் பாக்யராஜ்"],["இந்தியா","ஊழலில் மூழ்கியுள்ளது இடது முன்னணி அரசு சோனியா காந்தி"],["தமிழகம்","மதிமுக தலைவர் வைகோ சிடி மூல பிரசார"],["இந்தியா","மக்கள் தொகை பெருக்க கர்நாடகாவுக்கு இட"],["தமிழகம்","பென்டிரைவ் வீடியோ கேமரா உள்பட கோடி பொருட்கள் பறிமுதல்"],["இந்தியா","பிரதமர் பிரசார கூட்டத்துக்கு தேர்தல் ஆணைய மறுப்பு"],["மாவட்ட மசாலா","அறநிலைய அதிகாரி வீட்டில் நகை பண கொள்ளை"],["மாவட்ட மசாலா","மனைவிக்கு செல்போனில் டார்ச்சர் கண்டித்த கணவர் குத்திக் கொலை"],["தமிழகம்","திருவொற்றியூர் அதிமுக வேட்பாளர் மீது பிரவீன் குமாரிட புகார்"],["தமிழகம்","சமுதாய புரட்சியை ஏற்படுத்திய முதல்வருக்கு ஆதரவு தாருங்கள் ஸ்ரீதர் வாண்டையார்"],["தமிழகம்","மத்திய அரசுடன் இணக்க இல்லாமல் ஜெயலலிதாவால் நிறைவேற்ற முடியாது நடிகர் பாக்யராஜ்"],["தமிழகம்","விருத்தாசல தொகுதி இளைஞர்கள் ரிஷிவந்தியத்தில் நூதன பிரசார"],["தமிழகம்","முதல்வர் கருணாநிதியை பற்றி நாகரிக இல்லாமல் பேசுவதா கார்த்திக்"],["தமிழகம்","அழிக்க நினைத்தவர் ஜெ வாழ வைத்தவர் கருணாநிதி திருமாவளவன்"],["இந்தியா","அரசியலுக்காக குடுபத்தை பிரித்துவிட்டது காங்கிரஸ் ஜெகன்மோகன்"],["விளையாட்டு","கண்கவர் கலை நிகழ்ச்சிகளுடன் ஐபிஎல் திருவிழா நாளை துவக்க"],["விளையாட்டு","பிளாஷ் பேக்"],["விளையாட்டு","அணிகளின் மவுசு கூடுது"],["ஸ்டேட் எக்ஸ்பிரஸ்","லட்ச பரிசு அறிவிக்கப்பட்ட மாவோ தலைவர் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","துப்பாக்கி சூட்டில் உயிரிழந்தவருக்கு சோனியா லட்ச நிவாரண"],["தமிழகம்","தொகுதிகளுக்கு மேல் திமுக கூட்டணி வெற்றி பெறு முகஅழகிரி"],["தமிழகம்","வருங்கால முதல்வர் என்று ஜெ முன் கூற தில் இருக்கிறதா வடிவேலு"],["தமிழகம்","தமிழகத்தில் மீதமுள்ள பணிகளை முடிக்க திமுக ஆட்சியை மீண்டு அமைப்போ முக ஸ்டாலின்"],["இந்தியா","சாய் பாபாவுக்கு நினைவு திருபுகிறது டாக்டர்கள் தகவல்"],["இந்தியா","பாஜ தனித்து போட்டி ஏன் நிதின் கட்கரி"],["குற்றம்","மனைவி நடத்தையில் சந்தேக கார் டிரைவர் படுகொலை"],["இந்தியா","ஹசாரே உண்ணாவிரத நீடிப்பு அமைச்சர் நடத்திய பேச்சு தோல்வி"],["உலகம்","தாக்குதலை நிறுத்துங்கள் ஒபாமாவுக்கு கடாபி கடித"],["தமிழகம்","ஏப் தேதிக்கு பின் கட்சியினர் ஊர்வல சென்றால் நடவடிக்கை தேர்தல் அதிகாரி"],["தமிழகம்","சாய ஆலை பிரச்னைக்கு விரைவில் தீர்வு ஜிகேவாசன்"],["தமிழகம்","மக்களுக்காக சிந்திக்கு ஒரே தலைவர் கருணாநிதி குஷ்பு"],["தமிழகம்","மதுரை காந்தி மியூசியத்தில் விஜயகாந்த் மாத தங்கி பணி செய்ய வேண்டு பெண்கள் கூட்டத்தில் தீர்மான"],["இந்தியா","மேற்குவங்கத்தில் களைகட்டு ஹைடெக் பிரசார"],["தமிழகம்","மீண்டு திமுக ஆட்சிதான் முதல்வர் கருணாநிதி"],["தமிழகம்","திமுக கூட்டணிக்கு ஆதரவு திரட்ட மன்மோகன் சிங் நாளை கோவை வருகிறார்"],["தமிழகம்","ஏழை எளிய மக்களின் முன்னேற்றத்துக்காக திமுககாங்கிரஸ் நல்லுறவு தொடரு ராகுல்காந்தி"],["விளையாட்டு","சென்னையில் இன்று ஐபிஎல் டி சீசன் கோலாகல தொடக்க"],["தமிழகம்","தேர்தல் வந்தால் மட்டுமே ஜெயலலிதா வருவார் முகஸ்டாலின்"],["தமிழகம்","பெருபாலான தொகுதிகளில் திமுக அணி வெற்றி பெறு முதல்வர்"],["தமிழகம்","ஆக்கபூர்வமான இலவசங்களை நாங்கள் வரவேற்கிறோ ஏபிபரதன்"],["தமிழகம்","மத்திய அரசுக்கு முன்னோடியாக திகழ்பவர் முதல்வர் கருணாநிதி பசிதபர"],["இந்தியா","அசா தீவிரவாத பிரச்னைக்கு பேச்சுவார்த்தை மூல தீர்வு பிரதமர்"],["இந்தியா","மத்திய அரசு யோசனை நிராகரிப்பு ஹசாரே போராட்ட நீடிக்கிறது"],["தலையங்கம்","விலங்கு உரிமை காப்பது கடமை"],["மாவட்ட மசாலா","கல்லூரி நிர்வாகி வீட்டில் பவுன் நகை கொள்ளை"],["மாவட்ட மசாலா","பிஎப் பண வழங்க லஞ்ச அதிகாரி உள்பட பேர் கைது"],["மாவட்ட மசாலா","வாலிபரைக் கொன்று மாந்தோப்பில் உடல் எரிப்பு"],["மாவட்ட மசாலா","ாய் லட்ச துணி மினி ஆட்டோ பறிமுதல்"],["மாவட்ட மசாலா","விஐடி பல்கலைக்கழகத்தில் தேதி வளாகதேர்வு"],["குற்றம்","காதலி வீட்டில் காதலன் தீக்குளித்து தற்கொலை"],["தமிழகம்","பாஜ ஆட்சிக்கு வந்தால் இலவசங்கள் நிறுத்தப்படு வெங்கையா நாயுடு"],["தமிழகம்","மக்களுக்காக போராடு ஒரே தலைவர் கருணாநிதி வீரமணி"],["தமிழகம்","தொகுதி ஒரு பார்வை சேப்பாக்கதிருவல்லிக்கேணி"],["குற்றம்","ரயிலில் இருந்து குதித்து காதல் ஜோடி தற்கொலை"],["தமிழகம்","ஆவணங்களை காட்டி ஓட்டு போடலா தேர்தல் கமிஷன்"],["தமிழகம்","அரசு அலுவலர்கள் தேர்தல் பிரசாரத்தில் ஈடுபட்டால் சஸ்பெண்ட் நெல்லை மாவட்ட கலெக்டர்"],["தமிழகம்","திமுக ஆட்சியில்தான் வறுமை பட்டினி கிடையாது குஷ்பு"],["தமிழகம்","தமிழகத்தை முதன்மை மாநிலமாக மாற்றிய திமுகவுக்கு வாக்களியுங்கள் முகஸ்டாலின்"],["தமிழகம்","உழவர் சந்தைகளை மூடியவர் ஜெயலலிதா ஜிகேவாசன்"],["தமிழகம்","ஜெ விஜயகாந்துக்கு மரண அடி கொடுங்கள் நடிகர் வாகை சந்திரசேகர்"],["ஸ்டேட் எக்ஸ்பிரஸ்","காங் கூட்டணியில் இருந்து போடோ கட்சி விலகுகிறது"],["ஸ்டேட் எக்ஸ்பிரஸ்","லட்ச கோடி ஊழல் மாயாவதி மீது பாஜ புகார்"],["ஸ்டேட் எக்ஸ்பிரஸ்","கட்ட தேர்தல் அறிவிக்கை மேற்குவங்கத்தில் வெளியீடு"],["ஸ்டேட் எக்ஸ்பிரஸ்","சிரஞ்சீவி பிரசாரத்தில் தடியடி மாணவர்கள் படுகாய"],["உலகம்","ஐப்பான் பூகபத்தில் பேர் பலி பேர் காய"],["இந்தியா","கடப்பா இடைத்தேர்தல் ஜெகனுக்கு எதிராக களமிறங்கு அமைச்சர்"],["இந்தியா","பீகாரில் நடந்த தகுதித் தேர்வில் ஆயிர ஆசிரியர்கள் பெயில்"],["விளையாட்டு","ஐபிஎல் இன்று ஸ்டார்ட் சென்னையை சமாளிக்குமா கொல்கத்தா நைட்ரைடர்ஸ்"],["விளையாட்டு","கிங்ஸ் லெவன் விற்பனையா"],["விளையாட்டு","சாபியன் பட்ட மகனுக்கு உத்வேக"],["விளையாட்டு","கிமீ வேகத்தில் பந்துவீசு வருண் ஆரோன்"],["விளையாட்டு","சவால்கள் ரஸ்க் மாதிரி"],["விளையாட்டு","அணிகள் ஒரு ரவுண்ட் அப்"],["விளையாட்டு","லாப சபாதித்த பஞ்சாப்"],["தமிழகம்","வில்லிவாக்க கொளத்தூர் தொகுதிகளில் முதல்வர் கருணாநிதி தீவிர பிரசார"],["இந்தியா","ஏப் முதல் சிறை நிரப்பு போராட்ட அன்னா ஹசாரே"],["தமிழகம்","பீஷ்மர்போல் செயல்படுகிறார் முதல்வர் கருணாநிதி நடிகர் சிரஞ்சீவி"],["தமிழகம்","இந்தியாவிலேயே முதன்முறையாக ஈரோட்டில் மாபெரு ஜவுளி சந்தை தயாநிதிமாறன்"],["தமிழகம்","கிலோ அரிசி ஒரு ாய்க்கு வழங்கி வறுமையை ஒழித்தவர் கருணாநிதி தங்கபாலு"],["தமிழகம்","தேர்தல் பணியில் லட்ச போலீசார் டிஜிபி போலாநாத்"],["தமிழகம்","ஓட்டுக்கு பண கொடுத்தாலு வாங்கினாலு வருட ஜெயில் தண்டனை தேர்தல் கமிஷன்"],["இந்தியா","மேவங்க சட்ட ஒழுங்கு சவாலாக இருக்கிறது குரேஷி"],["தமிழகம்","வன்னியருக்கு தனி ஒதுக்கீடு வழங்கப்படு முதல்வர் கருணாநிதி"],["விளையாட்டு","ஐபிஎல் வது சீசன் தொடக்க ஆட்ட சென்னை சூப்பர் கிங்ஸ் வெற்றி"],["இந்தியா","குஜராத்தில் போலி என்கவுன்டர் சிபிஐ விசாரணைக்கு சுப்ரீ கோர்ட் உத்தரவு"],["இந்தியா","மத்திய அரசுடனான பேச்சில் முன்னேற்ற ஹசாரே விரைவில் நல்ல முடிவு"],["தமிழகம்","குமரியில் பாஜனதா தொகுதியிலு வெற்றி சுஷ்மா சுவராஜ்"],["தமிழகம்","கருணாநிதி ஆட்சியில்தான் நன்மைகள் நடந்துள்ளன குஷ்பு"],["தமிழகம்","வாக்குச்சாவடியிலேயே பூத் சிலிப் வினியோக தேர்தல் ஆணைய"],["தமிழகம்","தேர்தல் குறித்து கருத்து தெரிவிக்க வேண்டா வைகோ"],["தமிழகம்","ஏழைகளின் துயரை போக்கியவர் கருணாநிதி தங்கபாலு"],["இந்தியா","உதவியாளர் மூக்கில் குத்து விட்ட ஆந்திர அமைச்சர்"],["ஸ்டேட் எக்ஸ்பிரஸ்","தேர்தலை புறக்கணிக்க மாவோயிஸ்ட்கள் அழைப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","நீதிமன்ற அவமதிப்பு வழக்கு ஐஏஎஸ் அதிகாரிகளுக்கு நாள் சிறை"],["விளையாட்டு","கோட்டை விட்டது கொல்கத்தா"],["விளையாட்டு","பிரீத்தி ஜிந்தாவுக்கு அபராத"],["விளையாட்டு","ராஜஸ்தான் ஐதராபாத் இன்று மோதல்"],["விளையாட்டு","பெங்களூர் அதிரடிக்கு தாக்கு பிடிக்குமா கொச்சி"],["தமிழகம்","யானை நடமாட்ட துப்பாக்கி சரவெடிகளுடன் வாக்குச்சாவடியில் பாதுகாப்பு"],["தமிழகம்","நக்சல்கள் நடமாட்டமா மாநில அதிரடிப்படைகள் முதுமலையில் திடீர் ரெய்டு"],["தமிழகம்","உலககோப்பையில் அபார வெற்றி கிராம மக்களுக்கு கறி விருந்து"],["மாவட்ட மசாலா","நிதி நிறுவன மேலாளரிட லட்ச பறிமுதல்"],["மாவட்ட மசாலா","தூத்துக்குடியில் வது நாளாக வெடிபொருட்கள் கண்டுபிடிப்பு"],["மாவட்ட மசாலா","பாளையங்கோட்டை வியாபாரி அரிவாளால் வெட்டிக்கொலை"],["மாவட்ட மசாலா","ஜவுளிக்கடையில் பயங்கர தீ விபத்து"],["குற்றம்","கள்ளக்காதலி வீட்டில் தூக்கில் தொங்கிய போலீஸ்காரர்"],["தமிழகம்","வாக்காளர்கள் ஒற்றுமையாக இருந்தால் நல்ல அரசு உருவாகு முதல்வர்"],["தமிழகம்","தமிழ்நாட்டை ஆளுகின்ற தகுதி கருணாநிதிக்கு மட்டுமே உள்ளது அன்பழகன்"],["தமிழகம்","விஐபி தொகுதி ஒரு பார்வை திருவா்"],["தமிழகம்","விஐபி தொகுதி ஒரு பார்வை கொளத்தூர்"],["தமிழகம்","தங்க விலை உயர்வுக்கு முதல்வரா பொறுப்பாக முடியு நெப்போலியன்"],["தமிழகம்","தமிழகத்தில் எதிர்க்கட்சியாக செயல்பட வாய்ப்பு தாருங்கள் சுஷ்மா சுவராஜ்"],["தமிழகம்","ஜெயலலிதா விஜயகாந்துக்கு மக்கள் பாட புகட்டுவார்கள் குஷ்பு"],["தமிழகம்","நாகை திருவா் மாவட்டங்களில் முதல்வர் கருணாநிதி நாளை சூறாவளி பிரசார"],["இந்தியா","மேற்கு வங்க தேர்தலில் செக்ஸ் தொழிலாளருக்கு தனி வாக்கு சாவடி"],["மாவட்ட மசாலா","கோவையில் பேர் கைது மெகா சூதாட்ட"],["தமிழகம்","குளச்சல் அருகே கடலில் மூழ்கிய கப்பலில் இருந்து டீசல் எடுக்கு பணி தொடக்க"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆயிர கார் திருடிய குபல் தலைவி கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","டெல்லியில் இருந்து அஜ்மீருக்கு இளபெண் பிண பார்சல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","விவசாய நிதியில் முறைகேடு எடியூரப்பா மீது குற்றச்சாட்டு"],["தமிழகம்","பைக் மினி லாரி மோதல் தந்தை மகள் பரிதாப சாவு"],["இந்தியா","அபாய எச்சரிக்கை மணியால் பீதி கைகா அணுமின்நிலையத்தில் மின் உற்பத்தி திடீர் நிறுத்த"],["இந்தியா","அசா சட்டசபைக்கு நாளை இறுதிகட்ட தேர்தல் ஆயிர போலீசார் பாதுகாப்பு"],["இந்தியா","சாய்பாபா உடல்நிலையில் நல்ல முன்னேற்ற"],["விளையாட்டு","டிவிலியர்ஸ் அதிரடியில் சிதைந்தது கொச்சி"],["விளையாட்டு","சங்ககரா டுனி அவுட் தான் திருப்புமுனை கேப்டன் வார்ன்"],["தமிழகம்","திருவாில் முதல்வர் கருணாநிதி வீதிவீதியாக வாக்கு சேகரிப்பு"],["தமிழகம்","வடிவேலு பரபரப்பு பேட்டி"],
