வியை வெட்டி கொன்ற கணவனுக்கு ஆயுள் தண்டனை"],["மாவட்ட மசாலா","கிரேனில் இருந்து விழுந்த தொழிலாளர்கள் சாவு"],["மாவட்ட மசாலா","குட்டையில் தவறி விழுந்து பள்ளி மாணவன் பலி"],["மாவட்ட மசாலா","மாணவிகளிட அத்துமீறல் மாணவர்கள் சஸ்பெண்ட்"],["தமிழகம்","அரசு திட்டவட்ட அறிவிப்பு ஜூன் தேதி பள்ளிகள் திறப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","ராதேவுக்கு முதிர்ச்சி இல்லை அன்னா ஹசாரே"],["ஸ்டேட் எக்ஸ்பிரஸ்","தவாங் ஹெலிகாப்டர் விபத்து பலி ஆக உயர்வு"],["ஸ்டேட் எக்ஸ்பிரஸ்","பத்திரிகையாளர் சந்திப்பை தவிர்க்கிறார் ஒரிசா முதல்வர்"],["இந்தியா","ஆந்திராவில் தெதேச ஆட்சியை பிடிக்கு சந்திரபாபு நாயுடு"],["குற்றம்","வீட்டில் கொள்ளை முயற்சி தோல்வி பைக்குடன் திருடர்கள் ஓட்ட"],["தமிழகம்","கு் தேர்வு தள்ளி வைப்பு ஜூலை தேதி நடக்கிறது"],["உலகம்","ஈ கோலி பாக்டீரியாவுக்கு காரண ஜெர்மன் பீன்ஸ்"],["சினிமா(ரீல்மா)","ரன்பீரை தொடர்ந்து தீபிகாவின் மற்றொரு காதலு முறிந்தது"],["உலகம்","வெடிகுண்டு தாக்குதலில் சோமாலியா அமைச்சர் பலி"],["விளையாட்டு","இந்திய வீரர்கள் மாதிரி பொறுப்புடன் ஆடுங்கள் கேப்டன் சமி"],["விளையாட்டு","பவுலர்களு மிஸ் டல்லடிக்க போகுது டெஸ்ட்"],["விளையாட்டு","ஹர்லி நிலை என்ன விளக்குகிறார் வார்ன்"],["விளையாட்டு","ிக்கு தலைமுடியால் தடை"],["தமிழகம்","அபத்தூர் வீட்டுவசதி வாரிய குடியிருப்பில் விநாயகர் அமன் கோயில்கள் இடிப்பு"],["குற்றம்","விடுதி விழாவில் அத்துமீறிய மாணவர்கள் சஸ்பெண்ட்"],["குற்றம்","திருத்தணி கோயில் குளத்தில் குளித்த வாலிபர் பரிதாப சாவு"],["இந்தியா","தவளை வேட்டை கோவா இளைஞருக்கு வலை"],["தமிழகம்","சீர்காழி அருகே அதிகாலை கார் மீது லாரி மோதி பேர் பரிதாப சாவு"],["இந்தியா","இலங்கை கடற்படை தாக்குதலை தடுக்க உளவு குழுவினர் தீவிர கண்காணிப்பு"],["தமிழகம்","பைக்குகள் மோதல் பஸ் கண்டக்டர் பலி"],["தமிழகம்","காட்டாமணக்கு தின்ற குழந்தைகள் மயக்க"],["தமிழகம்","அரக்கோண ஏரியில் மீன்கள் செத்து மிதந்தன"],["தமிழகம்","ஐஏஎஸ் ஐபிஎஸ்சுக்கு முதல்நிலை தேர்வு இன்று நடந்தது"],["தமிழகம்","செல்போனால் பறிபோனது பண மரக்கடை ஊழியரிட ஷ் லட்ச அபேஸ்"],["தமிழகம்","அபத்தூர் சிடிஎச் சாலையில் பாழடைந்து கிடக்கு போலீஸ் குடியிருப்பு"],["தமிழகம்","ஸ்ரீநிகேதன் பள்ளியில் மழலையர் வளர்ப்பு ஆலோசனை கூட்ட"],["தமிழகம்","மேற்கு கடற்கரை பகுதியில் மீன்பிடி தடைக்கால தேதி தொடக்க"],["உலகம்","அதிக கொழுப்பு மூளைக்கு ஆபத்து"],["தமிழகம்","குழந்தை பேறு தரு பழ துரியன் கிலோ ணீ ஆயிர"],["இந்தியா","வடக்கு அரபிக்கடலில் வீசப்பட்ட பின்லேடன் உடலை தேடு அமெரிக்கர்"],["சினிமா(ரீல்மா)","அசின் நயன் நடிப்பை காப்பி அடிக்க மாட்டேன் த்ரிஷா"],["இந்தியா","பாகிஸ்தானில் இரட்டை குண்டுவெடிப்பு பேர் பரிதாப பலி"],["இந்தியா","ஸ்பெயின் விமானத்தில் நிர்வாண பயணியால் பரபரப்பு"],["விளையாட்டு","அதிரடி காட்டினார் ரசல் பதிலடி கொடுத்தார் ரோகித் தொடரை வென்றது இந்தியா"],["தமிழகம்","இன்று மாலை கப்பல் போக்குவரத்து துவக்க கொழுபு செல்ல பயணிகள் ஆர்வ"],["குற்றம்","கோடி பண கேட்டு மாணவர்கள் கடத்தி கொலை"],["மாவட்ட மசாலா","வாலாஜா முகாமில் அகதிகள் அடைப்பு"],["மாவட்ட மசாலா","தொழில் போட்டியில் தகராறு பேர் மீது ஆசிட் வீச்சு"],["மாவட்ட மசாலா","வேன் கார் மோதல் பேர் படுகாய"],["மாவட்ட மசாலா","எண்டோசல்பானுக்கு தடை உ உ கட்சி வலியுறுத்தல்"],["தலையங்கம்","உயிரை காக்கு நீச்சல் பயிற்சி"],["குற்றம்","சந்தன கடத்தலை தடுத்த அதிகாரிகளை தாக்கிய வாலிபர்கள் சிக்கினர்"],["தமிழகம்","மின்விசிறி மிக்ஸி கிரைண்டர் வினியோக ரேஷன் அரிசி வாங்குவோர் விவர சேகரிப்பு"],["மாவட்ட மசாலா","கார் மீது பஸ் மோதி புதுமாப்பிள்ளை பலி"],["தமிழகம்","அழகு கபீர உழைப்பின் மறுபெயர் காங்கய காளைகள் அழியு அபாய"],["தமிழகம்","தேர்தல் செலவு கணக்கை தாக்கல் செய்யாத வேட்பாளர்கள் மீது கடு நடவடிக்கை"],["மாவட்ட மசாலா","குட்டையில் மூழ்கி இறந்த குழந்தைகள் குடுபத்துக்கு தலா ஆயிர நிதியுதவி"],["இந்தியா","முதல்வர் பதவி காங்கிரசுக்கா உமர் அப்துல்லா மறுப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","நிபந்தனை பேச்சுவார்த்தைக்கு உல்பா திடீர் எதிர்ப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","மத மாற்ற முயற்சித்ததாக பெங்களூரில் பேர் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஒரிசா முதல்வர் பதவி விலக காங்கிரஸ் வலியுறுத்தல்"],["தமிழகம்","சேல மாரியமன் கோயில் வளாக கடைகளில் பயங்கர தீ"],["தமிழகம்","பள்ளிகளில் கட்டணகொள்ளை முறைப்படுத்த விரைவில் சட்ட"],["உலகம்","சிலி எரிமலை சாபல் ஆஸி விமானங்கள் ரத்து"],["உலகம்","டி ஆபாச படத்துக்கு அமெரிக்கா விருது"],["விளையாட்டு","இந்தியா வெஸ்ட் இண்டீஸ் மோதல் இன்று வது ஒரு நாள் போட்டி"],["விளையாட்டு","நியூசி கேப்டன் போட்டியில் பேர்"],["விளையாட்டு","மீண்டு வந்தார் ஆண்டர்சன்"],["விளையாட்டு","ஏடிபி மாஸ்டர்ஸ் டென்னிஸ் போட்டி போபண்ணா ஜோடி சாபியன்"],["சினிமா(ரீல்மா)","புலிவேஷ தாமத ஏன்"],["உலகம்","மூச்சு காற்றால் மனிதனை கண்டுபிடிக்கு கொசு"],["இந்தியா","ஆண்டாக காத்திருப்போருக்கு ஹஜ் பயண செல்ல அனுமதி எஸ்எகிருஷ்ணா"],["தமிழகம்","திமுக காங்கிரஸ் கூட்டணியை முறிக்க முயற்சி கருணாநிதி"],["இந்தியா","நேர்மையான பிரதமர் ஏன் பயப்பட வேண்டு அன்னா ஹசாரே"],["தமிழகம்","டெல்லியில் ஜெயலலிதா பிரதமருடன் இன்று சந்திப்பு"],["இந்தியா","அரசையே பயமுறுத்து ஆயில் மாபியாக்கள்"],["தமிழகம்","தனியார்பள்ளிகள் கல்விக் கட்டண மேலு உயர்வு"],["தமிழகம்","நவீன வசதிகள் பெருகியதால் காங்கய இன காளைகள் அழிந்து வரு அபாய"],["தமிழகம்","மதுரை அரசு மருத்துவமனையில் குழந்தைகளை கடத்தி விற்பனை"],["தமிழகம்","செலவு கணக்கை தாக்கல் செய்யாத வேட்பாளர்கள் ஆண்டு தேர்தலில் நிற்க தடை"],["தமிழகம்","விடுதலைப்புலிகள் மீதான தடையை நீக்குவரை போராடுவேன் வைகோ"],["தமிழகம்","வீட்டுக்குள் சூப்பர் மார்க்கெட் கொண்டு வருகிறது சன் டைரக்ட்"],["இந்தியா","மார்பக புற்றுநோயை கண்டுபிடிக்க புது கருவி கண்டுபிடிப்பு"],["தமிழகம்","பயணிகள் சொகுசு கப்பல் இன்று கொழுபு சென்றது"],["உலகம்","குழந்தை பெற முடியாத மகளுக்கு அமா கர்ப்பப்பை தான"],["உலகம்","பென்ஷனுக்கு ஆசைப்பட்டு பாட்டி உடலை மறைத்த தாய் மகளுக்கு சிறை"],["உலகம்","பேஸ்புக் சங்காத்தமே வேணா லட்ச பேர் ஜகா"],["உலகம்","செவ்வாய் கிரகத்தில் காந்தி உருவ"],["ஸ்டேட் எக்ஸ்பிரஸ்","முபை நிருபர் கொலை வழக்கு போலீஸ் அதிகாரியிட விசாரணை"],["ஸ்டேட் எக்ஸ்பிரஸ்","தெலங்கானா விவகார காங்கிரஸ் புது முடிவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","நில கையகப்படுத்துதல் ஒரிசா அரசுக்கு பாஜ கோரிக்கை"],["ஸ்டேட் எக்ஸ்பிரஸ்","பேராசிரியர் கை துண்டிப்பு மேலு ஒருவர் கைது"],["மருத்துவம்","குழந்தைகளை தாக்கு டயாபடிஸ்"],["உலகம்","குரான் படிக்கிறார் டோனி பிளேர்"],["உலகம்","லிபியா பற்றி எரியுபோது செஸ் விளையாடினார் கடாபி"],["இந்தியா","இறந்து கிடந்த பிச்சைக்காரரிட லட்ச பண"],["விளையாட்டு","உலக சாபியனை வீழ்த்தியது வெஇ"],["விளையாட்டு","கோட்டை விட்டது பூபதி பயஸ் ஜோடி"],["குற்றம்","வக்கீலை கடத்தி சென்று கொடூர கொலை கொலையாளிகளை பிடிக்க தனிப்படை அமைப்பு"],["தமிழகம்","கல்வி கட்டண நிர்ணய தனியார் பள்ளிகள் கடு அதிருப்தி"],["தமிழகம்","நாளை சந்திர கிரகண கிரிவல சென்றால்பாதிப்பு வருமா"],["மாவட்ட மசாலா","புயல் வெள்ள பாதிப்புகளை மதிப்பிட துறை அதிகாரிகள் குழு நியமன"],["மாவட்ட மசாலா","என்எல்சியில் விரைவில் இகான்ட்ராக்ட் முறை"],["மாவட்ட மசாலா","ராமேஸ்வர தலைமன்னார் இடையே விரைவில் கப்பல் போக்குவரத்து"],["மாவட்ட மசாலா","திருமண நிச்சயித்த மறுநாள் லாரி மோதி மாப்பிள்ளை சாவு"],["மாவட்ட மசாலா","நெல்லை அருகே இரவில் பஞ்சாயத்து தலைவிக்கு வெட்டு"],["மாவட்ட மசாலா","பெருந்துறை அருகே மயில்கள் மர்ம சாவு"],["மாவட்ட மசாலா","பதுக்கல் எரிசாராய பறிமுதல் பெண் உள்பட பேர் கைது"],["மாவட்ட மசாலா","பள்ளிகள் நாளை திறப்பு வெறிச்சோடியது ஊட்டி"],["குற்றம்","அண்ணாசாலையில் பயங்கர தீ"],["இந்தியா","அன்னா ஹசாரே கொடுங்கோலன் காங்கிரஸ்"],["தமிழகம்","முதல்வர் ஆன பிறகு முதன்முறையாக டெல்லியில் பிரதமரை சந்தித்தார் ஜெயலலிதா"],["ஆன்மீகம்","தடைகளை தகர்க்கு விசாக வழிபாடு"],["மர்மம்","அருவியை பார்த்து அலறு காகங்கள்"],["வேலைவாய்ப்பு","மண்வள ஆராய்ச்சி மையத்தில் சயின்டிஸ்ட் பணி"],["வேலைவாய்ப்பு","இந்தோ திபெத் எல்லை காவல் படையில் எஸ்ஐ வேலை"],["தமிழகம்","பள்ளிகள் இன்று திறப்பு வார பாட நடத்த தடை"],["தமிழகம்","மத்திய அரசுடன் மோத மாட்டோ முதல்வர் ஜெயலலிதா"],["தமிழகம்","ஜெயலலிதா முதல்வராக இருந்த போது கச்சத்தீவை மீட்க எடுத்த நடவடிக்கை என்ன"],["உலகம்","அமெரிக்கர்களின் வேலைவாய்ப்பு இந்தியாவு சீனாவு போட்டி போட்டு பறிக்கின்றன ஒபாமா"],["இந்தியா","மாணவர்களுக்கு லேப்டாப் வழங்க கோடி வேண்டு முதல்வர் ஜெ"],["தமிழகம்","தடுப்புக்குழு அமைத்து பலனில்லை மாதத்தில் பேர் தற்கொலை"],["தமிழகம்","ல் கவுன்சலிங் எபிபிஎஸ் கட்ஆப் ல் வெளியீடு"],["தமிழகம்","சிவகங்கை தேர்தல் பற்றி ஜெ பேச்சு நீதிமன்ற அவமதிப்பு பசிதபர"],["இந்தியா","தூத்துக்குடி கொழுபு கப்பல் போக்குவரத்தை நிறுத்த பிரதமரிட ஜெயலலிதா கோரிக்கை"],["இந்தியா","உலக தரத்துக்கு இணையாக விரைவில் தபால் சேவைகள் கபில் சிபல்"],["மாவட்ட மசாலா","பெட்ரோல் பங்க்கில் தகராறு வேன் ஏற்றி தொழிலாளி கொலை"],["மாவட்ட மசாலா","ஆட்டோ கவிழ்ந்து விபத்து ஆயுள் தண்டனை கைதி பலி"],["மாவட்ட மசாலா","அரசு பஸ்சில் தீ பேர் சஸ்பெண்ட்"],["மாவட்ட மசாலா","நரி தலை தாயத்து வாலிபர்கள் கைது"],["மாவட்ட மசாலா","நஷ்டஈடு வழங்காததால் மின்வாரிய ஜீப்கள் ஜப்தி"],["குற்றம்","கோடி மோசடி கைதான ஆசாமியிட கூடலூரில் விசாரணை"],["தமிழகம்","குமரி மருத்துவகல்லூரியில் டாக்டர்கள் சஸ்பெண்ட்"],["தலையங்கம்","தாய்மையை பழிக்கு குழந்தை கடத்தல்"],["சினிமா(ரீல்மா)","கங்கனாவுடன் சண்டையா மாதவன்"],["விளையாட்டு","வாரியத்துடன் அப்ரிடி சமரச"],["விளையாட்டு","இந்தியா ஆஸி இலங்கை மீண்டு ஜவ்வு போட்டி"],["விளையாட்டு","பதிலடி கொடுக்குமா ரெய்னா அன்கோ"],["கல்வி","வெளிநாட்டில் உயர்கல்வி பயில விருப்பமா மத்திய அரசு உதவித்தொகை"],["கல்வி","மத்திய அரசு பயிற்சி நிறுவனத்தில் புட்வேர் டெக்னாலஜி டிப்ளமோ"],["உலகம்","சிறையில் கலவர கைதிகள் பலி"],["உலகம்","நியூசிலாந்து டிவி சேனலுக்கு அபராத ஷீலா தீட்சித்"],["உலகம்","ஈ கோலி தாக்குதலுக்கு வயது குழந்தை சாவு"],["தமிழகம்","கோடை விடுமுறைக்கு பிறகு பள்ளிகள் திறப்பு ஆசிரியர் மாணவர் உச்சகட்ட குழப்ப"],["குற்றம்","லாரி மீது அரசு பஸ் மோதி பெண் உள்பட பேர் பலி"],["சினிமா(ரீல்மா)","நடிகர் நாகார்ஜுனாவின் மகனை மணக்கிறார் அனுஷ்கா"],["தமிழகம்","தனியார் பள்ளியில் புதுசு அரசு பள்ளியில் பழசு"],["தமிழகம்","புதிய தலைமைச் செயலக விவகார ஜெவுக்கு மதிமுக கண்டன"],["தமிழகம்","பொறியியல் கல்லூரிகள் டவுன் பிளானிங் அனுமதி பெற வேண்டு ஐகோர்ட்"],["ஸ்டேட் எக்ஸ்பிரஸ்","மீண்டு ஆறுதல் யாத்திரை ஜெகன்மோகன் முடிவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","பிடெக் மாணவி தற்கொலை ராகிங் கொடுமை காரணமா"],["ஸ்டேட் எக்ஸ்பிரஸ்","காவல் நிலையத்தில் சிறுமி பிண மாயாவதி பதவி விலக வலியுறுத்தல்"],["உலகம்","ஆகாய மேலே பாதாள கீழே ஆனந்த விமான நடுவினிலே"],["உலகம்","சாப்பிட்டால் வயிறு வலிக்கு வயது சிறுமிக்கு விபரீத நோய்"],["உலகம்","இத்தாலியில் கிடைத்தது மோனாலிசா எலுபுகளா"],["உலகம்","அடிச்சு நொறுக்க அமெரிக்காவில் கிளப்"],["தமிழகம்","பாபு பறவை வேண்டா அலறுகிறது கோவை பூங்கா"],["குற்றம்","கழுத்தை அறுத்து வக்கீல் கொலை போஸ்ட்மார்ட்டத்தில் அதிர்ச்சி தகவல்"],["தமிழகம்","புதிய கல்வி கட்டண விவர வெளியிடாமல் பள்ளி நிர்வாகங்கள் மறைப்பு"],["தமிழகம்","சமச்சீர் கல்வி பிரச்னையில் வீபு காரணமாக அரசு வீண் செலவு கருணாநிதி"],["இந்தியா","ஆண்டுக்கு லட்ச கோடி குவிப்பு கறுப்பு பணத்துக்கு குழந்தைகளு பலிகடா"],["இந்தியா","சாமியார் மரணத்தில் சர்ச்சை பாஜ மீது காங்கிரஸ் குற்றச்சாட்டு"],["விளையாட்டு","இந்தியா வெஸ்ட் இண்டீஸ் மோதல்"],["இந்தியா","நீண்ட இழுபறிக்கு பின் அமர்நாத் யாத்திரை துவங்கியது"],["தமிழகம்","சிங்கப்பூரிலிருந்து ஜெயலலிதாவுடன் ரஜினி பேச்சு"],["தலையங்கம்","ரவுடி போல் நடந்த ரயில்வே பாதுகாப்பு வீரர்"],["விளையாட்டு","டிசபர் மாத சென்னையில் டெஸ்ட் போட்டி"],["விளையாட்டு","இன்று கடைசி ஆட்ட வெற்றியுடன் முடிப்போ ஹர்பஜன்சிங்"],["விளையாட்டு","டெஸ்ட்டிலு கெய்லுக்கு ஆப்புதான்"],["விளையாட்டு","செரீனா ஷாக் தோல்வி சானியா சோதேவ் அவுட்"],["உலகம்","விக்கிலீக்ஸ்க்கு நிதி திரட்ட ஜூலியன் அசான்ஜ் மொய் விருந்து"],["உலகம்","அனாதை குழந்தைகளுக்கு நான்தான் அப்பா பாக் அதிபர் யோசனை"],["உலகம்","உண்மையை அபலப்படுத்துகிறார் அர்னால்டு வீட்டு வேலைக்காரி"],["ஸ்டேட் எக்ஸ்பிரஸ்","மதிய உணவு சாப்பிட்ட மாணவர்கள் அட்மிட்"],["ஸ்டேட் எக்ஸ்பிரஸ்","விரல் அதிசய குழந்தையின் கூடுதல் விரல்களை வெட்ட முடிவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","புலிக்குட்டியை தத்தெடுத்தார் கிரிக்கெட் கேப்டன் தோனி"],["ஸ்டேட் எக்ஸ்பிரஸ்","முபை நிருபர் கொலைக்கு சந்தன கடத்தல்காரன் காரணமா"],["உலகம்","நிறைய விளையாடணு பீட்சா பர்கர் குறைக்கணு"],["உலகம்","உறைய வைக்கு நீரில் பெண் விஞ்ஞானி சாகச"],["உலகம்","ஞாபக சக்தியில் பட்டைய கிளப்புது பட்டை"],["உலகம்","இளவரசி கேத் வாங்கிய கமி விலை பேஸ் கிரீ"],["உலகம்","ஆயிர அடி உயரத்தில் பறக்கு பைக் கண்டுபிடிப்பு"],["மாவட்ட மசாலா","மூக்கில் பஞ்சை அடைத்து வயது குழந்தை கொலை"],["மாவட்ட மசாலா","கல்குவாரி அதிபரிட லஞ்ச சுரங்கத்துறை அதிகாரி கைது"],["மாவட்ட மசாலா","நாமக்கல் அருகே விபத்து பலி ஆக உயர்வு"],["மாவட்ட மசாலா","இலுப்பூரில் போலீஸ் ரெய்டு லாட்டரி விற்ற பேர் கைது"],["மாவட்ட மசாலா","எபிஏ எசிஏ நுழைவு தேர்வு தேதி முடிவு வெளியீடு"],["மாவட்ட மசாலா","கோவையில் தேதி ராணுவத்துக்கு ஆள் சேர்ப்பு"],["மாவட்ட மசாலா","வழிப்பறியை தடுத்த ஏட்டு கொலை அப்பீல் வழக்கில் இருவருக்கு ஆயுள்"],["தமிழகம்","மலையில் குடியேறியவர்கள் வது நாளாக போராட்ட"],["தமிழகம்","அபத்தூர் பஸ் நிலையத்தில் அடிப்படை வசதிகள் இல்லை"],["தமிழகம்","சிங்கப்பூரில் இருந்து போனில் கருணாநிதியுடன் ரஜினி பேச்சு"],["இந்தியா","பீகார் ரயில் நிலையத்தில் தீ வைப்பு மாவோயிஸ்ட்கள் அட்டகாச"],["தமிழகம்","ஸ்ரீபெருபுதூர் நோக்கியா கபெனி குடோனில் இன்று பயங்கர தீ விபத்து"],["இந்தியா","மீண்டு உண்ணாவிரத அன்னா ஹசாரே மிரட்டல்"],["இந்தியா","கல்வி கட்டண கட்டாததால் கவனிக்கப்படாத குழந்தைகள்"],["தமிழகம்","ஜெயலலிதா திருச்சி வருகை அமைச்சர்கள் ஆலோசனை"],["தமிழகம்","நியமிக்கப்பட்ட கிராமத்தில் தங்காத விஏஓக்கள் மீது நடவடிக்கை உயர் நீதிமன்ற"],["தமிழகம்","லட்ச லேப்டாப் வாங்க எல்காட் மூல டெண்டர்"],["தமிழகம்","முல்லை பெரியாறு பிரச்னை தமிழகத்துடன் மோத மாட்டோ உமன்சாண்டி"],["தமிழகம்","வது பரிசோதனைக்கு பின் ஹரித்துவார் சாமியார் உடல் அடக்க"],["இந்தியா","கர்நாடக அமைச்சர் பயண செய்த ஹெலிகாப்டர் திடீர் மாய"],["இந்தியா","பிரமபுத்திரா நதியில் சீனா அணை கட்டவில்லை எஸ்எகிருஷ்ணா"],["இந்தியா","தொகுதிக்கு ஏன் வரவில்லை சிரஞ்சீவியிட மக்கள் கேள்வி"],["தமிழகம்","தமிழகத்தில் எய்ட்ஸ் பாதிப்பில் தேனி முதலிட"],["உலகம்","அல்கய்தா புதிய தலைவர் அய்மன் அல் ஜவாஹிரி"],["இந்தியா","சிறப்பு அதிகாரத்தை பயன்படுத்தி பலாத்கார கொலைகளில் ராணுவ வீரர் ஈடுபடலாமா"],["தமிழகம்","சிங்கப்பூர் பள்ளிகளில் ஒரே கல்வி முறை மாணவ மாணவிகள் கல்வி சுற்றுலா"],["தமிழகம்","அரசு பள்ளி மாணவர்களுக்கு தனியார் பள்ளியில் அட்மிஷன் மறுப்பு"],["தமிழகம்","பிஇ படிப்புக்கு கவுன்சலிங் எங்கு எப்போது நடக்கு"],["இந்தியா","லோக்பால் மசோதாக்கள் தயாரிக்கு திட்ட இல்லை மொய்லி"],["இந்தியா","கயூனிஸ்ட் கட்சிகளை இணைக்கு திட்ட இல்லை பிருந்தா கரத்"],["தமிழகம்","கட்டண உயர்வால் கோப தொழில்நுட்ப கல்லூரி விடுதி சூறை"],["மாவட்ட மசாலா","டிராக்டர் மீது கார் மோதி போலீஸ்காரர் பரிதாப சாவு"],["மாவட்ட மசாலா","விஐடி பல்கலைக்கழகத்தில் நாள் மாநாடு தொடங்கியது"],["மாவட்ட மசாலா","செமை கருபு சாகுபடி கோடி நிதி ஒதுக்கீடு"],["மாவட்ட மசாலா","தனியார்மயமாக்க முயற்சி தபால் ஊழியர்கள் ஸ்டிரைக்"],["மாவட்ட மசாலா","போலீஸ் ஏட்டு பைக் திருட்டு"],["மாவட்ட மசாலா","மயிலாடுதுறையில் பயங்கர தீ வீடுகள் எரிந்து நாச"],["மாவட்ட மசாலா","வறுமை வேலைவாய்ப்பு குறித்து நாடு முழுவது ஜூலையில் ஆய்வு"],["சினிமா(ரீல்மா)","ஸ்ருதி பற்றி கேள்வி சித்தார்த் கோப"],["உலகம்","உலகிலேயே காஸ்ட்லி சிக்கன் கபாப் ஆயிர"],["உலகம்","சமையல் போட்டியில் சபாஷ் உப்புமாவுக்கு லட்ச"],["உலகம்","பாக் குத்துச் சண்டை வீரர் தீவிரவாதிகளால் சுட்டு கொலை"],["உலகம்","ஜவாஹிரியையு கொல்வோ அமெரிக்கா திட்டவட்ட"],["குற்றம்","மினி லாரிகள் நேருக்கு நேர் மோதல் வாலிபர்கள் பலி"],["குற்றம்","தாசில்தார் ஆபீஸ் ஊழியர் கைது கோடி ஆவணங்கள் பறிமுதல்"],["விளையாட்டு","வது ஆட்டத்தில் தோல்வி கோப்பையை வென்றது இந்தியா"],["விளையாட்டு","யூடிஆர்எஸ் முறைக்கு சச்சின் மீண்டு ஆதரவு"],["விளையாட்டு","கடைசி டெஸ்ட் தள்ளாடுது இலங்கை"],["குற்றம்","ஆயிர லஞ்ச ஆவின் ஜிஎ கைது"],["தமிழகம்","புதிதாக கட்டப்பட்ட கோடி பைபர் படகுகள் எரிந்து நாச"],["தமிழகம்","மாற்று திறனாளிகளுக்கு தாலிக்கு தங்க"],["இந்தியா","மாதமாக பூட்டியிருந்த கதவு திறப்பு பாபா அறையில் வைர வைடூரிய கரன்சி"],["உலகம்","ஆண்டாக எரியு வாட் குண்டு பல்பு"],["இந்தியா","வகுப்பு மாணவியை சீரழித்த விஐபிக்கள் உள்பட பேருக்கு வலை"],["இந்தியா","மனைவியை காதலனுக்கே கட்டிவைத்த கணவன்"],["ஸ்டேட் எக்ஸ்பிரஸ்","உல்பாவுடன் பேச்சுவார்த்தை அசா முதல்வர் அறிவிப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","மாருதி கார் தொழிற்சாலை ஊழியர் போராட்ட வாபஸ்"],["ஸ்டேட் எக்ஸ்பிரஸ்","முபை நிருபர் கொலைக்கு குடுப பிரச்னை காரணமா"],["ஸ்டேட் எக்ஸ்பிரஸ்","சொத்து விவரங்களை வெளியிட ஜனாதிபதிக்கு ஆலோசனை"],["தமிழகம்","சாய சலவை ஆலை மூடலுக்கு தீர்வு காண தலைமை செயலாளருடன் பேச்சுவார்த்தை"],["தமிழகம்","தண்டையார்பேட்டையில் பயங்கர தீ குடிசைகள் சாபல்"],["இந்தியா","மீண்டு வெடிக்கிறது தனி தெலங்கானா மத்திய அரசுக்கு மிரட்டல்"],["தமிழகம்","பள்ளிகள் திறக்கப்பட்டதால் சாலைகளில் வாகன நெரிசல் அதிகரிப்பு"],["தமிழகம்","தமிழீழத்துக்கு ஆதரவாக கையெழுத்து இயக்க விடுதலை சிறுத்தை தீர்மான"],["தமிழகம்","திருவள்ளூர் மாவட்டத்தில் சாலை பணிகள் கலெக்டர் ஆய்வு"],["தமிழகம்","எல்கேஜிக்கு வரை கட்டண"],["தமிழகம்","திமுக ஆட்சி போட்ட திட்டங்களால் எதிர்காலத்தில் மின்சார பற்றாக்குறை வராது கருணாநிதி"],["இந்தியா","மனித கழிவை கையால் அகற்று கொடூரமான நடைமுறையை மாதத்தில் ஒழிக்க வேண்டு பிரதமர்"],["இந்தியா","ஊழல் விஷயத்தில் மவுன சோனியா காந்திக்கு பாஜ கண்டன"],["இந்தியா","அசா ரயிலில் சக்திவாய்ந்த டைபா கண்டுபிடிப்பு"],["தமிழகம்","சிக்னல் கோளாறு மின் கபி கட் குமிடிப்பூண்டி ரயில்கள் தாமத ஒரு தொடர்கதை"],["தமிழகம்","மதிப்பூதிய வழங்காததால் சென்சஸ் பணியில் ஈடுபட்ட லட்ச ஊழியர் ஏமாற்ற"],["தமிழகம்","ஆண்டு நேரடி சேர்க்கையில் இலங்கை அகதிகளின் குழந்தைகளை சேர்க்கலா தமிழக அரசு"],["மாவட்ட மசாலா","லங்காடி தேசிய போட்டி தமிழக அணி தேர்வு"],["மாவட்ட மசாலா","லாரி மீது வேன் மோதி பேர் பலி"],["மாவட்ட மசாலா","சலூன் கடைக்காரருக்கு மாத சிறை தண்டனை"],["மாவட்ட மசாலா","புதுவை அரசு ஊழியர் வீட்டில் கோடி நகை கொள்ளை"],["குற்றம்","மனைவியை குத்தி கொன்ற ராணுவ அதிகாரி கைது"],["தலையங்கம்","மாணவர்களுக்கு பள்ளிகள் அவமரியாதை"],["உலகம்","மயக்க மருந்து கொடுக்காமல் ஆபரேஷன்"],["விளையாட்டு","டிரெலெட் வேகத்தில் அரண்டது இலங்கை"],["விளையாட்டு","விபிள்டனுக்கு மழையால் சிக்கல்"],["விளையாட்டு","கெய்ல் கதி என்ன"],["சினிமா(ரீல்மா)","அதிகமாகு நட்பு வாய்ப்பு பிடிக்கு பெல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","சொத்து விவரங்களை வெளியிட பிரதிபா பாட்டீல் முடிவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","விசாரணை கைதிக்கு கத்திகுத்து ஒட்டுமொத்த போலீசு சஸ்பெண்ட்"],["ஸ்டேட் எக்ஸ்பிரஸ்","லோக்பால் மசோதாவுக்கு டெல்லி முதல்வர் எதிர்ப்பு"],["உலகம்","ரஷ்ய பிரதமர் புடினுக்கு போட்டோகிராபர் ஆனார் மாடல் அழகி"],["உலகம்","சீனாவில் வெள்ள பேர் பலி"],["இந்தியா","கரீனா கபூர் சைப் அலிகான் காதலில் திடீர் விரிசல்"],["உலகம்","கருப்பு பண பதுக்கிய இந்தியர்கள் யார் லிஸ்ட் வெளியிட சுவிஸ் அரசு முடிவு"],["இந்தியா","கடல் கொள்ளையர் விடுவித்த எவிசூயஸ் கப்பல் நடுக்கடலில் தத்தளிப்பு"],["மாவட்ட மசாலா","புதுகை கலெக்டர் ஆபீசில் லிப்டில் சிக்கிய எஎல்ஏ"],["மாவட்ட மசாலா","ஏரியில் மண் சரிந்து தொழிலாளி பரிதாப சாவு"],["மாவட்ட மசாலா","கோயில் குளத்தில் மூழ்கி மாணவர்கள் பலி"],["தலையங்கம்","கோடிகளை குவித்த கலப்பட குபல்"],["மர்மம்","இருண்ட குகைக்குள் ஐந்து தலை நாக"],["வேலைவாய்ப்பு","கூடங்குள அணுமின் நிலையத்தில் டிப்ளமோ படித்தவர்களுக்கு வாய்ப்பு"],["வேலைவாய்ப்பு","இன்டலிஜென்ஸ் பீரோவில் அதிகாரி பணியிட"],["வேலைவாய்ப்பு","கடற்படையில் மாலுமியாகலா"],["தமிழகம்","உள்ளாட்சி தேர்தல் பணிகள் தீவிர ஊராட்சிகளில் ஒற்றை வார்டு பிரிக்கு பணி தொடங்கியது"],["குற்றம்","பட்டுக்கோட்டையில் பட்டப்பகலில் பயங்கர தலைமை ஆசிரியர் மனைவி கழுத்தை அறுத்து கொலை"],["குற்றம்","அச்சிறுப்பாக்க அருகே பரபரப்பு முகத்தை சிதைத்து வாலிபர் எரித்து கொலை"],["குற்றம்","பாடியில் சூதாட்ட பேர் கைது"],["தமிழகம்","தர்மபுரி அருகே சோக கிணற்றில் மூழ்கி மாணவர் பலி"],["உலகம்","தந்தையாக இருப்பது கஷ்டமான வேலை சொல்கிறார் ஒபாமா"],["உலகம்","தலிபான் தலைவர்களுடன் அமெரிக்கா பேச்சுவார்த்தை"],["விளையாட்டு","ஜமைக்காவில் முதல் டெஸ்ட் இந்தியா வெஇ நாளை மோதல்"],["விளையாட்டு","கோடி பரிசுத்தொகையுடன் விபிள்டன் நாளை ஸ்டார்ட்"],["தமிழகம்","சூளைமேட்டில் நள்ளிரவு விபத்து இன்ஜினியர் உள்பட பேர் பரிதாப பலி"],["உலகம்","இங்கிலாந்து டாக்டர்கள் சாதனைஇளபெண்ணுக்கு நுரையீரல் மாற்று ஆபரேஷன்"],["தமிழகம்","பெண்களு ஈடுபடு பயங்கர ஆபத்தான ஆசனவாய் கடத்தல்"],["இந்தியா","முண்டே நிதின் கட்கரி மோதல் பாஜ தலைவர்கள் இன்று டெல்லியில் ஆலோசனை"],["ஸ்டேட் எக்ஸ்பிரஸ்","அரசு ஊழ¤யர் கொலை பகுஜன் சமாஜ் தலைவர் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","முபை பத்திரிகையாளர் கொலை ஜூன் ல் போராட்ட"],["ஸ்டேட் எக்ஸ்பிரஸ்","தெலங்கானா காங் தலைவர்கள் இரட்டை வேட டிஆர்எஸ்"],["இந்தியா","லோக்பால் கூட்டு குழு கூட்ட காங் தலைவர்கள் ஆலோசனை"],["இந்தியா","லோக்பாலில் பிரதமர் சேர்க்கப்படுவாரா இன்று முக்கிய ஆலோசனை"],["தமிழகம்","ஸ்ரீரங்க தொகுதியில் கோடி திட்டங்கள் ஜெயலலிதா அடிக்கல் நாட்டினார்"],["இந்தியா","லோக்பால் பற்றி ஆலோசிக்க ஜூலை முதல் வாரத்தில் அனைத்து கட்சி கூட்ட"],["விளையாட்டு","இந்தியா வெஸ்ட் இண்டீஸ் முதல் டெஸ்ட் இன்று தொடக்க"],["சினிமா(ரீல்மா)","ரஜினி நாட்களில் சென்னை திருபுவார் நடிகர் தனுஷ்"],["தமிழகம்","ஸ்ரீரங்க ரங்கநாதர் கோயிலில் முதல்வர் ஜெயலலிதா வழிபாடு"],["இந்தியா","கட்கரியை இறக்கி விட்டு புறப்பட்ட ஹெலிகாப்டர் விழுந்து நொறுங்கியது"],["இந்தியா","கர்நாடக எல்லையில் சாய்பாபா டிரஸ்ட் காரில் லட்ச சிக்கியது"],["இந்தியா","அவதூறு பிரசாரத்தை ஆதரிக்கவில்லை ஹசாரேக்கு சோனியா பதில்"],["தமிழகம்","எஸ்எஸ்எல்சி மதிப்பெண் சான்றிதழ் இன்று வினியோக"],["தமிழகம்","இளைஞர் காங்கிரசுக்கு அதிகார கிடையாது தங்கபாலு"],["தலையங்கம்","உயிரை எடுக்கு மது விருந்து பார்ட்டி"],["மாவட்ட மசாலா","நாகர்கோவிலில் பரிதாப சரியாக வேலை செய்யாத சிறுவனுக்கு அயர்ன்பாக்ஸ் சூடு"],["மாவட்ட மசாலா","தனியார்மய வேண்டா சாலை பணியாளர் தீர்மான"],["மாவட்ட மசாலா","திடீர் கடல் சீற்ற படகு சர்வீஸ் ரத்து"],["மாவட்ட மசாலா","பள்ளி மாணவி பலாத்கார வழக்கு நாளில் விசாரணை அறிக்கை"],["தமிழகம்","தாத்தா முதல் கொள்ளு பேரன்கள் வரை தலைமுறையினர் சந்திப்பு"],["மாவட்ட மசாலா","கிட்னி திருட்டு புகார் ஆஸ்பத்திரியில் இருந்து வாலிபர் மாய"],["குற்றம்","பிளஸ் மாணவரை தற்கொலைக்கு தூண்டிய அரசுபள்ளி ஆசிரியர் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","எய்ஸ் ஆஸ்பத்திரியில் இருந்து கொலை கைதி தப்பியோட்ட"],["ஸ்டேட் எக்ஸ்பிரஸ்","ரயில் பிரேக் கபி குத்தி பேர் பரிதாப பலி"],["ஸ்டேட் எக்ஸ்பிரஸ்","பீகாரில் மர்ம காய்ச்சல் குழந்தைகள் பலி"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஜார்கண்ட்டில் தண்டவாள தகர்ப்பு மாவோயிஸ்ட்கள் அட்டகாச"],["உலகம்","வது மாடியில் இருந்து விழுந்த குழந்தையை காப்பாற்றியது ஏசி"],["உலகம்","விரைவில் வருது வாழைப்பழ கார்"],["உலகம்","வாள் மூக்கு வேட்டைய ராஜா எக்ஸ்பிரஸ் ரயிலைவிட ஸ்பீடு"],["சினிமா(ரீல்மா)","கார்த்தி திருமண பற்றி காஜல் அகர்வால்"],["விளையாட்டு","இலங்கை போட்டிகள் இந்திய வீரர்களுக்கு தடை பின்னணியில் லலித் மோடி"],["விளையாட்டு","விபிள்டன் இன்று தொடக்க"],["விளையாட்டு","நியூசி வீரர்களுக்கு கோடி சபள நிறுத்த"],["விளையாட்டு","தத்தளிக்குது இலங்கை"],["விளையாட்டு","நபர் அந்தஸ்தை இழக்கிறார் சச்சின்"],["விளையாட்டு","கெய்லுக்கு வேட்டு வைத்தது ராநரேன்"],["உலகம்","வயாக்ராவால் ப்ளே பாய் அதிபருக்கு காது செவிடானது"],["உலகம்","பாரீஸ் ஏர் ஷோவில் போயிங் ஜபோ விமான"],["உலகம்","மனித குண்டு தாக்குதல் ஆப்கனில் பேர் பலி"],["இந்தியா","ரஜினியின் அண்ணன் நாள் சிறப்பு ஹோம"],["குற்றம்","மத்திய அமைச்சரின் மருமகள் மர்ம சாவு"],["தமிழகம்","அண்ணா பல்கலைக்கழகத்தில் ஜூலை ல் இன்ஜி கவுன்சலிங்"],["தமிழகம்","ராமேஸ்வர ரயிலை கவிழ்க்க பயங்கர சதி"],["தமிழகம்","கிராம கிராமமாக சென்று நன்றி தெரிவிக்கிறார் முதல்வர்"],["தமிழகம்","அதிக கட்டண வசூல் பெரபூர் மெட்ரிக் பள்ளி முன்பு பெற்றோர் உண்ணாவிரத"],["தமிழகம்","சாயப்பட்டறை விவகார கோட்டையில் நிபுணர் குழு ஆலோசனை"],["தமிழகம்","மணி நேர பவர் கட் சென்னை மக்கள் கடு அதிருப்தி"],["சினிமா(ரீல்மா)","டைரக்டர் சங்க தலைவராக பாரதிராஜா தேர்வு"],["குற்றம்","உபியில் பலாத்கார செய்து பெண் எரித்து கொலை"],["இந்தியா","லோக்பால் மசோதா தயாரிப்பு கூட்டுக் குழுவில் சதவீத உடன்பாடு"],["இந்தியா","கறுப்பு பணத்தில் பாதி காங்கிரசாருக்கு உரியது மேனகா காந்தி"],["இந்தியா","கவர்னர் பதவி ஆட்டுக்கு தடியா யானைக்கு அங்குசமா"],["உலகம்","உலக முழுவது கோடி அகதிகள்"],["தமிழகம்","புதிய கவர்னர் யார் சுர்ஜித் சிங் பர்னாலா பதவிக் கால முடிந்தது"],["இந்தியா","ராஜ்யசபா எபி பதவிக்கு ஜூலை ல் தேர்தல்"],["தமிழகம்","இன்று அமலாக இருந்த மணி நேர மின்தடை ரத்து"],["தமிழகம்","உள்ளாட்சி தேர்தலுடன் சேர்த்து இடைத்தேர்தல் நடத்தப்படாது தேர்தல் அதிகாரி"],["தமிழகம்","மாணவியை பலாத்கார செய்த குமரி அதிகாரிகள் பட்டியல் தயார்"],["மாவட்ட மசாலா","பூட்டிய அறையில் தவித்த தாய் மகள் மீட்பு"],["மாவட்ட மசாலா","பெண்ணின் கூந்தலை வெட்டிய பெண்கள் கைது"],["மாவட்ட மசாலா","ரப்பர் தோட்டத்தில் ஆண்யானை இறந்து கிடந்தது"],["மாவட்ட மசாலா","கோயிலில் கொள்ளை முயற்சி அண்ணன் தபி கைது"],["மாவட்ட மசாலா","மாணவிகளிட சில்மிஷ போதை ஆசாமிக்கு அடி"],["தமிழகம்","முதல்வர் ஜெயலலிதா வது நாளாக வாக்காளர்களுக்கு நன்றி"],["குற்றம்","ஜட்டி கொள்ளையர் கோவையில் சிக்கினர்"],["குற்றம்","நெல்லை அருகே துப்பாக்கிச்சூட்டில் பேர் படுகாய"],["சினிமா(ரீல்மா)","சர்ச்சைக்குரிய பார்ட்டி மீண்டு நடத்துகிறார் கேத்ரினா"],["மருத்துவம்","ஆஸ்துமா அவஸ்தைக்கு ஹோமியோ தீர்வு"],["இந்தியா","அமைச்சர்கள் கவர்னர்கள் மாற்ற சோனியாவுடன் பிரதமர் ஆலோசனை"],["உலகம்","இந்திய தூதரக அதிகாரி மீது வேலைக்கார பெண் புகார்"],["உலகம்","மனித குண்டாக வந்த வயது சிறுமி மீட்பு"],["உலகம்","பாபை கொத்த செய்து பெண் விபரீத தற்கொலை"],["விளையாட்டு","ரன்னில் சுருண்டது இந்தியா"],["உலகம்","ரஷ்யாவில் விமான விபத்து பயணிகள் பரிதாப பலி"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஜெகன் ஆறுதல் யாத்திரை காங்கிரஸ் எஎல்ஏ பங்கேற்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","அமர்நாத் புனித பயண போலீசார் பாதுகாப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஏக்கர் டாடா நில விவசாயிகளிட ஒப்படைப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","பீகாரில் லாலு பஸ்வான் கூட்டணியில் திடீர் பிளவு"],["உலகம்","ஆரோக்கியமாக இருந்தால் குண்டு உடபு நோ பிராப்ள"],["உலகம்","வீட்டு வேலை செய்தால் படிப்பில் சுட்டி ஆகலா"],["இந்தியா","வகுப்பறையில் ஓட்கா குடித்த மாணவிகள் சஸ்பெண்ட்"],["இந்தியா","அமைச்சர் மருமகள் கொலை கணவர் உள்பட பேர் கைது"],["இந்தியா","புட்டபர்த்தி பண கடத்தலில் அமைச்சர்களுக்கு தொடர்பு பாபா பேத்தி உயிருக்கு ஆபத்து"],["இந்தியா","முபைக்கு விமானத்தில் வந்த சவப்பெட்டியில் இருந்த நகை பண கொள்ளை"],["குற்றம்","தாய்க்கு திதி கொடுத்தபோது புழல் ஏரியில் மூழ்கி சிறுமி சாவு"],["தமிழகம்","வங்க கடலோரத்தில் கடல் சீற்ற மீனவர்களுக்கு திடீர் தடை"],["தமிழகம்","ஆசிரியர்களே இல்லாத அரசு மாதிரி பள்ளி"],["இந்தியா","லோக்பால் மசோதா தயாரிப்பில் உடன்பாடு ஏற்படவில்லை"],["இந்தியா","பொய் சத்திய செய்பவர்கள் தண்டனை அனுபவிப்பார்கள்"],["இந்தியா","மழைக்கால தொடர் நாள் தாமத நாடாளுமன்ற ஆக ல் கூடுகிறது"],["தமிழகம்","ஐஏஎஸ் அதிகாரிகள் மாற்ற"],["தமிழகம்","ஜூலை தேதி எபிபிஎஸ் கவுன்சலிங் தொடக்க"],["இந்தியா","இனி பெட்டிக்கடைகளில் ரயில் டிக்கட் வாங்கலா"],["விளையாட்டு","ரெய்னா ஹர்பஜன் அபார ஆட்ட இந்தியா ஆல் அவுட்"],["இந்தியா","யாருக்கு ஓட்டு போட்டோ வாக்காளர்கள் அறிந்து கொள்ள மின்னணு இயந்திரத்தில் வசதி"],["தலையங்கம்","அவரவர் வாழ்க்கை அவர்கள் இஷ்ட"],["ஸ்டேட் எக்ஸ்பிரஸ்","சிங்கூர் நில சட்டத்தை எதிர்த்து ஐகோர்ட்டில் டாடா வழக்கு"],["ஸ்டேட் எக்ஸ்பிரஸ்","நானாவதி கமிஷன் பதவி கால நீட்டிப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","பார்லி கூட்டத்தொடர் தாமத பாஜ கடு எதிர்ப்பு"],["உலகம்","குரங்கு நாய் பிரெண்ட்ஷிப் புத்தக"],["உலகம்","கிமீ வேகத்தில் பறக்கு ஹைப்பர்சானிக் விமான தயார்"],["உலகம்","கூர்ந்து கவனிப்பவர் பெட்் கில்லாடி"],["சினிமா(ரீல்மா)","அமா கேரக்டரா அஞ்சலி எஸ்கேப்"],["விளையாட்டு","ஷரபோவா இவானோவிக் கலக்கல் வெற்றி"],["கல்வி","வேலை பார்த்துக்கொண்டே எபிஏ எசிஏ படிக்கலா"],["கல்வி","வேளாண் பல்கலையில் தொலைதூர படிப்புகள்"],["கல்வி","அரசு ஐடிஐகளில் அட்மிஷன்"],["உலகம்","கணவரை ஏமாற்றுவதில் பிரிட்டிஷ் பெண்கள் முதலிட"],["உலகம்","கின்னஸ் பாட்டி மரண"],["உலகம்","ஐநா பொதுச்செயலராக பான்கி மூன் தேர்வு"],["தமிழகம்","இலங்கை சிறையில் உள்ளவர்களை மீட்கக் கோரி ராமேஸ்வர மீனவர்கள் காலவரையற்ற ஸ்டிரைக்"],["குற்றம்","துணை ராணுவத்தினர் சென்ற வேன் கவிழ்ந்து வீரர்கள் பலி"],["குற்றம்","வயது சிறுவன் கடத்தி கொலை"],["தமிழகம்","அரசு கல்லூரியில் ஆள் பிடிக்க அலையு தனியார் ஆசிரியர்கள்"],["குற்றம்","அபத்தூர் ஆவின் மார்க்கெட்டிங் மேனேஜர் தீக்குளித்து சாவு"],["மாவட்ட மசாலா","ாய் இரட்டிப்பு மோசடி திட்ட எஸ்ஐ சிக்கினார் ஜீப் பறிமுதல்"],["மாவட்ட மசாலா","ஸ்டேஷனில் இருந்த கவுன்சிலரை அழைத்து சென்ற அதிமுகவினர்"],["தமிழகம்","முஸ்கான் ரித்திக் கொலை வழக்கு சாட்சி விசாரணை துவங்க தாமத"],["மாவட்ட மசாலா","கிணற்றில் மூழ்கி தாய் குழந்தைகள் பலி"],["மாவட்ட மசாலா","ரோட்டில் வேன் கவிழ்ந்து லட்ச மது நாச"],["மாவட்ட மசாலா","சிதபர ஆதிதிராவிடர் நல தாசில்தார் ஆபீஸ் ஜப்தி"],["மாவட்ட மசாலா","பிளஸ் மாணவர்களுக்கு சிறப்பு தேர்வு தொடங்கியது"],["இந்தியா","சாய்பாபா அறக்கட்டளை நிர்வாகிகள் உள்துறை அமைச்சரை சந்திக்க முடிவு"],["தமிழகம்","பிளஸ் சிறப்பு துணைத் தேர்வு எழுத முடியாமல் மாணவர்கள் தவிப்பு"],["தமிழகம்","ராகுல் பிரதமர் ஆக முடியாது சுப்பிரமணியசாமி"],["இந்தியா","பசிதபர சென்ற ஹெலிகாப்டரில் திடீர் கோளாறு"],["சினிமா(ரீல்மா)","அமா ஆகிறார் ஐஸ்வர்யா"],["இந்தியா","மண் கல் வீசி மாணவர்கள் தாக்குதல் அமைச்சர் விரட்டியடிப்பு"],["தமிழகம்","ரங்கசாமி டெல்லி பயண கவர்னர் வைத்திலிங்க சந்திப்பு"],["தமிழகம்","ஆக்கப்பூர்வமான எதிர்கட்சியாக செயல்படுவோ ராமகிருஷ்ணன்"],["தமிழகம்","லோக்பால் மசோதா நாடக சுப்ரமணியசாமி"],["தமிழகம்","கல்வி கட்டணத்தை அமல்படுத்த அரசு எடுத்த நடவடிக்கை என்ன"],["இந்தியா","பெண்கள் இடஒதுக்கீடு மசோதா தோல்வியில் முடிந்தது அனைத்து கட்சி கூட்ட"],["இந்தியா","ஊழல் செய்து வாங்கிய சொத்து பறிமுதல் செய்ய லோக்பாலுக்கு அதிகார"],["இந்தியா","பிரணாப் அலுவலகத்தில் உளவு முழு விசாரணை நடத்த பாஜ வலியுறுத்தல்"],["இந்தியா","லோக்பால் வரபுக்குள் பிரதமர் வர வேண்டு திமுக கருத்து"],["இந்தியா","காங்கிரசில் சேர மாட்டேன் கோபிநாத் முண்டே பல்டி"],["இந்தியா","கேஜிபி சொத்துகள் பற்றி விசாரணைக்கு உத்தரவு"],["இந்தியா","எடியூரப்பா குடுப ஏமாற்றி வாங்கிய சிமென்ட் கபெனி"],["இந்தியா","தர்மஸ்தலா கோயிலில் சத்திய செய்யு சவால் எடியூரப்பா திடீர் பல்டி"],["இந்தியா","போட்டி அரசாக லோக்பால் இருக்காது ஹசாரே"],["தலையங்கம்","கண்மாயில் விஷ கலந்து மீன்களை கொன்ற பேடிகள்"],["மாவட்ட மசாலா","சொத்து குவிப்பு வழக்கு ஓஎன்ஜிசி ஊழியர் கைது"],["மாவட்ட மசாலா","பிரபல கொள்ளையன் கைது செல்போன்கள் பறிமுதல்"],["மாவட்ட மசாலா","மாணவர்களுக்கு செஸ் பயிற்சி விஸ்வநாதன் ஆனந்த் முடிவு"],["மாவட்ட மசாலா","சத்துணவு முட்டை முறைகேடு ஒப்பந்ததாரர் அனுமதி ரத்து"],["மாவட்ட மசாலா","கடத்தல் வாகனங்கள் பறிமுதல் காங் நிர்வாகி மீது வழக்கு"],["மாவட்ட மசாலா","கோடி கேட்கிறது கேரளா"],["மாவட்ட மசாலா","மாணவியை கடத்திய வாலிபர்கள் கைது"],["மாவட்ட மசாலா","கைதியிட சிகார்டு பறிமுதல்"],["மாவட்ட மசாலா","மருமகள் படுகொலை மாமனாருக்கு வலை"],["மாவட்ட மசாலா","வேலைவாய்ப்பு பதிவை புதுப்பிக்க எஸ்எஎஸ் மூல நினைவூட்டல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","அமைச்சர் மருமகள் கொலை பிரேத பரிசோதனையில் உறுதி"],["ஸ்டேட் எக்ஸ்பிரஸ்","ராதேவுக்கு தந்த மரியாதை அன்னாவுக்கு உண்டு திக்விஜய்"],["ஸ்டேட் எக்ஸ்பிரஸ்","தகவல் சட்டத்தில் விலக்கு சிபிஐ மாஜிகள் எதிர்ப்பு"],["உலகம்","ஜாலியா ஷாப்பிங் போனால் மன உளைச்சல் மறையுமா"],["தமிழகம்","பட்டா போட்டு தங்கிய ஃபாரின் பறவைகள்"],["உலகம்","அழகாக பென்சில் பிடித்து பட வரையுது ரோபோ"],["உலகம்","தூளியில் படுத்தா சுகமா தூங்கலா"],["சினிமா(ரீல்மா)","போட்டோகிராபர் மீது பாய்ச்சலா"],["தமிழகம்","மீனவர்களை மீட்க கோரி நாளை முதல் உண்ணாவிரத"],["தமிழகம்","சோழவர செபரபாக்க ஏரியில் நீர்மட்ட குறைந்தது"],["இந்தியா","பாபா அறக்கட்டளை உறுப்பினருடன் ஜெகன் திடீர் சந்திப்பு"],["தமிழகம்","செயற்குழு உறுப்பினர்களிட பாஜ தலைவர்கள் கலந்தாய்வு"],["உலகம்","ஏமன் சிறையில் தப்பிய தீவிரவாதிகளை பிடிக்க தீவிர நடவடிக்கை"],["உலகம்","ஆப்கனில் இருந்து வீரர்கள் வாபஸ் ஒபாமா"],["உலகம்","வடை சுட்ட எண்ணெயில் ஓட போகுது விமான"],["உலகம்","நான் சன்னியாசி இல்லை எடியூரப்பா மகன் ஆவேச"],["இந்தியா","கோயிலில் சத்திய செய்யாதீர்கள் மடாதிபதிகள்"],["இந்தியா","சிமென்ட் கபெனி வாங்கினேனா"],["விளையாட்டு","டிராவிட் சதமடித்து இந்தியா சொதப்பல்"],["விளையாட்டு","வது சுற்றில் நடால்"],["தமிழகம்","லோக்பால் வரபுக்குள் பிரதமர் தங்கபாலு"],["தமிழகம்","ஆபரேஷன் ஹலாவில் பேர் சிக்கினர்"],["உலகம்","இந்தியா பாகிஸ்தான் பேச்சு வார்த்தை நபிக்கைக்கான ஆரப பஷீர்"],["இந்தியா","இலங்கை கடற்படை பிடித்து சென்ற மீனவர்கள் விரைவில் விடுதலை"],["விளையாட்டு","முதல் டெஸ்ட் இந்திய அணி ரன்கள் வித்தியாசத்தில் வெற்றி"],["தமிழகம்","கூடுதல் மாணவர் சேர்க்கை அரசு கோரிக்கை நிராகரிப்பு"],["தமிழகம்","தவறி விழுந்த கடிகார விலை ரயிலில் சங்கிலி இழுத்த பயணிக்கு அபராத"],["இந்தியா","உளவு பார்த்ததாக சொல்வது முழுக்க முழுக்க பொய் அபிகா சோனி"],["இந்தியா","கபெனிகள் பணத்தில் ஹசாரே போராட்ட பால் தாக்கரே"],["இந்தியா","துப்பாக்கி குண்டுகளை சந்திக்கவு தயார் அன்னா ஹசாரே"],["இந்தியா","வீட்டு வேலை செய்வோருக்கு மருத்துவ இன்சூரன்ஸ் திட்ட"],["தலையங்கம்","ஏழை நாடுகள் குப்பை கிடங்கா"],["மாவட்ட மசாலா","லஞ்ச வழக்கில் கைதான சுரங்க அதிகாரி சஸ்பெண்ட்"],["மாவட்ட மசாலா","வாலிபரை அடித்து கொன்று தண்டவாளத்தில் உடல் வீச்சு"],["மாவட்ட மசாலா","யானைகள் அட்டகாச ஏக்கர் பயிர் நாச"],["மாவட்ட மசாலா","இந்து தர்ம பிரசார பேர் குழு நியமன"],["மாவட்ட மசாலா","கோவையில் குற்றங்களை தடுக்க கிவ் அண்ட் டேக் பாலிசி"],["தமிழகம்","சென்னையில் சதுர கிமீக்கு பேர் வசிக்கு அவல"],["உலகம்","முதுமைக்கு தடா போடு மொறுமொறு பாப்கார்ன்"],["சினிமா(ரீல்மா)","சினிமாவை விட்டு விலக நினைத்த இலியானா"],["விளையாட்டு","வது சுற்றில் சானியா ஜோடி"],["தமிழகம்","பைக்கை தொட்டால் செல்போன் அலறு"],["உலகம்","மைக்ரோ ஓவனில் குழந்தை கொலை தாய் கைது"],["உலகம்","அமெரிக்க படை வெளியேற்ற ஆப்கன் அதிபர் வரவேற்பு"],["இந்தியா","ஆண்டு குளிக்காத அழுக்கு ஆசாமி"],["இந்தியா","சாய்பாபா அறக்கட்டளைக்கு அரசு சலுகைகள் திடீர் ரத்து"],["குற்றம்","முகத்தை பாலிதீன் கவரால் கட்டி கல்லூரி மாணவன் தற்கொலை"],["குற்றம்","காஞ்சிபுர காவலான் கேட் பகுதியில் அமன் கோயிலில் கொள்ளை"],["ஸ்டேட் எக்ஸ்பிரஸ்","எபிஏ மாணவர்கள் கொலையில் சிமி அமைப்புக்கு தொடர்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","சாய்பாபா அறக்கட்டளை உறுப்பினர் முன்ஜாமீன் வாங்க முயற்சி"],["ஸ்டேட் எக்ஸ்பிரஸ்","பெண்ணை சீரழித்தவர் கோர்ட்டில் சுட்டுக் கொலை"],["ஸ்டேட் எக்ஸ்பிரஸ்","லக்னோ சிறையில் கைதி கொலை சிபிஐ விசாரிக்க பாஜ வலியுறுத்தல்"],["தமிழகம்","போலீசாரிட அதிமுகவினர் அராஜக தொடர்ந்தால் போராட்ட நடத்துவோ"],["இந்தியா","அரசியலுக்கு கோயிலை பயன்படுத்துவதா எடியூரப்பா குமாரசாமி மன்னிப்பு கேட்க வேண்டு"],["விளையாட்டு","பரிசாக வந்த பெராரி காரை கோடிக்கு விற்றார் சச்சின்"],["தமிழகம்","ஆசிரியை ஸ்கேலால் அடித்ததில் மாணவன் கண்ணில் ரத்த கொட்டியது"],["உலகம்","பின்லேடனின் தொடர்புகள் செல்போன் மூல அபல"],["குற்றம்","அமிக்கல்லை தலையில் போட்டு கணவனை கொன்ற மனைவி கைது"],["சினிமா(ரீல்மா)","போக்கிரி பட தயாரிப்பாளர் ஏர்போர்ட்டில் கடத்தல்"],["தமிழகம்","காலி இடத்தை நிரப்புவதற்காக மாநிலங்களவை உறுப்பினர் தேர்தல்"],["தமிழகம்","வகுப்பில் தோல்வி அடைந்தவர்களுக்கு தேதி சிறப்பு துணை தேர்வு"],["இந்தியா","தந்தைதான் முதலில் பலாத்கார செய்தார் பேருக்கு இரையாகி இருக்கிறேன்"],["இந்தியா","லோக்பால் மசோதா இன்னு தயாராகவில்லை மொய்லி"],["இந்தியா","லோக்பால் சட்ட மூல தனி அரசாங்க நடத்த ஹசாரே விருபுகிறார் கபில்சிபல்"],["இந்தியா","பணக்காரர்களில் இந்தியா இட"],["இந்தியா","இறந்த பெண் திடீரென எழுந்ததால் அதிர்ச்சி"],["உலகம்","தீவிரவாதிகளின் துப்பாக்கி நிழலில் காஷ்மீர் பிரச்னையை பேச முடியாது நிருபமா ராவ்"],["விளையாட்டு","சிங்கிள் பெட்் பிளாட் வாங்கினார் டெண்டுல்கர்"],["இந்தியா","சிவில் சொசைட்டி உறுப்பினர்களின் நிர்ப்பந்தத்துக்கு பணிய கூடாது காங்கிரஸ் செயற்குழு"],["உலகம்","மலை உச்சியில் மரப்பாதை சறுக்கினால் சங்குதான்"],["தலையங்கம்","அடித்த ஆசிரியை துடித்த மாணவன்"],["குற்றம்","குடுப தகராறால் மனைவி குழந்தை கொலை"],["குற்றம்","தூத்துக்குடியில் இன்று அதிகாலை அட்டை குடோனில் பயங்கர தீ"],["மாவட்ட மசாலா","நர்சிட லஞ்ச வாங்கிய கருவூல அதிகாரி கைது"],["மாவட்ட மசாலா","லிட்டர் சாராய வாய்க்காலில் கொட்டி எரிப்பு"],["மாவட்ட மசாலா","மின்சார பாய்ந்து காட்டு யானை பலி"],["மாவட்ட மசாலா","ராஜராஜன் பெயர் மாற்ற மீண்டு திருந்திய நெல் சாகுபடி"],["மாவட்ட மசாலா","ஆற்றில் வேன் கவிழ்ந்து போலீஸ் அதிகாரிகள் காய"],["மாவட்ட மசாலா","பாலிதீன் பையில் அடைத்து பச்சிளங்குழந்தை கொலை"],["மாவட்ட மசாலா","காவிரி டெல்டா மாவட்டங்களில் தேதி முதல் முறைபாசன"],["மாவட்ட மசாலா","நாகர்கோவிலில் ஜூலை தேதி மாநில மல்யுத்த"],["சினிமா(ரீல்மா)","நீச்சல் உடைக்கு தயாரா மேக்னா"],["விளையாட்டு","லட்சத்தில் புது கார் வாங்கிய சச்சின்"],["விளையாட்டு","டோனி அக்கவுன்ட்டில் கூட இல்லை"],["ஸ்டேட் எக்ஸ்பிரஸ்","என்டோசல்பான் பூச்சிக் கொல்லி திரிபுராவில் மாத தடை"],["ஸ்டேட் எக்ஸ்பிரஸ்","பீகாரில் மின்னல் தாக்கி சிறுமிகள் பரிதாப சாவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","பெண்கள் கடத்தல் விவகார உபி எஎல்ஏ நீக்க"],["ஸ்டேட் எக்ஸ்பிரஸ்","மாணவி பலாத்கார அரசு பள்ளி ஆசிரியர் கைது"],["இந்தியா","கட்சி மேலிட வற்புறுத்தலால் சத்திய செய்யு முடிவை கைவிட்டார் எடியூரப்பா"],["உலகம்","இந்திய தூதர் மீது குற்றச்சாட்டு அமெரிக்கா கைவிரிப்பு"],["இந்தியா","பாக்குடன் பேச்சுவார்த்தை கூடாது நிதின் கட்கரி"],["உலகம்","நெட்டில் ஓட்டலை விமர்சித்தவருக்கு அபராத"],["தமிழகம்","இனி கலெக்டரின் ஆய்வறிக்கை தேவை தமிழக அரசு"],["உலகம்","அமெரிக்காவில் மைனாரிட்டியாகு வெள்ளை குழந்தைகள்"],["தமிழகம்","அதிமுக எஎல்ஏ மிரட்டலால் பார் ஏல நிறுத்திவைப்பு"],["குற்றம்","மனைவி தொடர்ந்த வழக்கில் கணவருக்கு ஆண்டு சிறை"],["தமிழகம்","குடிநீரில் கழிவுநீர் கலந்து வந்ததால் பெண்கள் மறியல்"],["தமிழகம்","சென்னை மற்று புறநகரில் மின்வெட்டு நேர அதிகரிப்பு"],["சினிமா(ரீல்மா)","அனுஷ்கா முடிவில் மாற்ற"],["சினிமா(ரீல்மா)","நயன்தாராவின் திடீர் கட்டுப்பாடு"],["வேலைவாய்ப்பு","பிளஸ் படித்தவர்களுக்கு கடற்படை சப்லெப்டினன்ட் பதவி"],["வேலைவாய்ப்பு","டேராடூன் ஆயுத தொழிற்சாலையில் ஐடிஐ படித்தவர்களுக்கு வாய்ப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","பீகாரில் கல்லால் தாக்கி தொழிலதிபர் படுகொலை"],["ஸ்டேட் எக்ஸ்பிரஸ்","உபியில் தொடரு கொடூர சிறுமிகள் பலாத்கார"],["ஸ்டேட் எக்ஸ்பிரஸ்","திருமலையில் அனுமதியின்றி உணவு விற்றவருக்கு அபராத"],["ஸ்டேட் எக்ஸ்பிரஸ்","இந்தூர் மருத்துவமனைகளில் ஆணாக மாறு பெண் குழந்தைகள்"],["உலகம்","தங்கமாய் ஜொலிக்கு கிவி பழ நோய் விரட்டு உற்சாக தரு"],["உலகம்","ஸ்பெஷல் ஒலிபிக் ஏதென்ஸ் கோலாகல"],["உலகம்","இங்கிலாந்து மாணவர் அசத்தல் சைக்கிள் ஓட்டினா துணிகள் பளிச்"],["மர்மம்","மிரள வைக்கு மிளகாய் பூச்சு"],["உலகம்","ஓரின திருமணத்துக்கு நியூயார்க் ஒப்புதல்"],["உலகம்","பாக் போலீஸ் நிலையத்தில் மனித குண்டு தாக்குதல் பேர் பரிதாப பலி"],["விளையாட்டு","டூர் அட்டவணை டெஸ்ட் ஒன்டே இந்திய அணி பங்கேற்பு"],["விளையாட்டு","ஜெயவர்த்தனே விளாசல் ல் இலங்கை வெற்றி"],["விளையாட்டு","வது டெஸ்டிலு கெய்லுக்கு இல்லை"],["இந்தியா","பிஎஸ்எல்வி சி ராக்கெட் அடுத்த மாத ஏவப்படு இஸ்ரோ தலைவர் பேட்டி"],["குற்றம்","மாணவி பலாத்கார வழக்கில் மின் வாரிய அதிகாரி சிக்கினார் குமரி இன்ஸ்பெக்டரை தேடுகின்றனர்"],["குற்றம்","வாலிபர் மண்டை உடைப்பு"],["தமிழகம்","போதை பொருள் விழிப்புணர்வு பேரணி"],["தமிழகம்","காதலுக்கு பெற்றோர் எதிர்ப்பு காதலி ஊரில் தூக்குப்போட்டு இன்ஜி மாணவர் பரிதாப சாவு"],["தமிழகம்","கேஜிகண்டிகையில் ஆக்கிரமித்து கட்டிய கோயிலை இடிக்க மக்கள் சமத"],["தமிழகம்","கணவருடன் பைக்கில் வந்த பெண்ணிட பவுன் பறிப்பு"],["தமிழகம்","பல் டாக்டரிட செயின் பறிப்பு"],["மாவட்ட மசாலா","பட்டாசு ஆலை விபத்து உரிமையாளர் கைது"],["மாவட்ட மசாலா","உணவு பொருள் கடத்தல் மாதத்தில் பேர் கைது"],["மாவட்ட மசாலா","மின்சார பாய்ந்து தொழிலாளிகள் பலி"],["மாவட்ட மசாலா","பள்ளி மாணவியின் உடலை தான செய்த அப்பா"],["மாவட்ட மசாலா","மாரியமன் கோயிலில் பவுன் கொள்ளை"],["தமிழகம்","அதிக வட்டி தருவதாக கோடி மோசடி பேர் சிக்கினர்"],["தமிழகம்","சேல அருகே பஸ்கள் மோதல் பலி ஆக உயர்ந்தது"],["தமிழகம்","ஒரு கோடி மோசடி ஆசாமி பிடிபட்டார்"],["தமிழகம்","நண்பர் சாவுக்கு வந்தபோது நேர்ந்த சோக குளத்தில் மூழ்கி பேர் பலி"],["தமிழகம்","கொடுங்கையூரில் துணிகர தனியார் நிறுவனத்தில் லட்ச காப்பர் கொள்ளை"],["தமிழகம்","கோடி கோடியாக பண கடத்தப்பட்ட விவகார பாபா அறக்கட்டளை உறுப்பினரிட மணி நேர போலீசார் விசாரணை"],["தமிழகம்","கச்சத்தீவு அருகே மீன் பிடித்த ராமேஸ்வர மீனவர் விரட்டியடிப்பு"],["தமிழகம்","காஸ் விலையை குறைக்க கருணாநிதி யோசனை"],["இந்தியா","லோக்பால் அமைக்க அரசு விருபவில்லை ராதேவ்"],["இந்தியா","ஹசாரே குழுவினரிட இனி பேச்சு கிடையாது கபில்சிபல்"],["தமிழகம்","கால்நடை மருத்துவ படிப்புக்கு ஜூலை ல் கவுன்சலிங் தொடக்க"],["தமிழகம்","முதல்வர் கவனத்துக்கு வந்த பிரச்னைக்கு நடவடிக்கை"],["தமிழகம்","புதுச்சேரியில் சபாநாயகர் தேர்தல் ல் நடக்கிறது"],["தமிழகம்","அரசு பள்ளியில் படிக்கு குழந்தைகளுக்கு ஒரே நேரத்தில் டிசி"],["இந்தியா","பிரதமர் நீதிபதிகளை சேர்ப்பது அரசியல் சட்டத்திற்கு எதிரானது"],["இந்தியா","கூட்ட நெரிசலை தவிர்க்க சபரிமலையில் புதுவசதி"],["இந்தியா","எடியூரப்பா குமாரசாமி தர்மஸ்தலாவுக்கு வருகை"],["உலகம்","சர்க்கரை நோயாளிகள் கோடியாக உயர்வு"],["தலையங்கம்","உழைக்காமல் பண வருமா"],["தமிழகம்","கட்டண கொள்ளை பள்ளிகளுக்கு கடத்தல் பற்றிய கவலை இல்லை"],["மாவட்ட மசாலா","கோவை உயிரியல் பூங்காவில் வவ்வால்கள் அடைக்கல"],["மாவட்ட மசாலா","ஈரோட்டில் ஒரே நாளில் போலீசார் மாற்ற"],["மாவட்ட மசாலா","கொசுக்கடி தாங்க முடியலே ரோட்டுக்கு வந்த யானைகள்"],["மாவட்ட மசாலா","சைக்கிள் மீது லாரி மோதி தொழிலாளர்கள் பலி"],["மாவட்ட மசாலா","மதுபாட்டில்கள் கடத்திய பேர் பிடிபட்டனர்"],["மாவட்ட மசாலா","பஸ்சில் சென்ற பெண்ணிட பவுன் நகை அபேஸ்"],["மாவட்ட மசாலா","ஐகோர்ட் நீதிபதியிட ஆயிர திருட்டு"],["உலகம்","உடபை பொத்தலாக்கிய குண்டுகள்"],["குற்றம்","பெண்களை ஏமாற்றிய அப்பாவி சிக்கினார்"],["உலகம்","தலை ஒட்டிய இளைஞர்கள் வயலின் இசையில் அசத்தல்"],["உலகம்","குண்டா இருக்கேன் எரிச்சலா இருக்கு"],["குற்றம்","காசிமேட்டில் பயங்கர இளபெண் அடித்து கொலை"],["குற்றம்","மறைமலைநகர் அருகே கார் மோதி பேர் பலி"],["இந்தியா","தர்மஸ்தலா கோயிலில் எடியூரப்பா குமாரசாமி தரிசன"],["தமிழகம்","இலங்கை கோர்ட்டில் மீனவர்கள் ஆஜர்"],["தமிழகம்","தேமுதிக எஎல்ஏ மீது பிரிவுகளில் வழக்கு"],["உலகம்","பிரான்சில் ஈகோலி தாக்குதல்"],["உலகம்","ஓட்டெடுப்புக்கு தயார் கடாபி அரசு அறிவிப்பு"],["தமிழகம்","ஊத்துக்கோட்டை அண்ணா சிலை சந்திப்பில் மீண்டு சிக்னல் கப"],["குற்றம்","தேமுதிக செயலாளருக்கு சொந்தமான ஆட்டோக்கள் எரிந்து சாபல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","முபை அருகே நள்ளிரவு பார்ட்டி மாணவிகள் உள்பட பேர் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","பத்திரிகை நிருபர் கொலையில் துப்பு துலங்கியது பேர் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","ரயில்வே டிக்கெட் முன்பதிவு முறைகேடு லட்ச ஆன்லைன் பதிவுகள் ரத்து"],["விளையாட்டு","இந்தியா வெஸ்ட் இண்டீஸ் மோதல் நாளை வது டெஸ்ட்"],["விளையாட்டு","உள்ளூர் ஆட்டத்தில் புதிய சாதனை ல் பேர் சத"],["விளையாட்டு","கோடியை பெற கவாஸ்கர் போராட்ட"],["இந்தியா","எடியூரப்பா வீட்டு முன்பு தேவகவுடா போராட்ட"],["தமிழகம்","முத்தரப்பு குழு அமைக்க தனியார் பள்ளிகள் கோரிக்கை"],["தமிழகம்","பிளாட்பாரத்தில் உரசியது ரயில் பயணிகள் அலறல்"],["தமிழகம்","ஆனி பஸ் பள்ளி வேன் கட்டண உயருகிறது"],["கல்வி","வெற்றி நிச்சய"],["கல்வி","கல்லூரியை தேர்ந்தெடுப்பது எப்படி"],["கல்வி","நீங்கள்தான் நபர் ஒன்"],["கல்வி","பயோ டெக்னாலஜியு பயோ மெடிக்கலு"],["கல்வி","ஏழை மாணவர்களுக்கு சிறந்த கல்வி"],["கல்வி","கு் ஸ்டடி"],["கல்வி","உடனடி வேலைக்கு ஐடிஐ"],["கல்வி","பெற்றோர்களே உஷார்"],["கல்வி","நீங்கள் கல்வியில் வெற்றி பெற வேண்டுமா"],["கல்வி","குளோபல் ஆலோசனை"],["கல்வி","எதிர்கால வாழ்வுக்கு சிவில் என்ஜினியரிங்"],["கல்வி","ஐஏஎஸ் ஆக வேண்டுமா"],["கல்வி","சக்சஸ்"],["கல்வி","உதவித் தொகை ரெடி"],["இந்தியா","தர்மஸ்தலா கோயிலில் சத்திய செய்தார் குமாரசாமி நழுவினார் எடியூரப்பா"],["இந்தியா","அன்னா விருட்சமாகு ஒரு விதை"],["தமிழகம்","லாரி உரிமையாளர்கள் பேச்சு தோல்வி மத்திய அரசுக்கு நாள் கெடு"],["தமிழகம்","லோக்பால் சட்ட வரபுக்குள் பிரதமரை சேர்க்க கூடாது முதல்வர் ஜெயலலிதா"],["தமிழகம்","மந்திரிகள் இலாகா மாற்ற முதல்வர் ஜெ"],["தமிழகம்","கல்வி கட்டண உயர்த்தியது போதாது பள்ளிகள் மனு"],["தமிழகம்","பிஇ எபிபிஎஸ் படிப்புக்கு மீண்டு பொது நுழைவுதேர்வு"],["தமிழகம்","சென்ட்ரலில் புதிதாக சிகிச்சை மைய தெற்கு ரயில்வே"],["இந்தியா","மத்திய அமைச்சரவையில் ஒரு வாரத்தில் மாற்ற"],["இந்தியா","உண்ணாவிரத ராதேவ் பங்கேற்க ஹசாரே நிபந்தனை"],["விளையாட்டு","வது டெஸ்ட் இன்று தொடக்க தொடரை வெல்ல இந்தியா உறுதி"],["ஸ்டேட் எக்ஸ்பிரஸ்","தேர்தலுக்கு பின் வன்முறை மேவங்கத்தில் பேர் பலி"],["ஸ்டேட் எக்ஸ்பிரஸ்","கல்வி கட்டண உயர்த்த ஒரிசா ஐகோர்ட் தடை"],["ஸ்டேட் எக்ஸ்பிரஸ்","ராதேவ் சொத்துக்கள் அமலாக்க பிரிவு விசாரணை"],["ஸ்டேட் எக்ஸ்பிரஸ்","மாணவி மானபங்க பள்ளி முதல்வர் கைது"],["உலகம்","எலுபு முறிவுக்கு குதிரை டெக்னிக்"],["உலகம்","வாய்க்கு வந்தபடி போலீசை திட்டலா"],["குற்றம்","போலி பெண் சாமியார் லட்ச கொள்ளை"],["உலகம்","வானத்துல இருந்து கரன்ட் சப்ளை"],["சினிமா(ரீல்மா)","விமானத்தில் ஜோடியாக பறந்த பிரபுதேவா பியா"],["விளையாட்டு","வரலாறை மாற்றி அமைப்போ டோனி"],["விளையாட்டு","காலிறுதியில் நடால் பெடரர்"],["விளையாட்டு","சாப்பாடு தண்ணீர் இல்லை டோனி அன்கோ தவிப்பு"],["மாவட்ட மசாலா","பள்ளி சைக்கிள் ஸ்டாண்டில் வெடிபொருள் வந்தது எப்படி"],["மாவட்ட மசாலா","திருடிய வாகனங்களை வாடகைக்கு விட்டவர்கள் கைது"],["மாவட்ட மசாலா","மாணவியிட சில்மிஷ வங்கி மேலாளர் கைது"],["மாவட்ட மசாலா","அரசு பஸ்சில் திடீர் தீ பயணிகள் உயிர் தப்பினர்"],["மாவட்ட மசாலா","லாரி மீது கார் மோதி சென்னை பேராசிரியர் பலி"],["மாவட்ட மசாலா","கோவை சிறை வளாகத்தில் பூங்கா பணி நிறுத்த"],["மாவட்ட மசாலா","தேரில் இருந்து தவறி விழுந்து தொழிலாளி பலி"],["தமிழகம்","மாணவி பலாத்கார வழக்கு தமிழக போலீஸ் அதிகாரிகளுக்கு வலை"],["குற்றம்","ஆண் குழந்தை தண்ணீரில் மூழ்கடித்து கொடூர கொலை"],["தமிழகம்","போக்குவரத்து விதி மீறுபவர்களுக்கு அபராத விதிக்க இசலான் முறை"],["இந்தியா","தேவகவுடா குடுப ஊழல் குற்றபத்திரிகையாக இன்று மாலை வெளியீடு எடியூரப்பா"],["இந்தியா","கணக்கு வழக்குகளை தாக்கல் செய்ய பாபா அறக்கட்டளைக்கு நாள் கெடு"],["தமிழகம்","மலை குள பிளாட் போட்டு விற்பனை"],["தமிழகம்","ரயில் நிலையத்தில் அடிப்படை வசதி இல்லை பயணிகள் கடு அவதி"],["உலகம்","ட்ரோன் தாக்குதல் தீவிரவாதிகள் பலி"],["உலகம்","இங்கிலாந்து ராணுவ வெளியேற பாகிஸ்தான் திடீர் உத்தரவு"],["உலகம்","நியூஸ் வெப்சைட் தொடங்குகிறார் போப்"],["தமிழகம்","வகுப்பு முடிக்காததால் மறுக்கப்படு புரமோஷன்"],["இந்தியா","பொருளாதார சீர்திருத்த இந்தியா கைவிடவில்லை பிரணாப்"],["உலகம்","தமிழர் பிரச்னைக்கு தீர்வு காண இந்தியா நெருக்கடி தரவில்லை ராஜபக்சே"],["தமிழகம்","தனியார் பொறியியல் கல்லூரி கட்டணத்தில் மாற்ற இல்லை"],["தமிழகம்","பட்ஜெட்டில் அறிவிக்கப்பட்ட புதிய ரயில்கள் இயக்க தெற்கு ரயில்வே"],["இந்தியா","மேற்கு வங்காளத்தில் மீண்டு மேலவை மதா"],["தமிழகம்","தூத்துக்குடி விசைப்படகு மீனவர்கள் வேலைநிறுத்த"],["இந்தியா","பாலாற்றின் குறுக்கே அணை கட்டாவிட்டால் விரைவில் போராட்ட சந்திரபாபு நாயுடு"],["இந்தியா","சாய்பாபாவுக்கு சமாதி கட்ட பக்தர் கொடுத்த நன்கொடை"],["தமிழகம்","மாற்றிக் கொள்ள இன்றே கடைசி நாளை முதல் காசு செல்லாது"],["சினிமா(ரீல்மா)","சர்வதேச இந்திய திரைப்பட விழாவில் எந்திரனுக்கு விருது"],["மாவட்ட மசாலா","சிறுமியை கடத்திய இலங்கை அகதி பிடிபட்டார்"],["மாவட்ட மசாலா","கள்ள நோட்டுகளுடன் கோவையில் பேர் கைது"],["மாவட்ட மசாலா","லாரி டிரைவரை தாக்கி ஆயிர பறிப்பு"],["மாவட்ட மசாலா","பலாத்கார வழக்கில் கைதான மின்வாரிய ஊழியர் சஸ்பெண்ட்"],["மாவட்ட மசாலா","விஐடியில் கவுன்சலிங்"],["மாவட்ட மசாலா","ஊட்டி தாவரவியல் பூங்காவுக்கு லட்ச மலர் நாற்றுகள் தயார்"],["மாவட்ட மசாலா","லஞ்ச தபால் ஊழியர் சஸ்பெண்ட்"],["தமிழகம்","கேன்சரால் பாதிக்கப்பட்ட பெண்ணை விஷ ஊசி போட்டு கொல்ல முயற்சி"],["குற்றம்","குண்டு வெடித்து இளபெண் பலி"],["ஸ்டேட் எக்ஸ்பிரஸ்","பள்ளி ஆயா தற்கொலை மாணவனு தூக்கிட்டு சாவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","பெண் சிசு விவகார விசாரணைக்கு உத்தரவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","குப்பை லாரியில் காவலர் சடல போலீசார் அதிர்ச்சி"],["தமிழகம்","நெல்லை சேலத்தில் இனி ஒரே மாவட்ட செயலாளர் முதல்வர் ஜெ"],["தமிழகம்","பஸ்களில் அதிக பயணிகளை ஏற்றி வசூலை அதிகரிக்க அரசு உத்தரவு"],["கல்வி","தாட்கோ மூல இலவச கடல்சார் பயிற்சி"],["கல்வி","தமிழ் கணக்கு உள்பட துறைகளில் எபில்படிப்பு"],["தமிழகம்","சிலிண்டர் கொடுக்க கெடுபிடி வசூல்"],["தமிழகம்","மதுரையில் பாஸ்போர்ட் சேவை மைய ஆன்லைன் பதிவு இன்று தொடங்கியது"],["விளையாட்டு","இந்தியா ரன்னில் ஆல்அவுட்"],["விளையாட்டு","காலிறுதியில் சானியா ஜோடி"],["விளையாட்டு","முதல் ஒருநாள் போட்டி இலங்கை தோல்வி"],["இந்தியா","பாதாள அறைகளில் தங்க புதையல்"],["உலகம்","நைட் ஷிப்ட் ஜாக்கிரதை"],["உலகம்","பீர் குடிச்சா கொசு கடிக்கு"],["உலகம்","புதிய சிகிச்சை நரைக்கு குட்பை"],["தமிழகம்","அமைச்சராக முகமது ஜான் பதவி ஏற்பு"],["தமிழகம்","விதிமுறை மீறி எழுதப்படு வாகன நபர் பிளேட்"],["தமிழகம்","ராமேஸ்வர எக்ஸ்பிரஸ் கவிழ்ப்பு சதியில் ரயில்வே ஊழியர்களுக்கு தொடர்பு"],["தமிழகம்","இடங்களில் நவீன நிழற்குடை மேயர் தகவல்"],["இந்தியா","ராகுல் பிரதமர் ஆவதில் தடை ஏது இல்லை பிரதமர்"],["தமிழகம்","பிளஸ் வகுப்பு மாணவர்களுக்கு போட்டோவுடன் மதிப்பெண் சான்றிதழ் தமிழக அரசு"],["இந்தியா","சோனியா காந்தியை சந்திக்கிறார் அண்ணா ஹசாரே"],["உலகம்","இலங்கை சிறையில் அடைக்கப்பட்டிருந்த தமிழக மீனவர்கள் பேரு விடுவிப்பு"],["இந்தியா","லோக்பால் வரபுக்குள் பிரதமரை சேர்க்கலா மன்மோகன் சிங்"],["தமிழகம்","விளையாட்டு பிரிவுக்கான பிஇ எபிபிஎஸ் கவுன்சலிங் தொடங்கியது"],["தமிழகம்","பத்தா வகுப்பு சிறப்பு துணைத்தேர்வு இன்று தொடக்க"],["தமிழகம்","அவசர காலத்தில் உதவுவதற்காக பச்சிளங்குழந்தைகளுக்கு ஆபுலன்ஸ் சேவை"],["தமிழகம்","கச்சத்தீவு ஒப்பந்தத்தை ரத்து செய்ய வேண்டு கிருஷ்ணசாமி"],["தமிழகம்","நாட்களே ஆன குழந்தைக்கு இதயத்தில் நவீன அறுவை சிகிச்சை"],["தமிழகம்","இந்த ஆண்டு இறுதிக்குள் விமான நிலைய விரிவாக்க பணிகள் முடிவடையு சீதாரா யெச்சூரி"],["தமிழகம்","மக்கள் இழித்துரையிலிருந்து தப்பிக்கவே புதிய தலைமைச் செயலக கட்டிட விசாரணை கமிஷன் கருணாநிதி"],["இந்தியா","இன்னு ஆண்டுகளில் அரசு இணையதள மூல பள்ளி மாணவர் சேர்க்கை கபில் சிபல்"],["தமிழகம்","புதுவை சட்டப்பேரவையில் சபாநாயகராக சபாபதி பதவியேற்பு"],["இந்தியா","சிறுமி பலாத்கார வழக்கில் இதுவரை பேர் கைது"],["தமிழகம்","இந்திய அரசு கொடுத்த கோடி இலங்கை தமிழர்களுக்காக செலவழிக்கப்பட்டதா"],["இந்தியா","விலைவாசி உயர்வை தடுக்க மந்திர கோல் இல்லை என்பதா"],["இந்தியா","பாஜ குற்றச்சாட்டை சிபிஐ விசாரிக்கலா ரேவண்ணா"],["இந்தியா","லோக்பால் மசோதா மார்க்சிஸ்ட் தலைவருடன் ஹசாரே குழு சந்திப்பு"],["உலகம்","ஐஎஎப் புதிய தலைவரானார் கிறிஸ்டின் லகர்டே"],["உலகம்","துபாயின் மிகப் பெரிய வர்த்தக கூட்டாளி இந்தியா"],["இந்தியா","மத்திய அரசின் அதிகாரிகள் மீது விஜிலென்ஸ் விசாரணை"],["தலையங்கம்","பார்சல் குண்டு பறித்த உயிர்"],["இந்தியா","ராஜபக்சேவுக்கு எதிராக கையெழுத்து இயக்க திருமாவளவன்"],["மாவட்ட மசாலா","மின்தடை நேரத்தில் பரிதாப பாபு கடித்து மாணவி சாவு"],["மாவட்ட மசாலா","லட்ச ஏக்கருக்கு பாசனவசதி கீழணையில் தண்ணீர் திறப்பு"],["மாவட்ட மசாலா","காதலன் இறந்த வேதனை நர்ஸ் தீக்குளித்து சாவு"],["மாவட்ட மசாலா","முதுமலை காப்பகத்தில் விலங்குகள் சிகிச்சை மைய"],["மாவட்ட மசாலா","விபத்தில் தபதி பலி பஸ்கள் உடைப்பு"],["மாவட்ட மசாலா","பொதுமக்கள் கடு அவதி வேலூரில் டிகிரி வெயில்"],["மாவட்ட மசாலா","மாட்டு வண்டியில் பைக் மோதி பேர் பலி"],["மாவட்ட மசாலா","சோழர் காலத்து சிவன் கோயில் நாகை அருகே கண்டுபிடிப்பு"],["உலகம்","கபி கான்கிரீட் வைத்து மர கட்டு நூதன"],["உலகம்","பஸ் கதவுகள் இடையே பெண் தலை சிக்கியது"],["உலகம்","வடகொரியாவில் நிதி நெருக்கடி கல்லூரி பல்கலைகள் மாத லீவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","எபி நிதி செலவிடுவதில் ராகுலை முந்தினார் வருண்"],["ஸ்டேட் எக்ஸ்பிரஸ்","கலவர ஆவணங்கள் அழிப்பு மோடி அரசு ஒப்புதல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","இறந்து போனவர் கோர்ட்டுக்கு வந்ததால் பரபரப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","குக செய்தால் நானோ கார் பரிசு"],["சினிமா(ரீல்மா)","சார்மிக்கு அமிதாப் அன்பு கண்டிஷன்"],["சினிமா(ரீல்மா)","ஷூட்டிங்கில் நயன்தாராவின் கடைசி நாள்"],["உலகம்","அப்பாவி மக்கள் மீது ஏமன் விமான குண்டுவீச்சு"],["உலகம்","நியூயார்க் ஏர்போர்ட்டில் ஆமைகள் படையெடுப்பு"],["உலகம்","விமானத்தில் முதல் வகுப்பில் குழந்தைகளுக்கு தடை"],["விளையாட்டு","அரையிறுதியில் நடால்"],["விளையாட்டு","வெஸ்ட் இண்டீசுக்கு விக்கெட் காலி"],["குற்றம்","பள்ளி வேன் கவிழ்ந்து மாணவர்கள் காய"],["தமிழகம்","சிவகங்கையில் இருந்து அந்தமானுக்கு வெடிபொருள் கடத்தல்"],["குற்றம்","சபள கணக்கு ஆபீசில் பயங்கர தீ பைல்கள் நாச"],["தமிழகம்","டிரெய்லர் லாரிகள் திடீர் ஸ்டிரைக்"],["தமிழகம்","லோக்பால் சட்டத்தை மத்திய அரசு விரைவில் நிறைவேற்று"],["குற்றம்","டிராபிக் போலீசை தாக்கிய அதிமுக பிரமுகர்கள் கைது"],["இந்தியா","தெலங்கானா பகுதி காங்கிரஸ் டிஆர்எஸ் தலைவர்கள் திடீர் சந்திப்பு"],["இந்தியா","பிரதமரின் மீடியா ஆலோசகரின் லேப்டாப் மாயமானதால் அதிர்ச்சி"],["தமிழகம்","பள்ளி மாணவ மாணவிகளுக்கு பஸ் பாஸ் வழங்குவதில் தாமத"],["தமிழகம்","பெருங்களத்தூரில் ஆனி பஸ்களால் போக்குவரத்து நெரிசல்"],["இந்தியா","லோக்பால் மசோதா ஜெ கருத்துக்கு நீதிபதி எதிர்ப்பு"],["தமிழகம்","பவானி கோயில் ஆடி விழா ஏற்பாடு குறித்து ஆலோசனை"],["இந்தியா","கேரள மாணவி பலாத்கார வழக்கு குமரி இன்ஸ்பெக்டர் சஸ்பெண்ட்"],["தமிழகம்","நாலணாவுக்கு குட்பை"],["சினிமா(ரீல்மா)","பிரபுதேவா விவாகரத்து வழக்கு தள்ளிவைப்பு"],["தமிழகம்","பயணிகளின் வசதிக்கே முக்கியத்துவ தீபக் கிரிஷன்"],["இந்தியா","சோனியா ஹசாரே நாளை மறுநாள் சந்திப்பு"],["தமிழகம்","அறிவிக்கப்படாத மின்வெட்டு சென்னை மக்கள் விழிபிதுங்கி பரிதவிப்பு"],["தமிழகம்","திமுக அரசின் நிதி மேலாண்மையை குறை கூறுவதா"],["உலகம்","தமிழர் வசிக்கு பகுதியில் அடுத்த ஆண்டில் தேர்தல் ராஜபக்சே அறிவிப்பு"],["இந்தியா","லோக்பால் மசோதா நிதிஷ் குமாருடன் ஹசாரே சந்திப்பு"],["தமிழகம்","விடுதலையான மீனவர் மண்டப வருகை"],["தமிழகம்","தனியார் மருத்துவ கல்லூரிகளுக்கு கல்வி கட்டண உயர்வு"],["இந்தியா","கொல்கத்தாவில் நாளில் குழந்தைகள் சாவு"],["இந்தியா","இந்திய அமெரிக்கா இடையே அணு ஒப்பந்த பாதிக்காது திமோதி ரோமர்"],["தமிழகம்","ஒரு மணி நேரத்துக்குள் விசா பிரெயின் டால்டன்"],["இந்தியா","போலீசை கண்டித்து லத்தியால் தன்னையே அடித்த எஎல்ஏ"],["இந்தியா","லோக்பால் வரபுக்குள் பிரதமர் காங்கிரஸ் நிலை என்ன"],["இந்தியா","சாகு வரை உண்ணாவிரத குமாரசாமி திடீர் அறிவிப்பு"],["தமிழகம்","சாதி வாரி கணக்கெடுப்பு முழுமையாக நடத்த வேண்டு தங்கபாலு"],["இந்தியா","எதிர்கால பற்றிய நபிக்கை இந்திய பெண்களுக்கு அதிக"],["மாவட்ட மசாலா","போதையில் சாட்சி ஆசாமிக்கு சிறை"],["மாவட்ட மசாலா","வேன் மீது பஸ் மோதல் பக்தர்கள் பலி"],["மாவட்ட மசாலா","திருப்பதியில் தேதி படி உற்சவ"],["குற்றம்","காவலாளி கொலை வழக்கு குண்டர் சட்டத்தில் ஐந்து பேர் கைது"],["தமிழகம்","வங்கி பணியில் பார்வையற்றவர் அசத்தல்"],["மாவட்ட மசாலா","கல்குவாரியில் இருந்து கொத்தடிமைகள் மீட்பு"],["மாவட்ட மசாலா","போலி எஸ்ஐ மீது குற்ற வழக்குகள்"],["மாவட்ட மசாலா","ஆட்டோ மீது வேன் மோதி பள்ளி மாணவன் பலி"],["மாவட்ட மசாலா","ஓஎன்ஜிசி அதிகாரியின் ஜாமீன் மனு தள்ளுபடி"],["தலையங்கம்","இருண்டது தலைநகர் மிரண்டனர் மக்கள்"],["உலகம்","கிங் குயின் ஜாக்கியால் அசரவைக்கு கட்டிடங்கள்"],["சினிமா(ரீல்மா)","மீண்டு மீண்டு பல்டி தொடர்ந்து நடிக்க சிரஞ்சீவி முடிவு"],["சினிமா(ரீல்மா)","சிபுக்கு கவுத மேனன் மறுப்பு"],["விளையாட்டு","இஷாந்த் சத"],["விளையாட்டு","ஆண்டுகளுக்கு பின் பைனலில் ஷரபோவா"],["விளையாட்டு","நாளை அணி தேர்வு சேவாக் நிலை என்ன"],["விளையாட்டு","ரன்னில் சுருண்டது வெஇ"],["ஸ்டேட் எக்ஸ்பிரஸ்","பிரதமரின் மீடியா ஆலோசகர் கார் கிடைத்தது லேப்டாப் எங்கே"],["ஸ்டேட் எக்ஸ்பிரஸ்","தெலங்கானா வாரத்தில் மத்திய அரசு இறுதி முடிவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","லட்சத்துக்கு மேல் நகை வாங்கினால் பான் கட்டாய"],["ஸ்டேட் எக்ஸ்பிரஸ்","இலங்கையிட இருந்து இந்தியா அதிவேக படகுகள் வாங்குகிறது"],["இந்தியா","மோசமான வானிலை அமர்நாத் யாத்திரை தற்காலிக நிறுத்த"],["தமிழகம்","சாவி இல்லாததால் சுடுகாட்டுக்கு வெளியே சடல காத்திருக்கிறது"],["உலகம்","சர்கோசி மீது தாக்குதல் இளைஞர் கைது"],["உலகம்","பாக் விமான தளத்தை காலி செய்யவில்லை அமெரிக்கா அறிவிப்பு"],["தமிழகம்","டிரெய்லர் லாரி ஸ்டிரைக் வாபஸ்"],["தமிழகம்","எபிபிஎஸ் பொதுபிரிவு கவுன்சலிங் தொடக்க"],["குற்றம்","விமானத்தில் திடீர் நெஞ்சுவலி சென்னை தொழிலதிபர் மரண"],["தமிழகம்","பார்களில் ஜெ படத்துடன் வாட்டர் பாக்கெட் விற்பனை"],["தமிழகம்","மாணவி பலாத்கார வழக்கில் மேலு பேர் பிடிபட்டனர்"],["இந்தியா","குத்துசண்டை வீரர் விஜயேந்தர் மீது வழக்கு"],["தமிழகம்","கோடியில் புதிய கட்டிட ஜூலை தேதி திறக்கப்படு"],["தமிழகம்","மின்தடையை கண்டித்து மின்வாரிய அலுவலக முற்றுகை"],["இந்தியா","அன்னா ஹசாரேக்கு ஆதரவாக ஒரு கோடி மிஸ்டு கால்"],["இந்தியா","தெலங்கானா வலியுறுத்தி காங்கிரஸ் எபி எஎல்ஏக்கள் தேதி ஒட்டுமொத்த ராஜினாமா"],["இந்தியா","லோக்பால் விவகாரத்தில் அரசியல் லாப பெற பாஜ மார்க்சிஸ்ட் முயற்சி பிரணாப்"],["இந்தியா","லோக்பால் மசோதா சர்ச்சை பாஜ தலைவர்களுடன் ஹசாரே குழு ஆலோசனை"],["இந்தியா","குழந்தை பலாத்கார இலங்கை அகதிகள் போராட்ட"],["தமிழகம்","சிறையில் இருந்தபடி செல்போனில் கைதி நடத்திய மோசடி"],["தமிழகம்","தொடர் மின்தடையால் தொழில் முடங்கு அபாய"],["தமிழகம்","அரசு விதிமுறைகளை அமல்படுத்தாத டிரைவிங் ஸ்கூல்களில் பயிற்சி பெறுவோருக்கு லைசென்ஸ் நிறுத்த"],["இந்தியா","ஜனாதிபதி பிரதிபாவுடன் மன்மோகன் ஆலோசனை"],["இந்தியா","தேங்கி கிடக்கு வழக்குகளை குறைக்கு திட்ட மொய்லி தொடங்கி வைத்தார்"],["இந்தியா","வந்தாச்சு இசிகரெட் இனி வராது கேன்சர்"],["இந்தியா","ஏடிஎகளில் பண எடுத்தால் எஸ்எஎஸ் மூல தகவல்"],["மாவட்ட மசாலா","மினி பஸ் மோதி போலீஸ்காரர் பலி"],["குற்றம்","வெடிபொருள் விற்பனை உரக்கடை மேலாளர் கைது"],["மாவட்ட மசாலா","ரோந்து செல்லாமல் ஏமாற்ற முடியாது ஏடிஎல் போலீசார் கைரேகை பதிவு"],["மாவட்ட மசாலா","வேளாண் தொலைதூர கல்வி தேதி வரை விண்ணப்ப"],["மாவட்ட மசாலா","நெய்வேலியில் வது புத்தக கண்காட்சி துவக்க"],["மாவட்ட மசாலா","மாபழ கழிவுகளை கொட்டிய மினி லாரிகள் பறிமுதல்"],["மாவட்ட மசாலா","ஊட்டி அருகே பரபரப்பு பஸ்சை துரத்தியது யானை"],["மாவட்ட மசாலா","லட்ச மின்சார திருட்டு ஆலை உரிமையாளர் மீது வழக்கு"],["தலையங்கம்","உயிர்களை பறித்த பயிற்சி ஓட்டுனர்"],["குற்றம்","அண்ணனை கொலை செய்த தபியை உறவினர்கள் அடித்தே கொன்றனர்"],["விளையாட்டு","லட்சுமண் டிராவிட் விளாசல் இந்தியா ரன்குவிப்பு"],["விளையாட்டு","இந்திய வீரர்கள் மீது நடுவர் பாய்ச்சல்"],["விளையாட்டு","கெய்ல் ஆக்ரோஷ"],["விளையாட்டு","பைனலில் நடால்"],["விளையாட்டு","இலங்கை அபார வெற்றி"],["சினிமா(ரீல்மா)","குறைந்த ஒளியில் நடந்த ஷூட்டிங்"],["சினிமா(ரீல்மா)","ஜஸ்வர்யா கர்ப்ப அமிதாப் அறிவித்தது ஏன்"],["ஸ்டேட் எக்ஸ்பிரஸ்","மனைவி காதை கடித்து தின்ற கொடூர கணவனுக்கு வலை"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆட்டோ மீது ரயில் மோதி பேர் பரிதாப பலி"],["ஸ்டேட் எக்ஸ்பிரஸ்","அரசு பள்ளிகளில் லெதர் ஷூக்களுக்கு தடை"],["ஸ்டேட் எக்ஸ்பிரஸ்","ரயிலில் அடிபட்ட பெண் யானை பலி"],["இந்தியா","விவசாயிகளுக்கு ஆதரவாக தேவகவுடா உண்ணாவிரத"],["உலகம்","தனக்கு நடந்த இதய ஆபரேஷனை தானே பட பிடித்தவருக்கு விருது"],["இந்தியா","கொச்சி விமானத்தில் கோளாறு பயணிகள் உயிர் தப்பினர்"],["இந்தியா","மாவோயிஸ்ட்கள் அட்டகாச அப்பாவிகள் சுட்டுக் கொலை"],["உலகம்","பாகிஸ்தான் பல்கலையில் பின்லேடன் பற்றிய இலக்கிய போட்டி"],["உலகம்","அமெரிக்க விமானத்தில் பயணியை தேள் கொட்டியது"],["உலகம்","டயானா பொன்விழா மக்கள் உற்சாக"],["குற்றம்","காஞ்சிபுரத்தில் காய்கறி வியாபாரி வெட்டிக் கொலை"],["தமிழகம்","பிளஸ் மற்று வகுப்பு தேர்வில் அதிக மதிப்பெண் பெற்ற மாணவ மாணவிகளுக்கு திமுக இளைஞரணி அறக்கட்டளை லட்ச பரிசு"],["தமிழகம்","தண்ணீர் பாக்கெட்டில் ஜெபட ராமநாதபுர டிஐஜி விசாரணை"],["தமிழகம்","சென்னைக்கு குடிநீர் வழங்கு ஏரிகளில் நீர்வரத்து அதிகரிப்பு"],["குற்றம்","பள்ளி மாணவி கடத்தல் டிரைவர் கைது"],["தமிழகம்","மாணவி பலாத்கார வழக்கு எஎல்ஏ சிக்குகிறார்"],["இந்தியா","சாய்பாபா தனி அறையில் திடீர் ரெய்டு லட்ச மதிப்புள்ள தங்க வைர நகை பறிமுதல்"],["விளையாட்டு","வது டெஸ்ட் டிரா"],["மாவட்ட மசாலா","கையாடல் செய்த கூட்டுறவு செயலருக்கு வலை"],["மாவட்ட மசாலா","ஆக ல் கொல்லிமலையில் வல்வில் ஓரி விழா"],["மாவட்ட மசாலா","பைக் மீது வேன் மோதி நண்பர்கள் பலி"],["மாவட்ட மசாலா","தென்மாவட்ட ரயில்கள் ஒரு மணி நேர தாமத"],["மாவட்ட மசாலா","இரட்டை கொலை வழக்கில் வாலிபர்கள் கைது"],["தமிழகம்","மயிலாப்பூரில் நாளை திமுக பொதுக்கூட்ட ஸ்டாலின் பேசுகிறார்"],["தமிழகம்","போலீசாரை கண்டித்து ஆர்ப்பாட்ட விடுதலை சிறுத்தைகள் கைது"],["தமிழகம்","அந்தமானுக்கு வெடி பொருள் கடத்தல் சென்னை துறைமுக ஊழியர்களிட போலீசார் தீவிர விசாரணை"],["உலகம்","படுத்த படுக்கையாக இருக்கிறார் ஏமன் அதிபர்"],["தமிழகம்","தமிழக அமைச்சரவை ஒரே வாரத்தில் வது முறை மாற்ற"],["இந்தியா","வலிமையான லோக்பால் மசோதாவை கொண்டு வர வேண்டு"],["இந்தியா","ஆந்திர அரசு கவிழ்கிறது எஎல்ஏக்கள் ராஜினாமா"],["தமிழகம்","குண்டு பாய்ந்து சிறுவன் இறந்தது நிண"],["தமிழகம்","லோக்பால் வரபுக்குள் பிரதமரை சேர்க்க வேண்டு திமுக"],["தமிழகம்","கடையநல்லூர் எஎல்ஏ கதர்துறை அமைச்சரானார்"],["இந்தியா","கனமழை நிலச்சரிவால் அமர்நாத் யாத்திரை மீண்டு நிறுத்த"],["தமிழகம்","ஒன்றாய் உலா வருகிறது கோழியின் தோழியான மயில்"],["மாவட்ட மசாலா","சாப்பாட்டுக்கு பில் தட்டிகேட்டவருக்கு கரண்டி அடி"],["குற்றம்","மரத்தில் ஆனி பஸ் மோதி பட்டதாரி பெண் பலி"],["குற்றம்","குடிபோதையில் டார்ச்சர் செய்த கணவனை கொன்ற மனைவி சரண்"],["மாவட்ட மசாலா","சதுர அடியில் உள்ளதா"],["மாவட்ட மசாலா","சிறுமியிட சில்மிஷ வாலிபர் பிடிபட்டார்"],["மாவட்ட மசாலா","கார் மீது லாரி மோதி பேர் பரிதாப சாவு"],["மாவட்ட மசாலா","தொட்டியில் விளையாடிய மாணவர்கள் மூழ்கி பலி"],["மாவட்ட மசாலா","செப்டபரில் வது சீசன் ஊட்டி பூங்காவில் ஆயத்த"],["மாவட்ட மசாலா","மெகா சூதாட்ட லட்ச பறிமுதல் பேர் கைது"],["விளையாட்டு","டாப் வரிசையில் மீண்டு லட்சுமணன்"],["ஸ்டேட் எக்ஸ்பிரஸ்","எபி பதவியை ராஜினாமா செய்ய ஜெயபால் ரெட்டிக்கு நெருக்கடி"],["ஸ்டேட் எக்ஸ்பிரஸ்","அண்ணனுக்கு கிட்னி தான செய்ய சிறுமி தற்கொலை"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆகஸ்ட் முதல் மணி நேர ராஜ்யசபா சேனல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","சிறப்பு இடஒதுக்கீடு ரத்து காஷ்மீர் முதல்வர் எதிர்ப்பு"],["தமிழகம்","கைதியின் வருகைக்காக நாளாக காத்திருக்கு மனைவியின் சடல"],["உலகம்","வது கின்னஸ் சாதனையை தானே முறியடித்தார் பபிள் மேக்கர்"],["உலகம்","ரோலர் கோஸ்டர் ரைடில் சிக்கி தவித்த பேர் மீட்பு"],["மர்மம்","பக்தர்கள் பார்க்காத அரியக்கா பெரியக்கா"],["வேலைவாய்ப்பு","மத்திய ரிசர்வ் படையில் சப்இன்ஸ்பெக்டர் ஆகலா"],["மாவட்ட மசாலா","ஆவடி பயிற்சி முடித்த வீரர்கள் அணிவகுப்பு"],["மாவட்ட மசாலா","வாலிபர் கொலை துப்பு கிடைக்காமல் போலீஸ் திணறல்"],["தமிழகம்","அயப்பாக்க பள்ளிக்கு குண்டு மிரட்டல்"],["மாவட்ட மசாலா","ஊத்துக்கோட்டையில் குடிநீரில் கழிவுநீர் கலப்பு"],["மாவட்ட மசாலா","பைக் மீது பஸ் மோதி விவசாயி சாவு"],["குற்றம்","புதுவையில் சென்னை போலீஸ் படுகொலை"],["விளையாட்டு","பூபதி ஜோடி பைனலில் தோல்வி"],["விளையாட்டு","சண்டிமால் அதிரடி சத இலங்கை வது வெற்றி"],["விளையாட்டு","கெய்ல்தான் சமரச ஏற்படாமல் தடுக்கிறார் வாரிய"],["விளையாட்டு","லார்ட்ஸ் மைதானத்தில் சச்சின் தீவிர பயிற்சி"],["தமிழகம்","மாணவி பலாத்கார வழக்கு கேரள தனிப்படை விசாரணை"],["உலகம்","எகிப்தில் பயங்கர கேஸ் பைப் லைன் தகர்ப்பு"],["உலகம்","ஸ்ட்ராஸ்கான் மீண்டு அரசியலுக்கு திருப மக்கள் ஆதரவு"],["உலகம்","ஆப்கன் பள்ளி மீது தாக்குதல் சிறுவர்கள் காய"],["குற்றம்","லட்ச மோசடி பேராசிரியர் தலைமறைவு"],["மாவட்ட மசாலா","மகனை போலீஸ் பிடித்ததால் மனமுடைந்த தாய் தற்கொலை"],["தமிழகம்","பதிவுத்துறை அதிகாரிகளுக்கு ஜீப் முதல்வர் ஜெயலலிதா வழங்கினார்"],["குற்றம்","பெட்ை ரசிக்கு ஜன்னல் காமுகன் சிக்கினான்"],["தமிழகம்","பாய்ந்து வந்த ஆட்டோ தண்டவாளத்தில் சிக்கியது"],["தமிழகம்","மத்திய அமைச்சர் பயண செய்த விமான திடீரென தரையிறங்கியது"],["குற்றம்","மனைவியுடன் கள்ளதொடர்பு மெக்கானிக் கொடூர கொலை"],["தமிழகம்","அழுக்கு துணி கிழிந்த பாய்கள் அரசு அலுவலக முன்பு அவல"],["தமிழகம்","சிறுவன் கொலை ராணுவ வீரருக்கு தூக்கு தண்டனை ராமதாஸ்"],["தமிழகம்","லட்ச மாணவ மாணவிகளுக்கு கோடியில் இலவச பஸ் பாஸ்"],["தலையங்கம்","ஏழைகள் என்றால் இளக்காரமா"],["உலகம்","கழுதை பாதி வரிக்குதிரை பாதி கலந்து செய்த கலவைதான்"],["உலகம்","இந்தியாவுக்கு அவுட்சோர்சிங் பணி நிறுத்துகிறது இங்கிலாந்து கபெனி"],["உலகம்","கார் சைஸ் விலங்கின் எலுபு கண்டுபிடிப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","மகனுக்கு மந்திரி பதவி கேட்டு மத்திய அமைச்சர் ராஜினாமா"],["ஸ்டேட் எக்ஸ்பிரஸ்","திகாரில் கைதிகளுக்கு சலுகை அதிகாரிகள் சஸ்பெண்ட்"],["ஸ்டேட் எக்ஸ்பிரஸ்","மரியாவுக்கு சினிமா வாய்ப்பு சிவசேனா கடு எதிர்ப்பு"],["சினிமா(ரீல்மா)","ஆக்ஷன் வேடத்தில் அனுஷ்கா"],["மருத்துவம்","பக்கவாதமா பயப்பட வேண்டா"],["விளையாட்டு","இன்று கடைசி டெஸ்ட் சாதிக்குமா டோனி அன்கோ"],["விளையாட்டு","அணியில் மகனுக்கு இட சர்ச்சையில் ஸ்ரீகாந்த்"],["உலகம்","துப்பாக்கி சூட்டில் தென்கொரிய வீரர்கள் பலி"],["உலகம்","ஸ்ட்ராஸ்கான் மீது பெண் நிருபர் புகார்"],["உலகம்","ஆப்கனில் பர்தா அணிந்து வந்த தீவிரவாதிகள் கைது"],["இந்தியா","சிகரெட்டால் சூடு வைத்து பள்ளி மாணவி பலாத்கார"],["இந்தியா","தெலங்கானா பிரச்னை விஸ்வ ஆந்திராவில் நாள் பந்த்"],["தமிழகம்","சிறுவனை சுட்டவர் அடையாள தெரிந்தது"],["குற்றம்","குமிடிப்பூண்டி அருகே தபி படுகொலை அண்ணன் கைது"],["தமிழகம்","திட்டக்குழு கூட்டத்தில் பங்கேற்க நாளை டெல்லி செல்கிறார் ஜெயலலிதா"],["தமிழகம்","ரங்கசாமி ஆட்சிக்கு ஆதரவு கிடையாது நாராயணசாமி"],["மாவட்ட மசாலா","பக்கத்து வீட்டில் இருந்த தென்னை மரங்களை வெட்டிய டிரைவர் கைது"],["மாவட்ட மசாலா","கோஷ்டியினர் மோதல் பேர் மீது வழக்கு"],["மாவட்ட மசாலா","பெண்ணுக்கு ஆபரேஷன் வயிற்றில் கிலோ கட்டி"],["மாவட்ட மசாலா","ஆனி பஸ் விபத்து பலி ஆக உயர்வு"],["தமிழகம்","இடைத்தரகர்களிட ஏமாற வேண்டா சரத்குமார்"],["மாவட்ட மசாலா","அரசு பள்ளி மாணவர்கள் உடல் உறுப்புகள் தான"],["தமிழகம்","நீலகிரியில் பயங்கர தந்தத்துக்காக யானைகள் வேட்டை"],["மாவட்ட மசாலா","திருப்பூர் ஈரோடு வேலூர் தூத்துக்குடி மாநகராட்சிகளில் இனி வார்டுகள்"],["குற்றம்","நர்சை பலாத்கார செய்த ராணுவ வீரருக்கு வருட ஜெயில்"],["மாவட்ட மசாலா","பென்னலூர் பேட்டையில் இருளர்களுக்கு சாதி சான்றிதழ்"],["மாவட்ட மசாலா","ரயில் நிலையத்தில் சாக்லேட் சாப்பிட்ட வாலிபர் மயக்க"],["தமிழகம்","கேரள மாணவியின் டைரியில் விஐபிகளின் பெயர் மொபைல் எண்கள்"],["மாவட்ட மசாலா","அரக்கோண போலீசுக்கு ஐகோர்ட் நோட்டீஸ்"],["தமிழகம்","கோயபேடு மார்க்கெட் பகுதியில் சாலை செப்பனிடு பணி ஆரப"],["மாவட்ட மசாலா","கெட்டுப்போன பிரியாணி ரயில் பயணிகள் போராட்ட"],["குற்றம்","ஐசிஎப் ஊழியர் வீட்டில் சவரன் பண கொள்ளை"],["உலகம்","செக்ஸ் காபி உடற்பயிற்சி அதிகமானால் ஸ்ட்ரோக் ஏற்படு"],["மாவட்ட மசாலா","துரைப்பாக்கத்தில் குடிநீர் தட்டுப்பாடு"],["மாவட்ட மசாலா","ஆனி பஸ்களை முறைப்படுத்த கமிட்டி"],["மாவட்ட மசாலா","தமிழ் முரசு செய்தியால் போலீஸ் குடியிருப்புக்கு சுத்தமான குடிநீர்"],["குற்றம்","மாணவி கடத்தல் வழக்கில் இன்ஸ்பெக்டர் சிக்கியது எப்படி"],["தமிழகம்","காஞ்சிபுர இளைஞர் காங்சார்பில் மாணவர்களுக்கு இலவச சீருடை"],["குற்றம்","படப்பிடிப்பில் மாணவர்களுடன் தகராறு ஸ்டன்ட் மாஸ்டர் கைது"],["மாவட்ட மசாலா","பீர் பாட்டிலால் தாக்கி வாலிபர் மண்டை உடைப்பு"],["மாவட்ட மசாலா","தூசி பாலிடெக்னிக்கில் மாணவர்களுக்கு வரவேற்பு"],["மாவட்ட மசாலா","நகராட்சி மாநகராட்சிகளில் சதவீத பணியிடங்கள் காலி"],["மாவட்ட மசாலா","அதிமுக தொழிற்சங்கத்தினர் பயங்கர மோதல்"],["மாவட்ட மசாலா","பைக்வேன் மோதல் வாலிபர் பலி"],["உலகம்","அடுப்பு பற்ற வைத்து செல்போனுக்கு சார்ஜ்"],["உலகம்","கோடி ஆண்டு முன்பு கழுகு பார்வை பூச்சி"],["உலகம்","ஏர்போர்ட்டில் செலினா மணி நேர தவிப்பு"],["தமிழகம்","பள்ளியில் எபி எஎல்ஏக்கள் தேர்தல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","மனைவி சித்ரவதை தயாரிப்பாளருக்கு சிறை"],["ஸ்டேட் எக்ஸ்பிரஸ்","போலீஸ் வேலைக்கு பயிற்சி முறை ஓடியவர் பலி"],["சினிமா(ரீல்மா)","கல்யாணத்துக்கு ரெடியாகிறார் ஜெனிலியா"],["சினிமா(ரீல்மா)","பார்ட்டியில் அதிர வைத்த ஜோடி"],["குற்றம்","சங்கரன்கோவில் அருகே ராணுவ வீரர் உள்பட பேர் வெட்டி கொலை"],["விளையாட்டு","கடைசி டெஸ்ட்டு மழையால் பாதிக்கு"],["விளையாட்டு","வது ஒன்டே இலங்கை இங்கிலாந்து இன்று மோதல்"],["விளையாட்டு","வோஸ்னியாக்கி வெற்றி"],["விளையாட்டு","கால்பந்து இங்கி வெற்றி"],["கல்வி","இந்திராகாந்தி பல்கலையில் தொலைதூர பிஎட் படிப்பு"],["கல்வி","அண்ணாமலை பல்கலைக்கழகத்தில் தபால் வழி பாராமெடிக்கல் கோர்ஸ்"],["கல்வி","மத்திய திறந்தவெளி பள்ளியில் எஸ்எஸ்எல்சி பிளஸ் படிக்க வாய்ப்பு"],["தமிழகம்","வெள்ளலூர் கோயிலுக்கு ஏராளமான சொத்துகள்"],["மாவட்ட மசாலா","வாக்குச்சாவடி விவரங்கள் க்குள் சேகரிக்க உத்தரவு"],["மாவட்ட மசாலா","வெளிநாட்டு வேலைவாய்ப்புக்கு வரு தேதி நேர்முக தேர்வு"],["மாவட்ட மசாலா","அரசு போக்குவரத்து கழகத்தில் ஒரே நாளில் பேர் டிஸ்மிஸ்"],["மாவட்ட மசாலா","தேனீக்கள் கூட்டத்தில் சிக்கிய முதியவர் பரிதாப சாவு"],["மாவட்ட மசாலா","குடுப தகராறில் பெண் உயிருடன் எரிப்பு"],["மாவட்ட மசாலா","குடுபமே நடத்திய சாராய தொழிற்சாலை"],["இந்தியா","தனி தெலங்கானா வலியுறுத்தி வது நாளாக பந்த்"],["குற்றம்","பெற்றோரை கொன்ற கொரட்டூர் எஸ்ஐ கைது"],["தமிழகம்","திட்டக்குழு கூட்டத்தில் பங்கேற்க டெல்லி சென்றார் ஜெயலலிதா"],["இந்தியா","கறுப்பு பண வழக்கில் ஹசன்அலிக்கு உதவிய புதுச்சேரி கவர்னர் பதவி விலக உத்தரவு"],["தமிழகம்","ரேஷன் கடைக்கு விஏஓ ஆபீசுக்கு அலையாய் அலைந்து திரியு மக்கள்"],["குற்றம்","மூட்டை பருப்பு பிடிபட்டது பேர் கைது"],["குற்றம்","காஞ்சி வியாபாரி கொலை வழக்கு"],["சினிமா(ரீல்மா)","வாசி அக்ரமுடன் நெருக்க"],["தமிழகம்","ராணுவ அதிகாரியை கைது செய்ய உத்தரவிட முடியாது ஐகோர்ட்"],["தமிழகம்","சட்டப் படிப்பு கவுன்சலிங் இன்று தொடங்கியது"],["குற்றம்","காரை கடத்திய குபல் சிக்கியது"],["குற்றம்","ஜீவனாச கொடுக்காத கணவர் சிறையில் அடைப்பு"],["தமிழகம்","காரைக்குடியில் ராகவேந்திரருக்கு ஐபொன் பாத கமலங்கள்"],["தமிழகம்","சைதையில் தேதி டிராஜேந்தர் ஆர்ப்பாட்ட"],["தமிழகம்","போதை போலீசார் லிஸ்ட் தயாராகிறது"],["தமிழகம்","நிலச்சரிவை தடுக்க தானியங்கி கருவி"],["தலையங்கம்","நில மோசடியில் புரளு கோடிகள்"],["தமிழகம்","சாய ஆலை வழக்கு விரைவில் முடிவுக்கு வரு"],["தமிழகம்","குவியு நில மோசடி புகார் விஏஓக்களு சிக்குகின்றனர்"],["மாவட்ட மசாலா","தண்டவாளத்தில் விரிசல் ரயில்கள் நிமிட லேட்"],["மாவட்ட மசாலா","சுத்தியல் எகிறி விழுந்து தொழிலாளி சாவு"],["மாவட்ட மசாலா","கூட்டுறவு வங்கியில் கையாடல் செயலாளர் எழுத்தர் கைது"],["குற்றம்","திருமணமான மாதத்தில் கர்ப்பிணி அடித்து கொலை"],["மாவட்ட மசாலா","பெட்ரோல் பங்க் ஆபீசில் தீ"],["மாவட்ட மசாலா","வீட்டை இடித்து யானை உயிர் தப்பியது குடுப"],["உலகம்","ஆண்டுகளுக்கு முந்தைய பிரமாண்ட கல் கதவு கண்டுபிடிப்பு"],["தமிழகம்","தூக்கில் தொங்கிய குடுபத்தை காப்பாற்றியது மகள் கழுத்து வலி"],["உலகம்","செல்போன் போது பூட்டை திறக்க"],["சினிமா(ரீல்மா)","சாலை விபத்தில் ஆர்யா காய"],["விளையாட்டு","இலங்கையை சுருட்டி வீசியது இங்கிலாந்து"],["தமிழகம்","பள்ளி மாணவிகள் சாமியாடியதால் பரபரப்பு"],["உலகம்","பின்லேடன் குடுபத்தினரை சொந்த நாட்டுக்கு அனுப்ப தடை"],["உலகம்","சீன நிலக்கரி சுரங்கத்தில் தீ"],["உலகம்","ரிக்டர் அளவில் நியூசிலாந்தில் நிலநடுக்க"],["ஆன்மீகம்","சங்கட தீர்க்கு சக்கரத்தாழ்வார்"],["தமிழகம்","மூத்த தமிழறிஞர் கார்த்திகேசு சிவதபி காலமானார்"],["குற்றம்","ஸ்ரீபெருபுதூரில் வீட்டில் விபசார பேர் கைது"],["இந்தியா","ராகுல் பாதயாத்திரையில் துப்பாக்கியுடன் புகுந்த நபர்"],["இந்தியா","உத்தரப்பிரதேசத்தில் பஸ் மீது ரயில் மோதி பயணிகள் பலி"],["குற்றம்","பாங்க் மேனேஜரை கொல்ல முயன்ற கேஷியர் கைது"],["இந்தியா","தெலங்கானா மாவட்டங்களில் மாணவர்கள் மறியல் தர்ணா"],["மாவட்ட மசாலா","கன்னிகைபேர் அரசு பள்ளி முன்பு பஸ் நிறுத்த மாணவர்கள் கோரிக்கை"],["தமிழகம்","திருவள்ளூர் மாவட்ட விஏஓ சங்க தேர்தல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","மாநிலங்களவை தேர்தல் யெச்சூரிக்கு மீண்டு வாய்ப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","துப்பாக்கி விற்பனை ராணுவ அதிகாரிகள் மீது நடவடிக்கை"],["ஸ்டேட் எக்ஸ்பிரஸ்","பலாத்கார கொடுமை பெண்களுக்கு நஷ்டஈடு"],["மாவட்ட மசாலா","பண தர மறுத்த மனைவிக்கு உருட்டுக்கட்டை அடி"],["மாவட்ட மசாலா","செருப்பு கடை எரிந்து நாச"],["குற்றம்","பட்டாபிராமில் வியாபாரி வீட்டில் சவரன் கொள்ளை"],["சினிமா(ரீல்மா)","பிரபுதேவா ரலத் விவாகரத்து குடுபநல நீதிமன்ற தீர்ப்பு"],["தமிழகம்","வக்கீல்கள் கோர்ட் புறக்கணிப்பு போராட்டத்தால் திடீர் பரபரப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","அரசியல் கைதிகள் விடுதலை மேவங்க முதல்வர் அறிவிப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","அமர்நாத் யாத்திரை சென்ற பேர் மாரடைப்பால் மரண"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஜெர்மன் சிறுமி பலாத்கார வழக்கு அமைச்சர் மகன் விடுவிப்பு"],["உலகம்","உயிருக்கு போராடு குறை பிரசவ குதிரை"],["உலகம்","ஒரு நாளாச்சு சுமா இருக்கணு"],["உலகம்","ஆயிர சதுர அடியில் ஜாலி ஆபீஸ்"],["தமிழகம்","வயது சிறுமியை வயது ஆசாமி திருமண"],["சினிமா(ரீல்மா)","அஜீத் பட கேமராமேன் திடீர் விலகல்"],["உலகம்","ட்ரோன் தயாரித்து விற்க சீனா திட்ட"],["உலகம்","சிலி பாலைவனத்தில் கடு பனிபொழிவு"],["உலகம்","ஒரு நாளாச்சு சுமா இருக்கணு"],["உலகம்","அட்லான்டிஸ் இன்று கடைசி பயண"],["விளையாட்டு","ரன்னில் சுருண்டது வெஇ"],["விளையாட்டு","ஹர்பஜன் விக்கெட்"],["தலையங்கம்","பொய் கேஸ்கள் பாயு போலீஸ்"],["தமிழகம்","மாணவர்களுக்கு ஒரு ஸ்பூன் சுண்டல்"],["குற்றம்","பெண்களை சீரழித்த போதை சாமியார் கைது"],["மாவட்ட மசாலா","கள்ளநோட்டு வாலிபர் பிடிபட்டார்"],["மாவட்ட மசாலா","சாய ஆலைகள் பிரச்னை"],["மாவட்ட மசாலா","அரசு டாக்டர் வீட்டில் லட்ச நகை கொள்ளை"],["மாவட்ட மசாலா","சிறை அதிகாரிகளுக்கு ஆண்டு ஜெயில்"],["மாவட்ட மசாலா","ஆற்றில் மினிபஸ் கவிழ்ந்து பேர் படுகாய"],["மாவட்ட மசாலா","கந்துவட்டி கொடுமை ஒரே நாளில் பேர் கைது"],["மாவட்ட மசாலா","மேட்டூரில் பரவு மர்ம காய்ச்சல்"],["இந்தியா","தனி தெலங்கானாவுக்கு எதிர்ப்பு மாணவர் அமைப்பினர் திடீர் பந்த்"],["தமிழகம்","இன்ஜினியரிங் கல்லூரிகளில் சேர பொதுப்பிரிவு கவுன்சலிங் தொடங்கியது"],["மாவட்ட மசாலா","தாமரைபாக்கத்தில் பாஜ ஆர்ப்பாட்ட"],["மாவட்ட மசாலா","காஞ்சியில் இளபெண்ணிட பைக் ஆசாமிகள் கைவரிசை"],["தமிழகம்","மொட்டை போடு பெண் பக்தர்களுக்கு இலவச அனுமதி"],["தமிழகம்","குடிநீரில் கழிவுநீர் கலப்பு நோய் ஆபத்து"],["தமிழகம்","கட்ட மருத்துவ கவுன்சலிங் எப்போது"],["குற்றம்","சாப்ட்வேர் இன்ஜினியரை மிரட்டி பண பறித்த திருநங்கை கைது"],["தமிழகம்","காங்கிரஸ் பலவீனத்துக்கு தங்கபாலுதான் காரண"],["சினிமா(ரீல்மா)","ஐஸ்வர்யா ராய்க்கு என்ன குழந்தை பல கோடி பெட்"],["மாவட்ட மசாலா","செல்போன் கடையில் கூரையை பிரித்து கொள்ளை"],["தமிழகம்","மாற்று திறன் பட்டதாரிக்கு சட்டக்கல்லூரியில் இட ஐகோர்ட்"],["தமிழகம்","அயனாவர போலீஸ் ஸ்டேஷனில் சட்ட ஒழுங்கு காவலர் பற்றாக்குறை"],["தமிழகம்","மாணவி பலாத்கார வழக்கில் இன்று அடையாள அணிவகுப்பு"],["மாவட்ட மசாலா","பெண் வார்டன்களுக்கு மாதத்தில் பணி நிரந்தர"],["தலையங்கம்","அரவாணிகளுக்கு அட்வைஸ்"],["உலகம்","காங்கோ விமான விபத்து பயணிகள் பரிதாப பலி"],["உலகம்","கராச்சியில் தொடர் கலவர கண்டது சுட உத்தரவு"],["உலகம்","புகை மதுவை மறக்க தியானதான் பெஸ்ட்"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஜெகன் கட்சி மாநாட்டில் காங் எஎல்ஏ பங்கேற்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","சபள தர பண இல்லை பிரதமருக்கு ஏர்இந்தியா கடித"],["ஸ்டேட் எக்ஸ்பிரஸ்","கேரளாவில் பன்றிக்காய்ச்சல் ஒரே நாளில் அட்மிட்"],["சினிமா(ரீல்மா)","ஒபாமா பற்றி இமெயில் அனுப்பிய பெண் இயக்குனர்"],["விளையாட்டு","இந்தியா முன்னிலை வீரர்கள் அரைசத"],["விளையாட்டு","மணி நேர சமைத்து விருந்து படைத்த சாக்ஷி"],["உலகம்","உலகின் உயரமான ரோலர் கோஸ்டர்"],["தமிழகம்","ஏழை குடுபங்களுக்கு இலவச ஆடுமாடு முதல்வர் ஜெயலலிதா"],["குற்றம்","டாக்டர் வீட்டில் பவுன் கொள்ளை"],["இந்தியா","உண்ணாவிரத தொடங்கினார் குமாரசாமி"],["மாவட்ட மசாலா","கல்குள தாலுகா ஆபீசில் புரோக்கர்கள் கைது"],["மாவட்ட மசாலா","யானைகள் வேட்டை நீலகிரியில் பேர் கைது"],["மாவட்ட மசாலா","பவுன் கொள்ளை போலி போலீசுக்கு வலை"],["மாவட்ட மசாலா","ஊட்டி பூங்காவில் ல் மலர் நாற்று நடவு"],["மாவட்ட மசாலா","பெண்ணுக்கு அடி உதை பெண்கள் கைது"],["மாவட்ட மசாலா","ராணுவ வீரர் மர்ம சாவு"],["குற்றம்","சினிமா பாட்டுக்கு மாணவிகளை ஆடச்சொன்ன ஆசிரியர் கைது"],["குற்றம்","சிறுமி பலாத்கார வழக்கில் எய்ட்ஸ் நோயாளி சிறையில் அடைப்பு"],["மாவட்ட மசாலா","திருமண கோஷ்டிக்காக மறியல் செய்த எஎல்ஏ"],["மாவட்ட மசாலா","காட்டு யானை மிதித்து முதியவர் பரிதாப சாவு"],["மாவட்ட மசாலா","சுவர் இடிந்து விபத்து பெண் தொழிலாளி பலி"],["மாவட்ட மசாலா","ரயில் முன் பாய்ந்து போலீஸ்காரர் தற்கொலை"],["தமிழகம்","திருமுருகன் கல்லூரி பட்டமளிப்பு விழா"],["தமிழகம்","இந்திரா செவிலியர் கல்லூரியில் இதய நோய் பராமரிப்பு கருத்தரங்க"],["தமிழகம்","திருநின்றவூர் நெமிலிச்சேரி ரயில் பயணிகள் புகார் தர கிமீ அலையு பரிதாப"],["மர்மம்","புத்துசாமிக்கு பிடித்த பொட்லி பூஜை"],["குற்றம்","அஞ்செட்டி அருகே நள்ளிரவில் விவசாயி மீது துப்பாக்கிச் சூடு"],["விளையாட்டு","இன்று கடைசி நாள் ஆட்ட பரபரப்பான கட்டத்தில் கடைசி டெஸ்ட்"],["விளையாட்டு","தொடரை வென்றது இங்கிலாந்து"],["வேலைவாய்ப்பு","நேஷனல் தெர்மல் பவர் கார்ப்பரேஷனில் சிவில் இன்ஜினியர்கள்"],["குற்றம்","வீட்டில் அடைத்து வைத்து மாணவியை சீரழித்த ஆசிரியர் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","மேவங்கத்தில் தொடரு சோக நாளில் குழந்தைகள் பலி"],["தமிழகம்","செப்டபர் இறுதியில் உள்ளாட்சி தேர்தல்"],["தமிழகம்","ரீடிங் எடுக்க ஆட்கள் பற்றாக்குறை மின் கட்டண செலுத்துவதில் குழப்ப"],["தமிழகம்","சிப்பாய் புரட்சி நினைவு தின"],["குற்றம்","சேவல் சூதாட்ட பேர் கைது"],["குற்றம்","வெளிநாட்டு மதுபாட்டில்களை பதுக்கி விற்றவர் சிக்கினார்"],["தமிழகம்","சென்னையில் ல் அதிமுக செயற்குழு ஜெயலலிதா அறிவிப்பு"],["குற்றம்","பூந்தமல்லி அருகே பிளாஸ்டிக் கபெனியில் பயங்கர தீ விபத்து"],["தமிழகம்","பகலில் காதலர்களின் சேட்டை இரவில் குடிமகன்களின் கோட்டை"],["உலகம்","ஆண்டுகள் கலக்கிய பத்திரிகை இங்கிலாந்து வாசகர்களுக்கு குட்பை"],["உலகம்","ஐப்பானில் பூகப சுனாமி எச்சரிக்கை"],["குற்றம்","திருத்தணி முருகன் கோயில் விடுதியில் வாலிபரை அடைத்து வைத்து பாலியல் தொந்தரவு ஒருவர் கைது"],["உலகம்","அமெரிக்க மாஜி அதிபரின் வயது மனைவி மரண"],["உலகம்","சிப்ஸ் பீட்சா உருவாக்கு கொழுப்பு அடிமைகள்"],["உலகம்","பாட்டு பாடிய கஞ்சா மூலிகை அந்தஸ்துக்கு நோ"],["தமிழகம்","திருவில்லியில் ஆடு ஜாக்கிரதை ரவுண்டு போகாவிட்டால் ரகளை"],["ஸ்டேட் எக்ஸ்பிரஸ்","மணிப்பூரில் தீவிரவாத அமைப்பு தலைவர் கைது"],["இந்தியா","பெங்களூரில் வது நாளாக குமாரசாமி உண்ணாவிரத"],["தமிழகம்","நெடுஞ்சாலைகளில் கனரக வாகன வேகத்தை குறைக்க வேண்டு"],["தமிழகம்","சிறுவன் தில்சன் சுட்டுக் கொலை ராணுவ அதிகாரி சிக்கியது எப்படி"],["விளையாட்டு","கடைசி டெஸ்ட் போட்டி டிராவில் முடிவடைந்தது"],["உலகம்","கமகம டிவி செல்போன் விரைவில் வருது"],["விளையாட்டு","லிகா சாதனை புத்தகத்தில் இடபெறுகிறார் டோனி"],["உலகம்","குட்டி குண்டு சகோதரிகள்"],["உலகம்","கர்ப்பிணி மனைவி கர்லாவுடன் சர்கோஸி ஜாலி சுற்றுலா"],["உலகம்","தொட்டால் கிஸ் பண்ணினால் கர்ப்ப"],["சினிமா(ரீல்மா)","ஜெனிலியா நடித்த திருமண காட்சியால் சர்ச்சை"],["சினிமா(ரீல்மா)","செட்டுக்கு கோடியா தயாரிப்பு அதிர்ச்சி"],["சினிமா(ரீல்மா)","கன்னட பட சமீரா ஆசை"],["இந்தியா","மாணவி பலாத்கார வழக்கு தனிப்படை எஸ்பி திடீர் மாற்ற"],["உலகம்","அமெரிக்காவின் சேரி பகுதியில் வில்லிய ஜோடி விசிட்"],["உலகம்","பாகிஸ்தானுக்கு நிதி உதவியை குறைத்தது அமெரிக்கா"],["விளையாட்டு","லட்சுமண் ஓஜாவுக்கு பதவி"],["விளையாட்டு","வின்ஸி சாபியன்"],["விளையாட்டு","ஸ்வான் நபர் இஷாந்த்"],["விளையாட்டு","அப்ரிடி வருத்த"],["தலையங்கம்","குழந்தை கடத்தல் கொலைக்கு சம"],["ஸ்டேட் எக்ஸ்பிரஸ்","இந்தியா கேட் அருகே வீலிங் வாலிபர்கள் சிக்கினர்"],["ஸ்டேட் எக்ஸ்பிரஸ்","போலீஸ் தேடிய கிரிமினல்கள் எஎல்ஏ காரில் பயண"],["ஸ்டேட் எக்ஸ்பிரஸ்","திருமண விழா பார்ட்டிகளில் கேமரா திருடியவர் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","டெங்கு காய்ச்சலுக்கு குழந்தைகள் பலி"],["தமிழகம்","புதிய காப்பீடு திட்ட விரைவில் தொடக்க முதல்வர் ஜெயலலிதா"],["இந்தியா","ஹவுரா ரயில் தட புரண்டு விபத்து பலி எண்ணிக்கை ஆக உயர்வு"],["மாவட்ட மசாலா","ஏரியில் குளித்த மாணவிகள் தண்ணீரில் மூழ்கி பலி"],["மாவட்ட மசாலா","அரசு பஸ்கள் மோதல் பயணிகள் படுகாய"],["மாவட்ட மசாலா","டாப்சிலிப்பில் பயங்கர யானை மிதித்து வாலிபர் சாவு"],["மாவட்ட மசாலா","உலக முழுவது அனுசரிப்பு இன்று மக்கள் தொகை தின"],["குற்றம்","நகைக்காக பாட்டியை கொன்ற பேரன் கைது"],["மாவட்ட மசாலா","திருமலைக்கு பஸ்சில் சரக்குடன் சென்ற பேர் கைது"],["குற்றம்","ராணுவ கேப்டன் வீட்டில் நகை பண கொள்ளை"],["குற்றம்","தூத்துக்குடியில் முதலிரவு அறையில் மணப்பெண் தற்கொலை"],["தமிழகம்","பெப்சி தொழிலாளர்கள் திடீர் போராட்ட"],["தமிழகம்","நடிகர் விஜய்க்கு சொந்தமான திருமண மண்டபத்துக்கு பாதிப்பு"],["தமிழகம்","அரசு பள்ளிக்கு சொந்தமான இட ஆக்கிரமிப்பு"],["தமிழகம்","தவறுக்கு துணைபோவோர் மீது பாரபட்சமின்றி நடவடிக்கை"],["தமிழகம்","அடைக்கல மாதா தேரில் ஊர்வல"],["குற்றம்","போலி பத்திர தயாரித்து ஏக்கர் நில மோசடி இருவர் கைது"],["தமிழகம்","பல நாளாக விழுந்து கிடக்கு சிக்னல் கப மக்கள் அவதி"],["குற்றம்","ஒசூரில் பவுன் நகையுடன் மந்திரவாதி ஓட்ட"],["குற்றம்","வீடு ஓட்டல்கள் சூறையாடல் மாஜி பஞ் தலைவி மீது தாக்குதல்"],["தமிழகம்","விமான நிலைய ஊழியர்கள் காலவரையற்ற உண்ணாவிரத"],["இந்தியா","மத்திய அமைச்சரவை மாற்ற மன்மோகனுடன் சோனியா இன்று மீண்டு ஆலோசனை"],["தமிழகம்","தனிப்பிரிவு போலீஸ் விசாரிக்க வேண்டு கருணாநிதி"],["தமிழகம்","பொய் வழக்குகளை சட்ட ரீதியாக சந்திப்போ முகஸ்டாலின்"],["தமிழகம்","இலவச மிக்சி டெண்டர் திறப்பு நிறுவனங்களின் மனு ஏற்பு"],["தமிழகம்","வக்கீல் மகன் கடத்தி கொலை அறிக்கை தாக்கல் செய்ய சிபிஐக்கு ஐகோர்ட் உத்தரவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","கோர்ட் அவமதிப்பு வழக்கில் மாஜி கவர்னருக்கு நோட்டீஸ்"],["ஸ்டேட் எக்ஸ்பிரஸ்","சாய் அறக்கட்டளை கணக்கு ஆந்திர அரசிட விவரங்கள் தாக்கல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","சுதந்திர தினத்தன்று கைதிகள் விடுதலைக்கு கர்நாடக அரசு பரிந்துரை"],["ஸ்டேட் எக்ஸ்பிரஸ்","வெளிநாட்டு பைலட்களை வீட்டுக்கு அனுப்ப மத்திய அரசு முடிவு"],["உலகம்","மச்சான் உஷாரு மலேரியா வருது"],["உலகம்","புத்த புதுசா மருந்து மாத்திரை"],["சினிமா(ரீல்மா)","ஒரு பாட்டுக்கு ஆட நயன நோ"],["உலகம்","ரஷ்ய படகு விபத்தில் பயணிகள் பலி"],["உலகம்","கோஎஜுகேஷனுக்கு ஈரான் அதிபர் ஆதரவு"],["உலகம்","தீவிரவாதத்துக்கு எதிரான நடவடிக்கை பாதிக்காது பாக்"],["தமிழகம்","வால்பாறை அரசு பள்ளியில் மது பார் ஆபாச சிடிக்கள்"],["விளையாட்டு","இந்தியா இங்கிலாந்து டெஸ்ட் ல் ஸ்டார்ட்"],["விளையாட்டு","டோனி முடிவுக்கு மாஜி வீரர்கள் எதிர்ப்பு"],["விளையாட்டு","ஊக்கமருந்து விவகார அஸ்வினி ஒலிபிக் கனவுஅபேல்"],["தலையங்கம்","கடைசி நேர வரை காத்திருக்க வேண்டா"],["மாவட்ட மசாலா","குத்துவிளக்கால் சரமாரியாக குத்தி மனைவியை கொன்றவர் கைது"],["மாவட்ட மசாலா","அரசு நடுநிலைப்பள்ளியில் கப்யூட்டர்கள் திருட்டு"],["மாவட்ட மசாலா","பைக் மீது லாரி மோதி புது மாப்பிள்ளை பலி"],["மாவட்ட மசாலா","சிறுவர்களிட சிக்கிய தங்க புதையல் மீட்பு"],["மாவட்ட மசாலா","நகை பறிக்க முயற்சி தபால்காரருக்கு வலை"],["மாவட்ட மசாலா","ஒரே குடுபத்தை சேர்ந்த பேரின் ஆயுள் ரத்து"],["மாவட்ட மசாலா","எஸ்ஐயை தாக்கிவிட்டு கைதி ஓட்ட"],["குற்றம்","டியூஷனுக்கு சென்ற மாணவி மர்ம சாவு"],["இந்தியா","மத்திய அமைச்சரவை மாற்றியமைப்பு புதிதாக அமைச்சர்கள்"],["மாவட்ட மசாலா","தூக்கிட்டு பெயின்டர் தற்கொலை"],["மாவட்ட மசாலா","ஓய்வு பெற்ற அலுவலர்கள் கூட்ட"],["தமிழகம்","மின் கபி துண்டிப்பு ரயில்கள் தாமத"],["சினிமா(ரீல்மா)","சொந்த வாழ்க்கையில் யாரு தலையிட வேண்டா நயன்தாரா"],["தமிழகம்","பள்ளி மாணவி பலாத்கார போலீஸ் அதிகாரிக்கு சிறப்பு சலுகை ஏன்"],["தமிழகம்","ஆதிதிராவிட மாணவர் விடுதிகளை மேபடுத்த கோடி நிதி உதவி முதல்வர் ஜெ"],["தமிழகம்","நகராட்சிகளில் நிலவு குடிநீர் பற்றாக்குறை தீர்க்க அதிகாரி ஆய்வு"],["குற்றம்","பண பறிக்கு குபல் கைது"],["குற்றம்","போலீஸ் நிலைய அருகே கல்லால் தாக்கப்பட்ட வாலிபர் சாவு"],["தமிழகம்","இடஒதுக்கீட்டில் மாற்ற இல்லை முதல்வர் ஜெ"],["தமிழகம்","மத்திய அமைச்சரவையில் திமுக இடபெறாதது ஏன்"],["குற்றம்","பெரியமேட்டில் பயங்கர தீ விபத்து"],["உலகம்","ஜெர்மனி வீரர்களுக்கு செக்ஸ் பொமை ஹிட்லர்"],["உலகம்","கோடி ஆண்டு பழைய உலக கண்டுபிடிப்பு"],["உலகம்","பாக்கில் அமெரிக்க விமான தாக்குதல் தீவிரவாதிகள் பலி"],["உலகம்","வது மாடியிலிருந்து விழுந்த குழந்தை கோமாவில் இருந்து மீண்டது"],["உலகம்","பாக்தாத்தில் குளோரின் வாயு கசிவு பேர் பாதிப்பு"],["இந்தியா","மாணவி பலாத்கார வழக்கு குமரி இன்ஸ்பெக்டரின் முன்ஜாமீன் மனு தள்ளுபடி"],["குற்றம்","மாணவியை கொன்று நகை பண கொள்ளை"],["ஸ்டேட் எக்ஸ்பிரஸ்","எமர்ஜென்சி கால கடிதங்கள் வெளியிட தடை"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஜெகன் சொத்து குவிப்பு சிபிஐ விசாரிக்க உத்தரவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","கேபினட்டில் இட இல்லை ஒரிசா முதல்வர் வருத்த"],["ஸ்டேட் எக்ஸ்பிரஸ்","ரயில் மீது மர விழுந்து பேர் காய"],["சினிமா(ரீல்மா)","பிரியங்காவின் டூப் மர்ம சாவு"],["சினிமா(ரீல்மா)","காடு ஆக்கிரமிப்பை சொல்லு குகி"],["குற்றம்","தீப்பெட்டி ஆலை விபத்தில் பெண் பலி"],["தமிழகம்","கிராம ஊராட்சிகளில் நிதியின்றி வளர்ச்சிப் பணிகள் முடக்க"],["தமிழகம்","பெற்றோரிட பண பறிக்க மாணவன் கடத்தல் நாடக"],["மாவட்ட மசாலா","கிணற்றில் குதித்து இளபெண் சாவு"],["கல்வி","பெட்ரோலிய துறையில் மாத சான்றிதழ் படிப்பு"],["கல்வி","அழகப்பா பல்கலையில் தொலைநெறி எபிஏ"],["விளையாட்டு","நாடுகள் கிரிக்கெட் ஸ்காட்லாந்து அதிரடி வெற்றி"],["விளையாட்டு","சவான் சவால் கொடுப்பார் டிராவிட்"],["விளையாட்டு","பேட்டிங்கை மேபடுத்துவதில் கவன சச்சின்"],["மாவட்ட மசாலா","தொழில் அதிபர் வீட்டில் பவுன் பண கொள்ளை"],["மாவட்ட மசாலா","கள்ளநோட்டு தயாரித்த மாஜி செக்யூரிட்டி கைது"],["மாவட்ட மசாலா","ஏழை ு நடிகர்கள் ஒப்புதல்"],["இந்தியா","உணவுப் பொருள் விலையை கட்டுப்படுத்த பிரதமர் தலைமையில் அவசர ஆலோசனை"],["மாவட்ட மசாலா","சென்னை தூத்துக்குடி சிறப்பு ரயில் நேர மாற்ற"],["குற்றம்","மில் தொழிலாளி வெட்டிக்கொலை"],["தமிழகம்","தாபர பாலத்தை சீரமைக்க கோரிக்கை"],["தமிழகம்","ஊத்துக்கோட்டையில் கூடுதல் பஸ் விட கோரிக்கை"],["தமிழகம்","நெல்லை சென்னை வழித்தடத்தில் பொங்கல் சிறப்பு ரயில்களின் நேர அடியோடு மாற்ற"],["வேலைவாய்ப்பு","மத்திய தொழில் பாதுகாப்பு படையில் கான்ஸ்டபிள்/ டிரேட்ஸ்மென் வேலை"],["வேலைவாய்ப்பு","பரோடா வங்கியில் புரொபஷனரி ஆபீசர் பணி"],["இந்தியா","பெண்களே வடிவமைத்த கைவினை பொருட்கள் டெல்லியில் சக்தி கண்காட்சி தொடக்க தயாநிதி மாறன் துவக்கிவைத்தார்"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஸ்ரீநகர் மணாலியில் கடு பனிப்பொழிவு"],["தமிழகம்","செந்தூர் எக்ஸ்பிரஸ் ரயிலை தினமு இயக்க வலியுறுத்தல்"],["இந்தியா","முபை ஐஓசி கிடங்கில் பயங்கர தீ விபத்து"],["தமிழகம்","திருவண்ணாமலையில் கிரிவல வர உகந்த நேர"],["விளையாட்டு","எல்லோரையு திருப்திபடுத்த முடியாது கேப்டன் டோனி"],["உலகம்","கடு தண்டனை வழங்கிய நீதிபதிகள் டிஸ்மிஸ்"],["கல்வி","இன்சூரன்ஸ் நிறுவன பணிக்கு டிப்ளமோ கோர்ஸ்"],["தமிழகம்","கபாலீஸ்வரர் கோயில் தைப்பூச விழா மயிலாப்பூரில் போக்குவரத்து மாற்ற"],["உலகம்","வயது இந்திய குழந்தை துபாயில் பலாத்கார பேர் கைது"],["குற்றம்","வயது இந்திய குழந்தை துபாயில் பலாத்கார"],["குற்றம்","இன்ஜி மாணவி வாலிபர் விபத்தில் பலி"],["தமிழகம்","ஏழுமலையானுக்கு அணிவித்த நகைகளை நீதிபதி ஆய்வு"],["தமிழகம்","பெருங்குடி போட்சியில் இலவச கலர் டிவி பட்டா"],["தமிழகம்","காஞ்சிபுரத்தில் லட்சத்தில் குடிநீர் தொட்டிகள் அங்கன்வாடி மைய திறப்பு"],["தமிழகம்","பென்னலூர்பேட்டையில் குப்பை கிடங்கை இட மாற்ற கோரிக்கை"],["குற்றம்","போலீஸ் காரில் இருந்து தப்பி ஓடிய அதிமுக பிரமுகர் மகன் கைது"],["தமிழகம்","குண்டு குழியுமாக மாறிய திருத்தணி சித்தூர் சாலை"],["தமிழகம்","விஐடி பல்கலை வேலைவாய்ப்பு முகா தேர்வான பேருக்கு பணி நியமன உத்தரவு"],["உலகம்","ஈராக்கில் கார் குண்டு பேர் பரிதாப பலி"],["மாவட்ட மசாலா","ஊரைவிட்டு ஒதுக்குபவர்கள் மீது கடு நடவடிக்கை எடுக்க வேண்டு"],["மாவட்ட மசாலா","ஆவடி திருமுல்லைவாயல் பகுதியில் சீரமைத்த மூன்று மாதத்தில் பழுதானது சிடிஎச் சாலை"],["உலகம்","ஈரா
