ாலா","திருவொற்றியூரில் அங்கன்வாடியை சீரமைக்க கோரிக்கை"],["மாவட்ட மசாலா","மாவட்ட குடிநீர் தேவை மேட்டூரில் இருந்து நீர் திறப்பு"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["மாவட்ட மசாலா","மேட்டூர் நீர்மட்ட அடி"],["மாவட்ட மசாலா","பராமரிப்பின்றி கிடக்கு மீஞ்சூர் ரயில் நிலைய"],["மாவட்ட மசாலா","அத்திமாஞ்சேரிப்பேட்டைநொச்சிலி சாலை சீரமைக்கப்படுமா"],["உலகம்","பூமிக்கு அருகில் சுற்று விண்கற்களால் ஆபத்தா"],["தமிழகம்","வகுப்புக்கான அறிவியல் செய்முறை தேர்வு வினா வடிவமைப்பு வெளியீடு"],["தமிழகம்","குண்டு குழியுமான ஸ்ரீபெருபுதூர் கரசங்கால் சாலையால் மக்கள் அவதி விரைவில் சீரமைக்க வலியுறுத்தல்"],["தமிழகம்","அதிக பயணிகளை ஏற்று ஷேர்ஆட்டோக்களால் விபத்து கூடுதல் பஸ் இயக்க கோரிக்கை"],["சினிமா(ரீல்மா)","உற்சாக பானத்தில் மிதந்த நடிகரு நண்பர்களு"],["தலையங்கம்","மாற்ற கொண்டு வர இதுவே போது"],["மாவட்ட மசாலா","குடிநீர் தேவைக்காக மேட்டூரில் நீர் திறப்பு அதிகரிப்பு"],["தமிழகம்","இலவச கலர் டிவி கேட்டு திருமுல்லைவாயல் விஏஓ ஆபீஸ் முற்றுகை"],["தமிழகம்","திமுக ஆட்சியில் ஏராளமான திட்டங்கள்"],["வேலைவாய்ப்பு","ரிசர்வ் வங்கியில் இன்ஜினியர் பணியிடங்கள்"],["வேலைவாய்ப்பு","இந்திய விமானப்படையில் பயிற்சியுடன் வேலை"],["இந்தியா","ஜேபிசி விவகார எதிர்க்கட்சிகளுடன் நாளை பிரணாப் முகர்ஜி பேச்சு"],["இந்தியா","விரைவில் அமைச்சரவை விஸ்தரிப்பு ஆந்திராவில் சிரஞ்சீவிக்கு அமைச்சர் பதவி"],["உலகம்","முபை ரயில்களில் சினிமா நியூஸ்"],["மாவட்ட மசாலா","முருகன் கோயில் பிரமோற்சவ நாளை துவக்க"],["தமிழகம்","தனித்து போட்டியிட தயாரா பாமகவுக்கு சரத்குமார் கேள்வி"],["தமிழகம்","போலீஸ் குழுவினருக்கு பேண்ட் வாத்திய போட்டி புறநகர் கமிஷனர் தொடங்கி வைத்தார்"],["இந்தியா","பாபா அணுசக்தி மையத்துக்கு தீவிரவாதிகளால் அச்சுறுத்தல் கண்காணிப்பு தீவிர"],["இந்தியா","ஸ்பெக்ட்ர விவகார பிரணாப் முகர்ஜி புது திட்ட பேச்சு வார்த்தை"],["இந்தியா","டிஎன்ஏ பரிசோதனைக்கு தடைகோரிய மனு உயர்நீதிமன்ற தள்ளுபடி"],["உலகம்","தீவிரவாதிகளின் கையில் சீன ஆயுதங்கள் அமெரிக்கா கவலை"],["குற்றம்","இளபெண் கொலை பரோட்டா மாஸ்டருக்கு வலை"],["தமிழகம்","சுற்றுலா பயணிகள் தவிப்பு ஊட்டி மலை ரயிலுக்கு புதிய இன்ஜின் வருமா"],["தமிழகம்","பிளஸ் தனித் தேர்வர்களுக்கு நாளை ஹால் டிக்கெட் வினியோக"],["தமிழகம்","திருத்தணி மலைக்கோயிலுக்கு கோடியில் மாற்று பாதை அமைச்சர் அடிக்கல் நாட்டினார்"],["தமிழகம்","பேரபாக்க தண்டல சாலை சீரமைக்க மக்கள் கோரிக்கை"],["விளையாட்டு","நமக்குத்தான் வாய்ப்பு முனாப்படேல்"],["மருத்துவம்","பீரியட் பிரச்னைக்கு ஸ்பெஷல் டிப்ஸ்"],["இந்தியா","ஜேபிசி அமைக்கப்படுமா எதிர்க்கட்சிகளுடன் அரசு ஆலோசனை"],["உலகம்","அதிகாரபூர்வ அறிவிப்பு புதிய நாடானது தெற்கு சூடான்"],["தலையங்கம்","கொத்தடிமை தொழிலாளர்கள்"],["சினிமா(ரீல்மா)","தமிழில் கதைகள் பிடிக்காததால் நடிக்கவில்லை அனன்யா"],["இந்தியா","தொலைபேசி ஒட்டு கேட்பு வழக்கு அமர்சிங்குக்கு உச்ச நீதிமன்ற கண்டன"],["தமிழகம்","சபள உயர்வு உள்பட அச கோரிக்கைகளை வலியுறுத்தி தமிழக அரசு ஊழியர்கள் இன்று ஸ்டிரைக் பணிகள் பாதிப்பு"],["குற்றம்","யானைகள் தாக்கி பெண் பலி சடலங்களை எடுக்க விடாமல் நள்ளிரவு வரை போராட்ட"],["தலையங்கம்","நல்லது நடக்க ஆலோசனை அவசிய"],["சினிமா(ரீல்மா)","அழகு லிஸ்ட்டில் அசத்தல் ஹாலிவுட் நடிகைகளை இந்திய ஹீரோயின் ஓவர்டேக்"],["இந்தியா","பிப் நெருங்குது காதலர்களே உஷார் லிப் டூ லிப் அடித்தால் யு டியூபில் உடனடி ரிலீஸ்"],["இந்தியா","ஸ்பெக்ட்ர வழக்கை விசாரிக்க சிறப்பு நீதிமன்ற"],["தலையங்கம்","உயிரை விட உயர்ந்தது இல்லை"],["உலகம்","அயர்லாந்தில் விமான விபத்து பேர் பலி"],["ஸ்டேட் எக்ஸ்பிரஸ்","இந்திய விமான படைக்கு ஹெலிகாப்டர்கள்"],["மாவட்ட மசாலா","மேட்டூர் அணையில் இரண்டு மடங்கு மீன்கள்"],["தமிழகம்","கால்வாயில் ஏற்பட்ட அடைப்பால் சாலையில் ஆறாக ஓடு கழிவுநீர் மக்கள் கடு பாதிப்பு"],["இந்தியா","ஜேபிசி அமைக்க தீர்மான கொண்டு வர வேண்டு பாஜக"],["உலகம்","தெற்கு சூடானில் மோதல் பேர் பலி"],["தமிழகம்","தாசில்தார்களுக்கு ஊதிய உயர்வு தமிழக அரசு உத்தரவு"],["தமிழகம்","சேப்பாக்க ஸ்டேடியத்துக்கு சிறப்பு பஸ்கள் இயக்க"],["தமிழகம்","திருவள்ளூர் செங்குன்ற சாலையில் தரைப்பால ஆக்கிரமிப்பை அகற்ற கோரிக்கை"],["தமிழகம்","ஏனபாக்க கிராமத்தில் ஆரப சுகாதார நிலைய திறப்பு"],["தமிழகம்","வாகனங்கள் செல்ல முடியாமல் அவதி செங்கால்பள்ளி கீச்சல சாலை சீரமைக்கப்படுமா"],["விளையாட்டு","இப்போதைக்கு ஆதிக்க செலுத்து அணி தென் ஆப்ரிக்கா"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஒரிசா எஎல்ஏக்களுக்கு மடங்கு சபள உயர்வு"],["உலகம்","அமெரிக்காவில் வாழு இந்திய மாணவர்களின் கால் விலங்கு அகற்ற"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["இந்தியா","சிரஞ்சீவிக்கு மத்திய அமைச்சர் பதவி"],["மாவட்ட மசாலா","மேட்டூருக்கு நீர் வரத்து குறைந்தது"],["மாவட்ட மசாலா","காதலியின் மாமாவுக்கு உதை காதலன் பேர் கைது"],["உலகம்","காலமெல்லா காதல் வாழ்க"],["உலகம்","ஈராக்கில் மனித குண்டு தாக்குதல் புனித பயண சென்ற பேர் பரிதாப சாவு"],["தமிழகம்","அரையப்பாக்க ஊராட்சியில் சாலை குடிநீர் பிரச்னையை தீர்க்க பொதுமக்கள் கோரிக்கை"],["தமிழகம்","தெருவிளக்குகள் பழுது மாதமாக இருளில் மூழ்கியது கொளத்தூர்"],["இந்தியா","கொடுங்கையூரில் வீட்டின் கதவு உடைத்து கொள்ளை"],["தலையங்கம்","காதல் இனிக்கு கல்யாண கசக்கு"],["மாவட்ட மசாலா","மேட்டூர் அணையில் நீர் திறப்பு அதிகரிப்பு"],["தலையங்கம்","காதலை வரவேற்போ"],["தமிழகம்","சென்னையில் போக்குவரத்து நெரிசலை குறைக்க பாலங்கள்"],["உலகம்","பூமி போலவே வெண்மேக கூட்ட சனியின் நிலாவில் ஐஸ்"],["இந்தியா","புருஷனை எப்பவு சந்தோஷமா வச்சிருந்தா நூறு வருஷ ஆனாலு காதல் கசக்காது"],["உலகம்","சுறா தோலை பார்த்தால் பாக்டீரியாவுக்கு பய"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["தமிழகம்","மீனவர்களுக்கு படகு போட்டி"],["குற்றம்","கள்ளக்காதல் விவகார வெல்டிங் தொழிலாளி ஓடஓட விரட்டிக் கொலை"],["குற்றம்","திருவொற்றியூரில் டீக்கடைக்காரர் வெட்டிக் கொலை"],["மருத்துவம்","அலர்ஜி தொல்லைக்கு அசத்தல் டிப்ஸ்"],["சினிமா(ரீல்மா)","ரவுண்டு கட்டு நடிகரு அர்ச்சனை செய்யு ரசிகர்கள்"],["தமிழகம்","சென்னை மாநகராட்சி பட்ஜெட் சிறப்பு அசங்கள்"],["தமிழகம்","பசுபாலுக்கு எருமை பாலுக்கு பால் கொள்முதல் விலை உயர்வு"],["இந்தியா","எல்லா ஊழல் புகாருக்கு ஜேபிசி விசாரணை பாஜக"],["குற்றம்","திமுக கவுன்சிலருக்கு சரமாரி அரிவாள் வெட்டு"],["ஸ்டேட் எக்ஸ்பிரஸ்","நக்சல் பகுதியில் ராணுவ பயிற்சி முகா"],["மாவட்ட மசாலா","விவசாயிகள் கவலை மஞ்சள் விலை சரிவு"],["தமிழகம்","மீனவர்கள் தாக்கப்படுவதை கண்டித்து தமிழக முழுவது திமுக ஆர்ப்பாட்ட"],["தமிழகம்","சென்னை மாநகர சாலைகளில் ஒளிரு வழிகாட்டி பலகைகள்"],["இந்தியா","அமெரிக்காவில் படிக்க வரு மாணவர்களுக்கு பாதுகாப்பு"],["இந்தியா","ஒரிசாவில் கலெக்டர் கடத்தல் மாவோயிஸ்ட் மணி நேர கெடு"],["இந்தியா","டெல்லியில் கடு பனி விமானங்கள் தாமத"],["தமிழகம்","போலீசார் அதிரடி வேட்டை சென்னையில் ஆயிர போலி மது பாட்டில் பறிமுதல்"],["தமிழகம்","பொன்னேரி பஸ் நிலையத்தில் திமுக கல்வெட்டு திறப்பு"],["தமிழகம்","திருவள்ளூர் ஜிஎச் பஸ் ஸ்டாண்ட் பயணிகள் நிழற்குடை சீரமைக்க கோரிக்கை"],["குற்றம்","தறிகெட்டு ஓடிய சரக்கு லாரி சிறு பாலத்தில் மோதியது டிரைவர் காய"],["ஸ்டேட் எக்ஸ்பிரஸ்","வங்கி பெண் அதிகாரிக்கு நடுரோட்டில் பளார்"],["இந்தியா","தனி தெலங்கானாவை வலியுறுத்தி லட்ச அரசு ஊழியர்கள் வேலை புறக்கணிப்பு"],["தமிழகம்","இலங்கை தூதரக முற்றுகை பாஜ கட்சியினர் கைது"],["இந்தியா","ஒரிசாவில் நக்சல்கள் கடத்திய கலெக்டர் நிலை என்ன"],["இந்தியா","கடத்தப்பட்ட கலெக்டரை மீட்க முயற்சி நக்சல்களுடன் பேச்சு நடத்த ஆந்திர பேராசிரியர்கள்"],["தமிழகம்","இலங்கை அரசை கண்டித்து கடல் பயண செல்ல தயார்"],["தலையங்கம்","வருமுன் காப்பதே புத்திசாலித்தன"],["ஸ்டேட் எக்ஸ்பிரஸ்","கலெக்டர் கடத்தலை கண்டித்து சென்சஸ் பணிகள் புறக்கணிப்பு"],["உலகம்","வில்லிய திருமண அழைப்பிதழுக்காக இளபெண் வது நாளாக உண்ணாவிரத"],["தமிழகம்","ஊத்துக்கோட்டை சாலையில் மாடுகள் உலா மக்கள் பாதிப்பு"],["மாவட்ட மசாலா","மேட்டூர் அணை நீர்மட்ட அடி"],["இந்தியா","கடத்தப்பட்ட கலெக்டரை மீட்க ஆந்திர பேராசிரியர்கள் ஒரிசா அரசுடன் பேச்சு"],["இந்தியா","எதிர்க்கட்சி தலைவர்களுடன் மீராகுமார் ஆலோசனை"],["இந்தியா","கூட்டணி கட்சிகளுடன் சமரச செய்கிறார் பிரதமர் பாஜக"],["தமிழகம்","கோயபேடு பஸ் நிலையத்தில் ஷேர் ஆட்டோக்களால் நெரிசல்"],["தமிழகம்","முஸ்லிகளுக்கான இட ஒதுக்கீட்டை சதவீதமாக உயர்த்த வேண்டு"],["வேலைவாய்ப்பு","அசிஸ்டென்ட் பப்ளிக் பிராசிகியூட்டர் பணிகளுக்கு டிஎன்பிஎஸ்சி தேர்வு"],["ஸ்டேட் எக்ஸ்பிரஸ்","கலெக்டரை மீட்க நடவடிக்கை மாவோயிஸ்ட்களை விடுவிக்க முடிவு"],["உலகம்","எமாபெரிய முட்டை"],["தமிழகம்","திருவள்ளூர் ராமஞ்சேரி இடையே கூடுதல் பஸ் இயக்க கோரிக்கை"],["சினிமா(ரீல்மா)","தமிழ் நடிகர் வினுசக்ரவர்த்தி மீது இந்தி பெண் தயாரிப்பாளர் தாக்கு"],["தமிழகம்","இலங்கையில் நுழைய திருமாவளவனுக்கு தடை சென்னையில் ஆர்ப்பாட்ட"],["தமிழகம்","உருது அகடமி ஆட்சி குழு நிர்வாகிகள் நியமன முதல்வர் உத்தரவு"],["இந்தியா","அமெரிக்காவில் உள்ள இந்திய மாணவர்களுக்கு உதவுங்கள் எபிக்கள்"],["தமிழகம்","நாகர்கோவில் கோவை மங்களூருக்கு சிறப்பு ரயில்"],["தமிழகம்","சென்னை தொகுதிகளுக்கான வாக்கு எண்ணு இடங்கள் அறிவிப்பு"],["தமிழகம்","செங்கல்பட்டு நெடுஞ்சாலையில் கோடியில் சாலை விரிவாக்க"],["தமிழகம்","செடி கொடிகள் படர்ந்த பஸ் ஸ்டாண்டை பராமரிக்க கோரிக்கை"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["மாவட்ட மசாலா","கோவையில் கோடி போலி சிகரெட் பறிமுதல்"],["தமிழகம்","இலங்கை அரசை கண்டித்து விடுதலை சிறுத்தைகள் ஆர்ப்பாட்ட"],["தமிழகம்","தமிழக மாணவர் காங்கிரஸ் தலைவராக பிரபுதாஸ் பொறுப்பேற்பு"],["இந்தியா","ஒரிசாவில் நக்சல்களால் கடத்தப்பட்ட கலெக்டர் விடுவிக்கப்படவில்லை"],["விளையாட்டு","சாதனைத்துளிகள்"],["இந்தியா","தமிழக மீனவர் மீது துப்பாக்கி சூடு பிரதமர் கண்டன"],["தமிழகம்","லிபியாவில் இறந்த தொழிலாளி குடுபத்துக்கு லட்ச முதல்வர் உத்தரவு"],["தமிழகம்","இலங்கை தூதரகத்தை அகற்ற ல் பேரணி நடைபெறு வைகோ"],["இந்தியா","சிபிஐ செயல்பாடு மீது சுரேஷ் கல்மாடி குற்றச்சாட்டு"],["இந்தியா","ஒரிசாவில் நக்சல்களால் கடத்தப்பட்ட கலெக்டர் கிருஷ்ணா நாட்களுக்கு பிறகு விடுதலை"],["இந்தியா","கறுப்பு பணத்தை மீட்க எதிர்க்கட்சிகளுடன் ஆலோசனை"],["உலகம்","கிளின்டன் மருமகனுக்கு மனநிலை பாதிப்பு"],["விளையாட்டு","சாதனைத்துளிகள்"],["மாவட்ட மசாலா","சதவீத இடஒதுக்கீடு முஸ்லி லீக் கோரிக்கை"],["இந்தியா","மதுரைக்கு எங்கு நிற்காத துரந்தோ ரயில் தமிழகத்துக்கு புதிய ரயில்"],["இந்தியா","முன்னாள் ராணுவத்தினருக்கு ரயில்வேயில் வேலை"],["இந்தியா","தமிழகத்துக்கு புதிய துரந்தோ ரயில்"],["இந்தியா","நாடு முழுவது ரயில்கள் சென்னை ஷீரடி எக்ஸ்பிரஸ்"],["இந்தியா","ஜன பூமி கவுரவ் பெயரில் சுற்றுலாவுக்கு புதிய ரயில்கள்"],["தமிழகம்","திருச்செந்தூருக்கு தினசரி ரயில் மதாவுக்கு ஜெயதுரை நன்றி"],["விளையாட்டு","கேப்டன்ஸ் கார்னர்"],["விளையாட்டு","கேப்டன்ஸ் கார்னர் டோனி"],["தமிழகம்","கோடி நகை கொள்ளை"],["தமிழகம்","உணவுக்கு உறுதி சட்ட விரைவில் அமலாகு மத்திய அமைச்சர் பசிதபர தகவல்"],["இந்தியா","தெலங்கானா போராட்ட எதிரொலி லட்ச ஊழியர்கள் சபள லேட்"],["இந்தியா","நேரடி வரி வருமான சதவீத அதிகரிப்பு"],["சினிமா(ரீல்மா)","வில்லன் மீது ரசிகர்கள் ஆத்திர"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["வேலைவாய்ப்பு","துணை ராணுவ படையில் காலியிடங்கள்"],["வேலைவாய்ப்பு","மாற்றுதிறனாளிகளுக்கு டிஎன்பிஎஸ்சி தேர்வு"],["வேலைவாய்ப்பு","சிண்டிகேட் வங்கியில் உதவி மேலாளர் வேலை"],["தமிழகம்","தேர்தல் வழக்கில் எபி ரித்தீஷ் பதில் அளிக்க ஐகோர்ட் உத்தரவு"],["தமிழகம்","இலங்கை தூதரகத்தை நோக்கி பேரணி வைகோ தாபாண்டியன் உள்பட பேர் கைது"],["தமிழகம்","பிளஸ் தேர்வுகள் நாளை ஆரப லட்ச பேர் எழுதுகின்றனர்"],["தமிழகம்","மயிலாப்பூர் கபாலீஸ்வரர் கோயில் பங்குனி விழா தேதி துவக்க"],["தமிழகம்","கோயபேடு பஸ் ஸ்டாண்டுக்கு வெடிகுண்டு மிரட்டல்"],["மாவட்ட மசாலா","ராமேஸ்வர மீனவர்கள் மீது மீண்டு தாக்குதல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","அடுக்குமாடி பார்க்கிங்கில் தீ பைக்குகள் எரிந்து நாச"],["விளையாட்டு","டைமிங் ஸ்பெஷல்"],["இந்தியா","தெலங்கானாவில் மறியல் ரயில் சர்வீஸ் முடங்கியது"],["இந்தியா","தெலங்கானா பிரச்னை வலுக்கிறது மறியல் போராட்டத்தால் ரயில்கள் ஓடவில்லை"],["தமிழகம்","ராமேஸ்வர மீனவர்கள் மீது குண்டு வீசி தாக்குதல்"],["மாவட்ட மசாலா","மேட்டூர் அணைக்கு நீர்வரத்து அதிகரிப்பு"],["தமிழகம்","பொது இடங்களில் வைத்துள்ள கட்சி பேனர்களை இன்று இரவுக்குள் அகற்ற உத்தரவு"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["சினிமா(ரீல்மா)","தமிழில் நடிக்க அதிக சபள கேட்ட இந்தி நடிகை"],["தமிழகம்","தெலங்கானா போராட்ட சென்னை ரயில்கள் ரத்து"],["தமிழகம்","துரந்தோ நான் ஸ்டாப் ரயில் ஏப்ரல் முதல் இயக்க திட்ட"],["தமிழகம்","இலவச கலர் டிவி நிறுத்த தேர்தல் அதிகாரி உத்தரவு"],["சினிமா(ரீல்மா)","கமல் பட வாய்ப்பை தட்டிப் பறித்தனர்"],["தமிழகம்","திருவான்மியூர் மருந்தீஸ்வரர் கோயில் பங்குனி திருவிழா மார்ச் ல் தொடங்குகிறது"],["தமிழகம்","டக்ளஸ் தேவானந்தா வழக்கு கீழ் கோர்ட்டை அணுக ஐகோர்ட் அனுமதி"],["விளையாட்டு","நெதர்லாந்தை நசுக்கியது தென்ஆப்ரிக்கா"],["தமிழகம்","திமுக அரசின் ஆண்டு திட்டங்களை தமிழக மக்கள் நன்கு அறிவார்கள்"],["இந்தியா","கறுப்பு பண வைத்துள்ளவர்கள் மீது நடவடிக்கை எடுக்க விடாமல் மத்திய அரசை தடுப்பது எது"],["விளையாட்டு","ஆலா டிவிலியர்ஸ் கலக்கல் சத நெதர்லாந்தை துரத்தியது தென் ஆப்ரிக்கா"],["விளையாட்டு","டைமிங் ஸ்பெஷல்"],["விளையாட்டு","சாதனைத்துளிகள்"],["ஸ்டேட் எக்ஸ்பிரஸ்","டெல்லி ஏர்போர்ட்டில் எபிகளுக்கு தனி கவுன்டர் திறக்க கோரிக்கை"],["சினிமா(ரீல்மா)","ராணுவத்தை பார்த்து படக்குழு பீதி"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["தமிழகம்","விவசாயிகளுக்கு ஏராளமான திட்டங்கள் திமுக ஆட்சியில்தான்"],["இந்தியா","அன்னிய நேரடி முதலீடுகள் அதிகரிக்க தீவிர ஆலோசனை பிரணாப்"],["சினிமா(ரீல்மா)","த்ரிஷா படத்தில் ஸ்ரேயா டான்ஸ்"],["ஸ்டேட் எக்ஸ்பிரஸ்","முபை குடிசை பகுதியில் பயங்கர தீ பேர் காய"],["ஸ்டேட் எக்ஸ்பிரஸ்","சபள உயர்வு கேட்டு எஎல்ஏக்கள் போராட்ட"],["விளையாட்டு","சாதனைத்துளிகள்"],["தமிழகம்","புது ரேஷன் கார்டுகள் வழங்கு பணி நிறுத்த"],["இந்தியா","ஆயிர கோடி வரி ஏய்ப்பு ஹசன் அலி கான் கைது கோர்ட்டில் இன்று ஆஜர்"],["தமிழகம்","பெண்கள் முன்னேற்றத்துக்காக திமுக ஆட்சியில் தான் ஏராளமான திட்டங்கள் முதல்வர்"],["இந்தியா","தங்கத்தை முந்தியது வெள்ளி கிலோ ஒன்றுக்கு விலை"],["வேலைவாய்ப்பு","ரிசர்வ் வங்கியில் உதவி மேலாளர் பணி"],["வேலைவாய்ப்பு","அலகாபாத் வங்கியில் கிளார்க் பணியிடங்கள்பிளஸ் டிகிரி படித்தவர்களுக்கு வாய்ப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","நீதிபதிகள் டிஸ்மிஸ் ராஞ்சி ஐகோர்ட் உத்தரவு"],["தமிழகம்","மதுரை மீனாட்சி அமன் கோயிலில் ஸ்படிக லிங்கத்துக்கு மார்ச் முதல் பூஜை"],["இந்தியா","தெலங்கானா போராட்ட பின்வாங்குகிறது ராஷ்ட்ரிய சமிதி"],["தமிழகம்","தேர்தல் தேதியை மாற்ற முடியாது ஐகோர்ட்டில் தேர்தல் ஆணைய தகவல்"],["தமிழகம்","தகுதி தேர்வு ரத்து கோரி சட்டக் கல்லூரி மாணவர்கள் மறியல்"],["இந்தியா","பயங்கரவாத தடுப்பு சட்டத்தில் ஹசன் அலி மீது நடவடிக்கை உச்ச நீதிமன்ற அறிவுறுத்தல்"],["விளையாட்டு","சாதனைத்துளிகள்"],["விளையாட்டு","டைமிங் ஸ்பெஷல்"],["சினிமா(ரீல்மா)","வதந்தியால் பயமில்லை த்ரிஷா பேட்டி"],["உலகம்","பூமிக்கு அருகில் வருகிறது சந்திரன் பூகப ஏற்பட வாய்ப்பு"],["உலகம்","உலகின் சிறந்த பேரில் இந்திய பெண்கள்"],["தமிழகம்","தேமுதிகவுக்கு முரசு சின்ன உச்ச நீதிமன்றத்தில் வழக்கு"],["தமிழகம்","மயிலாப்பூர் கபாலீஸ்வரர் கோயில் பங்குனி விழா தொடங்கியது"],["தமிழகம்","திமுக ஆட்சியில் பெண்களுக்கு ஒதுக்கீடு உள்ளாட்சிக்கு பல்வேறு திட்டங்கள்"],["இந்தியா","ஹசன் அலிக்கு காவல் மேலு ஒரு நாள் நீட்டிப்பு"],["இந்தியா","காஷ்மீரில் அதிரடி ஜெய்ஷ் தீவிரவாத தலைவன் சுட்டுக் கொலை"],["விளையாட்டு","டைமிங் ஸ்பெஷல்"],["தமிழகம்","வேட்பாளர்கள் தேர்வு தீவிர அரசியல்வாதிகளால் திணறுது சென்னை"],["இந்தியா","பிரணாப் முகர்ஜி அறிவிப்பு எபி தொகுதி மேபாடு நிதி கோடியாக அதிகரிப்பு"],["இந்தியா","கறுப்பு பண வழக்கு ஹசன் அலி ஜாமீனில் விடுதலை"],["விளையாட்டு","தென் ஆப்ரிக்கா பவுலிங்கா இந்தியாவின் பேட்டிங்கா"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["தலையங்கம்","சாலை விதிகளை மதிக்க வேண்டு"],["தமிழகம்","லட்சக்கணக்கில் பண கிலோ வெள்ளி சிக்கியது"],["மாவட்ட மசாலா","மேட்டூர் அணைக்கு நீர்வரத்து குறைந்தது"],["வேலைவாய்ப்பு","இந்தியன் ஓவர்சீஸ் வங்கியில் பிளஸ் படித்தவர்களுக்கு வாய்ப்பு"],["மர்மம்","மர்மமாய் இருக்குதே நள்ளிரவில் அழுது புலபு முயல்கரடு மோகினி கிடுகிடுக்கு கிராம"],["இந்தியா","நான் பதவி விலக தேவையில்லை சாவன்"],["தமிழகம்","சீட் தராவிட்டால் தனித்து போட்டி நடிகர் கார்த்திக்"],["தமிழகம்","பாமகவில் புதுமுகங்களுக்கு முக்கியத்துவ தரப்படு ராமதாஸ்"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["வேலைவாய்ப்பு","இந்தியன் ஓவர்சீஸ் வங்கியில் பிளஸ் படித்தவர்களுக்கு வாய்ப்பு"],["மர்மம்","நள்ளிரவில் அழுது புலபு முயல்கரடு மோகினி"],["உலகம்","புகுஷிமா அணுமின் நிலையத்தில் வது அணு உலையிலு வெடிப்பு"],["இந்தியா","அணு உலைகள் பாதுகாப்பு ஆய்வு நடத்த உத்தரவு பிரதமர்"],["விளையாட்டு","அயர்லாந்து வைத்தியத்தில் தப்பிக்குமா தென் ஆப்ரிக்கா"],["மாவட்ட மசாலா","தலையில் கல்லை போட்டு லாரி டிரைவர் கொலை"],["மாவட்ட மசாலா","வனவரை தாக்கிய விவசாயி பிடிபட்டார்"],["தமிழகம்","அதிமுக கூட்டணியில் இருந்து வெளியேறுகிறோ நடிகர் கார்த்திக்"],["விளையாட்டு","அயர்லாந்தை வீழ்த்தி கால் இறுதிக்கு தென் ஆப்ரிக்கா தகுதி"],["இந்தியா","கேரளா தேர்தலில் காங்கிரஸ் வென்றால் யார் முதல்வர்"],["விளையாட்டு","டைமிங் ஸ்பெஷல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","எஎல்ஏக்களுக்கு சபள உயர்வு அரியானாவில் மசோதா நிறைவேற்ற"],["குற்றம்","நகைக்கடையில் துளைபோட்டு கிலோ வெள்ளி கொள்ளை"],["விளையாட்டு","பயிற்சியில் பங்கேற்க சச்சின் ஜாகீர்கான் சென்னை வந்தனர்"],["தமிழகம்","மயிலாப்பூரில் கபாலீஸ்வரர் கோயில் தேரோட்ட"],["தமிழகம்","காங்கிரஸ் சார்பில் போட்டியிட விருப்ப மனு தாக்கல் தொடக்க"],["தமிழகம்","காங்கிரஸ் வேட்பாளர் பட்டியல் ஜிகேவாசன்"],["கல்வி","மத்திய தொழிற்பயிற்சி மையத்தில் உடனடி வேலைவாய்ப்பு படிப்புகள்"],["தமிழகம்","தொகுதிகளில் தனித்து போட்டி நடிகர் கார்த்திக்"],["இந்தியா","தமிழக மீனவர்கள் மீது தாக்குதல் மத்திய அரசு இன்று பதில்"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["விளையாட்டு","டைமிங் ஸ்பெஷல்"],["விளையாட்டு","யாருக்கு வாய்ப்பு"],["மாவட்ட மசாலா","விழுப்புர அருகே தீ விபத்து குடிசை சாபல்"],["மாவட்ட மசாலா","கோவை சட்டக் கல்லூரி மாணவர் போராட்ட வாபஸ்"],["குற்றம்","ஆந்திராவுக்கு கலர் டிவி கடத்தல் பெண்கள் உள்பட பேர் கைது"],["இந்தியா","கறுப்பு பண வழக்கு சரணடைந்தார் ஹசன் அலி"],["தமிழகம்","பூமிக்கு அருகில் சந்திரன் வருவதால் பூகப ஏற்படுமா பீதி அடைய வேண்டா"],["தமிழகம்","இயூனியன் முஸ்லி லீக் வேட்பாளர்கள் அறிவிப்பு"],["தமிழகம்","கோடி போலி செல்போன்கள் அழகு சாதன பொருட்கள் பறிமுதல்"],["தமிழகம்","தலைவர்கள் சிலைக்கு திமுக வேட்பாளர் மாலை"],["தமிழகம்","வீடியோ கான்பரன்ஸ் மூல தேர்தல் அதிகாரிகளுடன் பிரவீன்குமார் ஆலோசனை"],["தமிழகம்","சென்னை புறநகர் ரயில்கள் நடுவழியில் நிறுத்த"],["ஸ்டேட் எக்ஸ்பிரஸ்","உச்ச நீதிமன்ற உத்தரவு கறுப்பு பண பற்றி விசாரிக்க சிறப்பு விசாரணை குழு"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["உலகம்","பூமிக்கு அருகே வரு சூப்பர் நிலவை இன்று பார்க்கலா"],["தமிழகம்","டாஸ்மாக் கடையை அகற்ற கோரி ஈசிஆரில் பெண்கள் முற்றுகை"],["குற்றம்","இளபெண்களை ஆபாச படமெடுத்து மிரட்டிய எபிஏ மாணவன் கைது"],["சினிமா(ரீல்மா)","கமென்ட் அடிச்ச"],["வேலைவாய்ப்பு","கார்ப்பரேஷன் வங்கியில் காலியிடங்கள்"],["வேலைவாய்ப்பு","சென்ட்ரல் வங்கியில் அதிகாரி வேலை"],["தமிழகம்","மதிமுகவை பாடாய் படுத்திய அந்த மணி நேர"],["தமிழகம்","உங்கள் மீது நன்மதிப்பு அன்பு எப்போது இருக்கு ஜெ"],["சினிமா(ரீல்மா)","ஹாலிவுட் இயக்குனரிட வாய்ப்பு கேட்ட தமிழ் நடிகை"],["தமிழகம்","திமுக கூட்டணியை ஆதரித்து நடிகர் வடிவேலு பிரசார"],["தமிழகம்","கல்பாக்க அருகே டாஸ்மாக் கடையை பெண்கள் முற்றுகை"],["தமிழகம்","நடிகர் சரத்குமார் உள்பட பேர் மீது வழக்கு"],["மாவட்ட மசாலா","வீட்டின் பூட்டை உடைத்து லட்ச நகை கொள்ளை"],["மாவட்ட மசாலா","மீன் வலையில் சிக்கிய அடி மலைப்பாபு"],["தமிழகம்","வீடு வீடாக சென்று விளக்க வேண்டு பாமகவினருக்கு ராமதாஸ் வேண்டுகோள்"],["இந்தியா","மத்திய அரசு ஊழியருக்கு டிஏ சதவீத உயர்வு"],["தமிழகம்","லட்ச வாக்காளர்களுக்கு ஏப் முதல் வீடு வீடாக பூத் சிலிப்"],["தமிழகம்","காங்கிரஸ் வேட்பாளர் பட்டியல் தயார் இன்று வெளியாகலா"],["இந்தியா","மருத்துவமனைக்கான சேவை வரி வாபஸ் பிரணாப் முகர்ஜி"],["ஸ்டேட் எக்ஸ்பிரஸ்","கலெக்டர் கடத்தல் சபவ ஒரிசா முதல்வர் மீது குற்றச்சாட்டு"],["மாவட்ட மசாலா","மேட்டூர் அணைக்கு நீர்வரத்து குறைந்தது"],["இந்தியா","கேரளாவில் தொகுதிகளுக்கு காங்கிரஸ் வேட்பாளர் அறிவிப்பு"],["தமிழகம்","சந்தேகத்தின் பேரில் சோதனை கூடாது தேர்தல் கமிஷனுக்கு ஐகோர்ட் உத்தரவு"],["தமிழகம்","திமுகவுக்கு ஆதரவாக பிரசார சலவை தொழிலாளர் சங்க தீர்மான"],["தமிழகம்","விஜயகாந்தை எதிர்த்து பிரசார நடிகர் வடிவேலு"],["தமிழகம்","அதிமுகவுக்கு ஓட்டு போடாதீங்க ப்ளீஸ் நடிகர் கார்த்திக்"],["தமிழகம்","காங்கிரஸ் வேட்பாளர்கள் பட்டியல் அறிவிப்பு"],["தமிழகம்","தன்னிச்சையாக அதிரடி நடவடிக்கை எடுப்பதா தேர்தல் கமிஷனுக்கு ஐகோர்ட் கேள்வி"],["தமிழகம்","திமுகவுக்கு ஆதரவாக நடிகர் குமரிமுத்து தேர்தல் பிரசார"],["இந்தியா","கேரளா பேரவை தேர்தல் காங்கிரஸ் வேட்பாளர்கள் அறிவிப்பு"],["இந்தியா","ஊழல் அரசியல்வாதிகள் போட்டியிட தடை குரேஷி"],["இந்தியா","வேட்பாளர் பட்டியலுக்கு எதிர்ப்பு கேரள காங்கிரசார் ஆர்ப்பாட்ட"],["இந்தியா","அமலாக்க பிரிவு நடவடிக்கை ஹசன் அலி கூட்டாளி கைது"],["உலகம்","ஹாலிவுட் நடிகை எலிசபெத் டெய்லர் மரண"],["தமிழகம்","பிளஸ் தேர்வுகள் இன்றுடன் முடிகிறது மே மாத முடிவு வெளியீடு"],["தமிழகம்","பறிமுதல் செய்த பணத்தை திருப பெறுவது எப்படி ஐகோர்ட்"],["விளையாட்டு","நியூசி தெஆப்ரிக்கா மோதல் அரை இறுதி வாய்ப்பு யாருக்கு"],["இந்தியா","அடுத்த மாத கேரளாவில் ராகுல் பிரசார"],["விளையாட்டு","கமென்ட்ஸ் கார்னர்"],["மாவட்ட மசாலா","புவி வெப்பமயமாதலை தடுக்க விளக்கு அணைக்க வேண்டுகோள்"],["தமிழகம்","தேர்தல் கமிஷன் அவசர அழைப்பு டிஜிபி ஏடிஜிபி டெல்லி விரைந்தனர்"],["இந்தியா","ஆந்திராவில் நில நடுக்க வீதிகளில் மக்கள் தஞ்ச"],["இந்தியா","ரயில் நிலையங்களில் மதா படங்களை அகற்ற அதிகாரிகளுக்கு உத்தரவு"],["இந்தியா","கறுப்பு பண வழக்கு ஹசன் அலியை ஏப்ரல் வரை சிறையில் அடைக்க உத்தரவு"],["விளையாட்டு","வழக்கபோல் வெளியேறியது தென் ஆப்ரிக்கா அரை இறுதியில் நியூசிலாந்து"],["தமிழகம்","காங்கிரஸ் வேட்பாளர் பேர் திடீர் மாற்ற"],["உலகம்","அதிபருக்கு எதிராக சிரியாவில் கலவர ராணுவ துப்பாக்கி சூடு"],["விளையாட்டு","டைமிங் ஸ்பெஷல்"],["விளையாட்டு","துரத்துகிறது துரதிருஷ்ட தென்ஆப்ரிக்காவை ஓரகட்டிய ஓர"],["விளையாட்டு","யுவி மனசுல யாரு"],["தமிழகம்","ஆயிர பூத்களுக்கு உச்சகட்ட பாதுகாப்பு"],["தமிழகம்","முஸ்லிகளுக்கான ஒதுக்கீட்டை அதிகரிக்க நடவடிக்கை ஜெ"],["தமிழகம்","வேட்பாளர்கள் அறிமுக கூட்ட பஸ்வான் ல் சென்னை வருகை"],["தமிழகம்","வகுப்பு தேர்வு நாளை தொடக்க லட்ச மாணவர்கள் எழுதுகின்றனர்"],["வேலைவாய்ப்பு","தொழில் பாதுகாப்பு படையில் டிரைவர் பணியிடங்கள்"],["ஸ்டேட் எக்ஸ்பிரஸ்","டிஆர்எஸ் கட்சி பிரமுகர் அரிவாளால் வெட்டி கொலை"],["தமிழகம்","தயவு செய்து அரசியல் பேசாதீங்க டீ கடைகளில் அறிவிப்பு"],["தமிழகம்","காங்கிரஸ் வேட்பாளர் பேட்டி மனுதாக்கல் செய்யாதது ஏன்"],["இந்தியா","பாஜ அரசு மாதத்தில் கவிழு குமாரசாமி"],["இந்தியா","கேரள காங்கிரஸ் தலைவர் ஹெலிகாப்டரில் தேர்தல் பிரசார அச்சுதானந்தன்"],["விளையாட்டு","மொகாலி ஸ்பெஷல்"],["உலகம்","துபாயில் பாகிஸ்தானியரை கொன்ற இந்தியரின் மரண தண்டனை ரத்து"],["இந்தியா","வெளிநாட்டு வங்கிகளில் உள்ள கறுப்பு பண யாருடையது இன்னு விசாரிக்காதது ஏன் உச்ச நீதிமன்ற"],["இந்தியா","கேரளாவில் போட்டி காங்கிரஸ் வென்றால் யார் முதல்வர்"],["தமிழகம்","பண பறிமுதல் விவகார ஐகோர்ட்டில் பரபரப்பு விவாத"],["மருத்துவம்","வதைக்கு வாய்ப்புண் விரட்ட வழிகள்"],["விளையாட்டு","எக்ஸ்ட்ராஸ்"],["விளையாட்டு","மொகாலி ஸ்பெஷல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","பூரி ஜெகநாதர் கோயிலுக்கு மத்திய தொழில்படை பாதுகாப்பு"],["உலகம்","புகுஷிமா அணுமின் நிலையத்தில் கசிகிறது கதிர்வீச்சு நீர்"],["தமிழகம்","கிராமங்களில் நிலநடுக்க திருப்பூர் அருகே மக்கள் பீதி"],["தமிழகம்","தேர்தல் ஆணையத்துக்கு அனைத்து அதிகாரங்களு இருப்பதாக கூறுவது தவறானது அட்வகேட் ஜெனரல்"],["உலகம்","குழந்தை பெற்றுக் கொள்ள அமெரிக்கா செல்லு சீன பெண்கள்"],["உலகம்","வில்லிய திருமணத்துக்கு தீவிரவாத அச்சுறுத்தல்"],["இந்தியா","கறுப்பு பண விவகார சிறப்பு புலனாய்வு குழு அமைக்க அரசு எதிர்ப்பு"],["குற்றம்","கத்தியால் குத்தி வியாபாரி கொலை"],["தமிழகம்","திண்டுக்கல் கோர்ட்டுக்கு வெடிகுண்டு மிரட்டல்"],["விளையாட்டு","மொகாலி ஸ்பெஷல்"],["இந்தியா","புதிய தலைமுறை தீவிரவாத பாதுகாப்பு படைகளுக்கு மன்மோகன் எச்சரிக்கை"],["தமிழகம்","சென்னையில் போட்டியிடு வேட்பாளர்கள் இறுதிப்பட்டியல்"],["தமிழகம்","ஒகேனக்கல் அருகே ரெய்டு லட்ச சிக்கியது"],["தமிழகம்","மக்கள் வரவேற்பை பொறுக்க முடியாமல் மாஜி கதாநாயகன் கதாநாயகி உளறல் ஸ்டாலின்"],["விளையாட்டு","மொகாலி ஸ்பெஷல்"],["தமிழகம்","தலைவனுக்கான தகுதி விஜயகாந்துக்கு கிடையாது திருமாவளவன்"],["தமிழகம்","தேர்தல் விதிமுறை என்ற பெயரில் அறிவிக்கப்படாத எமர்ஜென்சியா முதல்வர்"],["தமிழகம்","பண பறிமுதல் செய்வது ஏன் ஐகோர்ட்"],["தமிழகம்","தொகுதிகளில் திமுகவுக்கு ஆதரவு நடிகர் கார்த்திக்"],["ஸ்டேட் எக்ஸ்பிரஸ்","கட்டண உயர்வு எதிர்த்து வழக்கு பள்ளிகளுக்கு ஐகோர்ட் நோட்டீஸ்"],["விளையாட்டு","கேப்டன்ஸ் கார்னர்"],["தமிழகம்","ஆதார காட்டினால் பண பறிமுதல் கூடாது தேர்தல் கமிஷனுக்கு ஐகோர்ட் உத்தரவு"],["குற்றம்","சிறுவன் பரிதாப சாவு பேருக்கு தீவிர சிகிச்சை"],["குற்றம்","வலையில் சிக்கிய மலைப்பாபு மீனவரை நெரித்து கொன்றது"],["மாவட்ட மசாலா","கோழிப்பண்ணையில் தீ குஞ்சுகள்கருகின"],["தமிழகம்","தலைவனுக்கு இருக்க வேண்டிய எந்த தகுதியு விஜயகாந்துக்கு இல்லை வடிவேலு"],["தமிழகம்","அதிமுகவினர் காரில் கடத்தியதாக நடிகர் கார்த்திக் கட்சி வேட்பாளர்கள் புகார்"],["விளையாட்டு","சரித்திர மாறுமா"],["குற்றம்","குறுபு செய்ததால் ஆத்திர குழந்தைகளுக்கு சூடுபோட்ட அமா கைது"],["தமிழகம்","மத்திய அமைச்சர் அழகிரி மீது பொய் வழக்கு போடச்சொல்லி டார்ச்சர் மதுரை கலெக்டர் மீது தேர்தல் அதிகாரி புகார்"],["தமிழகம்","தலை பெரிதாக இருந்தால் தலைவராகி விட முடியாது வடிவேலு"],["ஸ்டேட் எக்ஸ்பிரஸ்","விதிகளை மீறினால் அபராத குஜராத் பள்ளிகளுக்கு எச்சரிக்கை"],["உலகம்","அணு உலை விரிசலால் புகுஷிமாவில் கதிர்வீச்சு கசிவு"],["தமிழகம்","போட்டி வேட்பாளர்கள் கட்சியில் இருந்து நீக்க காங்கிரஸ் அதிரடி"],["தமிழகம்","அரசு பள்ளிகளுக்கு முதல் கோடை விடுமுறை"],["விளையாட்டு","கமென்ட்ஸ் கார்னர்"],["மாவட்ட மசாலா","விசைப்படகு பேனில் துண்டு சிக்கி மீனவர் சாவு"],["தமிழகம்","மத்திய அமைச்சர் அழகிரிக்கு எனக்கு மோதலோ பிரச்னையோ எதுவுமில்லை மேலூர் தாசில்தார்"],["தமிழகம்","சென்னையில் தொகுதிகளுக்கு மின்னணு இயந்திரங்கள் ரேண்ட முறையில் தேர்வு"],["தமிழகம்","சினிமாவில்தான் ஹீரோ நிஜத்தில் ஜீரோ வடிவேலு"],["தமிழகம்","மாணவர் காங்கிரஸ் அறிக்கை ராகுல் கூட்டத்தில் பங்கேற்க அழைப்பு"],["தமிழகம்","முகஅழகிரி மீது பொய் புகார் அளித்தேன் மேலூர் தாசில்தார்"],["தமிழகம்","மத்திய அரசு திட்டங்கள் கிடைக்க திமுக கூட்டணிக்கு வாக்களியுங்கள் நடிகர் பாக்யராஜ்"],["உலகம்","புகுஷிமாவில் கதிர்வீச்சு நீர் கசிவை தடுக்கு முயற்சி தோல்வி"],["விளையாட்டு","கமெண்ட்ஸ் கார்னர்"],["குற்றம்","மளிகை கடை அதிபர் கடத்தி படுகொலை டிஐஜி விசாரணை"],["தமிழகம்","திமுகவுக்கு எதிராக செயல்படு மதுரை கலெக்டர் எஸ்பி மீது வழக்கு முகஅழகிரி"],["மாவட்ட மசாலா","முட்டை விலை காசு அதிகரிப்பு"],["மாவட்ட மசாலா","ராகுல் காந்தி நாளை ஈரோட்டில் பிரசார"],["இந்தியா","வரலாறு காணாத உயர்வு கிலோ வெள்ளி ஐ நெருங்கியது"],["இந்தியா","வளர்ச்சி பணிகள் தொடர காங்கிரசுக்கு வாக்களியுங்கள் ராகுல் காந்தி"],["தமிழகம்","மதுரை கலெக்டர் எஸ்பி மீது வழக்கு தொடருவேன் முகஅழகிரி"],["தமிழகம்","திமுகவுக்கு ஆதரவு அலை வீசுகிறது நடிகர் வடிவேலு"],["குற்றம்","குடித்துவிட்டு வந்து ரகளை கத்தியால் குத்தி கணவர் கொலை"],["மாவட்ட மசாலா","ராமேஸ்வரத்தில் மீனவர்கள் மாய"],["தமிழகம்","மக்களை வேதனைப்படுத்திய ஜெவுக்கு மீண்டு ஓட்டு கேட்க தகுதி இல்லை ஜிகேவாசன்"],["தமிழகம்","இலை கருகட்டு சூரியன் உதிக்கட்டு நாஞ்சில் சபத்"],["தமிழகம்","காரைக்குடியில் ராகுல் காந்தி ஆதரவு திரட்டுகிறார்"],["தமிழகம்","திமுக மீண்டு ஆட்சிக்கு வருவது உறுதி நடிகர் வடிவேலு"],["குற்றம்","வயல் குத்தகை தகராறில் விவசாயி அடித்து கொலை"],["குற்றம்","கருபு தோட்டத்தில் விவசாயி கருகிச் சாவு"],["தலையங்கம்","உயிரை வாங்கிய தொழில் போட்டி"],["தமிழகம்","நீதிமன்றத்தை போல நடுநிலையுடன் தேர்தல் கமிஷன் செயல்பட வேண்டு முதல்வர்"],["விளையாட்டு","வாய்ஸ் கார்னர்"],["விளையாட்டு","எக்ஸ்ட்ராஸ்"],["தமிழகம்","திமுக காங்கிரஸ் கூட்டணியால் பொருளாதார வளர்ச்சி தமிழகத்தில் அதிகரிக்கு ராகுல் காந்தி"],["தமிழகம்","மதுரை மீனாட்சி கோயிலில் சித்திரை திருவிழா துவங்கியது"],["தமிழகம்","திமுக கூட்டணிக்கு வாக்களியுங்கள் நடிகர் பாக்யராஜ்"],["தமிழகம்","வாழ்வு கொடுத்தவரை நடுத்தெருவில் விட்டவர் நடிகர் வடிவேலு"],["தமிழகம்","முல்லைப் பெரியாறில் புதிய அணை நில வடிவமைப்பு குறித்து ஆய்வு"],["தமிழகம்","கோத்தகிரி அருகே நிலச்சரிவு மக்கள் பீதி"],["தமிழகம்","விஜயகாந்த் சொந்த பட எடுத்து முதல்வராக நடித்துக் கொள்ளட்டு நடிகர் வடிவேலு"],["தமிழகம்","சொந்த கல்லூரிக்குகூட முதல்வராக விஜயகாந்துக்கு தகுதி கிடையாது நெப்போலியன்"],["இந்தியா","ஹசன்அலி வழக்கில் புதுச்சேரி கவர்னரிட விசாரணை நடத்த முடிவு"],["விளையாட்டு","எக்ஸ்ட்ராஸ்"],["இந்தியா","ஒருங்கிணைந்த வளர்ச்சியை லஞ்ச ஊழல் தடுக்கிறது பிரணாப் முகர்ஜி"],["தமிழகம்","ஏழையின் சிரிப்பில் இறைவனை காண்பவர் முதல்வர் வடிவேலு"],["தமிழகம்","நாமக வேட்பாளரை அதிமுகவினர் மிரட்டுகின்றனர் நடிகர் கார்த்திக்"],["மாவட்ட மசாலா","தோட்ட தொழிலாளியை கரடிகள் கடித்து குதறின"],["தமிழகம்","முருங்கை விலை உயர்வு விவசாயிகள் மகிழ்ச்சி"],["தமிழகம்","திமுக நகராட்சி தலைவர் வெற்றி பெற்றது செல்லு சுப்ரீ கோர்ட் தீர்ப்பு"],["இந்தியா","மத்திய அரசுக்கு ஆதரவாக மாநில அரசு செயல்பட வேண்டு ராகுல் காந்தி"],["தமிழகம்","மிரட்ட மிரட்ட பிரசார சூடு பிடிக்கு நடிகர் வடிவேலு"],["ஸ்டேட் எக்ஸ்பிரஸ்","அரசியலு ஊழலு நாணயத்தின் இரு பக்கங்கள் குமாரசாமி"],["தலையங்கம்","குண பார்த்த காதல் நிற பார்ப்பதில்லை"],["தமிழகம்","மதுரை கலெக்டர் மீது துணை சபாநாயகர் வழக்கு ஐகோர்ட்டில் நாளை தீர்ப்பு"],["தமிழகம்","வெள்ளி விலையு எகிறியது ஒரு சவரன் ஐ நெருங்கியது"],["இந்தியா","பணவீக்கத்தை குறைக்க நடவடிக்கை தொடரு பிரணாப் முகர்ஜி"],["விளையாட்டு","எக்ஸ்ட்ராஸ்"],["மாவட்ட மசாலா","மேட்டூர் அணைக்கு நீர் வரத்து அதிகரிப்பு"],["தமிழகம்","ஜெ குற்றச்சாட்டில் உடன்பாடில்லை ஜிகேவாசன் பேட்டி"],["தமிழகம்","மக்கள் சந்தோஷமா ஓட்டு போடுறாங்க நடிகர் வடிவேலு குஷி"],["ஸ்டேட் எக்ஸ்பிரஸ்","மேட்டூர் அணையின் நீர் மட்ட அடி"],["சினிமா(ரீல்மா)","அனுஷ்கா தெலுங்கு படங்களுக்கு தமிழில் மவுசு"],["தமிழகம்","வாக்குப்பதிவு இயந்திரங்களுக்கு துணை ராணுவப்படை பாதுகாப்பு பிரவீன் குமார்"],["தமிழகம்","மதுரை மீனாட்சி சுந்தரேஸ்வரர் திருக்கல்யாண நாளை நடக்கிறது"],["மாவட்ட மசாலா","கள்ளக்காதலி வீட்டுக்கு தீ லாரி டிரைவர் பிடிபட்டார்"],["குற்றம்","மகனுக்காக கதவை திறந்து வைத்து தூங்கியவர் வீட்டில் பவுன் திருட்டு"],["மாவட்ட மசாலா","திருவள்ளூரில் ஏடிஎ மையங்களை சீரமைக்க வாடிக்கையாளர் கோரிக்கை"],["விளையாட்டு","பிசிசிஐ கேட்டுக்கொண்டதால் இலங்கை வாரிய ஆலோசனை"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["இந்தியா","வரலாறு காணாத வகையில் வெள்ளி விலை உயர்வு"],["தமிழகம்","தினகரன் நாளிதழ் நடத்து கல்வி கண்காட்சி ஏராளமான மாணவர்கள் பங்கேற்பு"],["உலகம்","அமெரிக்காவில் சூறாவளி பேர் பரிதாப சாவு"],["உலகம்","இந்தோனேஷியா மசூதியில் மனித குண்டு தாக்குதல்"],["மாவட்ட மசாலா","நீலகிரி மலை ரயிலுக்கு வது புதிய இன்ஜின்"],["மாவட்ட மசாலா","மேட்டூர் அணைக்கு நீர்வரத்து குறைவு"],["சினிமா(ரீல்மா)","காஷ்மீரில் பெண் வேட்பாளரை சுட்டுக் கொன்ற தீவிரவாதிகள்"],["சினிமா(ரீல்மா)","ஹசன்அலி கூட்டாளியை விசாரிக்க செஷன்ஸ் கோர்ட் அனுமதி"],["தமிழகம்","தினகரன் நாளிதழ் நடத்து மாபெரு கல்வி கண்காட்சி தொடங்கியது மாணவர்கள் பெற்றோர் திரண்டனர்"],["தமிழகம்","கத்திவாக்கத்தில் குடிநீர் வராததால் நகராட்சி அலுவலகத்தை பெண்கள் திடீர் முற்றுகை"],["மாவட்ட மசாலா","செங்குன்ற அருகே பவுன் பண திருட்டு"],["மாவட்ட மசாலா","ஊத்துக்கோட்டை வழிப் பாதையில் நெரிசலில் திண்டாடு மக்கள்"],["குற்றம்","தொழிலாளிக்கு கத்தி குத்து"],["வேலைவாய்ப்பு","மத்திய தொழில் பாதுகாப்பு படையில் காலியிடங்கள்"],["வேலைவாய்ப்பு","கார்ப்பரேஷன் வங்கியில் கிளார்க் வேலை"],["தமிழகம்","மீனாட்சி கோயில் தேரோட்ட மதுரையில் மக்கள் வெள்ள"],["தமிழகம்","திருவள்ளூர் காஞ்சி மாவட்டத்தில் மகாவீர் ஜெயந்தி விழா கோலாகல"],["மாவட்ட மசாலா","லாரி சக்கர ஏறி டிரைவர் பரிதாப சாவு"],["உலகம்","அமெரிக்காவில் கடு புயல் பலி ஆனது"],["தமிழகம்","பவுன் ஆயிரத்தை தாண்டியது தங்க விலை தொடர்ந்து உயரு"],["தமிழகம்","தினகரன் கல்வி கண்காட்சி கட்டுக்கடங்காமல் குவிந்த மாணவ மாணவியர் கூட்ட"],["மாவட்ட மசாலா","மேட்டூர் அணை ஜூன் ல் திறப்பு"],["தமிழகம்","இலங்கை அரசை கண்டித்து காங்கிரஸ் ஆர்ப்பாட்ட தங்கபாலு உள்பட பேர் கைது"],["குற்றம்","மதுரை கிழக்கு தொகுதி வேட்பாளர் மகன் சரமாரி குத்திக்கொலை"],["தமிழகம்","ஆசிரியர் பயிற்சி பள்ளிகளுக்கு இணைப்பு அங்கீகார விவகார உயர் நீதிமன்ற"],["தமிழகம்","ஹசன் அலி விவகார ஆளுநரிட விசாரிக்க விதிமுறை வகுக்கப்படு பசிதபர"],["சினிமா(ரீல்மா)","அனுஷ்காவுடன் மோதலா அமலா பால்"],["சினிமா(ரீல்மா)","கமல் செல்வராகவன் படத்துக்கு திடீர் சிக்கல்"],["தமிழகம்","நள்ளிரவில் பூகப பீதி ஆயிர பேர் ஓட்ட"],["தமிழகம்","சென்னை சுற்றுலா இடங்களுக்கு சிறப்பு பஸ்கள் தயார்"],["தமிழகம்","சாலை பணியை முடிக்க கோரி பொன்னேரி அருகே மக்கள் மறியல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","சுரேஷ் கல்மாடியிட சிபிஐ மீண்டு விசாரணை"],["தமிழகம்","விசேஷ துரியன் பழ ஒன்றுகூட விளையவில்லை"],["தமிழகம்","தமிழக அரசு கல்வி கட்டண சிபிஎஸ்இ பள்ளிகளுக்கு பொருந்து"],["மாவட்ட மசாலா","விஐடி பல்கலைக்கழகத்தில் இலவச விளையாட்டு பயிற்சி"],["மாவட்ட மசாலா","கூலி தொழிலாளி மாய"],["கல்வி","டெல்லி பல்கலைக்கழகத்தில் சட்டப்படிப்புகளில் சேர ஜூனில் நுழைவுத்தேர்வு"],["உலகம்","பெட்ரோல் வேண்டா சூரியன் போது சோலார் விமான சாதனை"],["குற்றம்","தோழி மீது ஆசிட் வீச்சு இளபெண் கைது"],["தமிழகம்","இலங்கை அரசை கண்டித்து தேதி ஆர்ப்பாட்ட வைகோ"],["குற்றம்","கன்டெய்னர் லாரி கவிழ்ந்து கிளீனர் பலி டிரைவர் தப்பினார்"],["குற்றம்","கிலோ தங்க நகை லட்ச கொள்ளை"],["தமிழகம்","வாக்கு எண்ணிக்கை ஏற்பாடுகள் தேர்தல் அதிகாரி பிரவீன்குமார்"],["இந்தியா","ஊழல் செய்வதில் கர்நாடகா முதலிட ராகுல் காந்தி"],["தமிழகம்","சென்னை மெட்ரோ ரயிலுக்காக வழித்தடங்களில் சுரங்கப்பாதை"],["விளையாட்டு","டுடே ஸ்பெஷல்"],["சினிமா(ரீல்மா)","ரீமேக்கில் நடிப்பது தவறில்லை த்ரிஷா"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["இந்தியா","கறுப்பு பண விவகாரத்தில் மத்திய அரசு தூங்குவது ஏன்"],["தமிழகம்","கோயபேட்டில் நெரிசலை குறைக்க வெளியூர் பஸ்களுக்கு தனி பார்க்கிங்"],["உலகம்","அணுசக்தி விஷயத்தில் மிகுந்த எச்சரிக்கை தேவை பான் கி மூன்"],["மாவட்ட மசாலா","கழுத்து அறுத்து விவசாயி படுகொலை"],["மாவட்ட மசாலா","அமாவுக்கு அடி உதை போதை மகன் கைது"],["விளையாட்டு","டுடே ஸ்பெஷல்"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["தமிழகம்","சென்னையில் மின்தடை சிக்னல்கள் இயங்கவில்லை"],["தமிழகம்","வரலாறு காணாத வகையில் தங்க வெள்ளி விலை உயர்வு"],["இந்தியா","எகிப்து அதிபர் தேர்தலில் இந்திய ஓட்டு இயந்திரங்கள் குரேஷி"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["உலகம்","சிரியா தாக்குதல் பேர் பலி"],["மாவட்ட மசாலா","ஊட்டியில் பேர் குவிந்தனர்"],["மாவட்ட மசாலா","மேட்டூர் அணைக்கு நீர்வரத்து அதிகரிப்பு"],["தமிழகம்","செங்குன்றத்தில் பலத்த மழை நீர் தேங்கியதால் மக்கள் அவதி"],["மர்மம்","நள்ளிரவில் ஜல்ஜல் சத்த ரத்த காவு வாங்கு புளியமரத்து முனி"],["மாவட்ட மசாலா","கோடை மழையால் மேட்டூர் நீர்மட்ட உயர்வு"],["மாவட்ட மசாலா","காட்டெருமை அட்டகாச கிராம மக்கள் பீதி"],["வேலைவாய்ப்பு","பஞ்சாப் நேஷனல் வங்கியில் கிளார்க் பணியிடங்கள்"],["வேலைவாய்ப்பு","இந்திய விமானப்படையில் பயிற்சியுடன் வேலை விளையாட்டு வீரர்களுக்கு வாய்ப்பு"],["ஸ்டேட் எக்ஸ்பிரஸ்","தீவிரவாத கமாண்டர்கள் காஷ்மீரில் சுட்டுக் கொலை"],["தமிழகம்","தமிழக புதுச்சேரியில் இன்று இடியுடன் மழை"],["இந்தியா","டெல்லியில் மெட்ரோ ரயில் தொடங்கி மாதங்களில் கோடி பேர் பயண"],["மாவட்ட மசாலா","நாளை மறுநாள் வரை எபிஏ ஹால்டிக்கெட் பெறலா"],["மாவட்ட மசாலா","மேட்டூர் அணை நீர்மட்ட ஒரே நாளில் அடி உயர்வு"],["உலகம்","சிரியா போராட்டத்தில் நாளில் பேர் பலி"],["விளையாட்டு","டுடே ஸ்பெஷல்"],["இந்தியா","காமன்வெல்த் ஊழல் விவகார சுரேஷ் கல்மாடி கைது"],["இந்தியா","கறுப்பு பண விவகார விசாரணையை கண்காணிக்க உயர்மட்ட குழு அமைப்பு"],["உலகம்","ஆஸி கடலில் மூழ்கிய இந்திய மாணவர்கள்"],["தமிழகம்","வன ஊழியர்களை பத பார்த்தது நரி"],["சினிமா(ரீல்மா)","ஹாலிவுட்டை ஈர்க்க கமல் ஐடியா"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["மருத்துவம்","சிறுநீரக கல் வராமல் தடுப்பது எப்படி"],["தமிழகம்","பழவேற்காடு பகுதியில் மீனவர்களிட சிக்கிய புள்ளிமான் மீட்பு"],["தலையங்கம்","காதல் இனிக்குது கல்யாண கசக்குது"],["தமிழகம்","சட்டசபை தேர்தலில் ஓ பயன்படுத்தியோரை விசாரிக்க ஐகோர்ட் தடை"],["உலகம்","உறுப்பு நாடுகள் சமதித்தால் இலங்கை அரசு மீது விசாரணை ஐநாசபை"],["இந்தியா","புதுவை கவர்னர் இக்பால்சிங்கிட மீண்டு விசாரணை"],["கல்வி","இந்திராகாந்தி பயிற்சி நிறுவனத்தில் விமான பைலட் கோர்ஸ்"],["தமிழகம்","இலங்கை போரில் மனித உரிமை மீறல் சர்வதேச ஆணைய விசாரிக்க திமுக வலியுறுத்தல்"],["தமிழகம்","இலங்கை தமிழர் பிரச்னை மத்திய அரசுக்கு விஜயகாந்த் கோரிக்கை"],["விளையாட்டு","டுடே ஸ்பெஷல்"],["தமிழகம்","வாக்கு எண்ணு மையங்களில் பிரவீன்குமார் திடீர் ஆய்வு"],["சினிமா(ரீல்மா)","நடிகர் கார்த்தி திருமண ஈரோடு ரஞ்சனியை மணக்கிறார்"],["தமிழகம்","தேர்தல் வழக்குகள் மீது வாரத்தில் நடவடிக்கை தேர்தல் கமிஷனுக்கு ஐகோர்ட் உத்தரவு"],["குற்றம்","காஷ்மீர் ராணுவ முகாமில் சக வீரர்கள் பேரை சுட்டு கொன்றவர் கைது"],["இந்தியா","ஜனநாயகத்தை வலுப்படுத்த வேண்டு மீரா குமார்"],["தமிழகம்","இடங்களுக்கு மேல் திமுக கூட்டணி ஜெயிக்கு நடிகர் வடிவேலு"],["உலகம்","காதலி கேத் மிடில்டனை கர பிடித்தார் இளவரசர் வில்லிய"],["மாவட்ட மசாலா","கூலி தொழிலாளி வெட்டி கொலை"],["மாவட்ட மசாலா","மேட்டூர் நீர்மட்ட அடி"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["சினிமா(ரீல்மா)","தமிழில் தாய்லாந்து ஹீரோயின்"],["உலகம்","தென் அமெரிக்காவில் புயல் பேர் பரிதாப பலி"],["குற்றம்","நகைக்கடையை உடைத்து கிலோ தங்க கொள்ளை"],["உலகம்","தென் அமெரிக்காவில் புயல் பேர் பரிதாப பலி"],["தமிழகம்","இலங்கை தூதரக முன்பு ஆர்ப்பாட்ட நடத்திய பாஜகவினர் பேர் கைது"],["தமிழகம்","நடிகர் ரஜினிகாந்த் மருத்துவமனையில் அனுமதி"],["இந்தியா","மக்களுடன் தொடர்பில்லாத காங்கிரசாருக்கு சீட் இல்லை ராகுல் காந்தி"],["தமிழகம்","அஜீரண கோளாறு மருத்துவமனையிலிருந்து வீடு திருபினார் ரஜினி"],["உலகம்","எண்டவர் விண்கல பயண ஒத்திவைப்பு"],["விளையாட்டு","டுடே ஸ்பெஷல்"],["சினிமா(ரீல்மா)","வில்லியாக நடிக்க பியா ஓகே"],["ஸ்டேட் எக்ஸ்பிரஸ்","பேர் எரித்துக் கொலை கிராம மக்கள் ஆத்திர"],["குற்றம்","மாவட்ட திமுக துணை செயலாளர் சரமாரியாக வெட்டி படுகொலை"],["தலையங்கம்","கொலையு செய்யு கள்ளக் காதல்"],["வேலைவாய்ப்பு","கனரா வங்கியில் காலியிடங்கள் பிஇ பிடெக் எசிஏ படித்தவருக்கு வாய்ப்பு"],["வேலைவாய்ப்பு","யூகோ வங்கியில் அதிகாரிகள் பணி"],["தமிழகம்","மேட்டூர் அணைக்கு நீர் வரத்து அதிகரிப்பு"],["உலகம்","சர்வதேச பயங்கரவாதி ஒசாமா பின்லேடன் கொல்லப்பட்டார் உறுதிபடுத்தினார் ஒபாமா"],["இந்தியா","ஏர் இந்தியா ஸ்டிரைக் நீடிப்பு விமானங்கள் மட்டுமே இயங்கின"],["உலகம்","சர்வதேச பயங்கரவாதி ஒசாமா பின்லேடன் கொல்லப்பட்டான் உறுதிபடுத்தினார் ஒபாமா"],["இந்தியா","உ பில் பொறியியல் நுழைவுத் தேர்வு கேள்வித் தாள் அவுட்"],["தமிழகம்","வது கட்டமாக மெட்ரோ ரயில் பூந்தமல்லி வரை நீட்டிக்க முடிவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","தொழில் போட்டியால் பேர் படுகொலை"],["உலகம்","யார் இந்த ஒசாமா"],["தமிழகம்","தமிழகத்தில் மேலு இடத்தில் பாஸ்போர்ட் மையங்கள்"],["தமிழகம்","ஏற்க மறுக்கு தனியார் பள்ளிகளை அரசே நடத்த முன்வர வேண்டு ராமதாஸ்"],["உலகம்","கோழி கொழுப்பில் விமான எரிபொருள்"],["உலகம்","வில்லிய கேத் மிடில்டன் தேனிலவுக்கு செஷல்ஸ் பயண"],["மருத்துவம்","மிரட்டு மூல நோய் விரட்ட வழிகள்"],["மாவட்ட மசாலா","பயிர் உற்பத்தி அதிகரிக்க பெருந்துறையில் சிறப்பு மைய"],["மாவட்ட மசாலா","திமுக நிர்வாகி கொலையில் பேர் கோர்ட்டில் சரண்"],["ஆன்மீகம்","அக்னி நட்சத்திர தோஷ காலமா"],["தமிழகம்","சென்னை மக்களின் குடிநீருக்காக பூண்டி ஏரியில் தண்ணீர் திறப்பு"],["தமிழகம்","சூரியன் எஃப்எக்கு வது பர்த்டே"],["உலகம்","பின்லேடனை கொன்றதால் ஒபாமா செல்வாக்கு உயர்வு"],["இந்தியா","பழங்கால பொருட்கள் கடத்தல் ஹசன் அலி புது மோசடி"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["விளையாட்டு","டுடே ஸ்பெஷல்"],["தமிழகம்","மெட்ரோ ரயில் பணிக்காக நில கையகப்படுத்து பணி மீண்டு தொடங்கியது"],["ஸ்டேட் எக்ஸ்பிரஸ்","சுரேஷ் கல்மாடியை விசாரிக்க அமலாக்க பிரிவு நடவடிக்கை"],["தமிழகம்","ரஜினிக்கு வைரஸ் காய்ச்சல் மருத்துவமனையில் நாள் சிகிச்சை"],["குற்றம்","கை கால்களை துண்டித்து விவசாயி படுகொலை"],["மாவட்ட மசாலா","கல்வி உதவித்தொகை திட்ட இந்தியர்களுக்கு அமெரிக்காவில் பயிற்சி"],["ஸ்டேட் எக்ஸ்பிரஸ்","சாகுவரை உண்ணாவிரத பாபா ராதேவ் அறிவிப்பு"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["விளையாட்டு","டுடே ஸ்பெஷல்"],["உலகம்","பின்லேடன் சடல பட வெளியிடமாட்டோ ஒபாமா திட்டவட்ட"],["தமிழகம்","தட்கல் டிக்கெட்டாவது கிடைக்குமா காத்திருக்கு பயணிகள்"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["தமிழகம்","இன்று அட்சய திருதியை கொண்டாட்ட ஆயிர கிலோ தங்க விற்பனை ஆகு"],["மாவட்ட மசாலா","விற்பனை அதிகரிப்பால் முட்டை விலை உயர்வு"],["மாவட்ட மசாலா","குட்டிகளுடன் சிறுத்தை நடமாட்ட காரிமங்கல மக்கள் பீதி"],["மாவட்ட மசாலா","மின் கபியில் லாரி உரசி டிரைவர் பரிதாப சாவு"],["உலகம்","முதுகுவலியில் இருந்து விடுபட ஆய்வுகள் தரு அற்புத டிப்ஸ்"],["சினிமா(ரீல்மா)","ஜூனியர் என்டிஆர் திருமண ரசிகர்கள் மீது போலீஸ் தடியடி"],["தமிழகம்","நாளை மறுநாள் பிளஸ் ரிசல்ட் மே முதல் மறுகூட்டலுக்கு விண்ணப்பங்கள் வினியோக"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["வேலைவாய்ப்பு","துணை ராணுவப்படையில் காலியிடங்கள்"],["தமிழகம்","திருவான்மியூருக்கு கூடுதல் பஸ் இயக்க கோரிக்கை"],["தமிழகம்","இன்று காலை மணிக்கு பிளஸ் ரிசல்ட் வெளியீடு தேதி மதிப்பெண் பட்டியல் கிடைக்கு"],["தமிழகம்","பிஎட் எஎட் தேர்வுகள் தேதி தொடங்குகிறது ஆயிர பேர் எழுதுகின்றனர்"],["இந்தியா","என்னிட கறுப்பு பண ஒரு பைசா கூட இல்லை கேஜிபாலகிருஷ்ணன்"],["உலகம்","பின்லேடன் மனைவிகளிட விசாரணை நடத்த முடிவு"],["உலகம்","பாக்கில் பின்லேடன் வாழ்ந்தது பற்றி அரசு விசாரணை நடத்த வேண்டு ஒபாமா"],["விளையாட்டு","டைமிங் ஷாட்"],["விளையாட்டு","டுடே ஸ்பெஷல்"],["தமிழகம்","உளுந்தூர்பேட்டை அருகே தண்டவாளத்தில் விரிசல் எக்ஸ்பிரஸ் ரயில்கள் தாமத"],["மாவட்ட மசாலா","மேட்டூர் அணை ஜூன் ல் திறப்பு"],["தமிழகம்","பாடவாரியாக ஸ்டேட் ரேங்க்"],["உலகம்","பாகிஸ்தான் ராணுவத்திட அபோதாபாத் பங்களா இடிக்கு பணி துவங்கியது"],["தமிழகம்","தமிழக மீனவர்களை காக்க மத்திய அரசு நடவடிக்கை தேவை திருமாவளவன்"],["விளையாட்டு","டுடே ஸ்பெஷல்"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["மருத்துவம்","கண்கட்டி வராமல் தடுப்பது எப்படி"],["மாவட்ட மசாலா","மேட்டூர் அணைக்கு நீர்வரத்து குறைந்தது"],["உலகம்","பின்லேடன் மீதான தாக்குதலுக்கு ரிஸ்க் எடுத்துதான் உத்தரவிட்டேன் ஒபாமா"],["தமிழகம்","பிளஸ் மறு கூட்டலுக்கு இன்று முதல் விண்ணப்ப"],["தமிழகம்","தமிழை ஒரு பாடமாக எடுத்து படித்தவருக்கு மட்டுமே தரவரிசை ராமதாஸ்"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஊழல் நீதிபதிகள் டிஸ்மிஸ் சுப்ரீ கோர்ட் கருத்து"],["மாவட்ட மசாலா","மரத்தில் வேன் மோதி மீன் வியாபாரி பலி"],["தமிழகம்","பிளஸ் தேர்ச்சி சதவீத குறைந்த அரசு பள்ளிகளுக்கு நோட்டீஸ்"],["உலகம்","கார் குண்டு வெடித்து ஈராக்கில் பேர் பலி"],["தமிழகம்","செங்கல்பட்டில் ஜிஎஸ்டி சாலை விரிவாக்க பணி தொடக்க"],["தமிழகம்","சென்னை தொகுதிகளில் இதுவரை தபால் ஓட்டுகள் பதிவு"],["இந்தியா","உபி விவசாயிகள் போராட்ட கைதான ராகுல் காந்தி ஜாமீனில் விடுதலை"],["தமிழகம்","சென்னையில் தொகுதிகளுக்கு மாலை மணிக்குள் தேர்தல் முடிவு"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["விளையாட்டு","சென்னைக்கு வழிவிடுமா டெல்லி"],["விளையாட்டு","டுடே ஸ்பெஷல்"],["மாவட்ட மசாலா","ராகுல் கைது கண்டித்து நள்ளிரவில் காங் ஆர்ப்பாட்ட"],["உலகம்","சிரியாவில் குண்டு வீச்சு பேர் பரிதாப பலி"],["தமிழகம்","சென்னையில் இடங்களில் வாக்கு எண்ணிக்கை காலை மணிக்கு முதல் ரவுண்ட் முடிவு"],["இந்தியா","புதிய நில ஆர்ஜித மசோதா அடுத்த தொடரில் தாக்கல் ப சிதபர"],["தமிழகம்","தென்காசி தொகுதியில் நடிகர் சரத்குமார் முன்னிலை"],["தமிழகம்","மதுரை தெற்கு தொகுதி சிபிஎ வேட்பாளர் அண்ணாதுரை வெற்றி"],["தமிழகம்","மதுரை தெற்கு தொகுதி சிபிஎ வெற்றி"],["தமிழகம்","புதுச்சேரியில் என்ஆர்காங்கிரஸ் தலைவர் ரங்கசாமி முதலமைச்சர் ஆகிறார்"],["தமிழகம்","திருப்பூர் தெற்கு தொகுதியில் மார்க்சிஸ்ட் கயூ வெற்றி"],["மாவட்ட மசாலா","கயிறு உற்பத்தியாளர்கள் இன்று வேலைநிறுத்த"],["வேலைவாய்ப்பு","வேலை வாய்ப்பு என்எச்பிசி நிறுவனத்தில் பல்வேறு வேலைகள்"],["வேலைவாய்ப்பு","பேங்க் ஆப் இந்தியாவில் காலியிடங்கள்"],["உலகம்","புகுஷிமா அணுமின் நிலையத்தில் ஊழியர் மயங்கி விழுந்து பலி"],["தமிழகம்","திமுக பிரமுகர் வெட்டி கொலை நடவடிக்கை எடுக்க கோரி ஆதரவாளர்கள் ஆர்ப்பாட்ட"],["தமிழகம்","பள்ளி மாணவர்களுக்கு கோடைகால பயிற்சி"],["மர்மம்","நள்ளிரவில் நடுங்க வைக்கு கர்ப்பிணியின் மரண ஓல காவு வாங்கு மூன்று கண் பால"],["மாவட்ட மசாலா","வீட்டுக்குள் புகுந்து பவுன் கொள்ளை"],["மாவட்ட மசாலா","மேட்டூர் நீர்மட்ட அடி ஆனது"],["தமிழகம்","மருத்துவ இன்ஜி படிப்புகளுக்கு விண்ணப்ப வினியோக இன்று துவக்க"],["உலகம்","ஓட்டல் ஊழியரை பலாத்கார செய்ய முயற்சி ஐஎஎப் நிர்வாக இயக்குநர் கைது"],["தமிழகம்","சட்டசபை தலைவராக தேர்வு கவர்னருடன் ரங்கசாமி சந்திப்பு"],["தமிழகம்","போலீஸ் உயர் அதிகாரிகளை கூண்டோடு மாற்ற முடிவு"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["விளையாட்டு","டுடே ஸ்பெஷல்"],["தமிழகம்","இன்ஜி மருத்துவ படிப்பில் சேர விண்ணப்ப விற்பனை தொடங்கியது"],["மாவட்ட மசாலா","திருவண்ணாமலையில் கிரிவல வர உகந்த நேர"],["சினிமா(ரீல்மா)","ரஜினியை அமெரிக்காவுக்கு அழைத்து சென்று சிகிச்சை அளிக்க முடிவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","எல்லையில் வது நாள் பாக் ராணுவ துப்பாக்கி சூடு"],["இந்தியா","பெட்ரோல் விலை உயர்வில் அரசுக்கு தொடர்பு இல்லை பிரணாப் முகர்ஜி"],["இந்தியா","தமிழக மீனவர்கள் மீது தாக்குதலை நிறுத்துங்கள் இலங்கையிட இந்தியா வலியுறுத்தல்"],["தமிழகம்","ரஜினி நலமாக இருக்கிறார் நேரில் பார்த்த மோடி சந்திரபாபு நாயுடு"],["உலகம்","பலாத்கார வழக்கில் ஐஎஎப் அதிகாரியிட டிஎன்ஏ சோதனை"],["தமிழகம்","புதுச்சேரி முதல்வராக ரங்கசாமி பதவியேற்பு"],["இந்தியா","பாதுகாப்பு நிலவர முப்படை தளபதிகளுடன் பிரதமர் ஆலோசனை"],["சினிமா(ரீல்மா)","ஹாலிவுட் நடிகரின் அந்தரங்க அபல"],["சினிமா(ரீல்மா)","நீச்சல் உடையில் நடிக்கிறேனா த்ரிஷா"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["விளையாட்டு","டுடே ஸ்பெஷல்"],["தமிழகம்","திருநாகேஸ்வரத்தில் ராகு கேது பெயர்ச்சி விழா"],["தமிழகம்","கேளபாக்க வண்டலூர் சாலை சீரமைக்க மக்கள் கோரிக்கை"],["தமிழகம்","நுரையீரலில் நீர்கோர்ப்பு பிரச்னை ரஜினி உடல்நிலை சீராக உள்ளது"],["உலகம்","பாலியல் வழக்கில் சிக்கிய ஐஎஎப் அதிகாரி சிறையில் அடைப்பு"],["தமிழகம்","பிளஸ் விடைத்தாள் நகல் ஜூன் க்குள் கிடைக்கு"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["மாவட்ட மசாலா","திருவிழாவில் மோதல் வங்கி ஊழியர் கொலை"],["மாவட்ட மசாலா","மேட்டூர் நீர்மட்ட அடி"],["தமிழகம்","திருப்பூர் அருகே இன்று காலை கிராமங்களில் திடீர் நில அதிர்வு"],["தமிழகம்","சிபிஎஸ்இ தேர்வு முடிவு தேதி வெளியாகு"],["தமிழகம்","தீவிர சிகிச்சை பிரிவில் ரஜினி"],["மாவட்ட மசாலா","பண்ணையில் பயங்கர தீ கோழி குஞ்சுகள் பலி"],["குற்றம்","நகைப்பட்டறையில் ஊழியர்களை கட்டிப்போட்டு கிலோ தங்க கொள்ளை"],["உலகம்","செல்போன் நோ இங்கிலாந்து பெண்ணின் மின்சார அலர்ஜி"],["சினிமா(ரீல்மா)","சின்ன ஹீரோவுக்கு நோ கால்ஷீட் அமலா பால்"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["தமிழகம்","தமிழக அரசு உத்தரவு ஐஏஎஸ் அதிகாரிகள் கூண்டோடு மாற்ற"],["தமிழகம்","ரஜினி உடல் நிலை குறித்து டெலிபோனில் ஜெ விசாரிப்பு"],["இந்தியா","சுரேஷ் கல்மாடி மீது பக்க குற்றப்பத்திரிகை"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["உலகம்","சிரியாவில் துப்பாக்கி சூடு போராட்டக்காரர்கள் பலி"],["விளையாட்டு","டுடே ஸ்பெஷல்"],["மாவட்ட மசாலா","மேட்டூர் அணைக்கு நீர்வரத்து அதிகரிப்பு"],["மாவட்ட மசாலா","மேட்டூர் அணைக்கு நீர்வரத்து குறைந்தது"],["மாவட்ட மசாலா","விஐடி பல்கலைக்கழகத்தில் விளையாட்டு பயிற்சி முகா"],["தலையங்கம்","மரணத்தில் முடிந்த உறவை மீறிய காதல்"],["வேலைவாய்ப்பு","துணை ராணுவபடையில் கான்ஸ்டபிள் பணியிடங்கள்"],["உலகம்","பாக் கடற்படை விமான தளத்தில் தீவிரவாதிகள் திடீர் தாக்குதல்"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["தமிழகம்","ஜூன் ல் மேட்டூர் அணை திறப்பு டெல்டா விவசாயிகள் மகிழ்ச்சி"],["தமிழகம்","பிளஸ் தேர்வு மதிப்பெண் பட்டியல் நாளை வினியோக"],["மருத்துவம்","தூக்கமின்மையை துரத்துவது எப்படி"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["விளையாட்டு","பிரெஞ்ச் ஓபன் டென்னிஸ் வோஸ்னியாக்கி வெற்றி"],["விளையாட்டு","டுடே ஸ்பெஷல்"],["மாவட்ட மசாலா","மேட்டூர் அணைக்கு நீர்வரத்து அதிகரிப்பு"],["குற்றம்","சேலத்தில் அதிகாலை பயங்கர திமுக நிர்வாகி கொடூர கொலை"],["உலகம்","மாஜி ஐஎஎப் தலைவர் மீது பாலியல் புகார் டிஎன்ஏ ஆதார சிக்கியது"],["இந்தியா","ஐநாபாதுகாப்பு கவுன்சிலில் சீர்திருத்த செய்வது அவசிய மன்மோகன்"],["இந்தியா","சட்டீஸ்கரில் நக்சலைட்கள் அட்டூழிய போலீசார் பலி"],["இந்தியா","கறுப்பு பண பதுக்கலை தடுக்க நாடுகளுடன் புதிய ஒப்பந்த பிரணாப் முகர்ஜி"],["கல்வி","தொழிலாளர் நலத்துறை வழங்கு டிப்ளமோ கோர்ஸ்"],["விளையாட்டு","பிரெஞ்ச் ஓபன் டென்னிஸ் இவானோவிக் அதிர்ச்சி தோல்வி"],["மாவட்ட மசாலா","மேட்டூர் அணை நீர்மட்ட அடியாக அதிகரிப்பு"],["இந்தியா","டெல்லியில் பரபரப்பு ஐகோர்ட்டில் குண்டு வெடிப்பு"],["தமிழகம்","ஒரு வாரத்தில் ரஜினிகாந்த் சிகிச்சைக்காக வெளிநாடு செல்கிறார்"],["தமிழகம்","பத்தா வகுப்பு மதிப்பெண் பட்டியல் ஜூன் ல் கிடைக்கு"],["சினிமா(ரீல்மா)","இந்தி நடிகருடன் நீது சந்திரா காதல்"],["ஸ்டேட் எக்ஸ்பிரஸ்","டெல்லி குண்டுவெடிப்பு தீவிர விசாரணைக்கு உத்தரவு"],["குற்றம்","கூடலூர் அருகே யானைகள் தாக்கி பேர் பரிதாப சாவு"],["மாவட்ட மசாலா","மேட்டூர் அணைக்கு நீர் வரத்து குறைந்தது"],["தமிழகம்","கோயபேடு பஸ் நிலையத்தில் இரவில் பாதுகாப்பற்ற நிலை"],["உலகம்","ஏமனில் உள்நாட்டு கலவர வெடித்தது தமிழக நர்சுகள் பேர் தவிப்பு"],["தலையங்கம்","மரணத்தில் முடியு கள்ளக் காதல்கள்"],["சினிமா(ரீல்மா)","தமிழில் அசா அழகி"],["விளையாட்டு","டுடே ஸ்பெஷல்"],["தமிழகம்","சிகிச்சைக்காக நடிகர் ரஜினிகாந்த் இன்று சிங்கப்பூர் செல்கிறார்"],["மாவட்ட மசாலா","மேட்டூர் அணைக்கு நீர்வரத்து அதிகரிப்பு"],["மாவட்ட மசாலா","அனுமதியின்றி செயல்பட்ட சிறுவர் காப்பகத்துக்கு சீல்"],["தமிழகம்","வகுப்பு மதிப்பெண் பட்டியல் ஜூன் தேதி கிடைக்கு"],["தமிழகம்","ஓய்வுக்காக சிங்கப்பூர் பயண ரஜினி உடல்நல பற்றி கவலைப்பட வேண்டா"],["மாவட்ட மசாலா","மேட்டூர் நீர்மட்ட அடி ஆனது"],["சினிமா(ரீல்மா)","குத்துப்பாட்டு இல்லாத காதல் கதை"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["விளையாட்டு","பிரெஞ்சு ஓபன் டென்னிஸ் இந்திய வீரர்கள் முன்னேற்ற"],["தமிழகம்","பொதட்டூர்பேட்டை திருத்தணி சாலையை சீரமைக்க கோரிக்கை"],["இந்தியா","ஏமனில் பயங்கர கலவர ஆயிர இந்தியர்கள் வெளியேற உத்தரவு"],["தமிழகம்","தமிழக புதுச்சேரி பார் கவுன்சில் தலைவராக டிசெல்வ தேர்வு"],["தமிழகம்","டாஸ்மாக் பணியாளர்களை பணி நிரந்தர செய்ய முதல்வருக்கு கோரிக்கை"],["தமிழகம்","சென்னைபெங்களூர் சாலையில் சுங்க வரி உயர்வை கண்டித்து ஜூன் முதல் லாரிகள் ஓடாது"],["உலகம்","ஏமன் நாட்டில் கட்டுக்கடங்காத கலவர இந்தியர்கள் வெளியேற உத்தரவு"],["இந்தியா","மருந்து கபெனியில் வருமான வரித் துறை ரெய்டு கோடி கண்டுபிடிப்பு"],["உலகம்","பூமிக்கு இணையாக சந்திரனில் தண்ணீர்"],["மாவட்ட மசாலா","மேட்டூர் அணைக்குநீர்வரத்து குறைந்தது"],["வேலைவாய்ப்பு","துணை ராணுவ படையில் காலி இடங்கள்"],["தமிழகம்","ஓய்ந்தது அக்னி நட்சத்திர வெயில் தணிய வாய்ப்பு"],["தமிழகம்","சிங்கப்பூர் மருத்துவமனையில் அவசர சிகிச்சை பிரிவில் ரஜினி"],["மாவட்ட மசாலா","முஸ்லி இட ஒதுக்கீட்டை உயர்த்த மமக வலியுறுத்தல்"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["விளையாட்டு","பிரெஞ்ச் ஓபன் டென்னிஸ் காலிறுதியில் சானியா ஜோடி"],["குற்றம்","ரயில் மோதி டிரைவர் பலி"],["தமிழகம்","புளியந்தோப்பில் தீ விபத்து குடிசை இழந்தவர்களுக்கு வீடு"],["சினிமா(ரீல்மா)","அக்கா வேடத்தில் நடிப்பது ஏன் அனுயா"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஸ்ரீநகரில் தி "உலகம்","பாக் ராணுவ செக்போஸ்ட் மீது தலிபான் தாக்குதல்"],["விளையாட்டு","டைமிங் ஷாட்"],["விளையாட்டு","லண்டன் டென்னிஸ் பயஸ் பூபதி ஜோடி வெற்றி"],["விளையாட்டு","பிரவீன்குமாரிட போதை ரசிகர் ரகளை"],["ஸ்டேட் எக்ஸ்பிரஸ்","டாடாவிடமிருந்து நிலத்தை பெற அவசர சட்ட மதா அதிரடி"],["இந்தியா","லாக்கப்பில் செக்ஸ் சித்ரவதை போலீஸ் குபலுக்கு கண்டன"],["மாவட்ட மசாலா","தொழில் போட்டியில் வாலிபர் படுகொலை"],["மாவட்ட மசாலா","நாளை விஐடி நுழைவுத்தேர்வு நகரங்களில் நடக்கிறது"],["இந்தியா","சட்டீஸ்கரில் நக்சல் தாக்குதலில் போலீசார் பலி"],["மாவட்ட மசாலா","மேட்டூர் அணைக்கு நீர்வரத்து குறைந்தது"],["ஸ்டேட் எக்ஸ்பிரஸ்","சிங்கூர் டாடா நில விவகார அவசர சட்ட திடீர் வாபஸ்"],["உலகம்","சிரியா கலவர பேர் பலி"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["விளையாட்டு","லண்டன் டென்னிஸ் நடால் அதிர்ச்சி தோல்வி"],["தமிழகம்","தமிழக முழுவது தபால் நிலையங்களில் ஏடிஎ மையங்கள்"],["தமிழகம்","மேட்டூர் அணையில் இருந்து தண்ணீர் திறப்பு குறைப்பு"],["மாவட்ட மசாலா","திருவண்ணாமலையில் கிரிவல செல்ல உகந்த நேர"],["தமிழகம்","திருத்தணியில் வாகன நெரிசல் தவிர்க்க சென்னை திருப்பதி நெடுஞ்சாலையில் புது பஸ் ஸ்டாண்ட் மக்கள் கோரிக்கை"],["தமிழகம்","கடலூரில் இருந்து வெளிநாடுகளுக்கு பால்சுறா ஏற்றுமதி"],["விளையாட்டு","லண்டன் லார்ட்ஸ் மைதானத்தில் தில்ஷானுக்கு கவுரவ"],["தமிழகம்","திருச்செந்தூரில் வைகாசி விசாக கோலாகல"],["தமிழகம்","கோயபேடு பஸ் நிலையத்தில் தொடரு போக்குவரத்து நெரிசல்"],["விளையாட்டு","டைமிங் ஷாட்"],["இந்தியா","மருத்துவமனையில் இருந்து பாபா ராதேவ் டிஸ்சார்ஜ்"],["வேலைவாய்ப்பு","எஸ்பிஐ துணை வங்கிகளில் புரொபஷனரி ஆபீசர்ஸ் இடங்கள்"],["வேலைவாய்ப்பு","பரோடா வங்கியில் சிறப்பு அதிகாரிகள்"],["தமிழகம்","நாளில் கிரகண பூமிக்கு ஆபத்தில்லை"],["இந்தியா","பொது கணக்கு குழு அறிக்கையை திருப்பி அனுப்பினார் மீராகுமார்"],["சினிமா(ரீல்மா)","ரஜினி டிஸ்சார்ஜ் எப்போது"],["மாவட்ட மசாலா","விஐடி பல்கலையில் எல்டாய் கருத்தரங்க"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["குற்றம்","கூலிதொழிலாளி அடித்து கொலை"],["தமிழகம்","தமிழக புதுச்சேரியில் இடியுடன் மழை பெய்யு"],["தமிழகம்","டிஸ்சார்ஜ் ஆனார் ரஜினி சிங்கப்பூரில் சில வாரங்கள் ஓய்வு எடுக்க முடிவு"],["இந்தியா","சரக்கு அடிக்கு யானைகளால் கிராம மக்கள் அலறி ஓட்ட"],["உலகம்","காற்றில் எரிமலை சாபலால் ரத்த சிவப்பில் சந்திர கிரகண"],["விளையாட்டு","டைமிங் ஷாட்"],["தமிழகம்","வக்கீல் சதீஷ்குமார் கொலை சிபிஐ விசாரிக்க ஐகோர்ட் உத்தரவு"],["மாவட்ட மசாலா","வீடு பூட்டு உடைத்து பவுன் கொள்ளை"],["குற்றம்","வைர நகைகளை அள்ளி வீசிவிட்டு தங்கத்தை கொண்டு சென்ற திருடன்"],["தமிழகம்","சாலையை சீரமைக்க கோரி மக்கள் மறியல் போராட்ட"],["குற்றம்","படகு மெஷினில் சிக்கிய வலையை மீட்க முயன்ற தந்தை மகன் பலி"],["தலையங்கம்","அனாதையாகு குழந்தைகள்"],["மாவட்ட மசாலா","மஞ்சள் விலை உயர்வு விவசாயிகள் மகிழ்ச்சி"],["மாவட்ட மசாலா","முட்டை விலை உயர்வு காசாக நிர்ணய"],["விளையாட்டு","டைமிங் ஷாட்"],["தமிழகம்","வக்கீல் சதீஷ்குமார் கொலை வழக்கு சிபிஐ விசாரணை தொடங்கியது"],["தமிழகம்","பள்ளிகள் அரசுடமை ராமதாஸ் வலியுறுத்தல்"],["தமிழகம்","திருவள்ளூரில் அடிக்கடி பழுதாகு ஏடிஎ வாடிக்கையாளர்கள் அவதி"],["இந்தியா","ராகுல் காந்தி பிறந்த நாள் விவசாயிகள் தினமாக கொண்டாட முடிவு"],["இந்தியா","கடன் வட்டி உயர்வால் பொருளாதார வளர்ச்சி குறையு பிரணாப் முகர்ஜி"],["இந்தியா","அன்று கூலித்தொழிலாளி இன்று பள்ளிகளின் தாளாளர்"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["சினிமா(ரீல்மா)","கிளாமர் என் விருப்பமில்லை ஸ்ரேயா"],["உலகம்","சிரியா போராட்ட பேர் சுட்டுக் கொலை"],["வேலைவாய்ப்பு","மத்திய போலீஸ் துறையில் காலியிடங்கள்"],["மாவட்ட மசாலா","தேவை விற்பனை அதிகரிப்பால் முட்டை விலை உயர்வு"],["தமிழகம்","பொறியியல் படிப்புக்கான ரேண்ட எண் இன்று வெளியீடு"],["இந்தியா","பிரதமராகு தகுதி ராகுலுக்கு வந்து விட்டது திக்விஜய் சிங்"],["தமிழகம்","எபிபிஎஸ் ரேங்க் பட்டியல் நாளை வெளியாகிறது"],["குற்றம்","தலையில் கல்லை போட்டு கணவர் படுகொலை"],["இந்தியா","ஹெட்லியின் வாக்குமூல பற்றி பாகிஸ்தானிட விசாரிக்க முடிவு எஸ்எகிருஷ்ணா"],["தலையங்கம்","திருந்தாவிட்டால் மரணதான்"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["சினிமா(ரீல்மா)","காதலை விட நட்புக்குதான் மவுசு"],["விளையாட்டு","விபிள்டன் டென்னிஸ் குஸ்னட்சோவா வெற்றி"],["தமிழகம்","சேல கிருஷ்ணகிரியில் இன்று அதிகாலை திடீர் நிலநடுக்க"],["தமிழகம்","ராமேஸ்வர மீனவர்கள் பேர் சிறைபிடிப்பு"],["இந்தியா","பிரணாப் முகர்ஜி அலுவலக உளவு பார்க்கப்படவில்லை"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["மாவட்ட மசாலா","மேட்டூர் அணைக்கு நீர்வரத்து திடீர் உயர்வு"],["மாவட்ட மசாலா","செஞ்சி அருகே பதுக்கி வைத்த கீ லட்ச சாராய பறிமுதல்"],["தமிழகம்","முல்லை பெரியாறில் புதிய அணை கட்டுவதில் எந்த மாற்றமு இ¢ல்லை பிஜேஜோசப்"],["தமிழகம்","கல்வி கட்டண விவகார விசாரணை நடத்த டிஇஓக்களுக்கு அதிகார"],["தமிழகம்","தீவிரவாதிகள் ஊடுருவலை தடுக்க மணி நேர ஆபரேஷன் ஹலா"],["தமிழகம்","ராமேஸ்வர மீனவர் காலவரையற்ற ஸ்டிரைக்"],["சினிமா(ரீல்மா)","சமூக சேவை நடிகைகளுக்கு பிரியா அழைப்பு"],["குற்றம்","கூட்டுறவு வங்கி காவலாளி கழுத்தை இறுக்கி கொலை"],["விளையாட்டு","டைமிங் ஷாட்"],["இந்தியா","கோடி கோடியாக பண கடத்தல் சாய்பாபா ஆசிரமத்தில் வருமான வரி ரெய்டு"],["தமிழகம்","இன்ஜினியரிங் கவுன்சலிங் தரவரிசை பட்டியல் நாளை வெளியீடு"],["மாவட்ட மசாலா","யானைகள் தாக்கி பேர் பரிதாப சாவு"],["மாவட்ட மசாலா","நள்ளிரவில் வீடு புகுந்து லட்ச நகை கொள்ளை"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["தமிழகம்","இன்ஜி படிப்புக்கு புதிய கட்டண இன்று மாலை அறிவிப்பு"],["தமிழகம்","ராமேஸ்வர மீனவர்கள் நாளில் விடுதலை செய்யப்படுவார்கள் முதல்வர் ஜெயலலிதா"],["தமிழகம்","பிளஸ் மறுமதிப்பீடு கவுன்சலிங் தொடங்குவதற்குள் மதிப்பெண் வெளியாகு"],["தமிழகம்","மதுரை மீனாட்சி அமன் கோயிலை பகல் முழுவது திறக்க நடவடிக்கை"],["விளையாட்டு","டைமிங் ஷாட்"],["விளையாட்டு","விபிள்டன் டென்னிஸ் பயஸ் ஜோடி வெற்றி"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["வேலைவாய்ப்பு","ஸ்டேட் பாங்க்கில் சிறப்பு அதிகாரி பணி"],["வேலைவாய்ப்பு","ரெப்கோ வங்கியில் கிளார்க் வேலை பட்டதாரிகள் விண்ணப்பிக்கலா"],["விளையாட்டு","டைமிங் ஷாட்"],["தமிழகம்","திருவள்ளூரில் குடிநீர் பிரச்னை பபிங் ஸ்டேஷனுக்கு தடையின்றி மின்சார வழங்க கோரிக்கை"],["தமிழகம்","தமிழக புதுச்சேரியில் இடியுடன் மழை பெய்யு"],["இந்தியா","மீனவர் விடுதலை எப்போது"],["மாவட்ட மசாலா","வீட்டின் பூட்டை உடைத்து பவுன் கொள்ளை"],["உலகம்","சிரியா கலவரத்தில் இதுவரை வீரர்கள் பலி"],["ஸ்டேட் எக்ஸ்பிரஸ்","சட்டீஸ்கரில் நக்சல் தாக்குதல் போலீசார் பலி"],["விளையாட்டு","டைமிங் ஷாட்"],["கல்வி","எப்பொழுது முதலிட"],["இந்தியா","முன்னாள் ராணுவத்தினருக்கு துணை ராணுவத்தில் வேலை"],["மருத்துவம்","தொண்டை பிரச்னைகளை துரத்த வழிகள்"],["விளையாட்டு","டைமிங் ஷாட்"],["மாவட்ட மசாலா","மேட்டூர் அணை நீர்மட்ட அடி"],["மாவட்ட மசாலா","லாரி ஸ்டிரைக் எப்போது"],["தமிழகம்","இலங்கை மீது பொருளாதார தடை கோரி நடிகர் நடிகைகள் ஊர்வல"],["தமிழகம்","தமிழக ராமேஸ்வர மீனவர்கள் விடுதலை எப்போது"],["கல்வி","ஜிப்மரில் மருத்துவ படிப்புகள்"],["உலகம்","ஆப்கானிஸ்தான் ஓட்டலில் தலிபான் பயங்கர தாக்குதல்"],["உலகம்","புகுஷிமா டன் கதிரியக்க நீர் பூமிக்குள் ஊடுருவல்"],["உலகம்","மார்பக புற்றுநோயை தடுக்கிறது சூரியஒளி"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["சினிமா(ரீல்மா)","த்ரிஷா கிளாமராக நடிப்பதில்லையா பிரியாமணி"],["விளையாட்டு","டைமிங் ஷாட்"],["தமிழகம்","இன்ஜினியரிங் மருத்துவ படிப்புக்கு கவுன்சலிங் நாளை தொடக்க"],["இந்தியா","டெல்லி விமான நிலையத்தில் இயந்திர கோளாறு"],["இந்தியா","இலங்கை தமிழர்களின் குறைகள் நியாயமானது பிரதமர்"],["குற்றம்","விவசாய தொழிலாளி படுகொலை அண்ணன் தபிகள் பேருக்கு ஆயுள்"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["தமிழகம்","பழுதான சிக்னல்களை சரிசெய்ய வாகன ஓட்டிகள் கோரிக்கை"],["தமிழகம்","ராமேஸ்வர மீனவர்கள் பேர் இந்திய கடற்படையிட ஒப்படைப்பு"],["தமிழகம்","சென்னை புறநகருக்கு புதிய மின்சார ரயில்கள்"],["தமிழகம்","பல்வேறு திருட்டுகளில் பறிபோன கோடி மதிப்புள்ள நகைகள் மீட்பு"],["தமிழகம்","வக்கீல் சதீஷ்குமார் கொலை வழக்கில் சிபிஐ மெத்தனமாக செயல்படுவது ஏன்"],["தமிழகம்","திருச்செந்தூர் எக்ஸ்பிரஸ் தினசரி ரயிலானது"],["தமிழகம்","துரந்தோ எக்ஸ்பிரஸ் உட்பட இந்தாண்டு புது ரயில்கள் இயக்கப்படு"],["தமிழகம்","வைகை எக்ஸ்பிரஸ் ரயிலை விட பயணநேர அதிக"],["சினிமா(ரீல்மா)","கிளிப்பிங்ஸ்"],["விளையாட்டு","டைமிங் ஷாட்"],["தமிழகம்","வர்த்தக கேஸ் சிலிண்டர் விலை குறைந்தது"],["தமிழகம்","திருவேற்காடு நகராட்சியில் நலத்திட்ட உதவிகள்"],["தமிழகம்","விடுதலை சிறுத்தையு நாங்களு எப்போது ஒன்றாக இருப்போ ராமதாஸ்"],["இந்தியா","ஒரு அறையில் மட்டு ஆயிர கோடி நகைகள்"],["தமிழகம்","மின்துறை அமைச்சருடன் முதல்வர் அவசர ஆலோசனை"],["தமிழகம்","அமைச்சர்களுக்கான இலாகா முதல்வர் ரங்கசாமி ஒதுக்கீடு"],["உலகம்","ஐஎஎப் முன்னாள் தலைவர் பாலியல் வழக்கில் விடுதலை"],["குற்றம்","செங்கல்சூளை தொழிலாளி சரமாரி குத்திகொலை"],["தமிழகம்","காஞ்சிபுர மாவட்ட எல்லையில் மூடிக் கிடக்கு புறக்காவல் நிலையங்களை திறக்க கோரிக்கை"],["உலகம்","சீறி வந்தது விண் துகள் குறுகிய இடைவெளியில் தப்பியது சர்வதேச விண்வெளி மைய"],[ ந்தியா","கசாப் மீதான மரண தண்டனை முபை ஐகோர்ட் இன்று தீர்ப்பு"],["இந்தியா","கசாப்புக்கு தூக்கு தண்டனை உறுதி உயர்நீதிமன்ற தீர்ப்பு"],["தமிழகம்","தமிழக மேலவை தேர்தலுக்கு சுப்ரீ கோர்ட் திடீர் தடை"],["இந்தியா","முபை தாக்குதல் வழக்கில் தூக்கு உறுதியானதை தொடர்ந்து தனிமை சிறையில் கசாப் அடைப்பு"],["இந்தியா","உச்ச நீதிமன்றத்தில் கசாப் மேல்முறையீடு"],["இந்தியா","பொதுமன்னிப்பு அதிகாரத்தில் எல்லை தாண்ட கூடாது உச்ச நிதீமன்ற"],["சினிமா(ரீல்மா)","அர்ச்சகரின் காதல் கதை"],["தமிழகம்","திருவள்ளூரில் கோடியில் ஊராட்சி ஒன்றிய அலுவலக திறப்பு"],["தமிழகம்","தனியார் மருத்துவ கல்லூரிகளை ஆய்வு செய்ய ஐகோர்ட் அனுமதி"],["இந்தியா","சபாநாயகர் உத்தரவுக்கு தடை விதிக்க முடியாது உச்ச நீதிமன்ற"],["தமிழகம்","மருத்துவ கல்லூரிகளை ஆய்வு செய்யலா உயர் நீதிமன்ற"],["இந்தியா","ஸ்பெக்ட்ர கடிதத்தை தாக்கல் செய்ய உச்ச நீதிமன்ற உத்தரவு"],["இந்தியா","கேஜிபாலகிருஷ்ணன் உறவினர் சொத்து கூடுதல் ஆதார வழங்க உச்ச நீதிமன்ற அனுமதி"],["தமிழகம்","தேர்தலை தள்ளிவைக்க கோரி சென்னை ஐகோர்ட்டில் மனு"],["இந்தியா","மருத்துவ படிப்புக்கு பொது நுழைவுத் தேர்வு சுப்ரீ கோர்ட் உத்தரவு"],["ஸ்டேட் எக்ஸ்பிரஸ்","பள்ளிகளிலிருந்து ராணுவத்தை வெளியேற்ற சுப்ரீ கோர்ட் கெடு"],["உலகம்","சிவப்பு உதடு கவர்ச்சி ரகசிய"],["தமிழகம்","சென்னை ஐகோர்ட் உத்தரவு சட்டமன்ற தேர்தலை தள்ளிவைக்க முடியாது"],["ஸ்டேட் எக்ஸ்பிரஸ்","சுப்ரீ கோர்ட் உத்தரவு பாஜ எஎல்ஏ சரண்"],["தமிழகம்","வாகனத்தில் சைரன் பயன்படுத்த அமைச்சர்கள் மேயர்களுக்கு தடை"],["தமிழகம்","சின்ன ஒதுக்கு விவகாரத்தில் உச்ச நீதிமன்ற தலையிட கூடாது"],["இந்தியா","மாஜி கவர்னர் கோரிக்கை சுப்ரீ கோர்ட் நிராகரிப்பு"],["தமிழகம்","மருத்துவ கல்லூரி நுழைவு தேர்வு சென்னை ஐகோர்ட் திடீர் தடை"],["தமிழகம்","விஜயகாந்த் கட்சிக்கு தனி சின்ன வழங்க உத்தரவிட முடியாது சுப்ரீ கோர்ட்"],["தமிழகம்","தேர்தல் குறித்து ஆசிரியர்களுக்கு பயிற்சி அளிக்க சென்னை ஐகோர்ட் அனுமதி"],["தமிழகம்","திறந்தவெளி பல்கலை விவகார அரசு உத்தரவை ரத்து செய்ய உயர் நீதிமன்ற மறுப்பு"],["கல்வி","சட்ட பல்கலைக்கழகத்தில் படிக்க மே ல் நுழைவுதேர்வு"],["தமிழகம்","தலைவர்கள் சிலையை மூட உயர் நீதிமன்ற தடை"],["இந்தியா","தூக்கு தண்டனையை எதிர்த்து உச்ச நீதிமன்றத்துக்கு கசாப் கடித"],["இந்தியா", ாவுக்கு சிபாரிசு செய்கிறேனா இலியானா கோப"],["தமிழகம்","திமுக ஆட்சிக்கு அரணாக இருப்போ ராமதாஸ் பேச்சு"],["உலகம்","கடைக்காரருக்கு அழைப்பிதழ் கொடுத்தார் கேத் மிடில்டன்"],["தமிழகம்","தேமுதிக சார்பில் போட்டியிட விஜயகாந்த் முதல் மனுத்தாக்கல்"],["தமிழகம்","தகவல் ஆணைய விவகார ஜெயலலிதாவுக்கு நோட்டீஸ்"],["சினிமா(ரீல்மா)","மோகன்லாலுடன் டான்ஸ் சந்தியா நெகிழ்ச்சி"],["தமிழகம்","தேமுதிக நேர்காணல் தொடங்கியது விஜயகாந்த் சரமாரி கேள்வி"],["தமிழகம்","திருநங்கை மாற்று திறனாளிகளிட நேர்காணல் நடத்தினார் விஜயகாந்த்"],["தமிழகம்","அதிமுக கூட்டணி கட்சிகள் கொந்தளிப்பு விஜயகாந்த் தலைமையேற்க அழைப்பு"],["தமிழகம்","நானு திருமாவளவனு இணைந்து பிரசார செய்வோ ராமதாஸ்"],["தமிழகம்","தேமுதிக வேட்பாளர் முழு பட்டியல் ரிஷிவந்தியத்தில் விஜயகாந்த்"],["தமிழகம்","அதிமுகவுக்கு வைகோ பாட புகட்ட வேண்டு தொல்திருமாவளவன்"],["தமிழகம்","விஜயகாந்த் தொகுதிக்கு ஏப் ல் செல்கிறார் வடிவேலு"],["தமிழகம்","செஞ்சியில் இன்று துவக்க மாநில முழுவது விஜயகாந்த் பிரசார"],["தமிழகம்","செஞ்சி தொகுதியில் வேனில் சென்று விஜயகாந்த் பிரசார"],["இந்தியா","மேற்குவங்க தேர்தலில் பிரணாப் மகனுக்கு சீட்"],["தமிழகம்","சீட் தருவதாக கூறி அதிமுக அணிக்கு அழைப்பு திருமாவளவன்"],["தமிழகம்","கார் திடீர் ரிப்பேர் விஜயகாந்த் பிரசார பாதியில் நிறுத்த"],["தமிழகம்","தேர்தல் விதிமுறை மீறியதாக விஜயகாந்துடன் சென்ற கார்கள் பறிமுதல்"],["தமிழகம்","அரசியலில் ப்ரிகேஜி கூட படிக்காதவர் விஜயகாந்த் ராமதாஸ்"],["தமிழகம்","விஜயகாந்த் உருவபொமை எரிப்பு பாமக எதிர்ப்பால் பரபரப்பு"],["தமிழகம்","அதிமுகவை உடைக்க விஜயகாந்த் சதி பாக்யராஜ்"],["தமிழகம்","ரசிகர் மன்றத்தை கலைத்துவிட்டு திமுகவில் சேர்ந்த விஜய் ரசிகர்கள்"],["தமிழகம்","தலைமை தேர்தல் அதிகாரியிட விஜயகாந்த் மீது பாமக புகார்"],["தமிழகம்","வேட்பாளர அடிக்கிற விஜயகாந்த் மக்கள் வயித்துல அடிக்க மாட்டாரா வடிவேலு"],["தமிழகம்","வைகோவுக்கு ஏற்பட்ட பரிதாப நிலை விஜயகாந்துக்கு நாளை நிச்சய ஏற்படு ஐலியோனி"],["தமிழகம்","பாமக தொண்டர்கள் தீவிரமாக உழைக்க வேண்டு ராமதாஸ்"],["தமிழகம்","தேமுதிகவில் இருந்து நிர்வாகிகள் நீக்க விஜயகாந்த் அறிவிப்பு"],["தமிழகம்","தேர்தலுக்கு தேர்தல் ஓட்டு இழக்கு விஜயகாந்த் நெப்போலியன்"],["தமிழகம்","விஜயகாந்த் அடி விவகார பாக்யராஜ் சொன்ன ராஜா சிப்பாய் ஆடு கதை"],["தமிழகம்","வேட்பாளர அடிச்ச விஜயகாந்த இன்னு ஏன் அரஸ்ட் பண்ணல சென்னை பிரசாரத்தில் வடிவேலு கேள்வி"],["தமிழகம்","விஜயகாந்த் வண்டில ஏறாதீங்க வடிவேலு"],["தமிழகம்","திமுக கூட்டணிக்கு வைகோ ஆதரவு அளிக்க வேண்டு ராமதாஸ்"],["தமிழகம்","விஜயகாந்த் மீது பெண்களுக்கு வெறுப்பு ராமதாஸ்"],["தமிழகம்","கோப வந்தால் அடிப்பேன் விஜயகாந்த் பேச்சு"],["தமிழகம்","ஜெயலலிதா விஜயகாந்த் மீது நடவடிக்கை எடுக்க வேண்டு தலைமை தேர்தல் அதிகாரிக்கு மனு"],["தமிழகம்","ஜெ முன் பெண்களுக்கு மிதி வேட்பாளருக்கு விஜயகாந்த் அடி முகஅழகிரி"],["தமிழகம்","வடிவேலுவின் கேள்விகளால் விஜயகாந்த் திணறல் பாக்யராஜ்"],["தமிழகம்","சத்த போட்டா பேசமாட்டேன் விஜயகாந்த் சிடுசிடுப்பு"],["தமிழகம்","வசன பேசு அதிமுக கூட்டணியினர் ஊருக்கு எதுவு செய்ய மாட்டார்கள் அன்புமணி ராமதாஸ்"],["தமிழகம்","உங்கள் பிள்ளைகளை மாடு மேய்க்க வைக்க அதிமுக திட்ட அன்புமணி ராமதாஸ்"],["தமிழகம்","விஜயகாந்த்க்கு வைக்க போறாய்ங்க பெரிய ஆப்பு வடிவேலு"],["தமிழகம்","விஜயகாந்தின் அடி குடியால் தமிழகத்துக்கே தலைகுனிவு"],["தமிழகம்","விஜயகாந்த் பேச்சில் குழப்ப தேமுதிக அதிமுக அதிருப்தி"],["தமிழகம்","சத்த போட்டா பேசாம போயிடுவேன் விஜயகாந்த்"],["தமிழகம்","மேடைக்கு மேடை உளறுவது விஜயகாந்தின் சுபாவ இலகணேசன்"],["தமிழகம்","ஏதேதோ பேசி திமுகவுக்குத்தான் ஆதரவு திரட்டுகிறார் விஜயகாந்த் திருமாவளவன்"],["தமிழகம்","வேட்பாளரை தாக்கியதாக புகார் வந்தால் விஜயகாந்த் மீது நடவடிக்கை தேர்தல் அதிகாரி"],["தமிழகம்","அதிமுகவுக்கு ஆதரவாக ஒருதலைபட்சமாக செயல்படுகிறது ராமதாஸ்"],["தமிழகம்","கதை சொல்லி விளக்க விஜயகாந்த் கூட்டணி பாக்யராஜ் கிண்டல்"],["தமிழகம்","கண்ணாடியை கழற்ற சொன்ன கட்சி தொண்டர் மீது விஜயகாந்த் பாய்ச்சல்"],["தமிழகம்","விஜயகாந்த்தின் முகத்திரையை வைகை புயல் கிழிக்கு வடிவேலு"],["தமிழகம்","அதிமுக கூட்டணி கூட்ட விஜயகாந்த் புறக்கணிப்பு"],["இந்தியா","பெண் வேட்பாளர் மீது அச்சுதானந்தன் அவதூறு"],["தமிழகம்","அதிமுகவுடன் கூட்டணியால் பத்தோடு பதினொன்று ஆகிவிட்டார் விஜயகாந்த் ராமதாஸ்"],["தமிழகம்","முதல்வரை பற்றி அவதூறு பிரசார ஜெயலலிதா விஜயகாந்துக்கு தேர்தல் கமிஷன் நோட்டீஸ்"],["தமிழகம்","வேட்பாளரின் சின்னத்தை மாற்றி சொன்ன விஜயகாந்த்"],["தமிழகம்","அதிமுக பலவீனமான கூட்டணி ராமதாஸ்"],["தமிழகம்","மார்க்சிஸ்ட் சின்னத்தை மாற்றி கூறிய விஜயகாந்த்"],["தமிழகம்","பெண்களை பெற்றவர்களு சுகவாசி ஆகலா ராமதாஸ்"],["தமிழகம்","விஜயகாந்த் கதை இந்த தேர்தலுடன் முடிந்து விடு திருமாவளவன்"],["தமிழகம்","கொட்டு முரசு சின்னத்தில் அதிமுகவுக்கு ஓட்டு போடுங்கள் விஜயகாந்த்"],["தமிழகம்","ரிஷிவந்திய தொகுதியில் விஜயகாந்த் டெபாசிட் வாங்க கூடாது ராமதாஸ்"],["தமிழகம்","சத்துணவில் கருணாநிதி எக் போடுறார் விஜயகாந்த் எப்போது பெக் போடுறார் வடிவேலு"],["தமிழகம்","ஜெயலலிதா நிறுத்திய திட்டங்களை மீண்டு செயல்படுத்தியவர் கருணாநிதி நடிகர் பாக்யராஜ் பெருமித"],["தமிழகம்","விஜயகாந்த் மீது குற்ற சொல்ல மாட்டேன் கஅன்பழகன்"],["தமிழகம்","விஜயகாந்த் அடிப்பார் என ஜெயலலிதா பயப்படுகிறார் அன்புமணி ராமதாஸ்"],["தமிழகம்","கருணாநிதி அரசியல் விஞ்ஞானி விஜயகாந்த் உடைந்த அச்சாணி வடிவேலு"],["தமிழகம்","ஜெ விஜயகாந்த் பொருந்தா கூட்டணி பாக்யராஜ்"],["தமிழகம்","வில்லிவாக்கத்தில் அன்பழகன் வெற்றி பெற வேண்டு ஜிகேவாசன்"],["தமிழகம்","ரிஷிவந்திய மக்களை விஜயகாந்த் ஏமாற்ற முடியாது வடிவேலு"],["தமிழகம்","விருகபாக்க தொகுதியில் உறுதியாக ஜெயிப்போ விஜயகாந்த்"],["சினிமா(ரீல்மா)","சத்யராஜ் ஜோடியாகிறார் சங்கீதா"],["தமிழகம்","உயர்கல்வி படித்தால் வேலைவாய்ப்பு அதிக சென்னை பல்கலைக்கழக துணைவேந்தர் திருவாசக பேட்டி"],["தமிழகம்","மதுபான விளபரங்களில் டோனி நடிப்பதை தவிர்க்க வேண்டு அன்புமணி ராமதாஸ்"],["தமிழகம்","ரிஷிவந்திய தொகுதியில் விஜயகாந்த் வாக்குகள் முன்னிலை"],["தமிழகம்","நள்ளிரவில் வாக்காளர்களுக்கு நன்றி தெரிவித்த விஜயகாந்த்"],["தமிழகம்","லஞ்சத்தை அறவே ஒழிக்க வேண்டு விஜயகாந்த்"],["மாவட்ட மசாலா","செங்கோட்டையில் வாஞ்சிநாதன் நூற்றாண்டு நினைவு தின"],["மாவட்ட மசாலா","ஆண்டாள் கோயில் கொடிமரத்துக்கு கோலாகல குபாபிஷேக"],["தமிழகம்","தேமுதிக ஒன்றிய நகர நிர்வாகிகளுடன் விஜயகாந்த் ஆலோசனை"],["தமிழகம்","அன்பழகன் ராமதாசுக்கு விருதுகள் வழங்கு விழா"],["தமிழகம்","விடுதலை சிறுத்தைகள் கட்சி சார்பில் அன்பழகன் ராமதாஸ் உள்பட பேருக்கு விருது"],["தமிழகம்","உள்ளாட்சி தேர்தலில் யாருடன் கூட்டணி ராமதாஸ்"],["விளையாட்டு","விபிள்டனில் முதல் முறையாக சாபியன் ஆனார் ஜோகோவிச்"]],"hovertemplate":"category: %{customdata[0]}<br>title: %{customdata[1]}","legendgroup":"9","marker":{"color":"# வட்ட மசாலா","டன் கடத்தல் அரிசி லாரியுடன் பறிமுதல்"],["மாவட்ட மசாலா","நாமக்கல் அருகே வாகன சோதனை லட்ச பறிமுதல்"],["தமிழகம்","சேப்பாக்கத்தில் டிக்கெட் வாங்க ரசிகர்கள் குவிந்ததால் பரபரப்பு"],["தமிழகம்","அரசு ஊழியரை துன்புறுத்தியவர் எஸ்மா டெஸ்மா ஜெ முகஸ்டாலின்"],["குற்றம்","ஆனி பஸ்களில் கடத்திய கிலோ கஞ்சா பறிமுதல்"],["தமிழகம்","ஆபுலன்ஸ் ஊழியர் கடைபிடிக்க கட்டளைகள்"],["தமிழகம்","ஆந்திராவில் இருந்து வந்த ஆனி பஸ்சில் ரெய்டு லட்ச பறிமுதல்"],["தமிழகம்","டாஸ்மாக் கடைகளில் இன்று முதல் ஆஃப்க்கு மேல் விற்கக் கூடாது தேர்தல் கமிஷன்"],["ஸ்டேட் எக்ஸ்பிரஸ்","ஆயிர மதிப்புள்ள சந்தன கட்டை கடத்தியவர் கைது"],["ஸ்டேட் எக்ஸ்பிரஸ்","பிளாக்கில் மது விற்றவர் கைது டாஸ்மாக் சூபர்வைசர் மீது வழக்கு"],["குற்றம்","பீர் இல்லை என்றதால் ஆத்திர டாஸ்மாக் ஊழியருக்கு அடி"],["மாவட்ட மசாலா","ரேஷன் அரிசி பதுக்கல் அதிமுக பிரமுகர் கைது"],["மாவட்ட மசாலா","வரி கட்டாமல் கொண்டு சென்ற டன் ஏலக்காய் பறிமுதல்"],["தமிழகம்","லட்சத்தில் சிக்னல் அமைத்து மாதமாக இயக்கப்படவில்லை"],["மாவட்ட மசாலா","தமிழகத்துக்கு கடத்தி வரப்பட்ட கிலோ ஏலக்காய் பறிமுதல்"],["தமிழகம்","டாஸ்மாக் கடையில் சோதனையிட போலீசாருக்கு அதிகார இல்லை ஐகோர்ட்"],["மாவட்ட மசாலா","டாஸ்மாக் ஊழியர்கள் பேர் சஸ்பெண்ட்"],["தமிழகம்","பஸ்சுக்குள் பறந்த பீர் பாட்டிலால் பரபரப்பு போதை ஆசாமி தப்பியோட்ட"],["தமிழகம்","செயற்கையாக பழுக்க வைத்த டன் மாபழ பறிமுதல்"],["தமிழகம்","மாணவர்களுக்கு இலவச சீருடைகள் ஜூன் மாதத்தில் கிடைக்குமா"],["மாவட்ட மசாலா","லட்ச மதிப்புள்ள சிறுத்தை தோல் சிக்கியது"],["இந்தியா","¡ லட்ச மதிப்புள்ள சந்தன கட்டை பறிமுதல்"],["தமிழகம்","ரேஷனில் இலவச அரிசி ஜூன் தேதி முதல் அமல்"],["தமிழகம்","எல்லா ரேஷன் கடைகளுக்கு எலக்ட்ரானிக் பில்லிங் இயந்திர"],["குற்றம்","கேரளாவுக்கு கடத்த முயன்ற கிலோ கஞ்சா பறிமுதல்"],["தமிழகம்","டாஸ்மாக் கடை முற்றுகை மதுராந்தகத்தில் பரபரப்பு"],["இந்தியா","பைசா நாணயங்கள் ஜூன் முதல் செல்லாது"],["மாவட்ட மசாலா","ரேஷன் அரிசி கடத்திய பேர் பிடிபட்டனர்"],["மாவட்ட மசாலா","சந்தன கட்டை கடத்தல் கேரள ஆசாமிகள் கைது"],["தமிழகம்","ஜூன் முதல் இலவச திட்ட தொடக்க ரேஷன் கடைகளுக்கு அரிசி அனுப்பு பணி தீவிர"],["தமிழகம்","அனைத்து ரேஷன் கடைகளிலு அரிசி இருப்பு வைக்க உத்தரவு"],["மாவட்ட மசாலா","சந்தன கட்டைகளுடன் லாரி பறிமுதல்"],["தமிழகம்","லத்திகா சரணை டிஜிபியாக நியமன செய்தது செல்லாது"],["தமிழகம்","டாஸ்மாக் பார்களில் பதுக்கல் பீர்பாட்டில்கள் பறிமுதல்"],["மாவட்ட மசாலா","ரேஷன் அரிசி கடத்தல் கோழிப்பண்ணை ஓனர் கைது"],["மாவட்ட மசாலா","டாஸ்மாக் கடையில்தண்ணீர் கலந்து சரக்கு விற்ற ஊழியர்கள் பிடிபட்டனர்"],["மாவட்ட மசாலா","தூத்துக்குடி டாஸ்மாக் பாரில் மதுபாட்டில் பறிமுதல்"],["மாவட்ட மசாலா","ரேஷன் அரிசி கடத்தல் ஆந்திரா பெண் சிக்கினார்"],["குற்றம்","டாஸ்மாக் பண கொள்ளை பேருக்கு ஆண்டு சிறை"],["மாவட்ட மசாலா","சோப்பு வாங்கினால்தான் அரிசி ரேஷன் ஊழியர் சஸ்பெண்ட்"],["தமிழகம்","ரேஷன் அரிசியை கடைக்காரர்கள் வாங்கி விற்றால் நடவடிக்கை"],["குற்றம்","டாஸ்மாக் கடை உடைத்து லட்ச கொள்ளை"],["மாவட்ட மசாலா","கேரளாவுக்கு கடத்த முயன்ற டன் அரிசி பறிமுதல்"],["மாவட்ட மசாலா","சத்துணவு ஊழியர்கள் பேர் சஸ்பெண்ட்"],["ஸ்டேட் எக்ஸ்பிரஸ்","சட்டீஸ்கரில் பூரண மதுவிலக்கு சரக்கு கடைகளுக்கு மூடு விழா"],["குற்றம்","சென்னைக்கு கடத்தி வந்த கிலோ தங்க பறிமுதல்"],["தமிழகம்","டாஸ்மாக் கடை பார்களை டெண்டர் விடுவதில் சிக்கல்"],["இந்தியா","சோமாலிய கடற் கொள்ளையர்களால் கடத்தப்பட்ட இந்தியர்கள் டெல்லி திருபினர்"],["தமிழகம்","ஈஞ்சபாக்க டாஸ்மாக் கடையை மூடாவிட்டால் போராட்ட நடத்த முடிவு"],["தமிழகம்","ரயில்களில் ரேஷன் அரிசி கடத்தல் தொடர்கிறது"],["மாவட்ட மசாலா","பள்ளத்தில் பதுக்கிய ரேஷன் அரிசி பறிமுதல்"],["குற்றம்","ஆயிர மதிப்புள்ள வெளிநாட்டு நாய் திருட்டு"],["தமிழகம்","முதல் முறையாக ஓபிஎஸ் தாக்கல் ஆக ல் தமிழக பட்ஜெட்"],["மாவட்ட மசாலா","அபத்தூர் டாஸ்மாக் பாரில் பிராந்தி பீர் விற்ற பேர் கைது"],["மாவட்ட மசாலா","டாஸ்மாக் பார் ஓனர்களுக்கு குண்டாஸ்"],["தமிழகம்","டாஸ்மாக் பார் டெண்டரில் முறைகேடு உயர்நீதிமன்ற இடைக்கால தடை"],["மாவட்ட மசாலா","பெண்கள் மூல கேரளாவுக்கு பஸ்சில் ரேஷன் அரிசி கடத்தல்"],["மாவட்ட மசாலா","லட்ச சந்தன கட்டை பறிமுதல்"],["மாவட்ட மசாலா","ஊத்துக்கோட்டை டாஸ்மாக் மதுபான கடை திறக்க முயற்சி"]],"hovertemplate":"category: %{customdata[0]}<br>title: %{customdata[1]}","legendgroup":"4","marker":{"color":"#6A5ACD","symbol":"circle"},"mode":"markers","name":"4","scene":"scene","showlegend":true,"x":[-4.713416,
